/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `Reviews` (
  `id` char(25) CHARACTER SET ascii NOT NULL,
  `createdAt` datetime(6) NOT NULL DEFAULT CURRENT_TIMESTAMP(6),
  `updatedAt` datetime(6) NOT NULL DEFAULT CURRENT_TIMESTAMP(6) ON UPDATE CURRENT_TIMESTAMP(6),
  `deletedAt` int(10) unsigned NOT NULL DEFAULT '0',
  `createdById` char(25) CHARACTER SET ascii DEFAULT NULL,
  `body` varchar(5000) NOT NULL,
  `salary` int(10) NOT NULL COMMENT '-1 indicates no salary was disclosed by review author.',
  `salaryCurrency` varchar(10) NOT NULL,
  `salaryPeriod` varchar(10) NOT NULL,
  `overallRating` decimal(11,1) unsigned NOT NULL,
  `learningMentorshipRating` decimal(11,1) unsigned DEFAULT NULL,
  `meaningfulWorkRating` decimal(11,1) unsigned DEFAULT NULL,
  `workLifeBalanceRating` decimal(11,1) unsigned DEFAULT NULL,
  `tags` varchar(100) DEFAULT NULL,
  `isSpam` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `isLegacy` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT 'Whether or not this review was imported from old internCompass data. If true, use legacyUpdatedAt info.',
  `legacyUpdatedAt` varchar(100) DEFAULT NULL COMMENT 'Date of original review',
  `uniqueIdentifier` varchar(190) DEFAULT NULL,
  `isAnonymous` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `isVerified` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `authorEmail` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `createdAt_KEY` (`createdAt`),
  KEY `updatedAt_KEY` (`updatedAt`),
  KEY `deletedAt_KEY` (`deletedAt`),
  KEY `createdById_KEY` (`createdById`),
  FULLTEXT KEY `Reviews_FULLTEXT` (`uniqueIdentifier`,`body`,`tags`,`salaryCurrency`,`salaryPeriod`,`legacyUpdatedAt`,`authorEmail`),
  CONSTRAINT `Reviews_ibfk_1` FOREIGN KEY (`createdById`) REFERENCES `Users` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;
/*!40101 SET character_set_client = @saved_cs_client */;

