/*!40000 ALTER TABLE `Reviews` DISABLE KEYS */;
INSERT INTO `Reviews` VALUES ('ck1x0zvgo002001jv12bch15m','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459706,'ck1n1du49000501jo4pwygsav','I worked in the video team. Had a great mentor and learned a ton about video technology. Was able to work closely with many industry professionals from companies like Intel, Elemental, and Nvidia. Twitch also has a great culture, especially for gamers, and the perks are great :) Also, HR was very supportive and secured me a Product Management internship upon request.',7200,'USD','monthly',4.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgo002101jvf2qw0ml1','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459706,'ck1n1du49000501jo4pwygsav','I had a pretty good time at Snapchat, I was on the platform team mainly doing work on performance tooling and automation testing. Most of the people who work there are pretty chill, though I don\'t think the company culture is amazing. Snapchat\'s right on the beach which is really awesome, and the weather\'s pretty amazing, so there\'s always a nice view outside the window :) ',9000,'USD','monthly',4.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgo002201jv8mym8aw7','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459706,'ck1n1du49000501jo4pwygsav','I worked here twice and had fun each time. I had good mentors and there are some great engineers that taught me a lot at this company :)',1800,'USD','weekly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgo002301jv4nov63wv','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459706,'ck1n1du49000501jo4pwygsav','Great mentors and coworkers. I got a lot of freedom to choose my team, project and approach to solving problems.',8000,'USD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgp002401jvcwiu5khn','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459706,'ck1n1du49000501jo4pwygsav','No mentorship at all. Joke of a company. Horrible Manager. You will be expected to work overtime (no extra pay) on shit projects. Pays peanuts for a place right in the middle of downtown toronto.',17,'CAD','monthly',1.0,1.0,2.0,1.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgp002501jv84zlgvfp','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459706,'ck1n1du49000501jo4pwygsav','Absolutely loved the entire Vine team. Everyone was supportive and you are treated like a full time employee rather than just an intern. ',38,'USD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgp002601jv2htl3kzp','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459706,'ck1n1du49000501jo4pwygsav','Blackberry is as much as can be expected from a large company/ corporate work environment. The work is dependent on the team. ',2800,'CAD','monthly',4.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgp002701jv2e5jd5yb','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459706,'ck1n1du49000501jo4pwygsav','Fall 2016. ',19,'CAD','hourly',3.0,3.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgp002801jv7bnqdohj','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459706,'ck1n1du49000501jo4pwygsav','Really cool place to work if you enjoy gaming. Leans more towards the embedded systems design/ embedded programming.',5120,'USD','monthly',4.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgp002901jvgk8m8np0','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459706,'ck1n1du49000501jo4pwygsav','Wattpad as a company is decent and I really liked working there. Unfortunately QA developer wasn\'t a role that I particularly enjoyed.',30,'CAD','hourly',4.0,4.0,3.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgp002a01jv382u9fp9','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459706,'ck1n1du49000501jo4pwygsav','I felt like this internship was the best yet. It is definitely one of the best places to work in Toronto (as mentioned in Canada\'s Top Small & Medium Employers). Work is very relevant and you are treated like any other developer in the company. There is no intern project and therefore will feel to be an actual part of the team as well and not just an extension. You work with the team, join in sprints, planning meetings and your inputs are definitely taken seriously.\n\nP.S. Free lunch is once a week and free breakfast includes cereal.',5250,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgp002b01jv4jtdc8pu','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459706,'ck1n1du49000501jo4pwygsav','This was honestly the best internship I have ever had! I worked on a small team and got to ship code from day one. I had a lot of impact on the product in the four months that I was here. My manager really cared about my personal development and encouraged me to step out of my comfort zone. For example, he asked some of us to give a tech talk at one of the mobile meetups hosted at Coursera.',8000,'USD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgp002c01jv8o5n9y8e','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459706,'ck1n1du49000501jo4pwygsav','Lots of responsibilities (and fun to match it). Great team and culture.',4000,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgp002d01jvd1b1cowr','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459550,'ck1n1du49000501jo4pwygsav','I worked on the Amazon Ad Exchange team. My mentor and manager were both very supportive and the team was very welcoming. HR planned many events for interns (company offsites, hackathons, etc.). However, I did feel that as an intern, I was siloed from the rest of the team. Even though the project I was given was technically interesting and complex and I learnt a ton, I would\'ve liked to work closer with the rest of the team.',9600,'USD','monthly',4.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgp002e01jv2kmy5ttk','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459706,'ck1n1du49000501jo4pwygsav','I was on the Next Billion Users team. They create products for people on third world countries. I think that entire umbrella was really interesting. The perks at Google are great but the work really depends on the team you are on and how comfortable you feel with your manager. So make sure you really focus on the host matching process and don\'t just take the first manager that likes you. ',6150,'USD','monthly',4.0,5.0,3.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgp002f01jv0wibd26z','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459550,'ck1n1du49000501jo4pwygsav','ATA is great! A small company with an awesome culture and very talented people. They put a high value on interns and my team and HR were very supportive. Even now, ATA consistently invites me to dinners/lunches when they come to Waterloo to interview. On the topic of meaningful work... I thought that what I worked on wasn\'t technically exceptional/challenging most times. However, it had a large impact because of a very large userbase. Overall, highly recommend ATA, you meet great ppl, learn a ton, and Vancouver is an amazing city :D',5000,'CAD','monthly',4.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgp002g01jveex45yba','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Venmo is an excellent silicon valley style company to work for in NY. The city is awesome and the work is meaningful. Being a part of a small team its a lot easier to make impactful changes.',8000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgp002h01jvcn5l0y3v','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Excellent company to work for. Excellent work environment and great mentors.',3520,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgp002i01jvc5d64dgc','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459706,'ck1n1du49000501jo4pwygsav','Easily my favourite internship (been to most of the big tech companies).\n\nLots of interesting work (working with certain gov agencies), travel, customer interaction, etc.\n\nPerks are definitely a level above any other tech company (e.g. request literally anything to your local microkitchen and they\'ll get it). \n\nWork life balance is very team dependent. I never worked evenings or weekends but some interns are on busier teams did. People are generally young but super smart. More so than the average big tech corp employee in my experience (sample size of ~4 companies in the bay). \n',7500,'USD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgp002j01jv8gvnhfv2','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459706,'ck1n1du49000501jo4pwygsav','Only 4 coops and a full time who is not a dev. \nTasks are given but there\'s not much organization ',1100,'CAD','weekly',3.0,1.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgp002k01jvfr69eue7','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459706,'ck1n1du49000501jo4pwygsav','This was a great experience for me because I was able to learn lots at work and travel around in Europe for the first time. I worked with Ruby on Rails for the backend projects and EmberJS for the frontend. I was able to work and lead a project by myself and the best part is that they used two of my projects to actually help the company gain more revenue! The work was challenging and I was able to help with the design process as well. I would definitely recommend Intercom as you\'ll get to work with some really amazing and fun people!',8500,'EUR','monthly',5.0,4.0,5.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgp002l01jven5le1g4','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','My internship experience was a lot of prototyping and design work since there was no actual product at the time. I got to learn about animations and graphics which was cool since this was new to me. I felt like I was given a lot of responsibility and did the exact same work as a full time. \n\nOne thing I noticed was that everyone sat in their office/cubicle all day. It would be better if there was more open space and if team members collaborated more. I would have also liked more code review and mentorship. ',35,'USD','hourly',3.0,2.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgp002m01jvfp3m346x','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I did my internship in the Lincoln Square campus. Out of my 6 internships, I think the work I did here was the most challenging and involved more algorithm design and implementation than I had ever done before. I was able to understand a little more about how other apps worked as I programmed for Android for the first time. Be careful about choosing the gym membership options as once you enroll, it doesn\'t matter when you enroll, it will count the payment days from the first day of your internship (and you can\'t cancel your membership until your internship ends).',7100,'USD','monthly',4.0,4.0,4.0,2.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgp002n01jv35bk7msd','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I really liked this term because I got into mobile programming through what I learned at Metroland. I had a wonderful mentor who really helped me learn a lot. The pay was not good though so I would recommend this as a 1st or 2nd co-op term just for the experience.',2600,'CAD','monthly',4.0,5.0,3.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgp002o01jv72n706ej','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Firstly, that job title is a little misleading as I didn\'t get to do much programming at all. However, I did get to work with a lot of cool gadgets and futuristic technologies in concept design work. The worklife was good because I didn\'t have to do overtime very often and there was no pressure to bring work with me after work hours. The work I did was interesting - worked on designing a couple mental health apps for soldiers and also helped PhD students with their projects. I even got to go on a business trip to Ottawa. I would recommend this place for a 1st term co-op. (I didn\'t have a mentor but I had two supervisors because I worked on two main projects.)',2100,'CAD','monthly',4.0,1.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgq002p01jv3a848148','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','While this is a 3D graphics company and my title was 3D Software Developer, I didn\'t actually get to do any development for the 3D graphics part. Instead, I worked on developing a couple of animation library tools to help users animate characters/scenes with more ease. I worked in C++ and Python.',6000,'CAD','monthly',4.0,4.0,4.0,2.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgq002q01jv56tobxn2','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','This position is excellent if you are interested in both the computer science and finance side of things.  I worked on valuating bonds using fitted curves based bond yields.  This work required regression analysis and running optimizations on financial modelling parameters.',1000,'CAD','weekly',4.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgq002r01jv76negr8k','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Fantastic startup that\'s working on wastewater data. Very small, but everyone is a really chill person that does their job well, and can give great advice/mentorship when needed. Lots of freedom to try (useful) things that you think are interesting , as well as lots of responsibility since you\'re one of a few people at the company and your time really matters. \n\nIt was located in this cool co-working space at Bathurst/Bloor, which is fun, hipster area with no shortage of great lunch options. Co-working space has free tea + coffee that are both really good, and there are lots of interesting socially conscious startups in the building meaning you get to meet a lot of interesting people.\n\nI really enjoyed my work there and was encouraged to have a good work/life balance as well as find opportunities to grow. At the end of the day, even though I didn\'t know much about wastewater data, I felt pretty fulfilled with the work I did and had a great term.',20,'CAD','hourly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgq002s01jv4hgpg7yb','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Work largely consisted of software development with financial data.  I mostly programmed in C# and SQL Server.  The full-timers are experienced, as shown in their codebase, which is well-documented and cleanly written.',30,'USD','hourly',4.0,4.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgq002t01jvbjqg527c','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I was working on the Broadcast team which was one of the most fun teams available. Within the team there was great culture and my manager was extremely supportive and helpful whenever I needed it. The overall company culture isn\'t the best and there are some difficulties around recruiting and perks but overall it was a fun co-op and a great was to experience LA living.',9000,'USD','monthly',4.0,5.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgq002u01jv7vhjghgj','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I was working at HQ in the Menlo Park office on the Messenger team. Facebook is very flexible in the way they let you choose your team and in my experience, your project as well. The perks at Facebook can\'t be beat - they provide pretty much anything you can think of that you would need for living, awesome events, shuttles, often trips to remote offices, a health and wellness stipend (on top of an on-campus gym), etc. The work experience is very team/manager/project dependent. If all of these work out then everything else about the company is great and it\'ll for sure be a great experience. Return offers are also given directly after the internship with no extra interviews required.',8000,'USD','monthly',4.0,5.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgq002v01jv6b7n5jkx','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','This was my first developer internship. I was nervous that I wouldn\'t be good enough since I had never actually done any paid work before. Everyone was really nice and welcoming - most people were happy to answer questions. By the end of my time there I had learned a lot and was even able to help out some of my co-workers with their questions :)',700,'CAD','weekly',5.0,5.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgq002w01jvblltbzwm','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Interesting work and lots of smart people :)',5500,'USD','monthly',4.0,4.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgq002x01jvhfdhcbtt','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','There were lots of opportunities to learn, lots of tech and non-tech talks during lunches. Got to go on some cool company trips and the people were friendly. The first team I was on was a little too quiet - like, often people wouldn\'t even say good morning when someone new arrived. The second team I was on was really talkative so I felt more at ease :)',6400,'USD','monthly',4.0,3.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgq002y01jvaf9v16gd','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I had a great time here ! My mentors were great and I really learned what it was like to do a PhD (also more about MRI imaging and physics than I\'ll ever need to know). ',11,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgq002z01jvadsg7e98','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Yeah they weren\'t really sure what to do with me. They wanted someone to manage their social media for them but they were a cheap electronics company so their pages consisted mostly of people complaining about how awful they were. I wanted to advise them to delete their social media accounts \'cause they were so negative, but then I guess I wouldn\'t have had a job. O.o\n\nAlso it was in Markham. Ewie. ',600,'CAD','weekly',2.0,3.0,1.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgq003001jvb7bvfvfh','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Hulu\'s internship program is totally amazing. Everyone is super eager to help you and they\'re no limits to what you can do as an intern. Depending on your comfort level you can work on small frontend features or design an entirely new production facing service from scratch (I did both!). They organize great intern events every two weeks like Disneyland, Hollywood Cemetery movies, beach days, etc. My friend interned at Google afterward and said she missed Hulu\'s internship program :D',7000,'USD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgq003101jv4opl1uqs','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I had a great internship experience, working on a mobile product and able to see it in use at events and festivals. Free meals aren\'t every day, but there was an awesome smoothie room and some cool perks were being able to attend events for free. I would have wished for my team to do more social events together as I feel that\'s important (and there weren\'t many other interns), but overall I enjoyed doing the work, and had plenty of time to explore the city (good worklife balance).',38,'USD','hourly',4.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgq003201jv8ijq86nx','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','In my term, Lookout starts your term as a QA for about a month or so. Then, one is switched to a developer role working on some bug fixes and an intern project. Interns are discouraged to work on projects that have big impact to the company (since they want \"someone full-time to maintain it\"). However, it was a good balance between the two roles.',7000,'USD','monthly',4.0,4.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgq003301jvha2aaoer','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked at Vine on a four month internship at the beginning of 2016. Despite some housing-related qualms (not Vine\'s fault), I had a great time. Though Vine is a subsidiary of Twitter, it maintains its own distinct culture and feels very much like its own company. With less than 100 employees, the Vine team is a tight-knit group, who are all obviously passionate about the platform. The salary information in my review includes a prorated $2000 housing stipend, which won\'t get you the best apartment in New York, but certainly a passable one (which I would\'ve liked). Speaking of New York: it\'s a vibrant and diverse city in which you\'ll never run out of things to do. I highly recommend visiting Brooklyn Boulders if you ever happen to be in town!',8000,'USD','monthly',5.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgq003401jvee7j60wg','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459550,'ck1n1du49000501jo4pwygsav','They give you $3500 per 4 weeks for housing stipend on top of your salary. So it\'s a lot of money of you take the stipend. Work-wise, they assign you a standalone project that most of the time is a big feature or a standalone service. I was given lots of freedom in how I want to tackle development and everyone on the team is helpful when I had questions or I needed their opinion on something. Amazon is really big on ownership and delivering results. I feel like I learned a lot during this internship.',7300,'USD','monthly',4.0,5.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgq003501jv5j1bbs2j','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Overall I had a good time at Palantir; I interned in Winter 2016 and they were in the middle of a change to their hiring process so I ended up being on two different teams. I also got to travel quite a bit which was nice. The work was pretty typical application development work, mainly with React and React Native. There\'s rumours about poor work/life balance but I think that\'s only on certain teams/offices. I didn\'t notice anything too crazy when I was there.',7500,'USD','monthly',4.0,5.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgq003601jv79hmfdta','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','At Remond, I was on the Office Licensing Team working on the client side. The code was all in C++ and I had a hard time digging through the code because this is really old code with some complicated logic. Overall this team was great and the people seemed to have a great work life balance. Much like any other big company, you have to remember that the experience ends up depending on your team and your mentor. I knew people who hated it but I loved my time here! Also Microsoft doesn\'t really have an on site gym but they do give you a membership to the Pro Club which is better than any gym I\'ve ever been to and its close to the Redmond campus. Besides this, Microsoft is really generous about their intern events for the summer term (not really for the other terms) and they give an intern gift to every intern! ',7500,'USD','monthly',4.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgq003701jv47dh8yse','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','This was my first internship so I was really excited to work for such a big company. I loved working with my team and I still keep in touch with my mentor even after 4 years. I even went back to visit recently. I was on the App Engine team as a technical writer so I did a lot of web development (not so much the technical writing part). I got to understand the internal structure at Google, experience the work life there (which is pretty sweet with all of those perks and fun stuff lying around - even slept in one of those sleep pods once!). The work was challenging enough for me at the time and I also learned to work with a lot of new technologies. ',5200,'USD','monthly',5.0,5.0,4.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgq003801jvc3kh9l3u','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Microsoft Japan is unlike any other internship experience and obviously that is mostly because of the location. I\'m going to list out the pros and cons for this internship in detail since there are not many international students who intern here.\n\nPros: \n1. It\'s in Tokyo! Their office is in shinagawa and its so easy to get to any place in Tokyo. Weekends and evenings are always so fun. This is the main reason I give it a 5 star. If traveling or living in Tokyo for 4 months doesn\'t excite you then maybe this isn\'t the internship for you.\n2. They put you up in a nice studio apartment close to shinagawa. For me, my apartment was in Tamachi station but I heard some people were in a different location. Either way it is paid for and pretty nice. It\'s a little small but definitely enough for one person. \n3. The Japan team only hires international interns on the office team and the office team in Japan unlike Redmond is very small. They only have the Sway and Docs.com team and a bit of Office Lens I believe. This is a pro and a con. It\'s a pro because you get to know the team. It\'s very open concept unlike Microsoft in general. The con is that you might not want to work on these products at all. \n4. Companies in Japan have a interesting culture. People there work reallllly late but this isn\'t true for Microsoft Japan. I mean people did work late but I never felt any pressure to do so. It would be like any other company in Silicon Valley etc. \n\nCons:\n1. Salary. You will not save any money if you come here. If you\'re using your internships to pay for school then re evaluate this internship. We got paid around 2.5 CAD before tax/health insurance. They do reimburse you for the flights though. I heard that the the term after us started getting paid 400000 yen which is about 4000 CAD (at least when I interned there). But even then Japan is an expensive place and if you want to travel and eat good food this money will be enough to live there but not to save and bring back.\n2. Language barrier. Fewer people than I expected spoke English in Tokyo. Get used to using google translate or learn some Japanese. This can sometimes be frustrating because buying milk can be difficult but at the same time if you\'re considering this then I assume you have some interest in learning about the culture and language. ',250000,'JPY','monthly',5.0,5.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgq003901jv7d9c6tz0','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I interned here in 2014. Working at Minted was alright; there didn\'t seem to be much of a culture, and there seemed to be a divide between the engineering team and the non-engineers. People typically worked normal hours. The tasks I was assigned were kinda boring, but were pretty typical compared to the tasks assigned to other members of my team. It may just have been that I\'m not super interested in the sort of e-commerce they were working on.\n\nI was able to do most of my work mostly independently and got help when needed. They hire a good amount of interns from Waterloo so you\'ll have friends to hang out with after work. The pay isn\'t as great as other places, and they don\'t provide lunch very often.',6500,'USD','monthly',4.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgq003a01jv58wcag5a','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','D2L was a great place to work at. My team was comprised of talented and passionate individuals, that were always willing to help. They promoted an engaging learning environment, and presented challenging, meaningful work for me. Overall, I was very satisfied with my time there.',20,'CAD','hourly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgq003b01jvad4sczto','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','All I did was fix bugs my entire internship. It was my first co-op but it seemed like this was the case for returning interns as well. The technologies that I used was also not very transferable to my later internships. ',20,'CAD','hourly',2.0,2.0,1.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgr003c01jv9ll7bc5u','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked here during my first ever internship. The team was working on a small part of a large piece of enterprise software, and their lack of enthusiasm for the product and their work was apparent. So as you would expect, internships feel equally unexciting and menial. The culture is very corporate. Although I did learn some practical skills on the job, I would not recommend SAP to anybody with a bit more experience.',20,'CAD','hourly',2.0,1.0,1.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgr003d01jv72xbauuz','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I had a great internship at Uber, and loved the team I was on. There was a lot of meaningful work to do, and everything I worked on during my internship was launched. My team was a good mix of working and also having fun. I did have some weeks of very long hours, but I was never asked to do them - I just wanted to see my project succeed. You get a $1000/mo housing stipend, $50/mo cell phone stipend, and are paid for overtime work. The company itself has a few organizational issues that I\'ve noticed, but overall not a hinderance on my experience. ',43,'USD','hourly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgr003e01jvdfqr1p03','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Interns all got 2 flexible vacation days per month. I used them to take a bunch of 3-4 day weekend trips, visiting different countries in Europe.',3167,'GBP','monthly',4.0,4.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgr003f01jvcwe9dw0b','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I interned at Facebook in Winter 2015. They took care of everything for me so all I needed to care about was focusing on my work. They have excellent infrastructure and a great amount of resources I could leverage. I learned a lot about handling/working with large amounts of data using the industry-standard open-source software (made by Facebook) while working there.\n\nFacebook has the best culture out of all of my co-ops.',6800,'USD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgr003g01jv4clfb3cm','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked on the same research team at Autodesk for three separate internships, so it\'s needless to say that I really liked it there! The team is made up of immensely intelligent and impassioned individuals. You\'ll always be the dumbest person in the room (which isn\'t a new thing for me), but it\'s worth it when you get to contribute to the amazing work that the team is behind, even if only a little. ',25,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgr003h01jv1eu79ruy','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','This is essentially a QA role; most of the job consisted of manually testing CRM applications. This being a company that uses the dreaded waterfall design process, you are also responsible for writing numerous design documents for those same applications. Everyone on the team is friendly and helpful, but you can\'t help but feel dispirited when you find out that few people in the company actually use the applications you are supporting.',3000,'CAD','monthly',3.0,3.0,1.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgr003i01jva6zfh3er','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','My manager was nice, but he was far too busy to provide any support to me, who was basically shuffled to the corner with pointless projects. Some of my co-workers were also quite rude; they told me to go away when I asked them questions. Overall, I barely touched production code, and spent most of my time reading novels on the side.',2080,'CAD','monthly',1.0,1.0,1.0,1.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgr003j01jv9hwu41it','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','A very small company that does complicated online financial services. I did get a chance to do a little web development, but I was only one of three developers, one of whom was working part-time from Vancouver, and the other didn\'t believe in source control, so...',3122,'CAD','monthly',2.0,2.0,2.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgr003k01jv7316aezx','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','What we did—helping doctors to bill the provincial government for the services they performed—was not that exciting, but my co-workers were all fairly knowledgeable. One of them also proved to be a very good mentor. Still, there wasn\'t a whole lot of work to do.',2519,'CAD','monthly',2.0,3.0,1.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgr003l01jvflyh790z','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Palette Gear has some really cool-looking products—there\'s nothing more fun than turning a dial and watch the colours of a photo change on Photoshop. The codebase is a bit...scattered; on the other hand, it is a startup, so there were a lot of opportunities to make changes that actually impact your customers.',3059,'CAD','monthly',3.0,3.0,4.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgr003m01jv2hs6gawd','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','The perks were really awesome and there are a lot of organized intern events. The work itself was pretty meh. I didn\'t feel like the stuff I was working on was that important or high priority. I also feel like there wasn\'t much collaboration between team members. I was mostly doing my own thing and so was everyone else.\n\nI\'ve always been more interested in building user facing features, but this time I was working on a backend payments team. That may have contributed to my mediocre experience while other interns enjoyed it more.',8000,'USD','monthly',3.0,3.0,3.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgr003n01jv4kuq1yu6','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Charity Intelligence is a charity that operates as a watchdog for Canada\'s charity sector. As a summer research analyst, you will be one of 4 students updating the profiles of charities, both in terms of financial information and social results reporting. The job will expose you to a variety of different charities, develop your critical thinking skills, and strengthen your written communication skills. You will also have the chance to interact with the charities, providing feedback that will ultimately help charities improve their reporting.',2500,'CAD','monthly',4.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgr003o01jvaxdb1gdz','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Investor Relations was a relatively small team, so you will have the opportunity to jump onto a lot of different projects and meetings. In reporting, the work can be quite repetitive, but this role will definitely develop your critical thinking skills. The people are also super nice! :)',3000,'CAD','monthly',3.0,4.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgr003p01jvc2459v31','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','- job was mostly related to administrative items\n- training extensive, takes up to 4 months to be fully trained\n- great Cafeteria\n- great benefits as well as holidays\n- company located in north end of Toronto, if you commute, it takes a while',26,'CAD','hourly',4.0,3.0,3.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgr003q01jv575v9eds','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked there summer of 2015. \n\nThe mentorship and support was low here. My manager didn\'t really talk to me much. I only had about five one on one meetings: a few at the beginning of the internship, one at the midterm review, and one at the final review. He was nice at least and when I emailed him he would respond. He did offer me resources on how to learn what I needed for my project.\n\nI didn\'t finish my project, but afterwards someone else on the team finished it and it ended up in production which is cool.\n\nI did learn stuff at this internship since I hadn\'t used the technology and languages before. \n\nThe work life balance was great because interns weren\'t expected to work the same hours as the full timers. Full time employees generally work 9 am - 6 pm/7 pm. I worked 9 pm - 5 pm.\n\nThere weren\'t many perks. There were a few corporate discounts at tourist attractions. It was also free to ride the ferry across the Hudson to NYC during the work day since there were offices on both sides of the river. \n\nI did get to meet several people in senior leadership while I was there. The managing directors all tried to make time to meet some of the interns and it was sometimes effective to reach out directly to the MDs and ask to meet them.',6250,'USD','monthly',3.0,2.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgr003r01jv1zc1e1ej','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','The team is small and friendly, so time in the office is fun. I had no experience in iOS going in, but I was immediately given real work and I was trusted to pick up skills as I went, so I learned a lot in my time there. I felt real responsibility for the features I worked on. This was a rewarding internship, I highly recommend it!',8500,'USD','monthly',5.0,4.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgr003s01jvfrv44bjp','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Shopify has a cool blend of startup culture and having a lot of people (well, it\'s getting there.) I only worked on a small piece of the product, but everyone there is really excited about the parts they work on and happy to teach you things and help you out. Also the office and kitchen is hella rad, they have a book wall that you can just take interesting things to read from and they resupply it every week.',5200,'CAD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgr003t01jv3t7adz1l','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Worked under the Sony Creative Software department in summer 2015. It was a small friendly office with pizza parties every Friday. Work was meaningful to some degree; it was my first co-op so I understand my assignment of the easier tasks. Mentorship was slightly difficult as supervisors were in their own offices. Enjoyed the experience overall. ',660,'CAD','weekly',4.0,4.0,3.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgr003u01jv943w5xki','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I was on the stability and security team. My internship was centered around ZooKeeper mostly, but I had a lot of freedom in choosing the direction that I take the project. I was given the option to change projects and even teams in the middle of my internship if I wanted to try something else. The work-life balance was the best that I have seen and people often stayed after work to play games or hang out. Even though I was the only intern for a part of the time I was there, everyone made me feel very welcome and treated me as a full-time employee. They even let me shadow couple interviews and ask a question on one. I still keep in touch with the people on my team and visit the office whenever I am in town. ',8500,'USD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgr003v01jvdlwubzkr','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Enjoyed my first job here; good mentor and had a good time :)',1500,'CAD','monthly',4.0,4.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgr003w01jv0bq81qv8','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','The Toronto office has a really great, supportive culture - and you\'re treated as a full timer in every respect. There\'s a lot of focus on getting stuff done and stripping out inefficiencies / useless bureaucratic processes and \"just doing it\". Also, the whole company lives and breathes by their availability metrics. Even the smallest outage is taken very seriously - and it\'s interesting to work in a culture where no matter what you do, you shouldn\'t break anything. Even though interns don\'t go on-call, I still felt the responsibility for ensuring my code works well - and I often helped on-call devs handle incidents to get the feel. I feel like I learned a lot there, and had a lot of fun while still having relatively low levels of stress.',5000,'CAD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgs003x01jvhepnhaza','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I had a terrible experience at Facebook due to having a very bad manager. He couldn\'t explain expectations, he was not available to answer questions, and he overall seemed to dislike/be bad at being a manager. Your experience will vary though. Many of my fellow interns had better teams and managers, so they had a better experience.\n\nThe perks were great though! You get paid a ton and are given quality, free housing. My corporate housing was in a good location. In my case my apartment complex was within biking distance to the office. I had my own room and bathroom and laundry in my unit. Even though the apartments were close to the apartment, we still had free shuttles to and from work. They had free food and all the other standard tech company perks.\n\nPerks, pay, and that it looks great on a resume make this at least a two out of five even though I didn\'t learn much there.',8000,'USD','monthly',2.0,1.0,1.0,1.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgs003y01jvcuv4cacu','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I had a good experience at Facebook, but mostly because it\'s a big company and has a lot of perks. I was doing low level programming in C++ and the codebase for that part can be messy and hard to understand. The concept of meaningful work is also very different in a big company. \n\nMy team was made up of people who had kids and wanted to go home earlier, which was good for worklife balance but made getting to know them harder. There was almost no team communication outside of the necessary -- people rarely ate together, and when we tried \"mandatory\" Friday lunch together, it felt a bit awkward. There was almost no cross team communication.\n\nThe perks are awesome though. There are also a lot of other interns, which makes for a great experience. There are often various talks, presentations and events on the Facebook campus which anyone can attend.',8000,'USD','monthly',3.0,3.0,3.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgs003z01jvb8xmdbe3','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','My team made this internship amazing. I feel like I connected to the people the most and I had the best mentor out of all my internships. On my team, there was a culture of playing a lot of fussball, working a lot and then going out together. Often, people would hang out with each during the weekends as well.\n\nI don\'t think that the work that I did was that meaningful, but that might be because it was my first internship, so I focused more on learning how to do things and not enough on knowing the impact of what I did or looking at the broader picture. I did mostly front-end work. The work was organized in sprints, which were actually done properly and people got excited about finishing them and celebrating afterwards.',6000,'USD','monthly',5.0,5.0,3.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgs004001jvare1ep70','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Yext is a neat startup in Manhattan that provides a location management platform for business owners. The company takes very good care of its employees, with free lunch and dinner every day provided by Seamless (so you get food delivered to you from a nearby restaurant). During the middle of the term, they also took the whole engineering team on an all-expenses-paid trip to Puerto Rico. The product itself is a bit boring (like enterprise java software) but the perks make up for it.\n\nSince I was the only intern in my term, the culture felt a bit lonely at times. Much of the company culture was centered around alcohol, as every team mixed cocktails every Friday, and coworkers frequently went to bars together after work. If you like ping pong or Smash Bros, this is the company for you.',8700,'USD','monthly',4.0,4.0,3.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgs004101jvhq3zgtfg','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Sweet place, campus is amazing, quite an experience. Try it once if you can.',7230,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgs004201jvbuxy7ap0','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Opportunity to have incredible amount of impact as an intern.',6800,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgs004301jv6gig2dey','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I enjoyed it, but it really depends on your team. Morale is really low on some teams, so look out.',860,'CAD','weekly',3.0,4.0,3.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgs004401jv2xwa3628','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','The work was a bit all over the place and not super organized. The culture there is definitely as good as they\'ll tell you - a fun-loving, friendly bunch. As far as mentoring goes, my mentor was not great at, well, being a mentor. I\'d have more success reaching out to the team lead instead. ',6500,'USD','monthly',3.0,2.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgs004501jv9ghuh32h','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Worked there summer 2016. Great place, the Waterloo office is super nice. Great pay for the region, and has a good amount of features that Mountain View has (not quite as much though).',1950,'CAD','weekly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgs004601jv4sqx8buo','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I was there for Summer \'16. I was on the Messenger Core team, working on a cross-platform data-syncing library for the Android and iOS Messenger apps. I was given the general responsibility of reducing data consumed by the library, and was given leads and general ideas to explore in order to achieve this. I felt a ton of autonomy, to the extreme where I would have liked some more guidance and concrete projects to work on. It was a great opportunity to practice directing myself and others rather than the normal developer job of working on a stream of coding tasks. The perks, salary, and housing are awesome. Tons of events for interns and tons of interns to enjoy them with. Because you live with other Facebook interns, and eat all meals on campus, there\'s a poor work-life balance. Overall, I worked on some interesting stuff (invertible bloom filters and zstd compression), and would recommend this internship to everyone.',8000,'USD','monthly',5.0,5.0,5.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgs004701jv57k15km0','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Great group of guys, its a fun environment with a chance to make a lot of impact. Good experience, not great pay.',650,'CAD','weekly',4.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgs004801jv11h0deaa','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','This is my fourth internship overall and second internship at the states. I have to say this is the best internship I ever had. I was lucky to have the best team in the company, where everyone is so nice and helpful. The thing I like the most is that I don\'t feel like an intern at Zenefits, the projects I did were making impacts to both the customers and internal users.',7500,'USD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgs004901jv5twe03pa','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Really good mentorship program. They really want you to do meaningful work here.',9500,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgs004a01jvb2o5ck13','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','The projects were innovative and challenging, as the team does a lot of R&D work. Work life balance is manageable, although there is not much to do without access to a car.',35,'USD','hourly',4.0,5.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgs004b01jv6lfiecpo','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','The work is meaningful, although it is very busy and you need to be very self motivated to get through different issues. Work life balance is alright.',35,'USD','hourly',4.0,4.0,3.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgs004c01jvgctxctx5','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','As an electrical engineer, there\'s not too much work to be done, and the work is fairly straightforward. The perks were nice, although they have recently been removed.',36,'USD','hourly',4.0,3.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgs004d01jv9drv5zj6','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Fun and challenging projects that are really meaningful. Great mentorship and many activities for the interns at work and outside of work.',29,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgs004e01jv66hj8f0k','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Salary was actually $43 USD. I was given a full fledged project to work on -- so a large part of my good experience was my team and the project they gave me. Other than that summer internships are the best given that they hire 200+ interns from all across the US so there are more people to meet. Great experience overall.',50,'USD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgs004f01jv9b0t2y97','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Worked in the main Montreal office during the summer of 2016. The company culture is great, many small company events and volunteering opportunities. 5à7 every Friday where there are drinks and popcorn. Coworkers are very friendly and helpful, great place to learn lots of different design and modelling technology. ',23,'CAD','hourly',5.0,4.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgs004g01jv49fkdp9y','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked here in the summer of 2015 as a production engineering intern. The company culture was fantastic, there were many events planned for both interns and full times. The perks are great -- they really make it seem like they value you very much, not just as an employee but as a person. The only thing that was lacking a bit was work life balance, although I think that depends a lot on the team you are on.',8000,'USD','monthly',4.0,4.0,4.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgs004h01jv086fczrf','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','It was a very fulfilling experience, the work is sufficiently challenging and you are treated as a full time engineer. The project you work on will likely be high impact and definitely be in production before you depart. The company culture is very inclusive with a \"work hard, play hard\" mentality.',7000,'USD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgu004i01jvamyfhdw5','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I was an intern in the Microsoft Garage branch of the corporation. I worked with 3 other software engineers and a designer (all interns as well) in a team to create and design a product ground up over the span of 4 months.\n\nThere are two main offices in Boston, one on 1 Memorial Drive and the other is just across the street.  Both offer amazing views of the city and are very close to a bunch of food/grocery places.\n\nAs a team designing and building the product from the ground up, you are given basically complete control over the product you build and how you want to make it happen. Of course there are restrictions and guidelines which are clearly provided by a small team of mentors. The pace is very quick and you should be prepared to learn alot in a very short amount of time - in order to do successfully. \n\nThe one downside is that you really have no idea how plausible a project is to realize in a 4 month period, thus defining a MVP (minimum viable product) early on and committing to finishing it can range from very easy, to nearly impossible by the end of the 4 months.\n\nI worked an average of 8-9 hours a day 5 days a week. \n\n',7100,'USD','monthly',3.0,4.0,4.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgu004j01jv3l6ig1nb','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459550,'ck1n1du49000501jo4pwygsav','Interned on the search team. Got to work on a cool infrastructure-related project that directly improved Amazon\'s search engine. If you want to do data science / machine learning work, but also want to build things, I highly recommend.',9500,'USD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgu004k01jvbhgz6ndh','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Was there in summer 2016, the company culture was very friendly, and the constant growth the company was dealing with was interesting to take part in.',9500,'USD','monthly',5.0,4.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgu004l01jvd1zvf0s6','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Microsoft is a different company than you think it is. It\'s now a quickly adapting behemoth, poised to reap some big rewards in the near future.\n\nI tried PM for the first time after 4 different software roles and I really liked it. You work a lot more with others and have a say over strategy. You are basically the CEO of this little product/feature and are responsible for doing whatever it takes to make it successful (be it coding stuff yourself or getting others to do what you need). Mentorship and meaningful work is highly team dependent. From what I\'ve seen, the most exciting stuff happens in Cortana, Azure, Surface, Hololens, Xbox and Office. Work/life balance is great and Seattle is really dope (I like it more than SF).',7100,'USD','monthly',4.0,3.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgu004m01jv2442gw0z','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked at Wattpad as an iOS developer for my first co-op term in Spring 2014. Overall it was a great experience. Coming in, I didn\'t have much development experience apart from some tiny side projects that were on my resume to get me through the door. I learned a ton about iOS development, and other useful things such as Git/GitHub. The culture is quite relaxed and there is free beer, snacks, ping pong, and foosball available in the office. The work I did was really meaningful as I got to ship features that are used by everyone who uses the iOS app, such as story archiving and user profiles. The only thing I would try to improve about the mentorship is have a more structured mentorship process that focuses on helping the co-op meet their goals - I didn\'t even have weekly 1-on-1s to track my progress. However, I could always get the help that I needed on the work that I was doing.',3000,'CAD','monthly',4.0,3.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgu004n01jv931b9gq2','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked at Bidvine back in the summer of 2015, when they were just one month into building the actual product. I had a very good time working at this new startup for my first co-op term. There were just about 7-8 employees (including 3 co-ops) in a small office space in Waterloo. We didn\'t have the traditional perks that a startup would have these days; however, just the sheer excitement of working in a real, fast-moving startup scene amazed me. \n\nWe shipped things super fast, and generally moved at a high velocity. In terms of mentorship and support, I would give this a lower score, as they didn\'t really have a system or process for this. Things may have improved over time though.\n\nOverall, I was pleased with the experience of working at Bidvine, and so were the other two co-ops working with me.',18,'CAD','hourly',4.0,2.0,5.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgu004o01jv6cbj1mtu','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked here in the summer of 2015 as a production engineering intern. The company culture is pretty good and there is a push to be open and take on challenges. There is a dirth in good intern mentors in the production engineering internship program but experience may vary widely based on team.',8000,'USD','monthly',3.0,2.0,4.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgu004p01jv4tgc1xwz','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked at BitTitan during summer 2016. For the first few weeks, every new hire goes through brief training sessions and has to write unit tests to ramp up with the overall code base. After that, from a list of given projects, you rank the top 3 that you would like to work on and get assigned to one (usually your top choice but it can vary). Based on your project, you are also assigned a mentor. The work itself can vary from being important to being an improvement to an internal tool. Having the choice to do either based on how you rank your preference of projects is pretty handy. Depending on your mentor you may have more or less support from them. \n\nThe work/life balance is pretty good for interns. You are not required to stay late at all. There is catered lunches twice a week, but the sandwich/salad bar is available everyday. There are also lots of snacks and drinks. Once a month, the company celebrates birthdays during that month and there are weekly happy hour events. Finally, the company also organizes other employee events every so often like BBQ picnics, volleyball/pool tournaments etc.',5000,'USD','monthly',4.0,3.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgu004q01jv39ml1u0k','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','There was a really great work environment and group of interns. I learned a lot while there and had a lot of fun. Our team would play foosball and ping pong often after lunch and after work. We had fun intern events too, such as a Sharks game and tour of SF.',45,'USD','hourly',4.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgu004r01jv91bk9b7h','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked in Hong Kong over the summer with about a month in New York. Although Jane Street is a trading firm, they take tech seriously. Everybody dresses casually and the developers are viewed at the same level as the traders. Hours were approximately 9-6. We also had a bunch of classes about finance so it\'s a great way to get exposed to something other than tech.',83333,'HKD','monthly',5.0,5.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgu004s01jvbb4s3fjd','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','What\'s great about InfoScout: the culture, transparency across functions, the flexibility in projects, the working environment, and the sheer awesomeness that is everyone that works at this company.\n\nI accepted a full-time offer at InfoScout and am working there now full-time. I\'m really excited about the future of this company!',5500,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgu004t01jvf4o10bu4','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459551,'ck1n1du49000501jo4pwygsav','A Thinking Ape is a really great company! Everyone there is incredibly intelligent- if you end up working there you will learn a lot. I personally had a suboptimal relationship with my mentor at ATA which somewhat took away from the experience but after talking to other past interns at ATA it did appear to be an anomaly and so was more than likely an issue on my end.',5000,'CAD','monthly',4.0,2.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgu004u01jv6dix0iyw','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Really open and supportive culture. There is an emphasis on maintaining work life balance and biweekly paid-for \"council\" sessions. Internship project and mentorship can vary widely based on team. ',9000,'USD','monthly',4.0,4.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgu004v01jvcfwhcdw0','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','While at Twitch I worked on a team that was creating the new follows API and migrating out of the core web codebase / database. I worked closely with 4 engineers (2 senior) with one of the engineers serving as my mentor / buddy. My mentor was always open to listening and helping me throughout my internship which allowed me to learn a lot through my internship.',7200,'USD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgu004w01jv4csqai0j','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I interned at Facebook in Winter 2016. To start off, Facebook pays very competitively when you consider the base salary, luxury housing, intern & team events, inter-office travel, and perks. Large signing bonuses are attached with a full time return offer and you will not need to do technical interview to be considered. Facebook is a large company so your experience and work largely depends on you and your team. The matching process is mostly arbitrary so you are unlikely to be matched with your dream team. Teams have different dynamics so reviews and first hand experiences are mostly based on these individual experiences. The intern program at Facebook provides resources for a intern to shape the internship the way they want it to be. Despite the variety in teams, work life balance, and the difficulty of work, it all gets normalized in the end when they compare and contrast the intern class as a whole. The culture, despite being a large company, revolves around openness and seeking your own work, so it is always possible to salvage a poor team placement. I was lucky and was placed on a great team (Live Video) which ultimately resulted in my most challenging and rewarding internship up to this point (5th term).',8000,'USD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgu004x01jv2g6b78dj','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459550,'ck1n1du49000501jo4pwygsav','Mentorship at Amazon was great. My mentor really cared about what I wanted to achieve during the internship, what I can achieve, what is expected from me, what expectations I have on the internship, and other things that a mentor should care about. He was really resourceful whenever I had some technical problems explaining in detail very kindly. \n\nWorklife balance is pretty great for interns. However, for full-timers, depending on the team, everyone needs to be \'on-call\' for 2 weeks rotating between the teammates. I wouldn\'t like being an \'on-call\'. \n\nThere is no free food at all. I would give 1 star to benefits/perks category if it existed in this review website. The work time wasn\'t that flexible for my team. My team had stand up meetings at 10 am every morning. \n\nI had an internal intern project. It was both technically and conceptually adequate as an intern project. However, because it was just for internal use, I gave 3 star to meaningful work.',5300,'CAD','monthly',3.0,5.0,3.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgu004y01jvdl7w8af7','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Best team I\'ve ever worked with. I\'ve had the chance to work at great companies in the past, but the team at Figma was something else for me. I feel like I\'ve grown the most from this internship as a person and also learned so much about design and full stack development. I would highly recommend working at Figma if you\'re passionate about design!',8500,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgu004z01jv2u8hbnnr','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','The impact you get to make at Wish is very significant. You\'ll mostly like make major contributions to the app, with almost full ownership through out the development cycle. A/B experiments (if they go well) will sometimes tell you that your features increased annual revenue by millions of dollars. As relevancy engineer, you will do a mix of data science work, like analyzing user behaviours and revenue trends, and engineer work, like product recommendation and product categorization algorithms.\nYou won\'t get a designated mentor and will be expected to be very self directed, but it wasn\'t hard to get help from the full time engineers. People tend to come in late (at 10-11) and leave late (at around 7-8) so the work hour tends to be a big long. \nYou get snacks, free crepes, catered lunch and dinner, which were pretty nice. ',8000,'USD','monthly',5.0,4.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgu005001jv7ybxgkug','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I interned here during the Winter of 2014 and had myself a pretty good time.\n\nWork: The project I was put on was to create a tool to compare how effective our trade pricing algorithms were. Overall, I thought the project was dry and not all that challenging. The project I was put on was purely done in C++, using primarily Bloomberg specific libraries and tools, so it wasn\'t exactly exciting either. What made work fun though was a great team, a fun group of alumni, and the crazy interns that I got to live with.\n\nThe city: New York City has a certain charm on it, and it hooked me in. Getting around the city is incredibly easy and it\'s very happening. From great shows to even greater food, there\'s always something new.',40,'USD','hourly',4.0,4.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgu005101jv9292gsaz','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I had a great team, worked on a very interesting project and probably would\'ve come back repeatedly for more co-ops, if it wasn\'t for the fact that the company didn\'t seem to be doing so well financially.',28,'CAD','hourly',5.0,4.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgu005201jvexz6ac4f','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Had a fairly good experience working here. I felt like I was able to work on a lot of interesting things, but it was in a startup phase at the time, so it often felt like things were moving too fast, and that I\'d have to stay late to finish things.',21,'CAD','hourly',4.0,5.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgv005301jvfntj03sv','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Unlike many other interns, I was not given an \'intern project\' but rather tasks after tasks from my mentor. Therefore, I didn\'t really feel like I owned anything substantial. So for me, the work wasn\'t meaningful. Also, the mentorship/support from my mentor wasn\'t great. I told my mentor many times that I want some more tasks that involve much more coding. However, I was given tasks that had very little coding but require a lot of manual A/B testing done through web ui. \n\nI love Facebook culture and food though. 3 buffet meals a day every work day is too awesome. Not only there are a lot of variety of food but the taste of them are indescribable. I really miss their food. Also, intern life is great. Intern events, corporate housing, etc.',8000,'USD','monthly',4.0,2.0,2.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgv005401jv1fveg2l1','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Really fun studio to work at! Highlights of my 2016 Winter co-op term here include being invited to perform in a Legendary Pictures movie production based off of one of our past games, and given a gaming computer to take home after they changed to using newer machines! All of this is in addition to really flexible work hours, catered dinner everyday (if you work overtime), and an amazing charismatic influential studio director. Supervisor tries to assign you projects based on your interests. I said I was interested in audio and databases, and was literally given tasks to improve their current audio database',25,'CAD','hourly',5.0,4.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgv005501jv4d6dg583','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Working at FairVentures was definitely an awesome experience, getting to know a lot more about the insurance industry and team is super helpful and supportive. Environment is very open and you are encouraged to share your ideas.',3400,'CAD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgv005601jvhfm0g928','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','It was my best co-op hands down. It was my very first dev co-op - I never had a job in the valley as of yet. Even though I was basically a noob, I was treated as a full-time, working on projects that made a big impact that even got customers to sign up because of the features I built! Free food and games of Avalon/Secret Hitler every day at lunch was the best! Only downside was that I didn\'t get much exposure to the backend, but got tons of exposure to the frontend as a result.',27,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgv005701jvexio4bon','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Great people, very friendly environment. Only downside is the relatively low pay.',700,'CAD','weekly',4.0,4.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgv005801jvdbgk9e9l','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Great time, really tight company. ',9300,'USD','monthly',4.0,3.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgv005901jv7jpz8eow','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Very exciting company to work at. ',8500,'USD','monthly',4.0,3.0,4.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgv005a01jvh6qq39yp','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Amazing company with wonderful company culture. Everyone is very nice and supportive. ',7000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgv005b01jv6scrc778','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked in the Boutros Lab at the Ontario Institute for Cancer Research during the Summer of 2015. This was a research lab which applied machine learning techniques to cancer research. The lab actively participates in machine learning competitions related to bioinformatics such as the DREAM challenges (as it is similar to the work done in the lab and it can improve your skill with similar datasets).\n\nAs a software engineer here I got to work on both machine learning competitions and software engineering work. For the machine learning competitions I cleaned and transformed data in R, then ran it through the pipeline of feature selection and extraction, then the actual algorithms, then maybe some stacking. The software engineering work was pretty standard and related to maintaining and improving the libraries that are in use by the lab. At the time of my internship the codebase was R (for science related tasks) and perl (for systems related tasks). There are some libraries which have grown convoluted over the years being written as one-off research code which then is hacked to be reused. As a software engineering intern I had to refactor some of this spaghetti code.\n\nEvery week there was a lab meeting where there was one small and one large presentation by lab members. This was interesting to me as I got to learn about the different projects people had and how they used different ML models in order to make sense of the biological data. Sometimes it was very biology heavy which did offset me from understanding what they were presenting.\n\nThe lab members were very friendly and helpful, being experienced in their respective fields of expertise. Usually there are also other interns doing either similar software engineering work or bioinformatics research. Most of the full time lab members are bioinformaticians with a handful of software engineers which was kind of intimidating since I don\'t know much biology so I feared talking to the bioinformaticians (which was probably a mistake as they are strong programmers for academic work, which has different priorities but nonetheless they probably know many tricks that I could have learnt, especially with manipulating data in R).\n\nThe lab is in downtown Toronto right next to a subway station and there is a food court at the bottom of the building with ~10 selections. Exiting the building there are many great food places just a 5-10 minutes walk away.\n\nOverall the experience was great and I learnt a lot. The things that I have learnt about and value most probably is the data science experience as I use it in the current internships that I have.',3000,'CAD','monthly',4.0,4.0,3.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgv005c01jv09jvbfl8','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','A heavily funded and brand new start-up based in Toronto provided an awesome co-op experience. It\'s rare to get an opportunity to join such an early stage startup that is so strongly backed. I would definitely recommend a job here to anyone who is interested in the start-up scene. I\'ve been given tons of important work and had lots of involvement in steering the direction of the company. The company culture is open, friendly and extremely welcoming. Although it is a small team, the knowledge from your mentors is outstanding and you have the potential to learn a lot.',1500,'CAD','weekly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgv005d01jvfjpffkq6','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Overall a pretty good co-op term, catered lunch every day is great. There were some growing pains during the time I worked there so the organization of teams and the prioritization of projects were still being figured out.',3800,'CAD','monthly',4.0,4.0,3.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgv005e01jvgn8i3se5','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Loved the people I worked with! The projects were great and as an intern I was always valued and given lots of opportunities to contribute. The company has great values it likes to live by and really tries to make you feel part of a family',5000,'USD','monthly',4.0,5.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgv005f01jvca4i9b1c','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I loved it here, my mentor was amazing & I learnt ALOT. I was even placed on site and work directly with clients to put together what they needed. If you\'re not a fan of the Microsoft Stack, I\'d say steer clear. This isn\'t for you, otherwise its amazing :) Lunch and learns on Fridays (with Pizza!), great, supportive management. All in all a nice place to work.',27,'CAD','hourly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgv005g01jv1wa529oq','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','It was a comfortable job, there wasn\'t much to do. Lots of free time to play pool and ping pong.',800,'CAD','weekly',3.0,3.0,2.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgv005h01jvbcu3cn5c','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Interesting work, nice people, lots of perks.',7000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgv005i01jv3q88cjoz','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Currently interning here (Fall 2016), and it has one of the best company cultures I have ever experienced. You are treated as a full time, and given tasks that really make you feel like you\'re driving the company forward. There\'s a free beer on tap party every Friday afternoon. There are yoga, nap, and music rooms. Best of all, there are dogs everywhere. Interns are also paired up with a super friendly and helpful mentor, who truly makes efforts to make you feel fit in. ',4167,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgv005j01jv2h0f0j7x','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked there in Winter 2016, and the work-life balance and culture were really subpar. There was no effort to make the workplace enjoyable, and people seemed to live to work instead of the other way. People would come to work and stay until 9pm like its a normal thing, and the free dinners encouraged that. That being said the work was certainly plenty and meaningful to the company. It was a tougher time culture wise but the product and engineers they have are still top notch.',7000,'USD','monthly',3.0,3.0,4.0,2.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgv005k01jvb48s292b','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','With some of the best mentorship and support I\'ve ever experienced at any company, it\'s  difficult to overstate how positive my experience was at PagerDuty. I can\'t think of anything you\'d want in a job that it doesn\'t provide: \n1. Work life balance: The office is empty by 6pm, and I was actually discouraged from working more than 8 hours. \n2. Quality of work: PagerDuty tackles some very interesting problems and as a devops company, the way it handles its infrastructure is absolutely superb; even the most seasoned developers will learn a lot from their solutions.\n3. Co-workers: It\'s not unprecedented for a successful company located in SV to have so many intelligent engineers. However, the way it stands out from most other companies in the bay area is the empathy, humility, and genuine goodness of the people there. The most skilled engineers have the smallest egos and would often give me credit for work that I had a part in, even if it was mostly facilitated by them\n4. Pay: Scales by around $500/month as you are promoted every term (for SF office). The pay for the fifth work term is 1.5K stipend + 7.5k. Extremely generous, and is higher than the pay of many top tech companies.\n5. Perks: Free lunch everyday, free breakfast every Wednesday, planned fitness room, nap room, beautiful office space, freedom to work from home at your own discretion, monthly company wide hackdays.',9000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgv005l01jvfssc8otj','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked there from January to April 2016 and had a fantastic experience. Software consulting is very fast paced, so I was forced to learn mobile development quite quickly, but not without support from senior developers. It was great to see a product end-to-end in only a few months, very rewarding experience. We often had team lunches to increase bonding. ',920,'CAD','weekly',5.0,5.0,5.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgv005m01jv10ok1obk','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','My mentor and manager are very supportive. There is overtime pay here so I choose to overwork myself. The software that I write is actually used by others, which is great.\n\nBreakfast and lunch are 6 dollars per \"dish\". Dinner is 1 dollar for your first dish, and 6 thereafter.\n\nAll in all, a wonderful place to work.',40,'USD','hourly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgv005n01jv5iyn1ot2','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I had a wonderful work term here, with the best team ever. The software I wrote here was open-sourced and now used by many. My desk was huge with 4 monitors, and the desk was adjustable in height (really expensive desk!). Cubical walls were low, so we can see everything when standing. Pay is low, but we do internships for experience, not money.',20,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgw005o01jv3e7t73u2','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','CEO was awful. This was absolutely awful for skill development as the lack of competent mentors means that you write and get taught to write shit code. The CEO is an absolute nightmare to work with. But they\'re trying at least. Overall I did not enjoy this and would rank this as one of my worst coop experiences.',20,'CAD','hourly',2.0,1.0,2.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgw005p01jv0bqt11tj','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Winter \'16',8800,'USD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgw005q01jvfg7p4sfk','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Generally older culture due to manufacturing background of the company. Not very social but the support to get your work done is helpful. Meaningful work at the end of the day. Cool to learn about how steel is made. Do note that the salary won\'t be like Toronto area so keep that in mind.',3000,'CAD','monthly',3.0,3.0,3.0,2.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgw005r01jv2add9maz','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Worked there in the Summer of 2015. The company\'s core competencies aren\'t technology, and it shows. They were using very old and outdated monolithic Java applications, and it was rare that most people were all in the office at once. The workload was very small, and there were times when my manager actually said he has no work for me to do at the moment because the rest of the team, and many other people, were on vacation or working from home.',18,'CAD','hourly',1.0,1.0,1.0,2.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgw005s01jvfrdsfzyg','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Each team is VERY different, as one co-worker put it, IBM is essentially a massive company full of mini-startups (a.k.a individual departments or teams). My team had excellent mentorship/support, the team was very approachable and knowledgeable and were always willing to explain concepts to you.\n\nThe work itself was somewhat interesting, but felt like IBM was trying to \"catch up\" to the data science hype. This is expected for a large company though. Similarly, the work hours are very flexible but some people work insanely long hours due to the large amount of work that can get handed to you.\n\nFinally, one of the biggest negatives to IBM is the workplace politics. There are so many different levels of management that information can get diluted down the management chain which may also lead to unrealistic expectations. My direct manager(s) did their best to shield us from that, but things occasionally leak through.',25,'CAD','hourly',4.0,5.0,3.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgw005t01jv11pcalos','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Did an internship in Winter 2015 on the main campus and it was probably the best internship experience I\'ve had. Lots of perks and you\'re around really great people that want you to make the most of your internship experience. Would definitely recommend checking it out!',6667,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgw005u01jv26sp71qn','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Worked here for my first co-op term as a QA Analyst manually testing websites. The work itself wasn\'t super interesting but the hours were really flexible and the team members were really nice. It was a good learning experience for my first time working though.',15,'CAD','hourly',3.0,4.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgw005v01jvcbfl759u','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I just hate commuting there but it\'s a professional company that treats their interns with respect and assigns them real work.',25,'CAD','hourly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgw005w01jvh7n0epjs','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked on the test automation team here for my first coop, and really enjoyed the experience. Great people to work with, great culture, good office with a very nice espresso machine :), and I find Vancouver just a beautiful place to be (especially in the summer). As for the work, I felt I was doing useful work, and I believe what I worked on is still in use today. Talking to other interns while I was there, they said they were enjoying the term and liked it better than other coops they\'ve had.',4000,'CAD','monthly',4.0,4.0,3.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgw005x01jv5ove9y8z','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Zenefits was a phenomenal coop. I worked on the Affordable Care Act automation team, and it was one of the best experiences I\'ve ever had. It varies per team, of course, but I would say it\'s not for everyone. You work on really impactful projects meaning you also get very tied to its deadlines. Many employees work long, busy days. I would say, however, that for an internship it really kicks you into shape and even if you work a day or two in the weekends here and there it\'s absolutely worth it since you know you\'re doing valuable work and the customer impact is very direct. And at the end of the day an internship is only for 4 months or so. When I was there we also did plenty of fun things with the other interns (and full timers).',6500,'USD','monthly',5.0,5.0,5.0,2.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgw005y01jvd6lrgeau','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Great place with lots of things to do, and a lot of excitement around the product. The company is moving super quickly, so naturally there are a few growing pains here and there. Overall, the engineering team is world class and I would not hesitate to come back again.',4680,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgw005z01jv67i55znq','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','The vancouver office is super nice and in a great location downtown. The work I was doing is super fun and rewarding (got to work on a hololens project), although I was pretty stressed and busy sometimes since I joined the team at a very busy time. That\'s very team dependent though. I know of a lot of other teams that are super chill. No snacks and free food which is a letdown, but that\'s expected from a Canadian office. There\'s tons of free fruit and drinks though! I really loved working with my team members - everyone is super nice and smart too. There are also lots of fun company events and it didn\'t feel like a corporation at all. The only big disappointment is that the internship salary is so low compared to the redmond office.',4000,'CAD','monthly',4.0,5.0,5.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgw006001jv1g9k0gtt','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Their platform is very different, and probably suits more mathematically inclined people. Learning intentional programming was difficult for me (very different paradigm) but the mentorship and guidance was excellent. The intern group when I was there were some of the brightest people I\'ve met.\n\nI interned on the graphics team, which was a lot of fun. Learnt a lot about how GPUs work, and how to design and implement data pipelines in a rendering engine. There are a lot of interns, especially on the graphics team, so you\'ll often have to figure stuff out yourself.',35,'USD','hourly',4.0,5.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgw006101jv2bazgmdm','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I was given a lot of responsibility and ownership in my work which was rewarding. I learned a lot from my mentor as well. However, I feel like I didn\'t have as much fun here as I did in my other internships at other companies. ',7000,'USD','monthly',4.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgw006201jv6gcl7xhk','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459550,'ck1n1du49000501jo4pwygsav','My favorite internship to date! From a perks perspective, I was treated fantastically. The Operations team hooked me up with an amazing corporate apartment in midtown Manhattan. Food was always fantastic. \n\nFrom a learning perspective, this internship blew my expectations away, both professionally and personally. My coworkers were fantastic, projects were meaningful, and the culture overall was great. My only nit-pick would be some teams work too hard, but again that\'s New York culture to you. I didn\'t mind it, since I learned so much.',7000,'USD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgw006301jvf71ph9up','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I was the first product management intern at Twitch and I PM\'ed on the Clips team. Despite this being a new internship program, I had an amazing time and was able to grow significantly through the internship. I had a large support structure and my team was very welcoming. I was encouraged to and given opportunities to take on more and more responsibility, and eventually was able to be product lead for two major products, coordinating between engineering, design, UX research, and marketing. The Clips team was amazing as well... everyone was very friendly and supportive and there were lots of off work activities, Twitch-sponsored and not. Overall, I definitely recommend working at Twitch. The company has a startup culture with the resources of a big company (Amazon, AWS) and you\'re really given a lot of opportunity for growth as an employee.',10800,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgw006401jva5aq35pc','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','The internship at Mozilla (in Toronto) was 12 weeks, including one work week somewhere around the world (they have a semi annual work week where the global teams meet together), in my case it was in London. The work week in London was really fun, and a great experience to get to know the people (from all around the world) you may work with on the daily. The internship itself requires you to be very independent, though depending on the mentor, you may have a different experience. The environment is very pro open web and open source, and is a very geeky, but overall a fun place to learn and intern.',6000,'CAD','monthly',5.0,3.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgw006501jvf7lebkbt','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','People are very down-to-earth and nice to hangout with. Getting to know the other interns in the city was also great! The work itself was frontend web development which isn\'t my cup of tea, but still a good learning experience for an early co-op placement.',3750,'CAD','monthly',3.0,3.0,2.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgw006601jvaqft9zbq','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I love love love loved my internship experience at LinkedIn. One of the things I liked the best is that they really value craftsmanship there and designing things the right way. We get a day off every month where special events are provided as \"InDay\". The people are pretty chill and I had a lot of fun. They also put in a lot of effort to make sure you get a project you\'re happy with.',45,'USD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgw006701jvd50adxsc','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I interned at Benchling in Fall 2016. They\'re a small biotech startup with around 35 people and most people are pretty down to earth. At times I noticed people working a bit late or on weekends which is somewhat common for a startup, but as an intern I didn\'t really work much more outside of 10-6. I got to work with fairly modern tools (aside from some legacy coffeescript and backbone) like React, ES6, and Flask (python web framework).\n\nBenchling is in a pretty different space compared to a lot of tech companies, so I got to learn quite a bit about the industry and how a startup at this stage functions. Through weekly product demos I got to see what everyone else was working on and learn a bit of biology too!\n\nOverall I\'d highly recommend Benchling. They\'ve got a lot of great people working there and you can tell the people really care about the product.',8500,'USD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgw006801jvayyrcm80','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Everyone at Strava is super interested in health and fitness. The worklife balance here is really good. People leave work in the middle of the day to go for group runs and workouts. If you are really interested in biking or running this is the place for you. If you aren\'t, then not so much as it can feel a bit excluding at times. \n\nEngineering-wise it was pretty standard. I worked on a lot of different high-impact features and got to pick what I wanted to work on. I didn\'t receive much mentorship though. ',6400,'USD','monthly',3.0,3.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgw006901jvg09i3pbi','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459550,'ck1n1du49000501jo4pwygsav','The company culture at Airbnb is really open and friendly. Right from the get go I was able to notice a difference from other companies I have worked at. They highly value diversity and put effort into making sure everybody feels like they belong. The office space is also really nice.\n\nEven though the company has grown substantially, I still feel like I was able to have an impact through the work that I was doing. I could build features fast and get the help that I needed pretty quickly. ',10400,'USD','monthly',4.0,4.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgx006a01jvgfrrdyz1','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459551,'ck1n1du49000501jo4pwygsav','Your experience is gonna vary a lot depending on your team. I had a good time at Amazon and was working on code that shipped while I was there.  My mentor was a great resource and super helpful in guiding me through the project. My project was also well-scoped to be finished in 4 months.\n\nMy biggest learning experience was architecting my project from scratch. At most tech companies, I\'m expected to implement projects that are already architected. Here, I owned the execution of my project from start to finish. It gave me a lot more responsibility and was a new thing for me. \n\nMy team had a low operational load, so the on-call lives of my full-time peers didn\'t seem that bad either. However I\'ve heard of insane operational loads in other orgs/teams, so keep that in mind.\n\nOn the perks side, there isn\'t a lot to report about. You only get a 10% discount on all items \"sold by Amazon.ca\", which is pretty good. But you don\'t get free food or anything - even snacks are for purchase. Only coffee/tea is free. You do get corporate housing though, or a generous stipend.',5300,'CAD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgx006b01jvag7z0a1m','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked here during Fall 2016, and it was a great experience for me. The culture here was very immersive and supportive of all employees including interns. The work that I did here was very impactful and was in use immediately. I learned a lot.',35,'CAD','hourly',4.0,3.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgx006c01jv9i3oap7c','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Worked on the Fusion 360 project as a software developer intern. I really loved the project, I was doing alot of feature work as well as challenging bug fixes. I felt like I made a significant difference in the project, and the coworkers were really nice and supportive. \n10/9',3500,'CAD','monthly',4.0,4.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgx006d01jv0x83fegv','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked at Odyssey for my first co-op back in 2013. I got to work on very high level regulatory submissions for their international offices, which is a pretty unique experience. However, I don\'t think they anticipated the working ability of their co-op students, and as a result I did not feel very challenged. The working hours were very standardized, and there was a great work life balance. Overall, I definitely think it was a great experience but would definitely recommend management to put more effort in finding challenging work for their co-ops.',25,'USD','hourly',4.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgx006e01jvhjuje62a','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I interned at Minted in Fall 2014. The work was on par with what full-time engineers worked on, with a mix of front and back-end. The company\'s not huge, so it\'s fairly easy to get to know a lot of the engineers there and what\'s being worked on etc. My team was really friendly and patient with me throughout the whole experience. ',6500,'USD','monthly',4.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgx006f01jv4wby9t1z','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked at Facebook in Fall \'16. The compensation and perks speak for themselves. The work will vary depending on the team you\'ll end up on (based off your preferences and skill set to a certain degree). Your intern project and its impact will largely determine how successful the internship will be.\n\nFor me personally, I\'ve always preferred back-end a bit more, but my main project was a front-end one (ironically, my team was almost entirely backend and infra-related). That being said, I was still fine with getting more front-end experience, especially with React. After expressing my interest in doing more back-end stuff, I\'d help with some back-end items after finishing my main project. Admittedly, the stuff I was working on wasn\'t going to launch fb into a new era or anything, but I was perfectly happy with working on something that helped my team grow towards its goal.\n',8000,'USD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgx006g01jvbfe6dyut','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Given that it\'s a bank, it should go without saying that the culture was very corporate. As an eBusiness Specialist, you are pretty much given mindless tasks with very little coding involved. You will be asked to modify html and upload files/images into a content management system. There are very few meaningful projects for interns to work on. Spent at least half of my time either doing self-learning or wasting time on YouTube. Next to no mentorship was available.',17,'CAD','hourly',1.0,1.0,1.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgx006h01jvejd02gtk','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Extremely intelligent people working here. I learned a lot from just reading the codebase and talking with my mentor. Culture could feel a bit cliquy at times & I didn\'t get to work on a particularly interesting project.',8000,'USD','monthly',4.0,5.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgx006i01jvgse3hdg3','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Excellent opportunity to learn in-depth about nanotechnology research, as well as getting a broader understanding of the materials science and electrical engineering involved in the design of nano-systems.',77000,'JPY','monthly',4.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgx006j01jv7uti63pu','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Worked for four co-op terms as an auditor in the Toronto practice focusing on clients in the financial institutions industry. Taught and mentored by some of the best in the field. Exposed to a multitude of companies and was able to exposed to how different companies both within an industry and across various industries operate. Great place to start a career!',4580,'CAD','monthly',4.0,5.0,3.0,2.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgx006k01jvegtr8jdj','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','* My manager and mentor were both extremely knowledgeable and invested in my growth as an engineer. \n* I got the chance to work on a newer product and add useful features.\n* No intern events or any fun stuff',6000,'CAD','monthly',4.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgx006l01jvevfpa5yh','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Company culture isn\'t the best, but the location is key.',9000,'USD','monthly',2.0,3.0,4.0,2.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgx006m01jvbrsu6r0f','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Tremendous learning opportunity. Students get involved immediately into the group\'s research, and get a comprehensive background, ranging from the design of experiments to the publication of scientific literature.',2000,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgx006n01jv9940hvi9','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','At Google, you can be extremely productive because everything actually \"works\" as intended. It\'s true that the impact is diluted at such a big company, but on the bright side, it\'s extremely flexible to switch to a team that interests you.',6000,'CAD','monthly',4.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgx006o01jv3md91bie','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Facebook has a great culture and everyone treats each other really well. Team-matching does a pretty good job finding a team that would interest you. With all big companies, there is a concern with the amount of impact one can have, but aside from that, I can\'t think of any other cons.',8000,'USD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgx006p01jv15tngm1b','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','* Amazing team. My manager did bi-weekly one-on-ones where he asked me for feedback, mentored me on leadership, helped me solve problems related to my work, and pushed me to grow as an engineer. My mentor was really supportive as well and was always willing to help me.\n* Great social life. Team went after work weekly, plus we did lunch together every day.\n* Project was perfectly scoped for 4 months and interesting. Got to see it deployed & used before I left.\n* Annoying restrictions on doing things with the Bloomberg platform because I was an intern (like deploying my code)\n* This is Bloomberg so lots of very business-y meetings that are long and ... business-y.\n* Project was planned/designed before I started my internship, so that left less room for me to come up with my own architectural ideas.\n* Typical big company politics going on in the background',3000,'GBP','monthly',4.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgx006q01jv280k6m1q','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Worked there in 2016. Truly great people (\"not jerks\"). Lots of opportunity for learning and growth. Invested in your interests and preferences, happy to give you opportunities to learn whatever interests you - just ask!',1200,'USD','weekly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgx006r01jvg3ohhaq7','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','-Good first internship into corporate world\n-The corporate structure is a bit excessive. Strict hierarchies are in place and designers are from separated from technical to design. The dress code is business casual, which I wasn\'t too fond of.\n-Every intern is assigned a mentor, which was nice. \n-Interns were encouraged NOT to work overtime to reduce spending on company\'s part.\n-Perks: free taxi and free dinners after a certain time (8pm?)',3300,'USD','monthly',4.0,4.0,2.0,2.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgx006s01jvaum76flh','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked here in Winter 2016. I was assigned a team that had a lot of projects in progress. There is pretty good mentorship from people in your immediate team, but since the company is expanding very rapidly, it may not be as simple to grab a hold of people to ask questions. Work-life balance varies by team, with some people working pretty long hours, but as an intern, you aren\'t expected to work long hours.\n\nThe work you do at Snapchat will almost always be meaningful and be put to use. Those working on mobile will most definitely be able to point to something important or relevant in the app by the end of the internship.\n\nThere are many free food options around and a solid chef in the cafeteria for lunches and dinners. Although there\'s no on-site gym, you can get a subsidized gym membership at the one and only GOLD\'S GYM.',9000,'USD','monthly',5.0,4.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgx006t01jv5t6837ac','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked at Facebook in Fall 2016 on Infrastructure. Work-wise, Facebook\'s internship program is very well structured; they really focus on providing mentorship and tools that allow developers to come in and ramp up quickly. I had a great relationship with my team and a lot of respect for both my team manager and internship manager; they were all very keen to make sure I was enjoying my time there. Dev experience is very polished, I was never blocked on infrastructure not being available for me to work on my project.\n\nBenefits are probably top-tier in comparison to other tech-internships, you also really bond with other interns outside of work. This is a great choice!',8000,'USD','monthly',4.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgx006u01jvhgaz93ro','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked here during Summer 2015. I was assigned a team, but they are very flexible with regards to what you actually end up working on. For instance, I was put on a back-end team, but ended up doing mostly Javascript because of the project I chose. Everyone around you is pretty eager to help and support you learn. There\'s generally a lot of cool things to work on, but because of sheer size of the company, it may be difficult to make meaningful impact. Overall, Facebook has amazing perks and is great place to grow and learn as a software engineer.',8000,'USD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgx006v01jv1jg46bll','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459550,'ck1n1du49000501jo4pwygsav','The work was demanding and challenging which was exciting. Amazon emphasized a lot on taking ownership of your own work and spear-heading your own project by yourself. I did not like the company culture as much. Working at such a large company makes you feel like you are not as important. My project itself was being used by vendors so the work was fairly meaningful. The biggest disappointment was the perks available, especially compared to other companies in the Seattle area like Microsoft and Facebook (Amazon emphasizes a lot on being frugality). The corporate housing was quite generous, bi-weekly cleaning comes in clutch.',6000,'USD','monthly',3.0,3.0,4.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgy006w01jvgqwz33hw','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Great team and best experience of my life!',3750,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgy006x01jv3pbladk9','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','In terms of meaningful work, I think internships at Uber give their interns the meatiest projects, from technical and impactful perspectives. They really put a lot of trust in their interns to take on and deliver projects that are core to their teams.\n\nMy team was very tight-knit and genuinely enjoyed each others company; I was very sad when I said goodbye on my last day. Mentorship was also very strong, my mentor would always point me in the right direction if I needed any help.\n\nBenefits are really great; they provide monthly housing stipends and Uber credits. Also, they paid hourly when I was there, so overtime pay was amazing! Really recommend this experience. :)\n',7000,'USD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgy006y01jv68wk6ffx','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','The internship, I believe, is very dependent on the team. In my case, I was in an excellent team, that allowed me to pick up almost any project or task that I wanted, while giving me the support that allowed me to be effective. Hours were not predefined, and you were able to occasionally work from home. Though the company does not have the same perks as other internships, it was a great place to grow as a software engineer.',4200,'CAD','monthly',4.0,4.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgy006z01jvbvd0cz5g','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked on a machine learning team and not a games team, so I may have had different experience. \n\nOverall, the work was very laid back and fun, I got full control of where my project was headed. There were hackathons, ping pong tables, and video games. Worked with incredibly smart people and had a lot of fun.',4250,'CAD','monthly',5.0,4.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgy007001jvg3fkbt1o','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Nice environment. Coworkers were patient and helpful.  I worked as a full stack engineer on an insurance salesman management software. Hours were flexible. Work itself was a little dull. Lacks perks.',4200,'CAD','monthly',3.0,5.0,2.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgy007101jv8f9td5m8','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Overall, the company seems stingy. Dinner starts at 8:15 pm. The free rides program was changed from a credit based system to a ride based system, greatly reducing the usefulness. I personally did not get any transportation stipend.\n\nThere were a handful of engineers that were without a doubt overworked. However, I did not have bad worklife balance.\n\nThe work, the projects and the problems Uber is solving are very interesting.',43,'USD','hourly',4.0,4.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgy007201jv8xsvc9mc','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','1st coop term - worked on an internal service that searches through the catalogue of employees. Learnt Web dev and 3 tier architecture systems using C# .NET.',15,'CAD','hourly',4.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgy007301jv8pfd1zot','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked this past summer at Smucker\'s. The highlight for me was the company culture. Everybody was friendly, supportive and encouraging. There was an open door policy, lots of free merchandise and I would definitely hang out with my co-workers outside of work. It was a wonderful 4 months!',2414,'CAD','monthly',4.0,4.0,3.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgy007401jvbyx7b0p3','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','-Lots of long nights and weekends, but the hours are much worse for those doing competitions (also pressure). \n-Less pressure if you are put on a long term project than if you\'re put on a competition\n-Hiring process is ridiculous. From interview to being hired to being expected to work can all be within one week.\n-Model making sucks but it can be a break from staring at a computer all day. \n-Best part of the internship is making close connections with interns and being in Europe. 70 euro flights to many places! The Netherlands is also cool beans.',600,'EUR','monthly',4.0,3.0,5.0,1.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgy007501jv2nhz90m2','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked at trans-plan in summer 2015, up to that point they had only hired co-op students for software development. There were 6 co-op students in Traffic Operations and until the universities (Waterloo and Guelph) intervened midway through the term, we were working schedules that would be considered erratic at best and no-where near the university\'s requirtements. Some weeks we worked 10 hours, others we worked 25, but never the promised 35hrs and our paychecks were coming a month late and CECA had mentioned that the co-op term might not count at all even though I got the job through jobmine. At some point our supervisor said he doesn\'t have any more traffic jobs for the summer so he was thinking of letting some co-ops go. I spent the second half of the term in the office coding and designing products in solidworks (both things that weren\'t anywhere in the job description and requirements), which basically meant that the obly meaningful work I did that term was work that wasn\'t initially going to be worked on by me.',12,'CAD','hourly',2.0,1.0,2.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgy007601jv6ssi196n','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked at the CIW for 8 months this past year, and I loved the experience! I was able to put my research, communication and interpersonal skills to use, as well as developing a strong technical skill set on the job. My supervisors were supportive and helpful every step of the way, and I was constantly taking on new, meaningful projects. My work at the organization had real-world impact in the sense that I got to work hand-in-hand with the community to investigate measures of wellbeing and report on them to help real people! I would definitely recommend working for this organization, and I would certainly go back to this position again!',18,'CAD','hourly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgy007701jvgbhdf6jm','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Being a summer student at PHO was great. The people at the company are really kind, the PI and RTs give good guidance, and there are a lot of learning opportunities via journal clubs and guest presentations. ',400,'CAD','weekly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgy007801jvb7qg4j8q','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Great place to work if you\'re looking for experience in all areas of software development. The small team size lets you work on a variety of tasks. Additionally, the co-founders provide excellent mentorship and are always willing to help.',4000,'CAD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgy007901jvfv6s9pa5','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked for the Waterloo Cases in Design Engineering group in Winter 2016. It was a very interesting term in that I got to see what gets done with work-term reports and I was exposed to the steps that the faculty generally needs to go through to create new class material as well as getting professors to adopt these materials and incorporate them into their courses. Writing the case studies involved reading work term reports, released by the students, taking the parts relevant to the course the case study is being prepared for and developing a solution as well as a teaching note that guides the professor through potential implementations. Everyone was so nice and helpful and I was exposed to some professors\' research (another source of case studies) and learned about topics in other disiplines that I would not have been exposed to otherwise. But this position is also a true case of you get what you put in; while there are weekly progress meetings there are no deadlines beyond an expectation of 4 cases per tem, so you have to gauge how well you\'re doing and how good is your pace.\nWorking on campus also meant that I didn\'t have to pack up and move, I didn\'t have to sublet my place and I got to also take courses during the co-op term.',3065,'CAD','monthly',5.0,4.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgy007a01jv45qxfkx9','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I loved my time at Argus. Even though it didn\'t pay that well, it was such a great experience. I got to meet such wonderful women, and I got to learn so much about shelters, and the way they worked. I also learned a lot more about mental health, and even my own personal mental health.\n\nWhat was also invaluable was the opportunity I got to truly be open minded, and to open my heart to others. I was able to learn some administrative skills, ontop of problem solving, communication, leadership, and many more that are hard to come by in traditional student positions. All in all, I had a wonderful time at Argus and I would most definitely do it again! ',11,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgy007b01jv0fbjd7n2','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Part-time teaching kids different sports. People in the company are nice and really relaxed. ',12,'CAD','hourly',4.0,4.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgy007c01jv7eeeba9h','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','The employers were very friendly and supportive which created a positive work environment. This opportunity provided a great experience for gaining different technical skills. In addition, being able to assist in organizing a research project gave me insight to how research careers in the work field are conducted. It was at a great location and overall, a good co-op term.  ',1600,'CAD','monthly',4.0,5.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgy007d01jv4fan2ct4','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Worked summer 2016. Was at front reception greeting clients for multiple departments. Great way to learn more about the public sector, gain great admin and social skills. Very understanding supervisor. ',19,'CAD','hourly',4.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgy007e01jv907xadq6','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Smart coworkers, and meaningful work. Also has great perks for a startup.',8000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgy007f01jv8mw9dxds','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Pretty good but most of the team was remote so there wasn\'t a lot of mentorship.',6700,'USD','monthly',4.0,3.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgy007g01jv7c56exil','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked at Google Kirkland office during summer term of 2016. I was assigned to the Cloud team. It was a great experience. My host and my team were very helpful and flexible. They gave me constructive feedback and helped me improve and acquire new skills in software development.',6000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgy007h01jv3bpf27eu','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked there during Summer 2016. The company doesn\'t provide corporate housing, so interns have to find their own, but there is an extensive shuttle network and they also provide a bike for the duration of the internship.',6667,'USD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgy007i01jv95a695vg','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459550,'ck1n1du49000501jo4pwygsav','I interned at AdRoll winter term of 2016 on their data team. It was an interesting experience. I learnt a lot about the world of serving ads. Sometimes I was assigned work that I felt wasn\'t relevant. The culture at the company was great. People were friendly and approachable.',6400,'USD','monthly',4.0,4.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgz007j01jva7duggii','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I interned at Canadian Tire on their innovations in CommuniTech hub during the summer term of 2013. It was my first internship and also one of the first hires for the innovations team. There were more interns than full time employees on the team which contributed to a slight lack of mentorship. However it was a great experience and I learnt a tremendous amount because the environment forced us to work independently. Manager was great and approachable.',22,'CAD','monthly',4.0,3.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgz007k01jv11pmbgxo','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','In the fall of 2016, I had the pleasure of working on the Fabric team as a full stack developer. Every intern at Twitter is assigned a mentor and a manager. Intern mentors work with their mentees every day of the week and provide them the resources and support they need to succeed at their internship through weekly one-on-one meetings and frequent feedback. Managers address any career-related questions you may have, and provide general career counselling. \n\nThe culture on the Fabric team was the best I\'ve ever seen on an engineering team. There is an emphasis on openness and enthusiasm that is seen and felt on a daily basis. Team meetings rarely feel extraneous, and I left most of them feeling like progress was made or work was accomplished. \n\nIncluded in my salary was a $2000 housing stipend. The food is phenomenal.',8500,'USD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgz007l01jv2x3h4ns4','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I interned at Meta during the term summer term of 2015. I was on the data team. It was an interesting experience because it a startup/small company. The team members are tight-knit and very intelligent.',4000,'CAD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgz007m01jvfmg84ama','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I also received a housing stipend of $5000 USD and $400 worth of Uber credits every month (I believe they don\'t provide the Uber credits anymore though). I had a great experience here and learned a TON. Unfortunately, the workload was huge and the company moves at a very rapid pace, so I was incredibly stressed out. I don\'t think I\'ve ever been more stressed out in my life. ',44,'USD','hourly',3.0,5.0,3.0,1.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgz007n01jv2w54de25','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I had an internship there in 2014. There was a big focus on the team and I was able to work on a number of client projects. ',4120,'CAD','monthly',4.0,3.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgz007o01jv0fb4996o','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','ThoughtWorks is a very friendly and educational workplace. By adhering to Agile principles (Standup, pair programming TDD, etc), I felt that I quickly gained context on the entire text stack and became close with my co-workers. As well, I was given the opportunity to shadow both the business analyst and the project manager and learned about work outside of the programmer role.',22,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgz007p01jv9p04en9a','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Worked in a research lab in the summer of 2013. It was a great learning experience and I received a lot of support from my supervisor as well as my lab mates. I was able to start work on my own long term project and it culminated in a oral presentation at an undergraduate research conference. ',10,'CAD','hourly',4.0,5.0,5.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgz007q01jvdd1r587k','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','It was great! Worked on a variety of optimization and data problems for various Consumer Packaged Goods companies.  Dynamic and hilarious team to work with and lovely weather in the fall/winter.',4000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgz007r01jv96mdhykf','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459551,'ck1n1du49000501jo4pwygsav','I think the culture highly depends on the team that you work at. Out of the big companies, Amazon is definitely the most frugal in terms of taking care of their employees. There is not much random perks but the work is definitely challenging and rewarding especially when placed on the right team. Amazon, as I see it, is definitely an innovator and will see success for future years to come.',6000,'USD','monthly',4.0,5.0,4.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgz007s01jvg3w74ayp','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I interned at LinkedIn for my last coop term.\nThere are a lot of pros about LinkedIn and I\'d like to highlight them:\n- I learned way more about engineering here than I did at other large companies\n- I was surrounded by extremely talented people (ex-members of tech giants)\n- My team valued code quality which leads to self-improvement -> code not breaking in prod -> stress-free deployment\n- Put into housing with other interns\n- Lots of random day events (eg. chili cook-off, runs)\n- Breakfast, lunch, dinner all provided with great snacks\n- InDays - once a month, take some time for self-improvement if you want\n- Tennis courts, sand volleyball court, basketball court behind their office\n- Just lots of opportunities to succeed and live a good life\n\nThere were no real major cons while I interned here but if I were to point out some minor ones:\n- Sometimes your code reviewer is too busy with their own stuff to review yours (this is common to FB, Google, etc.)\n- South bay is pretty boring\n- Without a car, commute can be very inconvenient\n\nLikewise with all companies, your experience might be different but mine went beyond my expectations. I will be returning for full-time.',45,'USD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgz007t01jvgzjad74w','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked during the summer months, particularly July and August. I had a great time working for Habitat. The employees were absolutely amazing and I had a lot of support from my managers. ',1200,'CAD','monthly',4.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvgz007u01jvarv45ncv','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Great work environment!',1350,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh0007v01jv6vq70980','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked there in Fall 2016. This was the first time I got to work on real machine learning - I got to build a model and work on feature engineering. I had superb teammates who were technically strong, and the work I did at Uber had the most impact on the compared to all my other co-ops. The infrastructure at Uber is not as mature as companies such as Facebook but there are tons of challenges to solve and it is an exciting place to work at!',7500,'USD','monthly',5.0,4.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh0007w01jv5cc5esg1','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Very good Front End experience, great team dynamic and good exposure to UX/UI design. There is a variety of project selection and many interesting projects depending on when you intern there.',5600,'USD','monthly',3.0,3.0,3.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh0007x01jvaa1yfhwz','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I took this job during continuous round in 2014 and the interview was discussing past experience. It was essentially a walk-on job. My overall experience at the Ottawa branch left a lot to be desired of.\n\nMeaningful Work\n- Bug fixing for days with the occasional small feature\n- Eventually got to do a proof-of-concept that led to a patent\n- POC was fun to do\n- Proof-of-concept likely scraped a few months after I left and patent was finalized\n\nMentorship\n- At first, I had no mentor but was eventually (luckily) paired up with one\n- Rarely got my code reviewed so I did not get as much constructive criticism as I hoped (POC only got design reviewed but not code)\n\nWorklife Balance\n- As an intern, you get to decide how much work you want to do\n- Was able to go to the gym often\n\nLiterally no perks.',920,'CAD','weekly',2.0,2.0,3.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh0007y01jvggc06zz2','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I Interned for Street Contxt in there Toronto office. It was a very good experience, they are a fast growing startup that values interns and offers great mentorship.',27,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh0007z01jv3ilub6u2','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','SMART has a great internship program and offers many interesting teams for coop students to work on. I worked for SMART amp which is an online real time collaboration software for classrooms. It offered me a great learning experience. ',4500,'CAD','monthly',3.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh0008001jv9xos5btd','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','This was by far the worst experience I\'ve ever had. Half the time I had no work to do, so I was bored out of my skull. Then whenever there actually was work, they put multiple interns on it and let them \"battle it out\" and selected the one that produced the best product. Like wtf?! Also almost the entire office had been relocated to work on projects in other countries, so there was basically 2 other people in the office. Would not recommend.',22,'CAD','hourly',1.0,1.0,1.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh0008101jvepuu0i7c','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Super chill workplace, work I did was shipped and overall rate this job. Take it if you get the chance in lower years.',17,'CAD','hourly',4.0,5.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh0008201jv28vtdp5z','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Very relaxed workplace with little direction in task, recently adopted agile development however most leadership is in disarray, moreover mentorship for a first / second year coop is there with the standard that you put in some self work and learning. Status of the company overall is reflected at the office with environment being  terse at times. would rate a solid 3.5/ 7',3250,'CAD','monthly',3.0,4.0,1.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh0008301jvegu4fovj','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked for the Government of Canada as a summer co-op student. The office was relatively small, comprised of no more than 40 individuals, so the team was tightly-knit and friendly towards each other. Everyone would eat lunch together in the kitchen and share laughs. After an employee comes back for vacation, he or she would bring back souvenirs (often edible, like chocolate) for the entire office to enjoy.\n\nAs a co-op student, I was warmly welcomed by all the employees. Everyone at the office offered help and made sure I was not having a hard time understanding my tasks. They also ensured my workload was appropriate. My manager would also meet with me frequently to see my progress and suggest improvements. The tasks varied everyday depending on the work that was given to me so everyday was different.',16,'CAD','hourly',4.0,3.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh0008401jv03dydjky','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','This was a really great place to work in terms of work. In terms of culture maybe not? I really liked it, but I feel like its a very fake-faced culture in that not everything is communicated clearly. I know this is not possible in a normal work environment, but I feel like somethings should be communicated clearly and early. ',6000,'USD','monthly',3.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh0008501jv06iw3hp0','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked here in my first year and loved it so much I went back for another internship. The team lead was super friendly and incredibly supportive, but there was a contractor I worked with that wasn\'t as nice. I ended up doing a lot of work he was assigned to do, which is great for me because I learnt a lot. In terms of getting credit for what you do, this may not be the best, otherwise it was a great start to my career. ',14,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh0008601jvgo1cg92s','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','I worked at eHealth Ontario as a business analyst, though the role itself was more of a project management role. During the term, I was responsible for collecting weekly status reports from the various project managers, clarifying the report contents and developing a summary status report for senior management. My manager that term was a great mentor and provided me with many opportunities to take on more advanced and interesting tasks as the term progressed.',16,'CAD','hourly',4.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh0008701jv0na96aet','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Worked here in 2B. Mileage will vary depending on the team. Worked on the cryptography team. I was the only non-PHD. I love cryptography',10000,'USD','monthly',3.0,4.0,3.0,2.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh0008801jv6sdae3wo','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Pretty awesome place to work, everyone is smart, and helpful. A lot of different personalities, and everyone gets their work done.',8000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh0008901jv2hreduej','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Fun place to work when I was there 2014, a lot of young link minded engineers. Although I have heard many of them have left the company since, so I can\'t be too sure of its status now.',7500,'USD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh0008a01jvd8tzc7ml','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Cool place to work at if you are into the startup scene in Canada. They are a YCombinator  company, and they put a big emphasis on company culture. I had a mini project for myself, and I was able to touch parts of the entire stack from front end to back end. ',4000,'CAD','monthly',4.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh0008b01jv0ski1qqn','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','The people are really nice, driven and smart. Worklife balance is great, I found myself having a lot of free time. This was mostly due to the nature of the work, which mostly consisted of bug-fixing and new features. Overall a great place to work.',4800,'USD','monthly',4.0,5.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh0008c01jv13l11i6b','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','The work was fairly boring as I did not believe in their product. The people there are really great and intelligent. They recently got purchased by a larger company so the culture might be different now.',5000,'USD','monthly',3.0,2.0,2.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh0008d01jv4ymh6osv','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','I had a co-op at Wattpad for two terms, spanning the Fall 2012 and Winter 2013 terms. I joined the engineering team when there were ~50 employees and everyone worked in the same room. My first term was enjoyable because I was given a lot of ownership over the codebase and developed end-to-end features. My second term gave me an opportunity to grow my leadership skills by on-boarding and supporting several new full-time iOS developers.\n\nOverall, Wattpad was a very warm and welcoming place to work. Allen and Ivan are two very intelligent and devoted co-founders. I hope to see Wattpad continue to grow as one of Toronto\'s most successful startups.',3600,'CAD','monthly',4.0,4.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh0008e01jvfrokggqw','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','I worked at Coursera as an iOS intern during the Fall 2014 term. It was my first time working in Silicon Valley, and I was looking forward to meeting many smart engineers working at the cutting edge of the software industry. I found this in my internship at Coursera, working alongside some of the most inspiring engineers I\'d met thus far. During my four months, I focused on features around internal tooling, event tracking, and the lecture video player. I learned a ton of iOS development thanks to working closely with my mentor and teammates, as well as attending meet ups in the Bay Area.\n\nThere\'s a lot going on everyday at Coursera across all the different teams, but one thing is constant-a lot of the employees empathize with the mission of making online education accessible to anyone, anywhere in the world.',8000,'USD','monthly',4.0,4.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh0008f01jv4puj2n9f','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','The mentorship that was provided by my particular PI and the grad student I helped was amazing. However, I felt I wasn\'t contributing much to their project - I was doing very laborious things like maintaining cell culture. There was less actual experimentation than I had anticipated but that was due to the nature of the project, with primary cell lines increasing the down time between experiments.\n\nYour lab experience largely depends on your lab and your assigned project so discuss it thoroughly with your PI!',1200,'CAD','monthly',3.0,5.0,2.0,2.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh0008g01jvecola6v6','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Worked there from Aug - Dec 2016. Really engaging place to work, doing something new every day. People are really cool and helpful!',775,'CAD','weekly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh1008h01jvh4wufjzo','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Yelp was a great learning experience. I found the mentorship and atmosphere to be incredibly chill and inviting. Experience varies widely from team to team, but I found that most teams on search had fun and interesting work. Would recommend 5/5.',9000,'USD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh1008i01jv3ujdah05','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Capital One KW labs was a poor internship experience overall. You\'ll get an intern project to do amongst other interns that is likely to never see the light of day. There is an extremely low quality requirement, and you won\'t get much mentorship to actually learn anything. Would not recommend, unless you explicitly want a self learning experience.',25,'CAD','hourly',2.0,1.0,2.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh1008j01jv8mu6fkqh','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Team Viking was an awesome team! The team is extremely welcoming, and experienced. You get to work on cool distributed systems. One caveat is the team is R&D so your work might not actually see production. A great first work term!',19,'CAD','hourly',4.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh1008k01jvg1n3d511','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I was very lucky with the mentor I got at BlackBerry - he was very helpful and I learned a lot from him but the biggest issue is that there is not a lot of work to do in the first place. I sat around making myself look busy for at least 50% of the term and the work I was doing did not seem very meaningful. Kanata is a pretty boring place - would not recommend in the winter unless if you bring a car. The bus service needs work, it\'s hard to get around, and there\'s not much to do.',800,'CAD','weekly',3.0,4.0,2.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh1008l01jv6nrwhhsg','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','People are very passionate about what they\'re working on. I was on the server team which was quieter but they were friendly and approachable. Company culture is good, they do lots of events. Company was growing a lot and in an exciting place when I left.',24,'CAD','hourly',4.0,3.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh1008m01jvd4ve10k0','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Technology department only had about 15-20 people. Worked on a web app that promotes coding with coding challenges.\nThere were problems with management, but people were friendly and nice and Japan was fun. ',150000,'JPY','monthly',3.0,2.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh1008n01jv6c1ph22f','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I was working on Fusion 360 web which was a product in beta at the time. Since it was in beta, there was also a lot of bug fixing that came with it. However, the bugs were substantial enough to require significant changes and a great deal of learning, which resulted in some meaningful work. I would recommend working here, especially this team, if you are looking to dive into 3D graphics on the web. The office space is also beautiful and conveniently located in Old Montreal near downtown.',3600,'CAD','monthly',4.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh1008o01jvdlfy0izt','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459551,'ck1n1du49000501jo4pwygsav','A Thinking Ape is by far the best workplace I\'ve worked at.\n\nWork time is very flexible that I can come to the office at 1 pm. Working from home is also a common thing. You can also bank statutory holidays by working on a holiday and increasing your vacation day. A very flexible working environment.\n\nSince it\'s in Canada, you don\'t get free food like in the Bay area. However, you still get a catered lunch every Wednesdays. There are many companies in Van that don\'t even give you one free lunch a week.\n\nSupport was also great. Both my mentor and my team lead tried their best to give me tasks/features that I want to work on and that are meaningful. The features I worked on are being used by actual people all around the world right now through the game I worked on.\n\nAs I really loved working at A Thinking Ape, I actually returned here and am working as a full time right now.',4500,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh1008p01jvbfwa1vza','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459551,'ck1n1du49000501jo4pwygsav','ATA tries to get you to push code to production within 48 hours! They definitely treat you like a full-time engineer and are willing to give you interesting work. At first I wasn\'t quite sure what I wanted to do, but narrowed it down over the course of the term. Teams are about 4-6 people (including co-ops in my case). While I was working there, the office was fairly close - there were several intramural teams (Dodgeball, Hockey, etc).',30,'CAD','hourly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh1008q01jv7wa52b7q','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459550,'ck1n1du49000501jo4pwygsav','The co-workers on my team were all very helpful and extremely smart, and the hours were not as bad as I\'d thought they\'d be, but I disliked having a single intern project to work on for the entire term.',6000,'USD','monthly',3.0,3.0,2.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh1008r01jvgr2x5hl6','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Worked in Fall 2016 and it was an amazing learning experience. I was placed on a machine learning project without previous experience in this area. I had a lot of freedom in trying out different approaches so I was able to experiment with a lot of different approaches. It was challenging work but at the end rewarding. The culture is academic, which was new to me and I liked. There are also a lot of clubs/interest groups that allowed me to meet a lot of the people at the company. The people were amazingly smart, humble and fun to hang out with.',8250,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh1008s01jvdxqg6qy0','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Fun company to work at. Lots of social events and the average full time employee is pretty young so there was a lot to do as an intern. Work was cool due to the scale at which Uber operates. The work-life balance is lacking since most people stay late and there is an expectation to work overtime. Also, dinner is at 8:15 pm.',39,'USD','hourly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh1008t01jvaf3af05l','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Project was engaging, but mentorship and support in engineering could\'ve been more experienced. You end up having to learn a lot on your own, but you do get to own the project entirely.',750,'CAD','weekly',3.0,3.0,5.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh1008u01jv5g0m9omx','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Slow public sector job. Great pay for the work you do, and if you\'re into transportation planning and engineering it may be worth a try.',21,'CAD','hourly',3.0,3.0,2.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh1008v01jv1u074uh0','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Working in the now defunct BB10 web browser team while it was on its last legs was a great experience. The team was wonderful, I was assigned a mentor/supervisor who took me under their wing and taught me a lot, but I found out that the work wasn\'t for me. I was doing a lot of testing and automation, which isn\'t really my thing but it might be for you!',21,'CAD','hourly',4.0,5.0,3.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh1008w01jvccix1kat','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Learned a lot at this company; coworkers are supportive and fun. Overall a great term!',900,'CAD','weekly',4.0,5.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh1008x01jvd0695o29','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Casual work environment and very youthful culture. Many events and games held regularly. You\'re treated like a full-time employee, so you things you do actually matter within the game and engine. Tight deadlines to meet for releases while I was there, which meant lots of overtime, but I was assured that this was only specific to the project that I was working on. A bit of growing pains in the development process, but it has improved a lot since I started.',30,'CAD','hourly',5.0,3.0,5.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh1008y01jv105v765b','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Welcoming culture. Great learning experience for me, especially since other employees also have a learning mindset. (It is an education company after all, I guess)',7000,'USD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh1008z01jv72dudqre','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Was a small company when I was there. There were a few people that brought the internship experience up. Did not interact with the rest of the company much. Was given full autonomy over my project, but did not receive much feedback.',9000,'USD','monthly',4.0,3.0,4.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh1009001jv4znudrae','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Travelled a ton, so my work life balance was shot. Work is interesting. I personally got to work with many clients and found it rewarding learning about the data and sometimes inner workings / politics of other companies. Did not grow technically as much since the work was more business-application heavy. Lots of learning opportunities in business skills in this role though.',7500,'USD','monthly',3.0,3.0,4.0,1.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh2009101jvchr8gzr4','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Good work life balance. ',5800,'GBP','monthly',4.0,3.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh2009201jv55c96hzr','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Summer 2014, the emerging technologies team is a small team (30 people) within the company working on a lot of cool projects, many of them are prototypes, and iterate quickly on interesting technologies',3200,'CAD','monthly',5.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh2009301jv515vfw3l','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Perks: \n$1500 Housing stipend\nSnacks & Drinks\nCatered lunch on Friday\n\nYelp has a very solid internship program. The work experience might vary depending on the team, but YIP (Yelp Internship Program) does an amazing job at engaging interns with activities at least once a week (e.g. street art painting, indoor mini golf, Giant\'s game with the mentor, trip to Angel Island, just to name a few). I participated in most of them and it was a great way to get to know the other interns and explore the city.\n\nI enjoyed the work; it\' was not a \'let\'s add this small feature on the internal tools\', but actually directly working on the Yelp platform. One drawback for me was that my mentor was leading a big project and had a lot of responsibilities when I started my internship. I wished I received more guidance / mentorship throughout the term.',7360,'USD','monthly',4.0,3.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh2009401jv4k67dg9h','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Worked here in Fall 2014. Snacks and Friday catered lunches were provided. There was also a $1000 /mo stipend.\n\nI was assigned a team and given a designated mentor. I wasn\'t really given many options to branch out into what I was interested in. I worked mostly modifying internal API responses to facilitate the building of a few smaller features. The main feature I worked on wasn\'t particularly that complex or interesting; hence, the low rating for the quality of work.  Work-life balance was essentially enforced for interns, since interns are paid hourly and overtime is discouraged. However, because of this hourly system, interns are also not paid for any holidays (i.e. I was only paid for 24h during the week of Thanksgiving).',36,'USD','hourly',3.0,3.0,2.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh2009501jv4dqv7wuz','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','For my final co-op term, I worked for the Performance team at Yelp. I learned a lot at Yelp and really enjoyed my experience there. The culture is quite chill, and the workload is very reasonable.\n\nDuring my term, there was a large group of (30 or so) Waterloo interns, and the company organized group events for us once or twice a week. These events were a good way of getting to know people. Another perk is they provide a housing search service, so you don\'t have to spend hours combing through Craigslist -- this proved to be super useful. There is only free lunch on Fridays, but the pantry is stocked generously with snacks and drinks. I would definitely recommend working here!',8800,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh2009601jvgniuezfl','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','The people that work at Side Effects are some of the smartest engineers I\'ve ever met. This is easily the most technically challenging co-op position in Canada. By like a mile. They have experts on rendering, cloth simulations, explosions, sand, crowds, etc, basically everything used to make visual effects.\n\nA lot of independence is required to succeed (well depending on who\'s mentoring you). You\'ll never be bored, but you\'ll probably be frustrated at times. C++, Python, and VEX (their custom scripting language).',33,'CAD','hourly',4.0,3.0,5.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh2009701jv1wv1gk1d','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked on one of Bloomberg\'s ML teams during summer 2015; the work itself was challenging, and I got to work on and learn about infrastructure/data science at a big-data scale. My mentor and team were very available and knowledgable, and were happy to answer questions when I needed help.\n\nNew York is a blast! They provide corp-housing, which is a huge plus in terms of bonding with other interns and exploring Manhattan.',6400,'USD','monthly',4.0,4.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh2009801jvbi4e9dpl','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked there for my internship after the 2B academic term. I absolutely loved the people there, it was like working with friends. Unfortunately, my mentor didn\'t seem to understand the role of mentors and did not provide any support at all. The work was rather boring because the product is boring, but I did get to put something out to production. ',33,'USD','hourly',3.0,1.0,2.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh2009901jv6c7177i9','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Fall 2016 - Sept to Dec\nHighlight: The people I directly worked with were great! I would totally go and visit just to see them again after I recover from my monetary loss.\n\nThe culture there isn\'t great for interns, because corporate full-times tend to look down on you because you\'re a student. I worked with programmers so there was none of that, but it showed with the university management. There\'s a lot of office politics which made everything 1000x more complicated, and the lack of proper management made everyone\'s work excessively harder. Also the pay was incredibly low while nothing except the visa was subsidized, which was almost not because they didn\'t know we had to pay another fee when we pick it up. HR rejected to pay it until the full-times talked to finance and clarified that it\'s supposed to be paid.\nWe had some exciting events and things in the road map, but in the end all I got was marketing and administrative work even though I wanted to do more hands-on work. I ended up spending a lot of time self-studying or helping people meet their deadlines.',1176,'SGD','monthly',1.0,1.0,2.0,1.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh2009a01jv1ro260x6','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Great people and great workplace. Lots of responsibility due to the small team size (which has since exploded to something much bigger), but that also means the work was satisfying and significant within the game.',21,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh2009b01jvdepobee5','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked there Jan-Apr 2016 on their Internal Platform team. I was in a team of 6 people (including me) and we worked on one of their most critical microservices that would propel their future features. It was mostly modernization, but the technical challenges we faced during this made it much more interesting than \"refactoring code\". The people were great, got along with the interns very well and I still keep in contact with the full-times via Facebook or LinkedIn. I\'m still considering going back for full-time, even though it was my second internship so I\'d need to reapply.',3750,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh2009c01jv8cox2rip','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I interned at Reflektion for 2 co-op terms and the first term I was there I learned more about software engineering than I did during any other co-op term.\n\nI got the chance to use a wide range of technologies during my internship and had the freedom to work on 2 different teams. I took on a lot of responsibility, from getting the product ready by a tight deadline to demo to potential customers to being the main engineer/owner to work on critical tools and infrastructure. The engineers I worked with had a lot of industry experience and I learned many best practices and tricks from them.\n\nThere were monthly company outings and we had a huge Christmas party. However, there were no company-organized intern events.',5500,'USD','monthly',5.0,5.0,5.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh2009d01jv9mx6bj1g','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459706,'ck1n1du49000501jo4pwygsav','I worked here during the summer of 2015. It was a very immersive and satisfying first work term for me, as it helped me develop professionally and improve myself technically.',22,'CAD','hourly',4.0,5.0,4.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh2009e01jv5wri3nwv','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459706,'ck1n1du49000501jo4pwygsav','Fall 2016 Coop. Got to work on a wide variety of projects. A lot of self-guided learning in really interesting areas. Supervisors were often busy or out of town and difficult to reach.',4000,'CAD','monthly',4.0,2.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh2009f01jveejxeixq','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459706,'ck1n1du49000501jo4pwygsav','http://blog.shreyanssheth.com/2017/01/08/winter-at-wingify/\n\nAmazing Perks (PS4, Ping Ping table, Skateboard, BMX all in-house. Free catered lunch, in-house chef, and tons more), Great peers, Talented engineering team. Making a shit ton of revenue on their products. Interning at one of India\'s best startups was one hell of an experience. ',20000,'INR','monthly',5.0,4.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh2009g01jvbqt12obd','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459706,'ck1n1du49000501jo4pwygsav','- It was a two man QA team therefore no automation\n- Great people\n- Everyone has a different idea of the where the company is and where it is going\n- I interned while they hired new management who turned out to be great\n- Catered lunch on Fridays',17,'CAD','hourly',3.0,2.0,1.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh2009h01jvdovp8fbq','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459706,'ck1n1du49000501jo4pwygsav','Built a lot of internal tools, and managed internal (ie build) processes. Very open culture and friendly people. Free lunch on thursday, and fun company events.',3500,'CAD','monthly',4.0,3.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh2009i01jv9y3eeplp','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459706,'ck1n1du49000501jo4pwygsav','It was lit',26,'USD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh2009j01jv6v9xe321','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459706,'ck1n1du49000501jo4pwygsav','It was lIT',3500,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh2009k01jv0rqy5t1q','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459706,'ck1n1du49000501jo4pwygsav','Your experience at RBC while vary with each team, however during my time there I found that I was given a lot of responsibility, and opportunity to learn and make an impact for the bank. The people there were always very nice, and are often used to being around co-op students. Managers are very helpful, and understanding at the same time. I would highly recommend this position for anyone who is entering their 1st or 2nd co-op term.',18,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh2009l01jv58qjfz2m','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459706,'ck1n1du49000501jo4pwygsav','Winter 2016. Amazing work life balance and culture, but not very interesting in terms of projects you will get to work on.',16,'USD','hourly',4.0,4.0,2.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh2009m01jv6ponh4fg','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459706,'ck1n1du49000501jo4pwygsav','Definitely more of a tech company than a finance company. The office is pretty nice with around 100 people and located in downtown Toronto. All the teams are actively working towards goals and there are a lot of interesting projects going on. On product focused teams, you are treated as a full-timer and have input on new features, etc, which is really nice. The people are very kind and approachable and there are office events that go on throughout the term for example ping pong tournaments. Cons are lack of internship events and they don\'t hire a ton of interns (1 per team), so it can be lonely sometimes, but it also forces you to make friends with your team :)',4000,'CAD','monthly',4.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh2009n01jv9qa76gce','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459708,'ck1n1du49000501jo4pwygsav','Vena is a pretty chill company to work for. Although the work I did was not the most interesting, I still learned a lot on the job. ',3600,'CAD','monthly',4.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh2009o01jv9xll01m4','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459708,'ck1n1du49000501jo4pwygsav','While on the Android team at RBC, I was given a good amount of work, and was treated like a full time employee. My manager was quite good at managing co-op students, and providing support when needed. Everyone there was always very nice, and respectful despite being a co-op. There\'s also lots of other co-ops at RBC, and lots of organized student events to network and meet new people. \n\nAlthough the bank\'s dress code is usually business casual, anyone working in tech (Under T&O) can wear casual clothing. ',23,'CAD','hourly',4.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh2009p01jv7tlzcybt','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459708,'ck1n1du49000501jo4pwygsav','Very nice people and they often hire a ton of coops, so in terms of fun, this is the place to be. The mentorship is lower since the full time to coop ratio is so low. The work is not that meaningful since you just develop prototypes, however there have been projects that have been passed onto the accelerator (TD 55) which was the case for my term project. However, this is fairly rare (only 1 project made it to accelerator in my term), so I have to give a low rating for meaningful work. I would recommend this place for a 1st or 2nd coop especially if you lack industry dev experience. Throughout the term you will be exploring all kinds of tech stacks, so it is a good place to get breadth.',18,'CAD','hourly',3.0,3.0,2.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh3009q01jvgikfg8i6','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459708,'ck1n1du49000501jo4pwygsav','The work was very interesting and my mentor was great! Make sure to be self-driven for this job since some coworkers are located across time-zones.\n\nI cannot give 5 stars for this job for the following reasons:\n - The Austin office doesn\'t have a lot of interns\n - The Austin office is 30 mins drive away from downtown Austin\n\nAustin does not have good public transit. If you want to have fun outside of work, buy/rent a car and be 21.',5120,'USD','monthly',4.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh3009r01jv2ml2dxdf','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459708,'ck1n1du49000501jo4pwygsav','When I was here, the testing was all manual unfortunately even though during the interview, they mentioned scripting and automated tests. I would only recommend this place for a first coop if you seriously lack experience. You get free lunch, the people are nice, the office is nice, dogs roam around, but at the end of the day, I would not recommend this place for people in CS or related simply due to the fact that testing is manual. Perhaps this has changed, but this was back in 2013.',18,'CAD','hourly',2.0,2.0,1.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh3009s01jvb5w0ab8s','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459708,'ck1n1du49000501jo4pwygsav','Interned at 2015 summer. ',6666,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh3009t01jv8c5c0rdi','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459708,'ck1n1du49000501jo4pwygsav','This was my first big internship however I had the worst experience here. The environment is extremely laid-back. Employees are not passionate about their work and job. The management is biased and skewed. A partner because my manager who barely cared about my progress, even forgot my day of presentation, one which managers have to let them intern know about. If it does not work out with a mentor for you, then it is a bad bad sign. You are typically not supposed to express what you think about the  environment and your thoughts about mentor. No one check in to really see if all is going well. When you stand up to speak for yourself, you are not taken positively. This was my experience of this place. I know you can have a very different experience. This is because the orgs in this company are very disconnected from each other. The culture across the company is very varied, and I happened to get into a bad apples basket:(',7100,'CAD','monthly',2.0,1.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh3009u01jvdfj04ady','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459708,'ck1n1du49000501jo4pwygsav','The people here are outstanding and many have advanced degrees. The work is very technical and challenging. I was fortunate to receive very good mentorship, but your experience may vary from team to team. Downtown Toronto is fun and the proximity of the office to the University of Toronto opens up opportunities to get engaged with student life there.',32,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh3009v01jv74yw5x0x','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459708,'ck1n1du49000501jo4pwygsav','I worked on a cook project with a remote team. By the end of the summer, the work had gotten repetitive, but it was a really collaborative environment and there were fun intern events. At the end of the summer there was a poster fair competition, which I won (the prize was a laptop, which I still use)',23,'USD','hourly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh3009w01jvd1t39dvz','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459708,'ck1n1du49000501jo4pwygsav','Worked on the AutoCAD team summer 2016. Absolutely loved the place, team and work I did. Most of my work was close to research and development but was happy to know that my project blew expectations and is now going to be integrated into the product. Also got $1000/month post tax for housing stipend. Highly recommend working here!',27,'USD','hourly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh3009x01jv9xgzgphx','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','This isn\'t a typical startup in the Bay Area, but they really take care to teach you (the interns) the ins and outs of the industry. The company is small, so you get to do pretty much everything important. You work on a project with the CEO separately and present it to the company. If it\'s good enough, they\'ll actually use it, which is really cool. Since it\'s quite small, you\'ll learn a ton about UI/UX, business, and marketing if you want to.',25,'USD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh3009y01jv8qu4fdsd','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Absolutely loved the company and the company culture. The company culture was very open and there were monthly meetings where they would update everyone on what was happening and what direction the company was going in.\n\nThe people at the company were also amazing. Anytime you had a question about how to do something or how something worked, you could just walk up to the person who wrote that piece because they just sat a few rows away at most. While I was there the company was about 800 strong with 150 devs in total.\n\nInterns were paid hourly and also allowed 10 hours of overtime per week which is great if you\'re trying to dish out a little more cash. Intern housing was also amazing with most interns living right across the street from the office (literally door to door was around 5 minutes). While they don\'t provide free meals, there is are a few well kept snack walls and fridges full of basic commodities like eggs and milk.\n\nThe intern situation was amazing with a tight knit group of ~20 dev interns. Intern events were also absolutely amazing, with great events such as touring Hollywood, going to Disneyland, and going to concerts on the beach. Another added bonus was that all intern events were paid events (and with Disneyland being a 16 hour day...).',35,'USD','hourly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh7009z01jva57k4gl1','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked at Goddard Space Flight Center during the summers of 2015 and 2016, for 10 weeks each.  My boss was awesome, and the work was extremely interesting and rewarding.  Overall mood of the place was very chill and everyone there took their job seriously but were not high strung.  Everyone I worked with was very kind when I would ask for help and I never felt like a burden.  Overall this was an absolutely wonderful experience and if you get the opportunity, while the pay is not great, you should absolutely take it.',600,'USD','weekly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh700a001jvgiythjl9','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459550,'ck1n1du49000501jo4pwygsav','Mentorship\n- This is my third internship at Amazon so the mentorship was minimal as I was driving the project by myself. Teammates are chill and helpful if you have questions. I\'ve never come across any smug arrogant engineer or manager working at 3 different teams and locations and most of  the people are chill and nice.\n\nWork/life Balance\n- This depends on how qualified you are for the job tbh. Most of the time, teams will give you an independent project that is scoped correctly. And if it wasn\'t, then well, the complexity of the project and any mis-scope is taken into account when deciding upon giving you a return offer.\n\nMeaningful Work\n- Amazon is really big on Ownership. I sort of worked like a 1-man-startup to deliver my project. They give you an independent project and most of the time it is internal. Some of the projects given are simple but some of them can be really complex. Be prepared to learn a lot.\n\nPerks\n- You get USD $2500 / 4 weeks housing stipend so make sure you get this option. The corporate housing will deduct USD $500 / 4 weeks on your salary and given the conversion rate, it will just suck.',5700,'CAD','monthly',4.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh700a101jvhgcmbtwz','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','This company is highly dependent where you end up. I got paired with a great mentor and did semi-interesting work. They definitely taught me a lot about being a product manager, but the work wasn\'t that fascinating. Again, it really depends which area of the company you work on. They treat employees very well, and you can\'t beat Seattle life in the summer. ',7200,'USD','monthly',4.0,5.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh700a201jvf6bxawxk','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Had a good experience working here. Team was supportive and I was always busy working on things that were impactful to the team.  In large companies like this, it really seems to depend on which team you end up in though.',20,'CAD','hourly',4.0,4.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh700a301jv4v225t5e','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','My first internship and overall I enjoyed it. I felt that I had a fairly different experience from the rest of the interns. Most intern projects were silo\'ed off from the rest of the company (mine included) so they could have done better with that, but overall I felt that my project had a decent amount of impact.\n\nNo real benefits outside of work other than subsidized housing and a few intern events.',20,'USD','hourly',4.0,5.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh700a401jv36dr6pt0','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459550,'ck1n1du49000501jo4pwygsav','Mentorship\n- Smart, kind, helpful mentors and teammates\n\nWork/life Balance\n- If project is scoped correctly and you\'re qualified for the job, then this is 5/5.\n\nMeaningful Work\n- I worked on Amazon Echo during the term it was launched for Beta (invite-only). Being part of the launch and seeing all those unboxing videos and the positive feedback of the community and customers with your team is an experience I\'ll always cherish.\n\nPerks\n- Really nice housing stipend. Downtown City life. When you get a return offer, you can choose any team and any location to work on (they have offices in pretty much every major city in the world. Seattle, New York, Toronto, Vancouver, SF, and so on)',6000,'USD','monthly',4.0,5.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh700a501jv8yqv1i1m','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Summer 2016 | 10 weeks\nGot every other Fridays off. worked 8am-5pm on days I did have to work.\nGot tours of different JPL facilities.\nGot to attend talks by JPL engineers, Caltech professors, engineers from other companies.\nPretty easy to chat with full-time employees.',15,'USD','hourly',4.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh700a601jv84sd692t','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Mentorship\n- shitty team with shitty engineers = shitty mentorship\n\nWork/life Balance\n- this is where old people with kids work because work life balance is top notch\n\nMeaningful Work\n- depends on the team. My team was really bad but some of them can be really good.\n\nPerks\n- $300 for transportation\n- $1200 or you can get a car for the term instead\n- Subsidized cafeterias. Their cafeterias are the best in the world! Really good food and super cheap!)\n- Corporate housing\n- Free starbucks coffee and drinks (pop, juice, etc)\n- Signature event where you receive a laptop worth $2k+\n- $5k signing bonus if you\'re a returning intern (this $5k signing bonus is for an internship NOT for full time)\n- Best recruiters in the world.\n\n*NOTE: I had a shitty internship but in no way I am exaggerating or lying about the perks',7100,'USD','monthly',3.0,3.0,1.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh700a701jvbhm33s9p','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','During your beginning 2 or so weeks at RBC, you may find yourself not doing much. When you do start doing more work, you\'ll notice that you\'re very involved with the company. RBC has evolved their coop program to give coop students meaningful work on interesting teams, because they\'re really looking for people that they would want to have come back, either full-time or for future coop terms. The culture in RBC is all about your development, making it a welcoming, unique, and student-oriented culture. I would definitely recommend RBC for a junior-intermediate coop student looking to build their skillset, or learn new and marketable skills.',3000,'CAD','monthly',4.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh700a801jv6fnkckqy','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Jan - Aug 2016\n\nA lively, friendly bunch.',3100,'CAD','monthly',5.0,4.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh700a901jv6sma2esl','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Great company, highly recommend. Great office, work environment and coworkers. Work is interesting enough, tooling is great, lunch is great. \n\nDespite the fact that sometimes I was working on CRUD Ruby on Rails apps, I actually really enjoyed my job. The fundamentals of the work didn\'t seem to matter when the tools, coworkers and everything else were perfect.\n\nOne thing I really liked is having the opportunity to be just a normal team member. There\'s little structure and no sandboxing, you get a lot of autonomy and get to basically be like any other member of your team.',4333,'CAD','monthly',4.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh700aa01jvcr8ibjxl','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','You\'ll meet some of the best engineers in Silicon Valley at Square, many originally from Google and Apple. The team you work on is very, very important. It determines your work/life balance and learning experience. You can either work ~40/h if you are on a less user facing team, or up to ~50-70/h if you are on a critical team, maybe even on-call. You are paid by the hour with California overtime.\n\nAmenities:\n - Breakfast, Lunch, and Dinner usually cost around $1 (to test the Square Reader), it might still be reimbursable but it\'s not a lot of money.\n - There is an amazing free smoothie bar, and coffee shop (also $1 to test) on-site. \n - Micro-kitchens everywhere for a quick snack.\n - Showers on-site (Harder to find in San Francisco!)\n - Pool Table, Hidden Game Room for N64/Mario Kart.\n\nSalary for first/second year in 2014/2015: $36/h + $1500/m stipend => ~$46/h w/o overtime.',46,'USD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh700ab01jvgl5k9c19','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459551,'ck1n1du49000501jo4pwygsav','Very friendly people. Codebase and product roadmap were both somewhat less organized than they could have been.',40,'USD','hourly',3.0,3.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh700ac01jv11q653dm','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Great company, super interesting and a great place. Good food, outstanding pay, coworkers are awesome, get to work in OCaml, nice office. There\'s also fun dinners and events for interns and mentors. It\'s a fun and casual work environment with interesting technology, far from a stereotypical finance company.\n\nThe program is pretty structured. You do 3-5 self-contained small-ish projects, each one with a different mentor. Each one is interesting, takes a few weeks, and are often in a variety of different areas, which is nice. You don\'t get the same experience as a full time employee working on a team though.\n\nIf I was forced to find cons it would be the intern sandbox and the corporate IT setup. Interns are heavily firewalled with little access to the intranet and internal data, which is a bit sad since you can\'t actually see the things you make running in production. Also you need to use a CentOS computer without root access, the IT people are helpful and can install things for you, but only from the sparse and outdated CentOS repos. They have good reasons for both of these, but it doesn\'t stop them from being minor annoyances. You also have to do all your work on a remote server (but with sub-millisecond ping and gigabit bandwidth), which makes GUI editors like Sublime Text harder to use.\n\nDon\'t get me wrong though, that\'s just nitpicking. It\'s really a great place to work. I enjoyed it so much that despite getting 6 days of vacation I only took one, despite not knowing that I\'d be payed out for the days I didn\'t take. I was a short flight away from all sorts of neat European destinations, and the thing I wanted to do most was work there more. Taking them was actually encouraged, I just didn\'t want to.',7500,'GBP','monthly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh700ad01jvaily0itw','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked at Shopify in the winter and fall 2016 term. The nice thing about Shopify is that you\'re treated like any other full-time member. You all do work from the same pot. The culture is also amazing. They give you a lot of flexibility for what team and office you want to be in, if you ask. Also free lunch, amazing office, nice housing, etc.',4680,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh800ae01jv12yg760x','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked at Veeva for my first co-op, and I really enjoyed it.\n\nMy manager did a great job of starting me off with things I felt comfortable with, and allowed me to gradually take more and more ownership of the projects I was working on. He was also happy to listen to feedback and consider input about what I wanted to work on and what could be done to make my experience better.\n\nThe company culture is a little more mature, but the company is still growing very fast. Everybody was super friendly and a pleasure to work with. Some of the perks include: kitchen with snacks and drinks, lunches once a week, beer on Fridays, and (most importantly) a ping pong table.',18,'CAD','hourly',4.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh800af01jvf1aqgo1e','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','It\'s a fun place to work with great people. The work can be quite boring depending on the project you get put on. Also, pair programming isn\'t for everyone.',16,'CAD','monthly',3.0,2.0,2.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh800ag01jvh39l0v3f','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Worked here for 2 terms as a developer and 1 term doing QA. Loved my time here, learned a lot, the full-times and other co-ops were really nice and helpful, and there are a ton of things to do when you want a break (Wii U, PS4, Xbox One, pool, ping-pong, arcade machine, mini basketball nets), and things to do after work with your co-workers (ex. Friday socials, hardware hacking club, cooking club, etc...).',22,'CAD','hourly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh800ah01jv2f17e5zi','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked there for my first two co-op terms. I was able to learn quite a bit about web development there, although this was mostly from my own initiative. You won\'t really get a mentor assigned to you, but everyone will be happy to answer your questions, or forward to the right person.',18,'CAD','hourly',4.0,2.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh800ai01jv7d9d4a77','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Worked here Fall 2016. It was a good introduction to low-level C/C++ embedded stuff. I was assigned a major feature that was part of an upcoming release so the work was pretty meaningful. Mentorship was really good when I could get it, but that was often difficult as many people work from home or are frequently unavailable. Work life balance was great, was never asked to work OT and only did so by choice. Tools are pretty outdated but they are slowly transitioning. Overall a good Waterloo tech company if you want to get into low-level firmware.',5200,'CAD','monthly',4.0,3.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh800aj01jvc6dng86a','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Everyone there is really chill and super smart. Office is great and you\'ll make some life long friendships',9300,'USD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh800ak01jv5lvf5i90','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','The best place to work if you are passionate about cryptocurrencies. Also the only place I\'ve seen in Silicon Valley where I\'ve seen almost everyone leave at 6pm (a very good thing). \n\nDo note that you will mostly be expected to be self-driven, as it is a younger company with a less formal internship program. Being self-driven largely comes from their headphone-policy, meaning you can\'t disturb people if when they have their headphones on. (So if they don\'t see your Slack message asking about something...)\n\nAmenities/Perks:\n - Catered lunch, breakfast and snack room\n - Occasional Hackathons\n - Get paid your salary in bitcoin\n\nA typical salary in 2014/2015 would be $6000/month + $1500/month stipend. They usually tend to pay all their interns the same.',7500,'USD','monthly',5.0,2.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh800al01jv711h42vm','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Worked here for my second co-op as part of the ELT Params team. Mentorship was really great and learned a ton throughout the term. Don\'t remember ever having a moment where I was sitting having nothing to do. Had code reviews for all changes and really improved my coding style.\n\nOnly downside I would say was the lack of perks and lower than average pay.',18,'CAD','hourly',4.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh800am01jv5kfa98k2','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Loved my time at Zynga. Worked as an Android developer and the office, people, work life balance, etc were great. They also hire a lot of interns so it\'s fun to be there. Perks included free lunch, snacks/breakfast bagels, video games, ping pong, beer fridge.',28,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh800an01jv5hsj91qb','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked here in the W16 term. I learned how to use industrial machine vision cameras and program PLCs with no prior experience. The mentorship was top notch, however, my mentor left the company, so YMMV.\n\nThe job is actually in Dorchester, which is about 5 minutes East of London, so you should have your own transportation. It is possible to bike there.',650,'CAD','weekly',4.0,5.0,4.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh800ao01jv13tt0azg','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav',' ',2600,'CAD','monthly',3.0,3.0,3.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh800ap01jvdhi92uo3','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I recently applied for the position of an intern as a software developer and after a rigorous interview process got selected. Here is my interview experience in brief:\nThe whole interview was classified into 4 rounds.\n\nRound 0: It was an online contest hosted on Hackerrank(90 mins). There were 3 questions, one was string based(medium), the second was a dynamic programming(easy), and third was a dynamic programming(medium hard). Doing one problem was enough, though it depends on the actual rank list and not the number of problems you solve. This was followed by a debug round, a question on binary exponentiation. We just had to correct the code and submit within 15 mins.\n\nRound 1: This was a GoToMeeting interview. The interview was all about your resume. The interviewer asked about the projects in detail for about 30 mins and then in general everything about your experience with past internships and stuff.\n\nRound 2: This was an online coding round. I was given a question on binary trees, had to find the maximum sum path in the tree and code it up within 40 mins. The interviewer expects you to go step by step in this round, that is first you give a brute force solution and then progressively try to decrease the time complexity until the interviewer is satisfied. (Tip: Don\'t jump to the answer directly even if you know the answer beforehand. They are not interested in the fact that you know a problem but they test your approach to a new problem.)This was followed by a general discussion about the resume again.\n\nRound 3: This was a problem design round, basically to check how you go about solving a problem and how much of your computer science concepts are clear. Firstly, the interviewer presented a problem about recommendations made on an online e-commerce website. I had to suggest how all this could have been done. Another question was to design a bot that wished your facebook friends automatically. Another question was about distributed systems, he posted a query which needed to be parallelized, and you had to discuss all the aspects of it. Basically what the interviewer was looking for was that you understand your solution inside out and know about all of its shortcomings that may occur and then he would ask you to somehow solve these shortcomings.\n\nThis was all about it. It was a great experience interviewing with Codenation. Note that interviewing opportunity can only be obtained by participating in the Codeagon contest conducted by Codenation. I think you need to be in the top 100 or so for getting to interview. This first process may vary a little depending on a lot of things. So keep your eye on their facebook page for the update. About all the perks and the compensation, I feel that Codenation is transparent enough and has all the details mentioned on their website.',75000,'INR','monthly',4.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh800aq01jvdwbl9fqa','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Honestly, the thing\'s that made it good were the company culture and coworkers. I loved everyone I worked with. The work that was rather unique and interesting, and it gave a lot of insight into the field I wouldn\'t have had otherwise. I was working on a project  in post-production, so it wasn\'t as interesting as it could be, but it gave me the opportunity to explore a lot more than if we were starting from scratch. Not the best development environment as of writing, but plans to improve this.\n\nHours are 100% flexible, plus paid vacation. Opportunities for remote part-time.',18,'USD','hourly',3.0,3.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh800ar01jvh1aw8kqp','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Interned here for my 1st co-op. Your typical 9-5 (or 10-6) type job. Not much in terms of 1:1/mentorship per se, but the people are pretty chill and friendly. I mostly worked on bug fixes, code refactors, and features for a business app, so the application of the work was a bit dry, but it was 1st co-op, so a good first experience in the working world.',21,'CAD','hourly',3.0,3.0,2.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh800as01jv8ctw8chb','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Interned while this was still at the old office location in the Tannery. The facilities back then were great, so I\'m sure the new office is amazing. This was my first taste at the \"tech life\" i.e. free food, and I\'m pretty sure I gained at least 5 lbs by the end. In addition to salary, you get a housing and transportation stipend. As for work, the project I was on ended up being high priority for launch in that quarter, and so it was a great experience to work with a bunch of other engineers on the team and to launch it to real users in the end. Everybody is super smart and super friendly - a great internship experience overall.',1400,'CAD','weekly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh800at01jv7kqx2j3x','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','This was my first coop experience so I didn\'t know what to expect. It started off smoothly with me having a decent sized devops project. Within a few weeks, we had completed most of it and at this point, my role was simply to provide support to teams as they onboarded onto this new project. I asked to be removed from this as I was told this was a developer job and not a technical support job. \n\nI was removed from that project and put onto testing some small app. This took 2 weeks. After this, I would work on small random proof of concept projects for 1-2 weeks which would end up getting scrapped. The last 3 weeks I had no project at all - I approached my manager at least 10 times during the whole internship asking for more work and was told that they simply didn\'t have any for me.\n\nAll in all, I was quite disappointed with the internship. Why did they hire me if they didn\'t have any projects to put me on? I didn\'t learn much other than some high level architecture stuff. I was quite happy with the salary for my first year and saved quite a bit as I was able to live at home, but holy crap were those the longest 8 hours of my life (alternating between reddit, hotspotting on my phone to watch youtube and taking walks around the office).',21,'CAD','hourly',3.0,3.0,1.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh800au01jv7fte3q0h','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','(Team Vikings) \nGot to do very interesting work with a team of all very smart/helpful PhD\'s. ',3000,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh800av01jvf8ubf72y','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Pros: Kik is a company that has managed to stay small (<200 employees), yet keep a market of millions of american teens using their app, which is quite impressive. This means Kik deals with complex problems with little manpower to solve them, which allows interns to have a high degree of responsibility. You will learn a lot here and you\'ll definitely come out of the internship a much better developer than before. Also the snacks in the kitchenette are great, not to mention the free catered lunch, and dinner (at 5pm so you don\'t have to stay too late).\n\nCons: Kik is a small company and has monolithic Facebook as it\'s main competitor, so it has a lot to prove with few people. This means that work/life balance suffers and there isn\'t much focus on having a chill work environment, so the workday tends to become dry and purely work focused. Also, while interns are treated like full timers, there is definitely a gap in that while interns have the responsibilities of full timers, there\'s not much mentorship given to interns which makes it harder to form good relationships with coworkers.',28,'CAD','hourly',4.0,3.0,5.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh800aw01jv17ry0eo1','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','The work was very dull and far between. I found that a lot of the work I did was just stuff other people didn\'t want to do. The culture at the company was very \'white\' everyone plays golf, and there is mentality that once you work there you\'ll come back and work there forever. That said my manager and the other people on the standards team were very nice and new I had nothing to do and that the pay was bad they just couldn\'t do anything about it.',13,'CAD','hourly',1.0,2.0,1.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh800ax01jvfe5xbmxh','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Honestly this was a pretty great coop, I feel like I underutilized it a lot. My direct manager was a bit bipolar but our supervisor was open to any original ideas and the other people on our team would give me work that actually needed to get done. They also expected you to come up with projects to do and gave you time to dedicate to them. I was the only coop on their team but there were other coops at the company who were cool.',16,'CAD','hourly',4.0,4.0,3.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh800ay01jvdj2h54u6','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Let me start off by saying the Yelp Intern Program (YIP) is really awesome. The recruiters do a great job showing you around town and making sure you have a good time. My mentor was just alright but I\'ve heard of others having really cool mentors. Unfortunately I didn\'t learn too much from my mentor. Work-life balance was okay too, most people regularly work over 8 hours but nothing ridiculous. There\'s a lot of clubs (board games, sports etc) and people are generally friendly. I really didn\'t find the work that meaningful and I\'m not very optimistic about Yelp\'s future as a company. But there is some really awesome stuff being done in their data science and infra teams. If Yelp offers you your first time in the Bay Area, definitely take it. Otherwise, maybe think about all your options more carefully.',7100,'USD','monthly',3.0,3.0,2.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh900az01jv8qv333qq','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459551,'ck1n1du49000501jo4pwygsav','I had an absolutely amazing time for my SDE internship at Amazon in summer 2016. My mentor and manager were both really great at making me enjoy my time there and getting me to work better - I had daily talks with my mentor as well as weekly one-on-ones with my manager. \n\nInterns typically get to work on their own project over the summer, which they present to other teams at the end of the term. You\'re expected to take a lot of ownership over your project during the time, so you get to make a lot of the decisions when it comes to your design and deliverables.\n\nMy project was scoped out well, so that I knew what I had to do at what time. The project was fun and challenging while still manageable. \n\nThere\'s a lot of other interns around and weekly events - so that part was also fun.\n\nI chose to take the housing stipend for $2500 / month.',6000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh900b001jv5w5r3n9k','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked at Slack in the Fall of 2016, the term where Microsoft announced that they were launching a direct competitor to Slack, called \"Microsoft Teams\". This made the term an extremely exciting time, since everyone at the company buckled down to make Slack the best product it could be. This meant that there were many important projects to complete, which were distributed among interns and full-times alike.\n\nThe culture at the office is amazing – everyone is incredibly friendly and always willing to help. They also really live by the motto \"work hard and go home\" as shown by my team members encouraging me to go home when I was still working at 6.\n\nThe internship program in particular is also special because the University Recruiting team sets up time for interns to have casual Q&As with the execs of the company. Rarely would an intern be able to pick the brains of such powerful people at any other company.',40,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh900b101jvc0y39yrc','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','The work was really meaningful and I could see the impact it made to the projects I was working on. I was able to develop many useful technical skills in this role and made friends with many other co-ops (there was about 20 on my floor). \n\nMain issue is that your term was almost solely dependent on the team you were put on. I was very lucky because they were missing this role on the team. But it was really hard to sit down with my manager to get reviews on how I was doing or appreciation of any type in general - manager didn\'t really care about my work. ',19,'CAD','hourly',3.0,3.0,5.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh900b201jv5e84a88t','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Product manager work was very vague and did not let you have ownership on product features. Since Horizon is a client contract company there is little creativity on the tasks and features being built. PM work included HTML email campaigns, scripting reports, and occasional QA work. That being said everyone there is super cool and awesome so the time really flies.',18,'CAD','hourly',2.0,2.0,1.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh900b301jvdkuue7dd','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','The work was really dependent on the team you were put on and if the manager had anything in mind for you. \n\nUnfortunately, the work I did there was really lacking purpose and although I continually requested for more work, I felt like I spent the term doing work that didn\'t really have an impact. \n\nHowever! The company overall has a really great culture: very young age group (for the most part) and so many perks! Just make sure you know exactly what you\'d be doing in your role prior to accepting the job - the company itself is honestly great though. ',23,'CAD','hourly',3.0,3.0,1.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh900b401jv8p471hy5','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Worked in the US Office Properties division. Prepared workpapers and tax returns.',17,'CAD','hourly',3.0,2.0,2.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh900b501jv3326e1ss','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','This was my first co-op back in 2015 and it was honestly one of the greatest starting points I could\'ve ever asked for. Coming into the role with no office experience and still lacking in many other areas as well, both my managers were very kind in helping me develop my skills by asking me what I wanted to improve on and assigning me relevant tasks. The amount of work was strictly performed during work hours - so I had a great work life balance and the type of work could easily be traced to who it\'s impacting. \n\nThere wasn\'t many perks - but there was always snacks and candy on a drawer back when I was there, not sure if it\'s there anymore...',2400,'CAD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh900b601jvbpc39kde','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked for Shopify in the Ottawa office on my first co-op. Overall, it was a great experience, and it was especially exciting to be there during their 2015 IPO.\n\nPros:\n- Downtown Ottawa, not Kanata\n- Really fun work environment\n- Good dev environment/tools\n- Zero pressure to work long hours\n- Meet lots of other interns\n- Snacks, smoothies, espresso bar\n- Hack Days (internal hackathon)\n\nCons:\n- Culture is too hipster for my taste\n- Most likely only use Ruby on Rails',5200,'CAD','monthly',4.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh900b701jveai6fyol','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','The job allowed me to take a lot of responsibility and this was when I was a 1st year student. Overall the office was a pretty nice place to work, had an enterprise vibe. The work was fun and I did learn a lot, but I had issues with the company because they offered less in their offer letter than what they had shown me in the interview. Despite that, I would recommend them for one of your first work terms when you need to learn a lot.',17,'CAD','hourly',3.0,5.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh900b801jvbayyfwwn','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','People were nice. The Technology Co-op Program at CIBC is well established and provides many opportunities for co-op students to meet and socialize (e.g. contests, monthly socials, lunches).',20,'CAD','hourly',4.0,4.0,2.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh900b901jvcu1wam2h','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','The people at Capco are an amazing team of people to work with and work for. As an intern they did not treat me as someone who just does tasks for them but instead as someone part of the team and they cared more about me as a person and about my growth as a developer than about their specific tasks or products. I loved my first internship there so much that I returned for another one. I would recommend Capco to anyone.',22,'CAD','hourly',5.0,5.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh900ba01jvel39djot','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked at Tesla in Winter 2016 on the Systems Integration team. What this role entails is working with all the other types of engineering teams, whether it be Electrical, Mechanical, Manufacturing or Autopilot, to successfully deliver on features for the cars. This role is very jack-of-all-trades; It requires mechanical, electrical, and software knowledge, as well a lot of PM know-how. One of the biggest perks of this role is that since you\'re tied into all aspects of the car, you get to see how the car is developed at every stage, from the designs on whiteboards to the freshly assembled vehicles rolling out of the Fremont factory. \nThe pay isn\'t the best in the Bay, and the hours are pretty rough, but if you\'re looking for truly meaningful work then this is the company for you. This isn\'t some tacky startup or bloated software company trying to lock down young talent with lavish perks; Elon Musk is changing the world with Tesla, whether it be building an autonomous future or a renewable one, and doing an internship at this company gives you the chance to be a part of that.',4000,'USD','monthly',4.0,4.0,5.0,2.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh900bb01jvepfphjo1','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I spent two of my co-ops at Snowflake. It was an incredible experience. I was on the SQL team, but the division between teams is not that important. I was assigned challenging, meaningful projects, and mostly worked independently, talking regularly with coworkers and mentors and having them review my code.\n\nPros:\n- Very smart engineers to work with and learn from\n- Excellent codebase (organized, documented)\n- Meaningful projects that affect customers\n- Annual Snowflake ski trip in March\n- Cheesy Thursdays (cheese and wine)\n- 30 minute Caltrain ride away from SF\n- I got $6500/month 1st time, $9000/month 2nd time\n\nCons:\n- They use Subversion',6500,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh900bc01jvb7jqe3xf','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','It was aight. Company is a little big so most people just work on internal tools. People are mostly friendly. Good for first few coops, but their codebase isn\'t really amazing.',720,'CAD','weekly',4.0,3.0,3.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh900bd01jv2vu56zxe','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Clock in very strict 9-5:30 hours. Coworkers are nice, but management is terrible. Constant lashing out to the employees. Although no flak was given to co-ops, it really demoralized the office. Didn\'t look like they had any real vision on where they were going, so the work seemed boring. Mentorship was weak and minimual; tasks were assigned one at a time by the supervisor, and only when you completed the one you were working on.',720,'CAD','weekly',2.0,1.0,2.0,2.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh900be01jv87p8bex9','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Very friendly and flexible place. Many of the coworkers are also young Waterloo graduates, so it\'s easy to communicate with them. Many of them are extremely stereotypically nerdy, which may rub well/badly depending on how you are yourself. They have the occasional board game/bring-your-own-computer nights, which can be a good opportunity to get to know your coworkers better. They have a strong sense of mentorship, and they\'re happy to help or answer any questions. Work can get a little boring at times, but the products can be interesting. ',20,'CAD','hourly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh900bf01jv50q5d74z','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','They do monthly reviews to give detailed feedback. Most people are very willing to teach as the workplace is mainly former UW grads. They give meaningful work and pay overtime too. As long as you prove that you can handle it, they give co-op students a lot of responsibility.',22,'CAD','hourly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh900bg01jvbzw71xh8','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Excellent company to work for as you start up your engineering career. You get to take part in a lot of meaningful work that you can choose. This position is hands-off which means you are responsible for meeting deliverables. There are lots of great professionals who work at the company. They are extremely friendly and willing to help at any time, you just need to ask. The job is fast paced and priorities shift quickly. \n\nThe tasks you do are very front-end. If you have ROS experience, that is a big plus. You do everything for robot emulations to testing and integration robots for trade-shows, customer demos and deployment. You can put your hand everywhere but just make sure you can handle all your responsibilities. \n\nAdditional Perks: Every week or two there\'s some company wide event. Free breakfast everyday, free alcohol, free snacks and food otherwise. You also get a lot of free swag. ',21,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh900bh01jvah7ses56','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Worked with the mobile team in Toronto in 2016 and I had a great time. Very relaxed office culture despite fixed hours of 9-6, free breakfast on Mondays, and lunch and happy hour on Fridays. Every one was very kind when I had questions and were very patient with teaching the co-ops. Often times my manager sat down with us and taught us things just because we were curious even if they were not related to the job. Great mentorship. I did a combination of manual and automated testing, but my group were their first co-op students so we got to create the automated test suite from scratch and future co-ops will probably build on that and do less manual testing. Recommend it for first internship or if your genuinely want to test.',650,'CAD','weekly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh900bi01jv5dhme5ca','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','The internship experience was great, it was my first time in San Francisco and the YIP (Yelp Intern Program) offered a ton of fun events to get to know the other interns. As well, they offered plenty of reimbursement and support to find housing. The work life balance was great, there were smash nights on Monday, board game night on Wednesday and occasionally movie or trivia nights will pop up. The work I did was primarily Android, I was one of 4 people on the Core Android team so it was extremely fulfilling.',7600,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh900bj01jv5hgk51rh','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Worked on biz.yelp.com full stack web development. The intern program is tbh one of the best I\'ve ever seen. Everyone is super fun, they know exactly how to treat interns from fun events, to making sure your project is done at the end of the term. I got a bit unlucky put on my own project doing front-end which I found out I didn\'t like, so work-wise it was a bit of a rough ride. Still, from my mentor to the PM to the team, everyone was really nice and my coding style got infinitely better, so it was a good experience.',38,'USD','hourly',3.0,5.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh900bk01jva94za7ns','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Redfin was a great place to work as an Internship. You are surrounded by incredibly smart people who like to get stuff done. Through the mentorship program I was able to grow and really learn some new concepts and try different things.  Everyone is very friendly and wants to help you. The company is small enough that you could strike up a conversation with the CEO or CTO.',7000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh900bl01jv7ffj6r8a','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','As a release and qa engineer you would help test for any features being released, verify fixes for bugs and help out with the release of each version at the play/app store. \n\nPros: The free food, close distance to campus, working with other co-ops. Get to attend meetings with project management and designers to understand what goes into designing features and how it can impact users. You really get to understand more about what Apple and Google require in an app before it is released. Your mentor will also let you work on a side project, which is nice but can be a dead-end if your mentor does not really know how to code.  \n\nCons: The work is just painfully boring, it\'s pretty meaningless. Some developers never want to fix the bugs you found. Mentorship is god awful. The people working at Kik are very young and most of them haven\'t been in the industry for too long, so it\'s kind of hard trying to find someone to look up to. People who are working there aren\'t passionate enough, in my opinion most of them probably don\'t see a long-term relationship with Kik. ',21,'CAD','hourly',3.0,1.0,2.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh900bm01jvfklyc7v9','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Decent place to work; pay could be better, some grunt work involved\nMay need to deal with some spaghetti code',920,'CAD','weekly',4.0,4.0,3.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh900bn01jvbtj7hhfg','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Small engineering team with around 50 engineers and teams averaging 5 people. Work was generally meaningful and very interesting. It was exciting to see the company hit milestones and know that you are contributing to something that is growing and has goals to meet. I was fairly close with my team and some other co-workers. It was easy too since there were a lot of young people and everyone is friendly. There is also a company hackathon every 4 months (so us co-ops can participate in them for our time there) which is quite fun. The fridge is stocked with ice cream, and the snack room with bagels, chips, yogurt, avocados, you name it. All in all, pros: great mentors, delicious and abundant snacks, cons: pay was a bit low for the cost of living of the city (expect rent to be around $1000).',4800,'USD','monthly',4.0,5.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh900bo01jvf3e7gank','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Great people and culture - there\'s lots of socials (interns and company-wide). Lots of mentorship, responsibility, and opportunity to develop. ',4000,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh900bp01jv0lz9bu5c','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I was allowed to choose out of three projects; backend, front-end with a bit of backend, and hybrid mobile, but the only interesting project was the front-end one. The company does not offer much guidance to the co-ops and I was left alone quite often, having to direct myself. The people are quite nice, and there is quite often free food.',23,'CAD','hourly',3.0,3.0,2.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh900bq01jv1rytf61p','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Worked there during Summer of 2016. Team was really nice and we got along well together. Everyone worked hard when they needed to otherwise we all went home and no one bothered you outside of work hours. \n\nGot to work on proper backend stuff. I heard interns on mobile teams didn\'t get to do as much interesting stuff however.',24,'CAD','hourly',4.0,4.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvh900br01jv9nwi50gf','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked there Fall 2016. I was the only intern that term so ended up with a great studio apartment just by the Bay Bridge, 20 min walk from the office. I ended up working on JavaScript infrastructure stuff (static asset management/bundling, front-end build scripts, cache-busting etc.) which I enjoyed immensely and felt was very meaningful to the front-end developers. (I had the option to work on various web dev oriented teams. From what I understand most interns end up on client-facing stuff using Python + JavaScript.) I ended up doing a lot of code reviews, as well as getting my own code reviewed, which I feel I learned a lot from.\n\nThe product itself has so many moving parts, and it\'s difficult to understand how they all fit together, so I didn\'t develop any interest for the client facing stuff in my time there (largely because all my work was internal).\n\nMy mentor was PHENOMENAL. Weekly sync up meetings to see how I was enjoying myself, exceptional knowledge of everything we were working on and more, encouraged me to work on open-source stuff, organized so many events, the list goes on.\n\nI felt at home at the company really quickly - everyone is very friendly and the culture is relaxed. I didn\'t feel any pressure to work extra hard and I wasn\'t afraid to make mistakes or open pull-requests early. Regular company events (Giants games, beer bashes, etc.) really contributed to the chill atmosphere. I\'m relatively quiet so didn\'t always attend events, but I never felt pressured to participate or drink if I didn\'t want to.\n\nFor my first term in the US (incidentally my final co-op term), it\'s hard to imagine a better experience. It seemed like the perfect place to work while exploring a new city, what with the location, the provided housing, the flexible work hours, the work I ended up doing, and the people I was working with.',6400,'USD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvha00bs01jv25xm5i07','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','This was my second term with RBC and I feel I made the correct choice going back. \n\nThings in the first month were slow but there was a lot to learn. I quickly realized I got lucky as the full time Project Control Officer for my team was leaving and I got to do all the work. This included budgeting for a 5+ million dollar project for 2017! Even though I was doing the work of two people it never felt that bad and I rarely stayed past 5 on any given day except for month end. \n\nI probably got lucky as my manager and senior manager were both really nice to me and mentored me really well. I know friends who didn\'t have great experiences in other business roles at RBC. It all depends on your team. \n\nOverall great place to work but depends highly on your team. ',3000,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvha00bt01jv4nxac6j1','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Mentorship\nYou\'re assigned a one-on-one mentor to make sure that you get familiar with the codebase and addresses any questions you may have when ramping up. Everybody is really friendly and is willing to lend a helping hand if you ask.\n\nWork/life Balance\nThis is something that\'s really stressed at Eventbrite. You won\'t find yourself working late. They want to make sure that when you\'re at work your doing the best work that you can.\n\nMeaningful Work\nThe mobile team is fairly small, although their general engineering team is quite a bit larger. This means that as a mobile engineering intern, you have the potential to do work that impacts the core product in fundamental ways, but it won\'t be handed to you. You have to have the initiative to raise your hand and seek out what you\'re interested in.',1400,'USD','weekly',4.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvha00bu01jv0wr5g3nb','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','A quickly changing company going through a lot of growth. When I was interning, teams were still being figured out, but working at such a company will provide a neat learning experience. Would recommend at least one internship in this kind of environment. People at TextNow were super friendly, and the work that they were doing was interesting and is becoming more interesting term after term as they face new challenges.',25,'CAD','hourly',4.0,4.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvha00bv01jv3dkb9t69','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','This was my second year as an intern. I started as part of the Explore Program, chose to come back as a PM and will be returning this upcoming summer for my 3rd internship. \n\nI know others have talked about unenthusiastic teams, bad mentors, and bad managers. I understand. My first summer, my manager was horrible, chastising my abilities and my work. I expressed my concerns with my mentor, and thankfully, she was able to help me. The CEO said \"people don\'t quit companies, they quit teams\", which struck a chord with me. I decided to return the next summer as part of a different team. (I also found out that summer that my previous manager had been moved down to the position of Individual Contributor)\n\nI was also able to connect with someone on the UX Design team for HoloLens that summer and she took me under her wing. Because of the experiences I had with people outside of my team, I gave Microsoft a second chance. It was worth it. I had a phenomenal summer and created the initial prototype of an internal tool that is going to be used company wide and by the end of my internship they had decided to ship it. My mentor was extremely supportive and pushed me in the right direction to join her team and I will be returning next summer to work on UX Design for HoloLens. The people on my team this summer were amazing and it was well worth putting up with one bad manager to get to a better place.',7100,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvha00bw01jvfrk96k08','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Really enjoyed this job, solely because they let me work on projects that would normally be reserved for full time engineers. Out of all my internship experiences, I can say that I learnt the most at this one hands down. Would really recommend working here if you want to learn as much as you can in 4 months time.\n\nBiggest con was the salary, tho I think that has to do with my lack of negotiation.  They do give a stipend but it really isn\'t enough to cover housing in the city (plus it gets taxed at a higher rate).',6000,'CAD','monthly',5.0,5.0,5.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvha00bx01jvhc9nhrmt','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Such a great company :)\nThere\'s an intern retreat, they fly you out to Ottawa for onboarding, which is super fun, and there\'s Hack Days every semester. \nThe people in the Waterloo office are lovely, can\'t speak for the other offices. \nThe company culture overall is very open and I think they\'ll be growing a lot! Definitely worth interning for. ',30,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvha00by01jvh97a1jsu','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','May-August 2015. Unique opportunity to have both autonomy and valuable guidance. Extreme Blue gives interns access to industry experts who are open and willing to helping you succeed in your project. We were able to reach out to senior IBM leaders to receive feedback and mentorship as well as had the chance to grow our own ideas and thoughts. ',4500,'CAD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvha00bz01jvcq7r8ge4','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','I worked on financial models for interest rate derivatives. I liked the fact that I got to use a bunch of different programming languages. I had some guidance from one full-time employee. After a while, I ran out of work to do (partially my own fault, partially my superiors\').',3500,'CAD','monthly',3.0,2.0,3.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvha00c001jv6b7ldalw','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Free breakfast is pastries and fruit. Free lunch is catered by local restaurants, and is usually really good. The company is really good at accommodating dietary preferences and allergies, too. The company subsidizes housing for interns - I believe they pay 50% of your rent if you\'re working in Ottawa, not sure if the situation is the same elsewhere.\n\nI\'m only three weeks in, but really enjoying it so far. Cool problems to work on. Great coworkers and a supportive team. All interns did a three-day onboarding in Ottawa, and spent another three nights in Ottawa for the annual corporate summit (usually scheduled in January, I gather). Plenty of free clothing, if that interests you. Shopify is growing really fast, too - it seems like a great company to transition into a full-time role at.',1200,'CAD','weekly',5.0,4.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvha00c101jvdx5u3n99','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','I worked at Polyvore, and the company culture was amazing. Everyone was really friendly, and my supervisor specifically chose tasks to maximize my learning experience, as well as my contribution to the product. Also, the food was delicious, and it was really diverse, as every day there were different options.',38,'USD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvha00c201jv27gsacqc','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Kik is a great work environment. People are nice, free meals and Starbucks every day is nice. QA is fine, it\'s just testing the app for bugs, unfortunately that can only get so interesting. The QA full-times are super nice and helpful. You\'ll learn a bit about the mobile development cycle. Kik will encourage you to talk to others in the company if you are working on a side project, or if you want to return in a different role. I had lots of time outside work to work on passion projects. All in all, they\'re used to having lots of co-ops, so it was as comfortable as it could have been. Your experience is what you make of it! Thanks Kik, shoutout to Ted.',3200,'CAD','monthly',3.0,4.0,2.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvha00c301jva2y685pg','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459551,'ck1n1du49000501jo4pwygsav','A9 operates like a start-up but has the resources and reach of Amazon! I worked on the Visual Search Mobile Team and got to ship features for the main Amazon application. My mentor and manager were both really supportive and gave me ample opportunities to work on what I was interested in. The work/life balance was great and there were a ton of fun events planned for the interns! The compensation was very competitive - the $9600 includes a stipend to help you with your rent expenses.\n\nOverall, A9 employs a lot of really intelligent people to work on challenging technical problems. Would recommend!',9600,'USD','monthly',4.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvha00c401jv5mu0aavh','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','I interned at Loblaw Digital in 2015. \nPros:\n- supportive, easy-going teammates\n- some free snacks in the kitchen\n- I got to work on very impactful features and had some flexibility to what I wanted to work on next. YMMV depending on the product you are working on. \n- very good working hours (9 - 5 with 1 hour lunch)\nCons:\n- The company hires contractors and the code quality in some parts of the code base is less than ideal, also quite some tech debt (might have changed since my time there)\n- My mentor was great but interns could benefit from more time with their managers. \nOverall, I would recommend working there, especially if it\'s one of your earlier internships. ',2800,'CAD','monthly',4.0,4.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvha00c501jv2w438xyv','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Interned Fall 2016. Salary was roughly $3500 per two weeks plus $1500 housing per month. Perks include but are not limited to: frequent intern events, quarterly offsites, and lunch on Fridays.\n\nPart of your experience depends on the team you\'re on and the project you\'re assigned. I believe your second round interviewers will recommend teams for you to be placed on so be sure to let them know where your interests lie and what kind of work you want to do.\n\nSome aspects that don\'t depend on team and project are the work-life balance and company culture. The vast majority of engineers, PMs, and managers I interacted with were very smart and approachable. Seize opportunities to check out what other teams are doing, through yelp-beans, show and tell sessions like web sync, or ask a recruiter to arrange a meeting with another team lead.\n\nOverall, I had a great time at Yelp thanks to the quality of people it attracts and the company\'s commitment to providing a solid internship experience.',8000,'USD','monthly',5.0,5.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvha00c601jv3r7g5wcx','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Got scammed. It was supposed to be a developer job but I ended up doing manual QA for the majority of the internship. Manager was super busy so I had almost no guidance;  I think he ran out of work for the interns to do. Glad I moved on to companies more suited for me.',20,'CAD','hourly',2.0,2.0,1.0,2.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvha00c701jv5lwzcuon','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Great mentorship, work/life balance, but not so meaningful work as you might work on a legacy codebase.',3500,'CAD','monthly',4.0,5.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvha00c801jvgraj1yiz','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Worked there from July to December about six months. Great company, bunch of perks, but more importantly this company really cares about the interns and the work we do. Placed in various projects around the firm with senior people. ',25,'USD','hourly',4.0,2.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvha00c901jvaqx621st','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','This company has the best culture I\'ve ever seen.',45,'USD','hourly',5.0,4.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvha00ca01jvd5fm8tgc','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','your experience totally depends on your team, but the company culture is amazing',9673,'USD','monthly',4.0,5.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvha00cb01jv2w1o6i55','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Interned in Fall \'16. \nI Worked primarily on microservices written in Scala. The work is very fast paced and exciting, especially for those who enjoy more platform/backend oriented work. Also its in Vancouver which is an amazing city with tons to do.',4600,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvha00cc01jvgpfx5btt','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Great company for web development. Environment is very chill, but you\'re given enough work and responsibilities to always have something to do/improve on. Supervisor and boss extremely nice, and you learn a ton while you\'re there. Although the job description lists a lot of things I exclusively did React.js and Rails.',3200,'CAD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvha00cd01jvalo2e6ah','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I was an intern on the emerging technologies team which is very small (4 people including 2 co-ops). The type of work I did involved building out POCs (proof of concept) using proprietary SAP technologies. The team is really chill. We went out for lunch together nearly everyday and played foosball and table tennis. ',3200,'CAD','monthly',4.0,5.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvha00ce01jv293w0yii','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked with the enterprise solutions department. There\'s a lot of smart people at BlackBerry that provide excellent mentorship. There\'s no real perks/benefits to working there. There are plenty of other co-ops for you to socialize with. Overall, it\'s a good place to gain experience.',3220,'CAD','monthly',4.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvha00cf01jve3d90236','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','The Montreal office for SAP Hybris is an excellent location to do an internship. The workplace is very friendly, the work feels meaningful, there\'s lots of mentorship and plenty of work available to you. The office also has a gym, free breakfast on Fridays, fresh fruit delivered almost daily, and plenty of drinks. The city itself is great for students with lots to do and explore.',3520,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvha00cg01jv9pn627d1','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I had a great time as an intern at Facebook\n1) Work: This varies heavily with team, but you do have some say in what team you\'re assigned. In the Seattle office the bigger teams are Ads and Messenger. I was on Ads and the work was impactful and challenging but fun. Facebook also has amazing internal tooling, processes, and support; meaning we get to spend more time on meaningful work rather than dealing with trivial setup and issues.\n2) Perks: FB definitely has one of the best perks among the top tech companies. There\'s the usual free food, mini kitchens, pingpong/foosball, and gyms, but FB also provides free housing on top of your salary, professional laundry on-site (includes dry cleaning), bike stipend, wellness stipend, a phone with an unlimited plan for the term, and a wide selection of tech equipment. \nAlso, if you are in Seattle, there are many chances to go to HQ (I went 5/6 times during my term). If you do, FB pays for the flight, hotels, rental cars, and food if you eat out. \n3) Culture: Work life balance is great, everyone is very friendly and helpful (especially if you tell them you\'re an intern). There are many hackathons and intern events that you can take part in, as well as company-wide events, clubs, and learning sessions. Leadership is also great. Mark Zuckerberg is very transparent with employees and hosts a Q/A every friday where anyone can ask anything about the company.\n',8000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvha00ch01jv9x8348zj','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','A pretty fast-paced co-op, but that was very enjoyable for me. Was given a lot of freedom as to what I wanted to work on and how I managed my time. Also I was able to switch to more of a back end role in the latter half of the co-op which was great! Would definitely recommend TextNow; one of the better places to work for in the KW area.',27,'CAD','hourly',4.0,4.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhb00ci01jv9pvjdoza','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','The supervisor times your washroom break',14,'CAD','hourly',2.0,2.0,1.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhb00cj01jvfnni6h86','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Everything from the people I worked with to the workplace culture was absolutely awesome. The senior members of my team were always extremely helpful and patient when I was having any trouble with what I was assigned.',21,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhb00ck01jvaj1zhomr','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Worked at Premise when they were in their old office and it was just 30 people total. Company\'s mission and work is super inspiring, and they treat interns like full-time employees which means less hand-holding but also more responsibility and more interesting work. Team is super chill and great environment, even with startup growing pains.',9500,'USD','monthly',4.0,4.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhb00cl01jv6kp00t9t','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Was given a lot of responsibility and room to grow. However, the company culture seems to be very superficial. The company undeniably has very good perks for Waterloo, free lunch, breakfast, monthly events, etc... But that does not make up for some of the more serious issues with TextNow.\n\nThe company seems to have a large problem with work life balance, as a co-op this probably won\'t affect you too much, however be prepared to see some very stressed, overworked full time employees. There\'s also a lot of politics for a company of this size (~100 people) and the management team seems to push for things like unlimited vacation as a means to make up for the lack of work life balance. But as most people know in practice that does not lead to any meaningful change.\n\nOverall it is a good place to learn but not a good place to work at full time, most of these issues vary by team, but the company as a whole seems to have a culture that promotes burnout, especially when it comes to full time employees.',4200,'CAD','monthly',3.0,4.0,4.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhb00cm01jvg0jlhrfz','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Even though I was a co-op, I was given a lot of responsibility and make my own decisions regarding what I was doing. Gained a lot of experience. Their development environment uses Microsoft stack, so Visual Studio, Team Foundation Server and ASP.NET ',19,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhb00cn01jv0a6j82f1','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Worked on front end development. Overall project management seemed a little disorganized. At times UI design could significantly change from week to week, which caused a lot of code scrapping.\n\nOn the other hand. The pipeline for development was very well organized. There were code reviews for every commit and you were required to write extensive and robust tests for all your code. \n\nCo-workers were very approachable and helpful though my supervisor was often away on meetings. However, all my work was reviewed by my supervisor before committing so it wasn’t much of a problem.\n\nQuality of work can be team dependent, but it can range from bugfixing to creating new features or UI components.\n\nThere is a nice subsidized cafeteria at the ground floor with a large variety of food for relatively cheap. There is also a game room with a ping pong table but since the building is large, it can take a bit to walk there.\n\nOverall a great place to intern for beginner-level (1st/2nd years/internship) as their guidelines and detailed code reviews improve your code quality a lot and give you a nice base for writing industry-ready code',876,'CAD','weekly',3.0,3.0,3.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhb00co01jv7ka9e1we','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Culture was pretty laid-back for a bank; we could set our own hours. The people I worked with were very smart (most had a Masters of PhD in some sort of technical discipline). The work I did sometimes felt more like BI than Data Eng, but my manager tried his best to get me work that would be interesting. ',18,'CAD','hourly',4.0,4.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhb00cp01jvfjambjc5','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Opportunity to travel, varied work',9000,'USD','monthly',5.0,4.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhb00cq01jva2txe0ji','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Probably the most fun you can get from an internship. The Yelp Internship Program (YIP) is awesome, and they really help you explore the city/surrounding areas by providing events and weekend ideas. Perks are pretty standard: snacks + drinks, foosball, pool, free  in-house coffeeshop (especially the chai latte).\n\nThe work is very team-dependent. On Search, you work on pretty cool projects that cover a lot of different disciplines. Some of the other interns didn\'t like their projects too much, and a lot of people were placed on a different team than what the recruiter said. Mentors are hit-or-miss, but there\'s definitely a lot of opportunity to learn.\n\n',8300,'USD','monthly',5.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhb00cr01jv52g7bpks','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Company culture is great; everyone there is awesome and you get a chance to talk to everyone in the office everyday. Culture is super relaxed, you get to find a work schedule that\'s good for you (within reason). Fast paced, growing company and there is always something that needs testing as prototyping is quick here. Team knows how to get work done, but also knows how to have fun. Leadership is fantastic as well.',3000,'CAD','monthly',4.0,3.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhb00cs01jv6ug31ba1','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I interned at Flipp in Fall 2016. As a Data Quality Analyst, I could have been assigned to any of the teams in the Operations department.  Depending on the team, the responsibilities would differ, but in one form or another it would be some sort of quality assurance.\n\nI found the nature of my work to be a lot more repetitive than challenging, but the work that was assigned was also reasonable for a normal work day. That being said, the culture in Flipp is very good. I found it very easy to interact with people from other teams and I found my team very willing to let me explore new ways to do things (my team was still relatively new). In addition, each intern is assigned a mentor in their team whom they are usually able to meet with regularly.\n\nAs for perks, there is free lunch every Friday, free transportation passes and membership to GoodLife (There is one in the same building).\n\nI do think that the Data Quality Analyst position, in particular, is more suited for someone on an early work term unless they are joining a newer team.',850,'CAD','weekly',4.0,5.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhb00ct01jv80nybcru','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I interned in Statistics Canada in Winter 2016. The experiences of interns tend to vary a lot for Statistics Canada since each intern\'s projects for the term will depend on what their supervisor is responsible for. \n\nThere is no programming experience explicitly needed for the position, but every intern goes through a SAS training course for the first few days of co-op. Afterwards, there tends to be a lot less hand holding for interns. It is usually up to the intern to seek their supervisor if they need help. It was normal for me to see my supervisor once or twice a day to talk about any issues on my project, but it was normal for another intern to meet their supervisor just once a week for a regular update.\n\nEveryone in the office is very laid back and open to helping one another. There are also weekly statistical training seminars and other seminars and interns are generally open to be able to go to any that interest them.',2500,'CAD','monthly',4.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhb00cu01jv6cga5kvz','2019-10-19 03:52:01.800000','2019-10-19 04:39:02.937445',1571459707,'ck1n1du49000501jo4pwygsav','- Standard S&T Salary, if not a bit more than the other banks in Canada.\n- Took up a lot of responsibilities on my team, although experience does vary from desk to desk.\n- The people there are very enjoyable to work with and the culture of care is genuinely reinforced throughout the bank.\n- Work/Life Balance is definitely harder for anyone who is not used to front-office finance hours, but I know CIBC did have policies to relax the workload on interns for S&T (Not sure for investment banking).\n\nOverall: Had a great time and I would recommend CIBC to anyone who is interesting in working in Capital Markets.',0,'CAD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhb00cv01jv7eoa0s6h','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Worked on Google Research doing machine learning on my own project. Learned a ton and the team was really smart, I was playing catch-up the whole term. Culture is great, so even though I was the youngest person in the room by about 25 years we all go along great and imo Google does literally everything to make working there perfect. I\'d highly recommend joining a club, as bjj during lunch was a lot of fun. I think the well-known perks are overrated (food, laundry) and the biggest perk is the communities inside Google that are super friendly and inviting. Didn\'t have that many intern events but I was also not there in the summer, so go in the summer if you can!',7666,'USD','monthly',5.0,5.0,5.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhb00cw01jvhrf335py','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked there for my first co-op term in 2016, and I loved working there. It has a really good culture/environment with transparency. It is a fast growing company, and the office is located west of Toronto. They have a really nice office stocked with food and perks. However, I did not find my main tasks that rewarding because of the repetitive work. But you can definitely get involved in other projects outside of your department if you are interested. Highly recommend this company!',600,'CAD','weekly',5.0,5.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhb00cx01jvexh9bt2j','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked in the Digital Strategy department, which was less of a \"corporate\" culture. Your experience will vary depending on what team you\'re on. Everyone works on different projects and sometimes it is difficult to get feedback on your performance. However, you could tell that they value the co-ops there and the work is meaningful.',28,'CAD','hourly',4.0,3.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhb00cy01jvbmxzgvk6','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Great Experience at American Express.\n\nFantastic culture that values work/life balance. Projects can vary and work can be more or less interesting depending on the team. Mentorship is good but not excellent.',5250,'CAD','monthly',4.0,3.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhb00cz01jvbycecg0u','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Great experience!',840,'CAD','weekly',5.0,4.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhb00d001jvcf7k0382','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','There seems to be a disconnect between upper management and the typical employees. A lot of the founders and upper management seem to have drank the Kool-Aid and think they\'re the greatest thing since sliced bread. There\'s also a structural disconnect between the two offices (Waterloo and Bangalore), where the culture of the Indian office seems to clash with the culture at the local office—one of the teams I encountered during my time there measured the state of a project by \"how many lines of code remaining to write\", which is a totally useless metric and given as an estimate at the start of the project.\n\nTheir technology is somewhat dated, although it varies by team. A lot of the company used an old VCS (IBM ClearCase), although they were beginning to transition to their own hosted Gitlab instance. Also, they have a lot of their testing infrastructure written in a rather esoteric language that nobody really seems to use anymore—Tcl. Java, C and C++ make up a majority of the rest of their codebase, although they were beginning to embrace newer technologies like Golang (for some newer services) and node.js (mostly for client-facing things). I think some teams use Python as well.\n\nI worked on the Subscriber Policy Broker (SPB) team, and the project I was given was pretty isolated from the rest of the team. It was a pretty important project for the company, and I basically had full control over it during my co-op term, which I drove to completion during my time there. As such, I didn\'t really have to deal with all the politics, and had little interaction with the rest of the team. Half of my team was remote (in Bangalore), and the other half was in Waterloo.\n\nFrom my perspective, it seemed as if the full-time employees would always be dealing with some sort of production issue during their on-call rotation, and would work rather long hours in order to ensure that their projects were on track. However, as a co-op, I didn\'t really have to deal with that, and basically did my own thing, working 35-40 hours per week. Basically, as long as I was on track and producing results, they didn\'t really mind what I did.\n\nThey had monthly social events, a popcorn machine, foosball/ping-pong table, free pop, and beer on tap (usually some craft beer).',3900,'CAD','monthly',3.0,2.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhb00d101jv9mtgcwz3','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Had a really hard time at RBC. First two weeks were very slow. Didn\'t get my own laptop, badge or even a project. Had to really press the manager to be put on a project, which was literally dead. The code was messy, old and mostly written by previous interns. I guess your experience is determined by how quickly you take action. But overall, the entire management is pretty bad from my perspective. Period.\n',3400,'CAD','monthly',2.0,2.0,1.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhb00d201jvchqi8wb9','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459550,'ck1n1du49000501jo4pwygsav','I absolutely loved my experience at AeroFS (they also go by Amium/Air Computing). \n\nYou are able to choose the area you want to work in and given a series of projects intended to help ramp you up. You are exposed to a lot of different tech stacks and you are able to work on critical features and systems.\n\nThe mentorship and culture of the company are also great. It is a small enough company that you are able to know and interact with everyone. You are able to learn from very smart and capable engineers who are also very chill/friendly. ',1500,'USD','weekly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhb00d301jv21bd08j1','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Worked during the Fall of 2016, company was ~ 45 employees when I joined and 65+ when I left.\n\nPros:\n- Fast moving means you get to contribute code right away\n- Same responsibilities as a full time employee\n- Lots of company perks\n\nCons:\n- Growing pains, as always, lead to some disorganization\n- Sometimes best engineering practices aren\'t always followed',5500,'CAD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhb00d401jv1eid7qnw','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Absolutely no meaningful work, my manager was very busy and it seems that he had very little time and patients for co-op students on the team, other than the one he is working directly with. Makes you look for your own work starting from week 2, after you are done with the God awful/boring testing work. Office is very closed and everyone gets their own cube (imagine Kelly\'s desk from The Office, except for the entire office is like that).\n\nHighly not recommended ',3000,'CAD','monthly',1.0,1.0,1.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhb00d501jv5yi96ld7','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','You get to work on a variety of projects. On each of these projects, you\'ll be looking at something new that IFDS/DST Systems is looking at using. Things that I looked at specifically included blockchain ledgers, distributed databases vs traditional databases and Docker architecture (note that most banks nowadays have massive mainframes somewhere, so Docker is pretty new for them).\n\nThe team is very nice and knowledgeable about the banking world, and they will help guide you through your tasks. You are given a lot of freedom in what you look at though, so be sure to take advantage of that. Most of your coding skills will be used to make prototypes to demonstrate to someone inside/outside the team.',25,'CAD','hourly',4.0,3.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhb00d601jvhggzdeyp','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I loved my experience at Capco.\nThey were all very down to earth people who genuinely wanted you to get something useful out of the term. \nThey have an amazing work/life balance because everyone works very hard to get things done but also have company events once or twice a week.\nWould totally recommend applying here, best co-op experience I\'ve had!',920,'CAD','weekly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhb00d701jvewaq2fiv','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','TL:DR: If you want to build projects from the ground up with complete control over tech-stack and implementation, and are comfortable with self learning and having little to no mentorship, then LCBO next might just be what you are looking for.\n\nPros:\n- Small team: just 4 coops + a non-technical manager (they did just hire a full time dev though).\n- No BS meetings: Once the specs were decided on, people were left to work distraction free\n- Many small projects: we had 3 different projects over the span of 4 months.\n- Full tech-stack & creative control: we started 2/3 projects from nothing more than a blank Git repo and a rough set of specs from the higher-ups. True 0 Technical Debt™\n- Modern Development: The Frontends were SPAs build with React + Redux, and the Backends were node.js with Express, Passport, Sequelize + Postgres, Docker, etc... Our mobile apps used Swift or React-Native.\n- Communitech: it\'s a really nice place to work. Communitech in general has a nice atmosphere, and LCBO next has a really nice work-area. Also, there is a gym in the building.\n\nCons:\n- Some Corporate BS: There are times where LCBO\'s corporate machine clashes with the fast pace of innovation. Eg: we were once blocked on a project for several weeks due to internal bureaucracy in getting access to some internal data.\n- No Mentorship: (this might change with the recently hired dev) We didn\'t have anyone on-site to help up with any technical questions we had. We built everything ourselves, and when we ran into problems, we overcame them ourselves too. NOTE: this isn\'t really a con, more of a fact really...\n- No Free Food (barring the occasional Communitech event) \n- No Free Company Swag\n\nOverall, I really enjoyed my internship at LCBO next. I got a chance to finally learn and polish my skills with a wide array of different technologies, and it felt great to have such complete control over the projects I was working on.',1100,'CAD','weekly',4.0,1.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhb00d801jv6cybcage','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','The Office team in Microsoft Japan worked on docs.com and Office Lens while I was there.\n\nYou\'ll be assigned an onboarding project to start off with, and then move onto a main project to finish off the term with. If you finish your main project quickly, then you\'ll probably end up working on regular engineering tasks. The projects were in different fields, and a couple of them were quite interesting (involved NLP, OpenGL), but a lot of them were fairly standard web/mobile-development feature tasks. Obviously, these choices will vary each term.\n\nHours aren\'t particularly long, but they\'re pretty offset from the usual business hours (most people came in at 11 and left after 7). You\'re not pressured to commit to 11-7 at all though. Your mentor is mostly there to answer any questions you have, but you\'ll need to be fairly proactive in asking questions to get anything meaningful from them. I wasn\'t so proactive, and mostly ended up asking my mentor for help with Japanese paperwork.\n\nLiving in Japan is great, and there\'s a lot to see, do and eat. I highly recommend you take lots of trips on weekends and holidays!',400000,'JPY','monthly',4.0,3.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhb00d901jv17gb5xlp','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Mentorship was almost non-existent and the project was useless. Most intern software projects are demos / proof of concept work that never see the light of day. If you are lucky, you might work on some small features that actually ship. Company culture is really strange, everyone is super secretive about what they are working on. The company is also extremely stingy with perks, offering no free breakfast/dinner and free dinner only if you stay past 7 PM. Overall, I think that Apple is a good company to work at if you are into hardware or are a massive fan boy. If you are into software, there are better companies out there.',5600,'USD','monthly',3.0,3.0,2.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhb00da01jva173d7h7','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked here during 2016. Company culture is really good, everyone is friendly and the CEO shows a lot of respect for his employees. Intern projects were meaningful and challenging projects that were released into production. Mentorship is excellent and the company has fairly good work/life balance. Food was top notch with free breakfast, lunch and dinner. Intern housing was also extremely nice, although you do have to share a bedroom which can be annoying. Only complaints were that the commute from Redwood City to Sunnyvale was a little long (~1 hour) and the other interns in my term weren\'t very social. Overall I highly recommend it.',7200,'USD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhb00db01jv1b4z667q','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Worked on containerization.',40,'USD','hourly',4.0,4.0,5.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhc00dc01jv9rwsai1u','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I co-oped for Facebook twice: first time in Summer 2015, and second time at Instagram in Winter 2016. Both times I had excellent mentors, and who coached me during my term.  Facebook really does not differentiate between interns and full-times, so the work you get to do will be real and meaningful. They are also really flexible, and try to accommodate to your interests; I was initially assigned an Android project, since my resume has a lot of Android experience. However, I really wanted to learn something new, and my manager was able to accommodate to my learning needs. The corporate housing is luxurious and EVERYTHING at work is free!!!!! (Food, tech, snacks, etc...) The team and managers really try to ensure you have a good work-life balance, and encourage you to have fun at the campus arcade and bouldering rock! However, Facebook does move fast, and it can get busy at times. I would 100% recommend working at Facebook to everyone!',8000,'USD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhc00dd01jv36pkgik8','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Worked at TD for my second coop term. I was able to work on interest projects and see them through to production. I didn\'t learn about any cutting edge technology in this position.',22,'CAD','hourly',4.0,3.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhc00de01jvhqkk8k2w','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I was given the opportunity to work on projects that i was most interested in. The team was extremely helpful and the work/life balance is awesome. I\'ve interned with Facebook for 2 terms and both terms have been very exciting. ',6800,'USD','monthly',4.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhc00df01jvdt4n7vba','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','It was a good internship for first years but the work wasn\'t meaningful and was quite boring.',18,'CAD','hourly',2.0,2.0,2.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhc00dg01jvccxsfx0u','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','One mentor per coop guided you through. Worked as part of the team for a bit, then on a project in the app. Overall good experience. The housing sucked though',9000,'USD','monthly',5.0,5.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhc00dh01jv4insfzw0','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Working on really cool and interesting software. Sometimes difficult to communicate with other coworkers as they live in different time zones.',40,'USD','hourly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhc00di01jv0xupe9xw','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Learned a lot about fullstack web development. Coworkers and mentors were all super nice and friendly. Had lots of responsibilities and was able to make sizable contributions to the codebase.',31,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhc00dj01jv7m53fl70','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','The people there were friendly and always willing to help. Strong mentorship from one of the senior developers there who was always willing to help. Only downsides were that direction of the product is unclear and the salary was low for the amount of work that was being done. ',2850,'CAD','monthly',4.0,4.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhc00dk01jv16el5ktv','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Had a great time at Flipp. The people are really friendly and make an effort to make you feel part of the team. They have monthly company events that are lots of fun and free lunches on Friday, they also give you a Goodlife membership for the term and TTC passes. \n\nThe work they give you is pretty interesting, although that depends on the team. You\'ll have an opportunity to work along full time employees and take on as much work as you feel comfortable with. Overall their expectations are pretty reasonable and they seem like they really want to see you grow. I would really recommend working there!',19,'CAD','hourly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhc00dl01jv6ifxa2ab','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Working for Capco was an awesome experience. The projects are super cool, the people are amazing and you will learn a lot. There\'s a solid work/life balance with a bunch of fun corporate events. I would highly encourage everyone to intern at Capco if you get the chance!',23,'CAD','hourly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhc00dm01jvcayh9ime','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Your experience at D2L will be extremely team dependent.\nPoliticking between the team appears to be strong, and some get overloaded with work.\nYou\'ll have a mentor, and the office is a pretty nice open concept space.',650,'CAD','weekly',4.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhc00dn01jv7s1yfqig','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Your experience at D2L will be extremely team dependent.\nPoliticking between the team appears to be strong, and some get overloaded with work.\nYou\'ll have a mentor, and the office is a pretty nice open concept space.\n\nIf you go to D2L on a dev term, you\'ll be stuck doing a video tool \'onboarding\' for about a month and a half.',600,'CAD','weekly',4.0,4.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhc00do01jv01tram1b','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Had a fantastic mentor, and a great opportunity to contribute to a new tool.\nOffice was a bit depressing with the empty cubicles, but they\'re moved everything to the buildings up at Northfield now.\n\nWork is about as hectic as you let it be - there\'s always more work in this transition period.',805,'CAD','weekly',4.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhc00dp01jv9c0gdstv','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Did a 4 month internship at the CBC, and overall had a great time. Being a large public sector corporation, there are definitely office politics at play in some departments, but I felt that my immediate managers did a good job at sheltering the team from outside noise. As a mobile developer, I got to work on some of the company\'s most meaningful and important projects. Company culture is very relaxed and everyone is friendly and accommodating. Some aspects of the development process were a little slow for my liking, but as an intern I was treated no differently than a full-time dev. One perk of working at the CBC is that every 5th week is an innovation sprint, where you can work on a side project or learn something new that adds value to the company. Working in downtown Toronto is also very cool.',3000,'CAD','monthly',4.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhc00dq01jvf3kfhpcd','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Redfin is a real estate tech company headquarted in Seattle. On the first day, I got to meet all the execs and they were super nice. All the recruiters and managers I worked with were approachable as well. I was an intern in the Notifications Team. I worked with engineers who were from great schools and who had worked in Amazon and Microsoft before Redfin. They let you choose any team and project you want based on your interest. I loved the flexibility. The work culture is great and there is a lot of great mentorship and work-life balance. We also had team events to increase team morale. Overall, I would highly recommend Redfin as an internship, especially someone who is interested in Big Data problems and the Real-Estate business.',7000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhc00dr01jv78pj8ygw','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Not bad place. Management doesn\'t really have a good coop system so you might be left in the dust for a while. There\'s lots of work though, tons of features to work on. People are generally friendly. Perks are pretty meh.  Work varies between teams so don\'t fall for the \"big data\" meme although in general we do use a lot of cool tools.',3750,'CAD','monthly',4.0,4.0,5.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhc00ds01jvhhrz11sz','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Had a fantastic experience with Ciena at their Ottawa location. My team, and specifically my boss, were fantastic to work with. Didn\'t get any busy work after the first few weeks, was actually given meaningful work that taught me important software development practices and more. My boss specifically took me aside at times to highlight important things both about my work and thriving in a corporate environment. Team were all super friendly and helpful.\n\nPositive outlook on the company as a whole. Work life balance is there as most of the company is just people looking to do their ~40 hours and enjoy life outside of work. The occasional weekend of overtime would be asked in order to hit a target date but this seemed to be a very infrequent thing. Cool product and the company looks to be heading in the right direction.\n\nA few footnotes:\n\n1. Company is aging. Ciena Ottawa is a lot of former Nortel employees, and the company really didn\'t hit their stride until recently. This has created a bit of a hiring gap where you have a lot of employees aged 40+ but very few in the late twenties/early thirties area. They\'ve been hiring a lot of new grads so there is definitely youth there.\n2. Canadian pay. You can see their fulltime numbers easy enough on glassdoor and it\'s nothing exceptional as far as Canadian software goes. They have decent perks for employees who have stuck with the company for a bit, and I get the vibe that this is a \"work here for potentially the rest of your life\" kind of place. Having experienced both this environment and the much faster paced, swap companies frequently, higher paid environment of the states, I am not sure which I prefer. Two completely different paths which I believe both have their benefits.\n\nAnyways, as far as co-op goes you can\'t go wrong spending some time here. Great company, great people, good work, and Ottawa is a fantastic place to live. Give it a shot and see if it\'s for you.',20,'CAD','hourly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhc00dt01jvgm344hs7','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Being the only intern in the department, there is a lot of flexibility in the time taken to complete different projects. The job is mostly writing VBA code to automate a lot of manual work being done using MS Excel and Outlook. If you know how to work with BEx Analyzer, it would be advantageous.',18,'CAD','hourly',4.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhc00du01jv6pg34l2h','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','If you\'re a UX-er or product designer, Shopify should be on your list. They (are starting to) bring in some top talent from all over the world. Literally, I\'ve got to work with designers from Facebook and Airbnb during my time here. The design work is really starting to get noticed globally, and Shopify is one of those companies who deeply care about their design. You will come out of this co-op feeling as though you became a better designer for sure. \n- Lots of opportunities for growth. Your lead will take care of that for sure. \n- They actually give a shit about their design work\n- Amazing designers to talk to, lots of talent coming in \n- Intern housing in Ottawa is nice\n- Projects are super fun and there is lots of transparency so you\'ll get the big picture of what you are doing\n\nOnly cons: Ottawa is kinda boring if you\'re into big cities. Intern culture is kinda bland (lots of waterloo engineers). ',4000,'CAD','monthly',4.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhc00dv01jv93qi75yl','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','My co-op experience with the Region of Peel was good as the staff was friendly and the work environment was comfortable. Depending on your team and manager, your experience may vary. ',21,'CAD','hourly',4.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhc00dw01jvbwtj9pbt','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Job was ok, you are basically just doing people\'s taxes using their really old software. If you think that will help your career, probably won\'t be bad to work here. ',14,'CAD','hourly',3.0,3.0,2.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhc00dx01jvasudd4su','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Capco is a great place to intern at ! Great work, great people, and great social events. I learned a lot about iOS development here. When I graduate, I will definitely consider Capco for full time work. ',4000,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhc00dy01jv7vwwacmf','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','The work is pretty hard, fast paced physical labour. Coop students do spend a little bit of time working in the office, but it\'s mostly line work. You get used to it after a week or two, after which point it\'s not a bad job. Coworkers are friendly. If you can\'t get a coop in your field, it\'s not a bad consolation prize.\n\nI filled in the ratings kind of randomly, because I don\'t have a lot of frame of reference.',15,'CAD','hourly',4.0,4.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhc00dz01jv5cs1bs4j','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Depending on what team you get, your experience can be meh, or very positive. I was given several independent tasks to do over my term, but it felt like no one really cared about what I was working on. The people were nice; although it there is a TON of red tape (it\'s a bank). RBC is very big on co-op/internships so there were meetings with other interns (~10 in Capital Markets), and some of them seemed to be working on really cool stuff. Although being into finance isn\'t required, it\'s something I would recommend as most of the stuff you are taught on the job revolves around that.\n',3200,'CAD','monthly',3.0,3.0,2.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhc00e001jv969fefuc','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','January - April 2017\nThe people are nice and funny but there is not a lot of work to do. Work they do give you is meaningless. The only cool work was doing some Android development. It was their first time doing software dev and thats the only cool bit; other than that pretty boring.',18,'CAD','hourly',2.0,3.0,1.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhc00e101jv6g40g3np','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Very meaningful work with lots of freedom to take on larger responsibilities. If you do well, customers will write glowing feedback about your changes. Felt like I was actually part of a team where no one is too busy for you. They were flexible with frontend/backend and I did a bit of both. The culture is very open and fairly laid-back while avoiding startup cult culture. You can always find someone to help you with work or just to hang out with you.',3500,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhc00e201jv1hn46wj6','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Good environment, good people. ',18,'CAD','monthly',4.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhc00e301jvcyb1h4av','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','So I was in the first cohort of co-ops that joined the Jan Kelley Idea Incubator in Communitech (Our first day was the full-times\' first day). \n\nWe didn\'t have a ton of work at the beginning of the term (which is somewhat understandable considering the outpost was just starting up) and as the term went on we gradually got more work.\n\nIt was a great work environment and we worked with great people, but we were left on our own a lot. The two full-times spent 2 days a week in the Burlington HQ, so if we ran into a road block, we\'d often have to message them on slack (which isn\'t the worst thing in the world, but definitely not ideal)\n\nI\'d recommend this job for someone looking for a lot of autonomy and control over design decisions, and doesn\'t want to just be handed a spec.',17,'CAD','hourly',4.0,2.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhc00e401jv53xf9kfs','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','It was a great experience working at Capco. During my time at Capco. I was thrown right into development and given significant work. The people at Capco were willing to help me with any issues and I learned a lot through their mentorship. If you don\'t like your work, Capco will find you a project that you are happy in. I would highly recommend applying to Capco.',20,'CAD','hourly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhc00e501jv9zin5wty','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I really enjoyed my experience at Capco. Everyone I met was easy going and willing to help with anything you asked. I had a great work/life balance during my time at Capco, and they supported it by hosting many company events over the term. My role provided a unique blend of experience in consulting and project management while also allowing me to learn more about technology and software development. I would recommend applying here to anyone interested in consulting and/or technology, best co-op experience I\'ve had!',4500,'CAD','monthly',5.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhc00e601jv83vac8lz','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','People are absolutely awesome; fun and insightful. Work is also great, all you have to do is ask people to open up more opportunities. ',3840,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhc00e701jv5oqadlix','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','KC in Huntsville was an incredible place for an 8 month work placement. The town itself is wonderful and the whole Muskoka region is great. The mill is staffed by a team of veteran engineers who are great mentors to the students. I was given the chance to program, works hands on with the electricians and take the lead in a number of high-impact projects. I really feel like I learnt a lot in my time here and I seriously recommend this placement to any who get the opportunity!   ',18,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhd00e801jv5ujh1d1q','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I believe the purpose of an internship is to challenge you, whether that be by putting you in new situations or providing opportunities that force you to learn new things.\n\nCapco provided ample opportunities to be challenged this term, and that was by design. I have learned so much at Capco as a result, and would recommend others take up the opportunity to do the same.',3840,'CAD','monthly',4.0,4.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhd00e901jvbu4j7qjv','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','The quality of the internship really depends on these three things:\n\n- The team you end up on\n- The manager/mentor/lead you end up having\n- The project you get assigned\n\nThese things can vary greatly and I lucked out with fantastic team, manager/mentor/lead, and project. When interviewing, make sure to make it perfectly clear what your interests are. They\'ll try their best to put you on something that matches your interests.\n',7500,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhd00ea01jvgeth8pfo','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','The Microsoft intern program is well-organized with lots of special intern events (eg game nights, Mariners games, hiking etc). You get lots of perks with your salary including subsidized corporate housing, gym membership, and lots of gifts/swag.\n\nMicrosoft is large and fragmented, so your experience will depend a lot on your specific team and manager. Overall, the people are smart, the culture is laid back, and the company mood is optimistic.\n\nThere is lots of interesting stuff going on at Microsoft, but 4 months is not enough to ramp up and fully take advantage of everything. Your internship will likely be project-based and you shouldn\'t expect your intern project to be something cutting-edge.\n\nReturn offers are relatively easy to get as long as you put your work in.',7100,'USD','monthly',5.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhd00eb01jvf0z817b1','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','The projects given did not seem meaningful, but I did learn a lot through independent learning. There was the need to show up to the office early since the QA team is offshore. I had many long hour meetings that were not necessary.',3000,'CAD','monthly',2.0,2.0,1.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhd00ec01jve2fadro7','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','TD Lab is a prototyping environment. Interns are split into groups of 3-4 that work on experimental projects that can be used in context with the bank but will not be pushed to production. These projects are presented to the executives at TD at the mid-point and end of each term and are supposed to inform digital strategy.\n\nAs a designer, you will get the most out of this experience if you are able to take a step back from your individual work (working with tools such as Sketch, Marvel, etc.) and can think deeply about the meaning of your project. The Lab emphasizes ideas and concepts over perfecting visuals or UI.\n\nThe culture is great. Co-ops will get very close as they will be working together the entire time. 1 or 2 full timers will get assigned to each group to point the interns in the right direction. ',2750,'CAD','monthly',4.0,4.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhd00ed01jvgrlg4di0','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Very smart people, great support. Everyone there is very passionate so long hours aren\'t uncommon. However, you aren\'t forced to work long hours. They give cool projects and try to line them up to your interests.',4600,'CAD','monthly',4.0,4.0,5.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhd00ee01jv9cwyb2hb','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I was a Developer with Capco and had an absolutely wonderful time! The company is great and they have lots of fun events where you get to meet other project members and pretty much every event is free and has food :) It\'s not too corporate, it has a pretty flat structure, which is great. In terms of work, I lucked out with a really good project and with dev, I think you\'ll always have something to do. I learned a lot and it was definitely an awesome experience!',21,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhd00ef01jv7sod6x5r','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459551,'ck1n1du49000501jo4pwygsav','Honestly, hands down the best co-op i have ever had. Lots of smart people and I was given an insane amount of ownership!',6500,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhd00eg01jvf5gg5qhd','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','amazing mentorship & very interesting work',4000,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhd00eh01jvc5ic8pkw','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked at the Rogers Media for a 4-month internship on their web development team in downtown Toronto. Mainly working with JavaScript, PHP, and a little bit or Ruby. I was on the radio/broadcast/publishing team focusing on the Rogers Media radio sites. \n\nI really liked it there, it was an open environment with great feeling to it. The hours are great and very flexible and the amount of work is very manageable. They treat you just like another developer, so you are given your own project to work on. Sometimes you run out of work to do but I have never gone beyond 2 days of nothing to do. \n\nI had code reviews with my manager for my code regularly and people were very open to questions I had. \n\nOverall, I really liked it at Rogers in their Digital Media department. I would say though that I really liked working in the media field. If you are not interested in that kind of work, you will probably really dislike your day to day work. ',18,'CAD','hourly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhd00ei01jv0dzf1y20','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','The toronto office is great! I got to work with a lot of nice people. Particularly my manager and mentor Blake was very helpful. He gave me a lot of room of freedom that I can decide what projects I want to work on. The job itself is very hard to explain. It\'s kinda a combination of later stage pm and marketing on a scale (through the sales pods). Food can be a surprise sometimes. I\'ve had alligator and rabbit there. Gym and wellness expense are subsidized as well and you get $300 something everything on ad credits. Overall it\'s a very cool experience.',5000,'CAD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhd00ej01jv1xuaduax','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Pros:\n- Foosball, pingpong and free snacks/drinks\n- Great culture\n\nCons:\n- Very few experienced or senior engineers\n- Greater budget for sales than engineers\n- Low salary\n- Long hours\n',2800,'CAD','monthly',3.0,2.0,3.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhd00ek01jvdh1d4q32','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Nice co-workers, the projects weren\'t particularly interesting though. Decent mentorship, but the code reviews were not rigorous. Everyone wants to help you out though so there\'s that!',17,'CAD','hourly',3.0,3.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhd00el01jv11h32woj','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Although the company is declining, the coop experience is pretty nice. Lots of perks and outings. There may not be too much work to do, depending on your team.',6400,'USD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhd00em01jv0zjw96wt','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Worked there for Winter 2017 term, it was friggin awesome. The impact you can make working there is unreal, and for those less experienced you can really learn a ton.\n\nTry to work for relevancy, product, or infrastructure team; the platform team coops were slaves.',8500,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhd00en01jvgf9g3ekx','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','You\'ll get a lot of responsibility and make your own features, but the culture is a bit dull. Not very diverse and not really any company events.',1100,'CAD','weekly',4.0,4.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhd00eo01jv946284we','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','It\'s a good work-from-home job where you work with AngularJS (1.x) almost exclusively. Depending on the position, you may get access to the back-end PHP as well.',20,'CAD','hourly',4.0,4.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhd00ep01jv73bb7k50','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Hours were 9-5 and you develop proof of concept (POC) applications with Meteor and RapidMiner. The code you develop is not tested for quality and you are monitored on final product only. You can write garbage code and not be mentored on it. The code is considered throwaway since it is only a POC, not production code.\n\nBut the team lead cares a lot about you getting value with learning useful, new technologies.',800,'CAD','weekly',4.0,3.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhd00eq01jva3eya54n','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked as an intern in the winter term in 2017. The culture was surprisingly awesome for such a huge company - everyone is friendly and the company is very open. The perks were top notch - housing was luxurious, buffet of great food every day for three meals, fitness stipend and snacks. I had the opportunity to work on some pretty impactful projects and was treated like a full-time employee. At work, you\'re surrounded by really smart, driven people. There\'s excellent infrastructures and tools in place for developers.',8000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhd00er01jva173efmk','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I loved working at SkyWatch. You get to work on many projects and pretty much work on all aspects of the company\'s public API.\nYou\'ll learn a lot about building scalable back-ends and low-level geo-spatial libraries for processing satellite images.',3000,'CAD','monthly',5.0,4.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhd00es01jv586q1k8o','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Loved it. Everyone\'s professional and friendly. Working environment is casual. Somewhat flexible hours.',1000,'CAD','weekly',4.0,4.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhd00et01jv619n7ass','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','First term was at N8.  Super friendly team, board games after work once a week.  Burlington\'s not the most exciting but it made for a simple first co-op term with a good intro to being a dev at a company.',17,'CAD','hourly',4.0,4.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhd00eu01jvea688yeo','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Everyone there is really nice and friendly. Interns are treated well. If you tell them what youre interested in, they will make an effort to pair you up with someone with expertise in that area and get you working on a project you will enjoy.  Lots of oppurtunity for training or learning more on a topic that intrigues you, but it may come from the perspective of sales, and not the nitty-gritty techinical, which can be good or bad depending on what you want. \n\nYou get to tag along to fun corporate events with food and schmoozing. It is as laid back as corporate enterprise gets.',20,'CAD','hourly',4.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhd00ev01jv7kfkb78e','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Did two winter co-op terms in financial services audit. \n\nReally enjoyed the team atmosphere of the job and the responsibilities I was given as my comfort level and experience progressed.  Benefits were quite good with a sizable fitness credit and a pretty solid points recognition program. Got some sweet shoes and a guitar through this.\n\nWork hours are bad but it\'s to be expected in this field. Initial pay is fairly low but that\'s also to be expected. Ultimately I left as I wanted to pursue another profession, but PwC would have been a great choice had I stuck with accounting.',3417,'CAD','monthly',4.0,4.0,3.0,2.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhd00ew01jve7h8e1mp','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Interned here in the Winter of 2017. The work was interesting, but got a little repetitive over time. Coworkers and other interns were very chill and open to collaboration for the most part. Free snacks, weekly catered lunches, and other benefits are great. My specific team was lacking a clear leadership presence, but managed to make do with help from other teams\' leads chipping in.',22,'CAD','hourly',4.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhd00ex01jv4tpn9ops','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','PROS\n- great people\n- really interesting projects\n- free snacks / foosball table / ping pong / coffee / tea\n- treat you like a full timer from day 1\n- lots of focus on culture - company events, awesome office space\n- really want you to learn - some 1 on 1s\n\nCONS\n- bit divisive in terms of cross-functionality... business and tech people are divided\n- though a \"startup\" environment, not a lot of perks for non-full timers\n- sometimes they think you know more than you actually do\n- high attrition pains\n\nOVERALL\n- really good early coop, but experience is definitely different for full time workers',3200,'CAD','monthly',5.0,4.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhd00ey01jvf0rd4mbo','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','The experience was great overall. You\'ll get to work on a meaningful product and get ownership of any new features you develop. You\'ll get to be a part of all the meetings and work closely with product managers, designers and senior engineers. You\'ll learn a lot of different coding practices and code reviews will push you to write better industry standard code. Perks include free drinks, snacks, team outings and monthly company lunches. Highly recommend!',5600,'CAD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhd00ez01jvdeuwaulr','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Worked there two terms now. Both on different teams as a EE intern. \n\nThe most important thing I find interning at Apple is finding a good team/mentorship.\nI was lucky enough to have amazing mentors and team during my time there which led me to learn a ton of things. \n\nLots of work to be done, so had some late nights, but no-one forcing you to stay late. Only stayed late because I really enjoyed the work.\n\nTip : Remember Apple is a huge company 40,000 + employees.. Every team is different, so when you are interviewing ensure there is proper mentorship and good work. For hardware, I say its a really good place if not the best, but for software I\'m sure there are other companies that are much better. ',35,'USD','hourly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhd00f001jv1q4ogd2k','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Did an 8 month co-op for my 3rd and 4th co-op term. I realized this was probably one of my biggest career mistakes. We were in a hire class of 10 individuals and were treated like brand new co-op students(for pay and other perks) even though most of us already have 2 busy seasons worth of experience.\n\nWe were paired up with a coach. Fortunately, I had a nice enough coach.\n\nHowever, while the Firm states there is a strong work-life balance, there really isn\'t. I was put on a large engagements that was short staffed which resulted in us working 14+ hour days for two months.\n\nAlso, work gets boring and is easily outsourced overseas.\n\nOverall, I would not recommend this job.',3400,'CAD','monthly',1.0,3.0,2.0,1.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhd00f101jvcufw0bpz','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Worked in 2017 after previously working at the New York office. Company culture was consistent. I felt that the projects were meaningful and enjoyed working on my team. London did not have as many intern events as NYC, though there isn\'t as much of an intern program in London so this is to be expected. Having 8 vacation days was nice and allowed me to take extended trips and long weekends.',3583,'GBP','monthly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhd00f201jvamadd7vs','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Kik was my favourite co-op in terms of work experience. Getting to develop full features here was great. Unfortunately pay is not competitive with the US, but it\'s definitely worth a co-op here to learn new things.',4333,'CAD','monthly',5.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhe00f301jvgmilfwi7','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I enjoyed my time at Uken Games a lot. I definitely learned a lot from working at Uken. I was given some pretty meaningful features in a fairly decent sized game. They also try to pair you up with senior developers, so if you have any trouble you can always ask for help. The environment is very friendly. There was no overtime for this position since the task estimations were done really well. Interns also have many perks like free food and events every month.',4000,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhe00f401jv617x90qp','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','3rd month into the term, experience has been nothing short of amazing. Super exciting to work at one of the best self driving car company in the world right now, I worked in a very small team (a special feature) of 2 people, I basically owned the entire feature stack, my work involved everything from frontend, backend, server scalability, data pipeline to the autonomous vehicle stack on the car. To put it simply, I learned a shit load.\n\nWork is very meaningful and relevant, company is evaluated by milestone, therefore everything I worked on was purely towards the milestones, and the impact of my work is clearly visible from metrics and benchmarks. \n\nCompany is growing extremely rapidly, we have about 300 full time right now, though the managements are doing a great job aligning the focus, especially the CEO who is also super down to earth and friendly. However as a consequence it can be difficult to get help just because the pace of the company\'s growth, it sometimes take a couple of redirecting to get to the right person. If you can self learn quickly then it isn\'t a problem.\n\nThe company is actively pushing equality and healthy work culture *cough cough uber*, there are 15 interns this summer, the intern program is new but also well planned, lots of intern events. The expectations of interns are just about the same as full time, still the workload is very resonable, and the work hours are very flexible. \n\nLots of benefits: free breakfast, lunch, dinner, snacks, deductable commute, free self driving car ride to work (soon to be to everywhere in the city), you can go on a test drive whenever you feel like, I like to go when I\'m just bored or can\'t figure out a hard problem. \n\nOverall the company is in a very interesting position after GM\'s aquisition, we are still independent as a company and very much like a startup, however backed up by a massive cooperation. I honestly can\'t ask for much more.\n\n\n\n',10500,'USD','monthly',5.0,4.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhe00f501jvdi5b61mt','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Mainly debugging of old legacy code with little to 0 mentorship and poor leadership. Culture is very clique with people hanging out in group, however there were 8 co-ops so you get to meet lots of new people.\nWould not recommend.',19,'CAD','monthly',2.0,3.0,2.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhe00f601jv4zu058eh','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Pros:\nAbove average pay, lunch provided\nDo actual work, not meaningless stuff that never gets used\n\nCons:\nYour experience with the CEO can be super hit or miss\nBad full time to co-op ratio\nThe codebase is a mess. Only by looking at it can you understand\n\nOverall, not as bad as the horror stories you normally hear, but I wouldn\'t work here if you already have some experience under your belt.\n\nThis picture describes Rave perfectly: https://i.redd.it/wzn251tvq49y.png',25,'CAD','hourly',3.0,1.0,3.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhe00f701jvc4wfgnss','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','The company culture is very laid-back which was good. However, they really need to work on managing and hiring enough developers to do the work instead of over-working their interns. ',4500,'USD','monthly',3.0,3.0,4.0,1.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhe00f801jv2iun3fqu','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I thought the internship program was fantastic. My mentor was extremely helpful and available whenever I needed help. I learned the whole stack of development, and felt like i was contributing a ton to the effort and to the team.\n\nThe specifics about what I learned are as follows: Continuous integration, Python, Django, React, Redux, a little AWS, page crawling, creating APIs etc.\n\nI was out largely because of an injury, but there were many awesome events for interns and the whole company. I was also housed in an apartment in San Francisco (mission district). The venue was good.\n\nIn terms of remarks, the learning curve is high, so you will definitely learn a lot.',38,'USD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhe00f901jvfb427ek4','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459550,'ck1n1du49000501jo4pwygsav','Company culture was great, pretty fast and small, growing startup in Toronto. There isn\'t too much of mentorship for the tech team since it\'s pretty small and the startup focuses more on marketing aspect. Personally, the work wasn\'t very impactful because it\'s mostly fixing bugs, fixes on their new management platform. ',2720,'CAD','monthly',2.0,3.0,3.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhe00fa01jv2tep6by6','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','New startup in Toronto, good experience for first co-op, the work is interesting since it focuses on data engineering. Pay is a bit low for living in Toronto though. ',3040,'CAD','monthly',3.0,2.0,4.0,2.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhe00fb01jvg52772dj','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Overall pretty good company, great company culture, people here are really friendly and willing to help. The work you do will depend on your team, but my team gave me lots of options and many were very interesting, they definitely promote giving interns interesting work. The Bellevue office is very new and nicely decorated, it has a barista bar who makes fresh coffees, expressos, etc. \n\nThey give an option of corporate housing or $11500 (after tax, this is your take home amount) stipend which is more than enough for Bellevue.  They have lots of other interns and intern events during the summer, not sure about other terms. Theres also a monthly 100 dollars \"wellness perk\", which is just a free 100 dollars to spend on whatever you want. They also promote volunteering and have whats known as VTO (Volunteer Time Off) which interns are encouraged to take advantage of.',7800,'USD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhe00fc01jv8ujygeo1','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Located in the Old Port of Montreal,  Lightspeed deals with retail and restaurant POS systems.',20,'CAD','hourly',4.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhe00fd01jvf1nyh8nt','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','It really depends on your team. I didn\'t feel connected to my team at all, and they didn\'t seem that interested in me or what I was doing. The test environment broke all the time and people didn\'t care. I was stuck with an underpowered dev server for the first 2 months which made everything very slow and flaky. Sometimes it took weeks for people to review my code. When planning my project, one teammate kept harping on the fact that it\'s \"an intern project\" and \"Maybe he doesn\'t know how to code.\"\n\nMy manager was not a good mentor. One of the first things he told me was how his previous intern\'s project is no longer used in production at all. He often acted as if things could be done in a \"few hours\" or \"a day\" when it would obviously be more work than that. When I was almost done planning my project, he changed his mind and wanted part of it to work completely differently.\n\nThat being said, the food and perks and corporate housing are great. They throw a ton of cash at the intern program. It\'s also cool to listen to Mark at the Q&A every Friday.',8000,'USD','monthly',4.0,1.0,3.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhe00fe01jv7idt1wy2','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','My experience with Bloomberg in NY was great. You get provided housing in full ($2000 USD/month value) in Manhattan (30 minute walk, 10 minute subway), along with a $2000 USD lump sum pay for relocation. The internship program itself comes with tons of events including weekly tech talks, picnic (they rent an island), data centre tour and hackathons (overnight, 16 hr overtime) and algorithm contests. Of course, you get access to Bloomberg’s pantry, unlimited museum pass and other perks like breakfast and dinner. The building is fantastic, especially the views of uptown in Lex and downtown view in Park.\n\nWork-wise the projects were very interesting, you get to pick what you’re interested in and they try their best to do something you love. I worked with the latest technologies as well (including React/Node, Scikit-Learn, Microsoft Cognitive Services). \n\nI would recommend this internship to anyone in a heartbeat, just be careful of the team that you join.  I also interned here during the summer so YMMV for the other terms.',43,'USD','hourly',4.0,3.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhf00ff01jva8fudia7','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Spent 1 term working as an investment banking analyst. Averaged around 70 hours a week and worked Sunday - Friday. Work ranged from tedious formatting updates to financial modeling. Formalized program gives you exposure to different groups within investment and corporate banking in both fall and winter terms',1650,'CAD','weekly',3.0,3.0,4.0,2.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhf00fg01jv6oxfb5br','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Worked Summer 2017. Bosses were all cool people and fun to talk to. Work was not heavy but had many opportunities to explore different things.',18,'CAD','hourly',4.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhf00fh01jvh6mh5myh','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','The company builds enterprise software for corporate clients, so the end product isn\'t always all that interesting, but everyone there is really great to work with.  Every second Thursday there\'s a company-wide \"Thursday Night Social\" where dinner is catered and sometimes a staff member will give a talk about something they\'re interested in.',28,'CAD','hourly',4.0,4.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhf00fi01jvfkkh5tjt','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Had a pretty chill experience at Zynga. Great office, smart people and fun environment overall. They have an amazing intern program, and they have cool perks. Work was interesting for the most part. All in all, it was a lot of fun working at Zynga. ',23,'CAD','monthly',5.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhf00fj01jve8webfyn','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Worked at Microsoft in summer 2017. Despite not being at the HQ in Redmond, there were intern events every week or two (paintball, baseball games, cruise, etc), and we also got flown to Seattle for a week for the famous signature event. In terms of work, I was put on a great team where my project was actually critical for the team. I became good friends with my mentor and manager, but with a company as big as Microsoft, team culture can really vary. The team asked for my preferences on the type of work I want beforehand and gave me something that matched them exactly, despite me not having any experience in that domain beforehand. However, I did find that intern expectations here were noticeably higher than the other companies I worked at. For compensation, we were also given $1200 USD for transportation (or a subsidized car rental), a few hundred for shipping things, and mad discounts on Microsoft products. The corporate housing is super nice and you don\'t have any roommates.',7800,'USD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhf00fk01jv7ail5jcz','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Best internship I\'ve had so far. Company culture is great, everyone is very friendly and we had lots of fun events throughout my term. While I never intended to go or stay in QA, I loved my time at Unata, and I was definitely able to learn a lot of skills that are applicable outside of direct QA work. ',750,'CAD','weekly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhf00fl01jv1pl2ff4m','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Absolutely amazing company. Everyone is extremely passionate about helping people, the direction of the company, is always willing to help you out, make sure your learning, and really strive to succeed.\n\nThe openness and friendliness of everyone are really welcoming, and the general culture is great. It\'s common to just ask anyone for lunch of coffee, even if you have no reason or connection to them, and it\'s always great learning from them or chatting.',7900,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhf00fm01jvhb1sdp1x','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','My expectations coming in were fairly low considering the fact that Yahoo no longer has the tech giant reputation that it once had. However, I was greatly surprised and had a great internship. Note that experiences at Yahoo are team dependent, but the general consensus among the other interns was that the internship was awesome. \n\nThe perks are cool (3 free meals, micro-kitchens with snacks, gym, VTA pass, etc), but what really makes this place great is the people. The full time employees on my team were super smart and helpful and seemed to care about making sure I learned and enjoyed my time here. I was really impressed that my team gave me meaningful projects since coming in, I was expecting to work on \"side projects\" that wouldn\'t get shipped. \n\nAgain, experiences are team dependent, but the good thing is that you can have the chance to talk to teams (just make sure to list your interested teams during the team matching stage). Don\'t let the supposed reputation fool you (even after the acquisition). Would definitely recommend an internship here!',48,'USD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhf00fn01jv92888int','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','You learn alot about project management and project engineering and get experience in real work the company is doing. There is not many other coop students and it can get pretty boring. Overall a pretty good internship',31,'CAD','hourly',4.0,3.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhf00fo01jv3r73g0q5','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Great place to work at. Loved the work culture and how they\'re pushing forward now. Relaxed workplace with an emphasis on getting impactful work done. Joined the company during its\' changing phase and it\'s been quite the ride.',3000,'CAD','monthly',4.0,4.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhf00fp01jveqkahl5i','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Yahoo is a great place to work as an intern. The free food here is amazing, however dinner can be hit or miss. YMMV with your project, however I was given a lot of responsibility to work on my project, and implement new features. There are a lot of intern events in the Summer, including UW specific events that are also there during Fall and Winter. I would highly recommend Yahoo, especially for people in years 1 - 3. There\'s also a 6k housing stipend. ',38,'USD','hourly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhf00fq01jvfg8c5swq','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Great work environment; on-site gym, bikes to use on campus, free lunch and dinner. Work was meaningful and challenging. I worked on the mobile team and was given plenty of opportunity to grow my skills and learn new things. Team is very talented and supportive as well. On top of the $7000 / month salary you also receive $1300 / month housing stipend.',7000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhf00fr01jvfuularom','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','One of the best companies to intern at in Silicon Valley. Just wrapped up my summer internship at LinkedIn\n- Interesting and challenging work.\n- Excellent mentorship and focus on employee growth\n- Some of the best meals I\'ve had\n- Multiple on-site gyms and fitness classes (Brazilian Jiu Jitsu, Kickboxing, Yoga, Bootcamps)\n- On site massages\n- Luxurious corporate housing (Swimming pools, hot tubs, large spacious rooms with balcony)\n',8000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhf00fs01jvansreio9','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','I really enjoyed working at Zugata for a few reasons. First, the people who work there are all passionate about the product and improving it, and you easily get drawn into the culture of putting your butt on the line every time you complete a ticket. \n\nAlthough mentorship isn\'t always available as everyone is super busy, I was able to learn most of the stack on my own, and ask quick questions on slack if I ever needed help or was stuck on something. Generally, people come in whenever they want in the morning, before standup at least, and leave around 6ish, so they won\'t have you working crazy hours. Usually I stayed back later to perfect features, as I had to opportunity to work on large pieces of the application.\n\nThe kitchen is always stocked with a bunch of snacks, and lunches are catered and are restaurant quality.  Overall, I really enjoyed my term and learned a lot!',35,'USD','hourly',5.0,4.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhf00ft01jv8t7724re','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Worked summer of 2017 on the platform team.\nThe platform team really improved throughout my term to become a team that\'s quite enjoyable to work in. Work hours are flexible, and you get a lot of flexibility in your own work as well.\nFrom day 1, you\'re treated exactly the same as full time engineers, and have the same privileges as them. The work is very impactful, and you\'re encouraged to come up with your own solutions to problems that they try to solve.\nThe food, location, and coworkers are all nice. They really push you to work hard and be responsible for your work, which can make you adjust your own work hours in order to get the work done.\nThe salary could be higher to match other larger companies, as they really strive to attract talented students.',6000,'USD','monthly',4.0,4.0,5.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhf00fu01jvgbsf2p7k','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','There seemed to be a lot of pressure to get work done while I was coop here. Lots of emphasis on billable hours since this is a consulting company. ',4000,'CAD','monthly',2.0,2.0,3.0,1.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhf00fv01jvcncnaiqk','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','I worked here in Spring 2017 as an iOS developer. Capco offers the unique opportunity of contributing to projects that will affect millions of consumers due to their position in the finance industry (clientele include all of the big banks in Canada). The work culture here is fast-paced but you\'ll have lots of support within your team, as you\'ll often work with experienced developers who are more than willing to help you out. Capco also hosts lit socials almost every week throughout Downtown Toronto that are completely covered. I guarantee your time here will be worth it.',4000,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhf00fw01jv8qvmejei','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','I worked here for four months for Chris Tharmalingam and Igor Omerasevic. This was easily the best co-op experience I\'ve had up to date. My supervisors were extremely supportive and allowed me to take on responsibilities that you would not get in most other internships. The overall culture at Capco is excellent. Everyone is supportive from top to bottom. Tom Wan, the head of the BA coops during my time was also a great mentor who was always willing to provide advice. I would recommend this co-op to anyone looking to get their feet wet in FINTECH consulting. ',4000,'CAD','monthly',4.0,5.0,5.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhf00fx01jvg4evaou0','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Great culture, tons of smart people to learn from and hang out with. Work wasn\'t boring.',9166,'USD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhf00fy01jv87y6hn4o','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','I returned to Capco for a second work term due to the positive experience I had with them in the past & I absolutely do not regret that decision! Everyone at this company has such a great mentality to \"work hard, play hard\" which is why the culture is so great. I had amazing opportunities to take on responsibility well outside the realm of a co-op student, but with great mentorship and learning capabilities. My favourite co-op experience by far and would recommend to anyone who wants real experience and amazing co-workers!',26,'CAD','hourly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhf00fz01jv4s8d2ovo','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Pay was competitive, the tech stack was varied (I got to work with 3-4 languages, and a bunch of different tools) and you\'re given a lot of space to figure things out for yourself. The environment is very relaxed, work is independent. You can finish tasks at your own pace, and they\'ll have more for you when you\'re done. In addition to your personal co-op projects and adding features onto their existing stuff, you\'ll work on their automated testing/CI/CD frameworks. \n\nThe office is  quiet. The manager is a really nice guy, but often out of the office, so you\'ll have to ask the other devs for help. I struggled to do this because it\'s not clear who has the time/expertise to look at what you\'re doing. They\'re nice though, so don\'t be afraid to do ask.\n\nIt was an excellent internship and I learned a lot. Unless you have an offer from a big name US company or equivalent, I\'d seriously consider these guys.',850,'CAD','weekly',4.0,3.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhf00g001jves7y9gey','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','At Mosaic, I worked on a Ruby on Rails application for a small period of time during my internship. There was a new React Native project starting up, so I got to work on the initial stages of the project. I also did Scrum work, so I had a nice balance of dev and business work, which was great for me. The people I worked with were great, and very helpful. The hours were flexible, which I also liked very much. Overall, an amazing experience for me.',4000,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhf00g101jvayg7eigo','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459550,'ck1n1du49000501jo4pwygsav','Worked on the search team at A9. Lots of very important, and very interesting work going on. Pay is also top notch ($8,475 + $3,500 housing stipend per month). Mentorship could have been better. My project was something I was not very interested in, but I learned a lot regardless.  ',11975,'USD','monthly',4.0,4.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhf00g201jve3ao095d','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked there from May to September 2017. InFlight has great culture and the work you do directly affect the client so it\'s pretty meaningful. You get a team lunch every Thursday. The internship is the best I\'ve had so far. ',23,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhf00g301jv8kaqbih6','2019-10-19 03:52:01.800000','2019-10-19 04:39:02.937445',1571459707,'ck1n1du49000501jo4pwygsav','I worked as part of the IoT/AI team from the 120 Bloor Location at IBM. Mostly built PoCs relating to IoT throughout the work term. Got to learn a lot as I was using cutting edge technologies involving AI (Computer Vision). The team was really small (3 co-ops) so we did a lot of fun activities together throughout the term. Work/life balance was great (super flexible hours). Overall a great experience!',0,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhf00g401jv9gxwhl3r','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Internship greatly exceeded my expectations. There were a lot more perks than I was expecting and the full times on my team were great. The experience does seem to vary based on which team you are placed in (luckily I had an amazing team). Additionally nice if you are a Canadian or UWaterloo student as there is additional mentorship available from grads that work at Yahoo (about investing, building credit, etc). Work is not super meaningful (hence 4 out of 5), but still more interesting than other places I\'ve interned at.',38,'USD','hourly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhg00g501jv0900683p','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked at Heap both summer 2015 and summer 2016. The listed salary was for my first summer when I was a sophomore. My experience at Heap was amazing. I was not treated like an intern, I was treated like a full-time employee who happened to be there for only three months. I was given a much-desired feature to work on, as well as working on the team with their goals. I was expected to be as productive as someone who\'s been in industry for many years, but was also given the resources and mentorship necessary to make that possible. My experience at Heap was so amazing that I returned for a second summer and then joined full-time after graduating.',6500,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhg00g601jv5tz383sj','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Great work environment. Mentors are very smart and you\'ll learn a lot. All the code you write will be useful/shipped, though the difficulty of the work varies based on what they need to get done.',30,'CAD','hourly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhg00g701jv0xt0gk3l','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Interned here during Summer 2017, during the acquisition. Work was a lot of fun; got to work on a meaningful project and design/implement it from start to finish. Mentors were really helpful and patient.\nNot sure how the acquisition will change the culture... after becoming Oath things seemed to have a more corporate overtone, but the work I was doing was not impacted and there was still free food, so I can\'t take anything away for that.',38,'USD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhg00g801jvej1l4byn','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Lots of work to do :( \n\nAccounting for the overtime + rent costs, I\'d say this internship wasn\'t worth it for me.\n\nYMMV',4800,'USD','monthly',3.0,4.0,3.0,1.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhg00g901jv40kd252e','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','PROS:\n\n-Management is good, no personality issues\n-100% project ownership: you can do things the way you think is good and you don\'t face a lot of resistance\n-You are almost always left to work in peace, meetings are minimal\n-Kitchener is close to Waterloo, you can still enjoy student life.\n-Communitech is nice\n-Pay is quite good\n\nCONS:\n\n-You work for the government. This sometimes entails some extremely boring meetings where no one knows what they are talking about. I\'ll emphasize that this is rare but it\'ll probably happen once or twice during a coop term based on the way they decide to take on projects.\n-LONG PERIODS OF BOREDOM. This is the biggest con. Sometimes you complete a project, and you won\'t have another one to do. You will end up reading reddit and grinding leetcode questions for a week or two.\n-Not really hardcore technical. If you\'re a really big computer science nerd and are hoping for difficult and interesting problems, you will be disappointed. Most tasks involve very standard problems and solutions.',4400,'CAD','monthly',3.0,1.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhg00ga01jv5nwv1zdp','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','I think the biggest thing about working at Wave was the type of people you work alongside with. Some of these people were among the early people who helped bring computer science to where it is today. I have learned a lot just having conversations with them now and then, and they are always willing to have a chat with us interns. My supervisor was very respectful of my abilities, so were every other person I worked with. The higher ups always had an open ear to my suggestions on various things, and they actually followed through with most of them.\n\nThe work itself was really fun as well, it\'s hard to find places that solve challenges as complex as the one Wave is solving. This is a place where your work is valued a lot since it actually matters.\n',5000,'USD','monthly',5.0,4.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhg00gb01jv26mtawql','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','just ok, nothing special',3500,'USD','monthly',3.0,3.0,4.0,2.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhg00gc01jv0v7f8nuw','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459550,'ck1n1du49000501jo4pwygsav','Salary doesn\'t include the 1500 after-tax housing stipend. Nice.\n\nNot the most exciting job, and the perks are a little poor compared to other companies (catered lunches happen very infrequently, no gym stuff, etc.). Those things aside, it\'s still a decent place to work overall.',6933,'USD','monthly',4.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhg00gd01jv9wrm1hzf','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','I worked there Summer 2017.\n\nThe company was going through very fast paced growth while I was there, with numerous new hires being made both on the engineering and business side of things.\n\nThe overall culture was great, with a lot of fun events happening throughout the summer. The people there were all nice and supportive and the company was full of incredibly smart engineers primarily from MIT.\n\nBoston is also a really fun place to be in the Summer. The entire city is basically within a 1 hour walking radius, and there\'s cheap and efficient public transportation. I really enjoyed my time there and I\'ll probably cherish the unforgettable experience I had in Boston forever.',4000,'USD','monthly',5.0,3.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhg00ge01jvg9q0h49m','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Worked there for my first internship. Everyone helped me even though I didn\'t know much. Teams are flexible with letting you work on what you want.',700,'CAD','weekly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhg00gf01jvgx41fiao','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Mentorship and work/life balance were great. Work was not that meaningful because I was assigned to a product that no one ever heard of and I was working on an intern project (meaning my work probably end up in the garbage right now). The intern events are probably the best out of all the big companies. Microsoft invited Daya and the Chainsmokers to perform in front of 2,000+ interns and gave out free xbox one to every intern. Overall, it\'s a very big company and your experience varies drastically depending on what team you are assigned. HR is also flexible on switching team/organization for your next co-op, though sometimes they are very unresponsive and unhelpful.',7200,'USD','monthly',4.0,5.0,2.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhg00gg01jvehfmhbkr','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','I worked for Finastra as a software developer intern for one of their financial software applications. This was my first co-op, and for a first co-op (or a first dev job, really), it\'s an excellent opportunity. I got to use new, up to date technologies, learn a LOT of stuff, and pay was fair especially for a first job--technically, I only needed to work 6 hours on my work, and 2 hours on whatever I wanted to learn (didn\'t have to be related to the work at hand). Overtime was never mandatory (and always unpaid). My boss and co-workers were extremely helpful, and I had a lot of freedom on which problems to tackle in the code. The job would not be particularly challenging for those who already have dev experience, but it was an excellent job for someone who lacked experience.',19,'CAD','hourly',4.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhg00gh01jveu8vfnrj','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','My best internship so far! I got to work with very talent people and work on impactful features. The leadership team is also amazing!\n\nSome cool perks:\n* Monthly hack-days\n* Monthly company socials (bowling, paddle-boarding, escape room, arcade, etc)\n* Backstage pass for budwesior stage & echo beach\n* Free music festival / concerts tickets\n* Standing desk + 4k monitor\n* Protein bars',1325,'CAD','weekly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhg00gi01jv0fat6uw0','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Depending on what kind of work you\'re put on, your experience might be great or terrible. Some people are staffed on extremely mundane projects dealing with Oracle, SAP or other kind of software packages, while others are staffed on interesting & creative projects. \n\nThe culture at Deloitte is very go-getting. If you put the effort in to put yourself out there you will be able to pickup cool side projects (PRD) and network with a lot of people. Be careful not to overextend yourself as it is easy to fall into working 9-11 hours a day. \nThere is a tiny bit of a fraternal culture at Deloitte, but it\'s relatively under-the-table (and they are doing a lot of work on diversity programs etc), but it does exist to some degree. Other than that, the people are generally really cool and down to earth. \n\nIt\'s important to note that as an organization Deloitte is a consulting firm first and a technology firm second. ',3500,'CAD','monthly',3.0,3.0,3.0,2.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhg00gj01jve9xx9trx','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','This was my first co-op, so I\'m grateful to have had the chance to work for a startup that did some really cool things with security, data mining, and machine learning. That said, despite receiving an offer for software development, I was placed on the QA team where I was far removed from the core software product and big data algorithms. My manager was not a coder and I did not receive the technical mentorship I needed. As a result I felt that my growth as a student there was very limited.\nThat said, Interset is still a solid company to work for provided you\'re placed in the right team to make an impact. The office is in Kanata which can be quite dull as there\'s not that many lunch options nearby and the whole area lacks the youthful vibrancy of other tech communities. ',3340,'CAD','monthly',3.0,2.0,2.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhg00gk01jvfo6h14ob','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Summer 2017 (May - Aug)\nHighlight: They really care about your mentorship and you as a person in all aspects!\n\nI worked on the iOS team without any previous experience in mobile at all, and everyone I spoke to made it very clear that doing something that you don\'t have experience in is completely and totally fine - and actually encouraged. In theory a lot of companies do the same, but in practice very few actually do that. Each person I spoke to have some crazy background story, like they were homeless for a few months and then biked across the USA for charity or studied food tasting science and then decided to go into data science. That made being there really interesting, and the company tries to be very transparent and very human all around. The perks and compensation were also top-tier with a culinary team that is part of the company for the sole purpose of making healthy yet delicious food for the employees. There used to be corporate housing until they decided that interns get taxed a lot because of this, and just added it to the salary instead so now they just help you extensively look for housing.\n\n',9166,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhg00gl01jv4x1thgg9','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I was a developer in my second year at PointClickCare. Pay was okay (above engineering average but not by much). Culture at PointClickCare was very good. Big open office, subsidized meals, free on-site gym, lots of recreational activities.',22,'CAD','hourly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhg00gm01jvfq1yd5js','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Worked there Spring term of 2017. The company is growing extremely quickly and hiring lots of people, so it\'s a bit of a chaotic workplace. Things were beginning to improve by the time I left but still not what I consider great. Work itself was okay, not very challenging; none of the teams they hire interns for deal with very interesting technical problems. \n\nPeople are all very friendly and chill. Lots of food, drinks and snacks. Free lunch, and usually there\'s leftovers you can save for dinner. They have ping pong, foosball, Wii U and PS4. ',25,'CAD','hourly',3.0,3.0,3.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhg00gn01jv9fjqdh01','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Mainly did web development. Small office, very small team, very low pay.',2400,'CAD','monthly',2.0,1.0,2.0,2.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhg00go01jvguld0u8a','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Working at Encircle was a great co-op experience. I worked with the server, front-end, and mobile code even when I didn\'t have a ton of experience in those areas. All of my code was code-reviewed so I was able to improve my programming abilities. Additionally, productivity is measured by the tasks you finish rather than the time spent. This is not only a more sensible method of measurement, but it improves motivation to finish tasks, and allows for more flexible work hours. The entire team was very friendly and approachable. I would highly recommend working at Encircle if you want to learn a lot.',1100,'CAD','weekly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhg00gp01jvebe5210b','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked there as part of the first batch of uWaterloo interns hired by Zuora in the summer of 2017.  The work I was given was meaningful and challenging.  The company itself is growing very fast but still maintains a very personable startup culture, which is definitely unique even in the valley.  The snack bar is amazing as well as the catered lunches every now and then. The one con I will say though is that the pay is not very competitive and there is no financial assistance for relocation or housing.  This might be partly due to inexperience in hiring students from Canada, so hopefully that will change in the future.  Overall a very enjoyable internship!',30,'USD','hourly',4.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhg00gq01jvd1fx25zy','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Had a wonderful experience at Magmic -- the team was small but everyone knew and were comfortable with each other. I worked on really meaningful projects while I was there -- like their server that handled hundreds of thousands of users.\nMy Supervisor was amazing as well and went out of his way to help and teach me along the way when I needed it while still allowing me to be independent and learn/implement things on my own.\n',2800,'CAD','monthly',4.0,5.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhg00gr01jvhdx56mju','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Worked as a Data Scientist in the Consulting division.  Got to work under an incredibly smart supervisor, however much of the work revolved around Business Intelligence and building client dashboards.  Culture is weak, as people vanish for weeks at a time at client sites and little mentorship as people are working on 3-5 projects at a time.  PwC does offer classes to improve skills which is extremely good for a co-op. Opportunities to work from home, typical 9-5 with flexible hours',4125,'CAD','monthly',3.0,3.0,2.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhg00gs01jvfzt2h5mh','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','A co-op farm.  No valuable experience is gained from the internship.  If you are a co-op student at uWaterloo, I strongly recommend to not rank this job.  All day is spent reviewing tax forms from farmers. DO NOT PROCEED',2025,'CAD','monthly',1.0,1.0,1.0,2.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhg00gt01jv9bdg0lbq','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Interned during the summer of 2017. I was on the Google Help/Feedback mobile team (iOS) and had two semi-independent projects throughout my term, both of them fully launched! I also got to do a large amount of backend development despite being hired as an iOS developer. The office culture was very laid back, and my host/team was very helpful during the entire internship. Not included in the salary is a $9000 relocation bonus at the start of the internship.',6667,'USD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhg00gu01jv46hn9p3d','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','It was alright overall, but the product is kinda boring and Hootsuite doesn\'t seem to be doing anything very interesting tech-wise. The people were nice and supportive tho. Good for your first three coops maybe. Also they kinda cheap out with housing stipend and salary.',4000,'CAD','monthly',4.0,4.0,2.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhg00gv01jv0s3ubanm','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Great company with a fantastic environment to learn and grow as an engineer. I was given opportunities to work on high impact projects and the culture there was amazing.',35,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhg00gw01jv8brrautv','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','I worked at Linamar in Fall 2016. My position there was really an entry level mechanical design and manufacturing position. Although the pay was extremely low (16.67/hr), the experience I got from the position really improved my co-op career. In my position, I started off with some menial officework (documentation and other paperwork), and in the 2nd month started drafting work in Solidworks. The first two months were really boring, but the exposure to Solidworks was a good formative experience. After this, I started doing far more interesting work, which involved designing fixtures for CNC machines, which included figuring out what the purpose of each part was, actually designing them, and then getting quotes for the parts and having it made. This portion of the job was a great experience and gave exposure to both the technical and business sides of things. In my opinion, YMMV depending on which facility you are in, but it does seem that this co-op position provides some good opportunity if you\'re willing to put some effort in. Be aware that the position is  fast paced since it is a manufacturing environment, and pretty much means you must be there from 8-5, no exceptions.',17,'CAD','monthly',4.0,4.0,3.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhh00gx01jvft3538d9','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','I was at ATS in Summer 2017, and I found it to be a worthwhile co-op. The position gave me great exposure to Solidworks modelling practices as well as good experience in mechanical design, including dimensional tolerancing and weld specification. Towards the end of my term, I was able to do some interesting static FEA work on weldments, which was certainly the highlight of my term. In my particular position, I felt that I was not given much design work until the 3rd month of the placement, which was unfortunate, but this may be different depending on the work the company has at the tine of a placement. As for the company itself, there is a cafeteria in each building with reasonably priced meals (~$7 for lunch), but no amazing perks. They do give free ice cream every payday (biweekly) and basically everyone goes for a 15min walk in the morning and afternoon around the buildings, which are a nice break from work. People are nice and hours are fairly flexible. Wish they had better coffee though lol. This is a great intermediate-senior mechanical design position, and if you pursue it,  try to ask for more and more technical work, because the company has a lot of opportunity for co-ops in that regard, if your manager is willing to give that to you.',23,'CAD','monthly',4.0,4.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhh00gy01jvf7150gdv','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Worked as a front-end developer intern for Fall 2017. The people and environment are really nice and I had a great term here. You get treated like a full time member of the team rather than an intern. Nice office, catered lunches mon-thurs',30,'CAD','hourly',4.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhh00gz01jv4s4rh5yd','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Did my second co-op here and overall it was pretty alright. Learned a lot of Angular and TypeScript so that\'s great. I just felt like my team lead wasn\'t very interested in helping/dealing with the interns. Maybe I\'m reading too much into it but he always seemed irritated when I asked questions and gave very vague answers so I ended up mostly working on my own. The work was interesting though so 3/5 would recommend.',19,'CAD','hourly',3.0,2.0,3.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhh00h001jvh1gtdisx','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','I did my first coop here so for a starting position it was really good. Got to play around with new technologies and the work wasn\'t stressful. My team was 4 people with one other coop and the manager didn\'t program so there was a lot of confusion to start. I feel like I didn\'t get good mentorship/support but everyone was super friendly and I figured stuff out on my own so it all worked out alright in the end.',19,'CAD','hourly',3.0,2.0,2.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhh00h101jv3jjh6q8a','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Was a part of the \"Innovation Team,\" your experience may be different for other teams. Basically just a team of co-ops. Worked on a bunch of different projects mostly for internal use, nothing user-facing. Pushed most things directly to dev, no code review or QA, no mentorship. ',21,'CAD','hourly',2.0,1.0,2.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhh00h201jv8h7pcfl7','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Great co-op culture, there\'s a good portion of co-op students who are not from Waterloo. \n\nOne of the downsides of working here is that most of the work involves a lot of coding and scripting. I had to be proactive and ask for electrical related work.',982,'CAD','monthly',4.0,4.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhh00h301jv42ygclvc','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Connected Lab is a gem in the Toronto tech scene.  Although it\'s still really young, the company has partnerships with some of the top tech companies in the industry, and it\'s super cool getting to work on these products.  It\'s worth mentioning that the company really believes in pair programming - it definitely has its pros and cons (mentorship with full times and great learning opportunity but more tiring).  Overall it was an amazing internship and I definitely recommend it!',20,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhh00h401jvaj3gfywg','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Really great work environment (can only speak for the Core team), and awesome people to work with. But as expected, the actually work of manual testing wasn\'t that great. ',17,'CAD','hourly',4.0,4.0,2.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhh00h501jv7sdncip5','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Worked with one department on one project for the duration of the co-op term. Was provided a lot of independence in my roles & responsibilities, with many degrees of freedom in my research. ',3246,'CAD','monthly',3.0,1.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhh00h601jv04tg8j29','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Extremely fun and meaningful work.\nWorked at Cardiogram when there was only 4 fulltimes.\nYou get to work on everything and anything that fulltimes work on. The team and cofounders are extremely talented and approachable.\nFood is great, usually restaurant food, or Uber eats and awesome drinks and snacks.',8250,'USD','monthly',5.0,4.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhh00h701jv55vuhp6c','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Honestly, it wasn\'t the most exciting work. They did offer a one time relocation stipend to help with moving.',23,'CAD','hourly',3.0,4.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhi00h801jvh63uee5l','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459550,'ck1n1du49000501jo4pwygsav','Product is extremely dumb and it\'s hard to be motivated working for it. Codebase is decade old and most of it is using ancient technologies; you\'re basically given grunt work that\'s left in the backburner. Company morale is low and turnover rate is high. Pay is alright, but it\'s one of the few things going for it. Co-workers are nice, however, and generally resourceful. ',4400,'CAD','monthly',2.0,3.0,1.0,2.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhi00h901jv4tcn6qd1','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Hard work, challenging project. Rewarding + Great Mentorships',10000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhi00ha01jv2vma3n06','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Great team atmosphere, get to work on meaningful projects.',18,'CAD','hourly',5.0,4.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhi00hb01jv70rtaeh9','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Pros:\n  - Interesting work and projects that you can take complete control over\n  - Projects are big in scope but move quickly so you work on multiple per term\n  - The ability to experiment and try out new tech if there\'s a use case for it (e.g. Elastic Search, Redis, Rust, etc...)\n  - Ping pong, Foosball and a Basketball Court as well as a culture that actually lets you use them during the day\n  - Pretty sick looking workspace\n  - Free shirt and sometimes free food in the cafeteria\n\nCons:\n  - Sometimes head office process\' gets in the way and this can either affect the velocity of a project or forces you to get creative to solve otherwise very simple problems \n  - Not very Agile (if you\'re in to that)\n  - Most of the tasks and projects involve very standard solutions. (i.e. you won\'t need a lot of well defined algorithms in the application you build)\n\nOverall I really enjoyed this work term. It allowed me to become proficient with Node.js, React and Azure as well as giving me exposure to things like Blob Storage, Redis and elastic search. With the excellent management it really is an amazing choice.',4400,'CAD','monthly',4.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhi00hc01jvcszb8gpf','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','...',3200,'CAD','monthly',3.0,3.0,3.0,2.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhi00hd01jv0iyoajix','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','They gave me an interesting and impactful project and all the resources to get it done. In hindsight I\'d rather have worked on something else but they did everything they could to accommodate me. I never felt pressured by any deadlines and my coworkers were all super nice.\n\nYou get free dinner every day and free lunch on Wednesdays. They also paid for flights to-and-from Waterloo.\n\n',7500,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhi00he01jv8pn7dfkg','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','do NOT work here.\n\nFirst of all, they pressure you to come to work early and stay late. On the contract and in the interviews, they say that it\'s a 9-5 job, but realistically, it\'s at least 8:30-6:30. To give you an idea, one of the coops left at 5:30 in the first week and got called out by the CEO who happened to be by the door. We weren\'t even doing anything that first week other than some warmup coding exercises. Needless to say, no one wanted to be the first to leave, resulting in sad kids staying WAY past their designated hours because they\'re all pressured to stay and pressured to not look bad for the next four grueling months.\n\nAdditionally, the office is tiny. Smaller than a classroom on the 4th floor of MC. It\'s as big as a 3-bedroom suite that you would find off-campus, and imagine fitting in ~20+ employees (including co-ops). The kitchen is also small enough that it\'s literally a fridge, a sink and a counter that fits a microwave on top. You would literally be unable to fit 3 people in the kitchen all together at one point in time. There are absolutely no perks and you are expected to work during weekends too. The only thing that the office spent their money on was probably their blinds. No amount of sunlight got in the office and added to the depressing atmosphere.\n\nFurthermore, they say that they pay the average amount according to CECA numbers. But that is for a 37.5 hour work week. They pay you biweekly, so doing the math with the hours that I had stated above, you would be earning < 15/hr for work that should be worth more based on how badly the company needs it. Their product is just starting to get off the ground and it will be hell for people working here in Winter/Spring 2018. (read, stay past 6:30)\n\nSo in conclusion, do NOT come here unless you are ABSOLUTELY desperate. They hired 7 software interns and their fulltime team has 2 backend developers and 1 front-end developer. The coops had to code a majority of their backend, so you can imagine how fun it\'ll be to work with that. Already by the first few weeks, us group of coops were all regretting taking this offer, because literally any other company would at least let you leave before 6:30pm without feeling guilty.',1400,'CAD','monthly',1.0,1.0,1.0,1.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhi00hf01jvextg8tlr','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','$200 for bike, $100 /month for other housing\n$1800 per month for housing,\ncan work lot of overtime if you want/manager approves.',37,'USD','hourly',4.0,3.0,3.0,2.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhi00hg01jvanzi5w3v','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Technically is supposed to be ~$6500 per month but they make you work lot of overtime and you rack up those hours (~$8000)',40,'USD','hourly',5.0,4.0,5.0,1.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhi00hh01jv5gb5gotw','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Company culture is great. There are 4 co-ops (2 fullstack, 1 mobile, 1 designer) each term. You get to take complete ownership with other co-ops and build projects from the ground up and learn pretty much whatever tech you want.\n\nThe pay is fixed at $1100 which is a really good opportunities for lower years to earn more.',4400,'CAD','monthly',5.0,1.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhi00hi01jvh0ke6667','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Typical startup company, where everyone is pretty much expected to work 40+ hours/week to meet deadlines. Great company culture, had a great time being able to get to know everyone. Also were happy to help me with anything.',728,'CAD','weekly',4.0,5.0,4.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhi00hj01jv7xfx6975','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Working at Communitech is great. It\'s probably been the most enjoyable co-op term in terms of the environment. Being the only mobile developer, you\'re kind of alone which could be both a good and bad thing. If you\'ve done any sort mobile development before and you\'re comfortable holding your own then you get to take full control of the mobile projects. On the other hand, there isn\'t too much mentorship on the mobile side.\n\nWe had more web apps to work on in my term so I learned a great deal about web development which was great. This openness is not just for the mobile developer but we had a full-stack developer work on an Android project so there is lots of freedom to work with technologies you\'re interested in learning about.\n\nThe worst part about the work is that sometimes it gets slow between projects but a lot of it is because head office slows things down and the work in the pipeline can get changed.\n\nOverall, the culture is amazing and every innovation lab should strive to have this culture and it seems you get paid more here than other companies around Communitech so it\'s a great place to work.',4400,'CAD','monthly',4.0,2.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhi00hk01jvdrwl8rb1','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','It largely depends on your team but my work was not very interesting. My team had very little guidance and mostly consisted of 16 month interns from other schools. We were actually entirely trained by the previous year\'s interns during a 4 month overlap, we rarely saw a full time employee on our team.',850,'CAD','weekly',2.0,2.0,2.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhi00hl01jv3p5v0ioa','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','I worked at Uber during Fall \'17. I thoroughly enjoyed my time there. I went to Uber as I had consistently heard from previous interns that they got really impactful projects. I was not disappointed - I could actually show off my work to my friends and family! There have been a lot of changes since some of the negative press that the company has received. Under the new leadership, the company is on an upward trend. Also, dinners are at 7pm now. ',46,'USD','hourly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhi00hm01jv9hfe35m6','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Symbility is an agency that works on strategy, design, and development projects for clients such as the LCBO.\n\nLots of smart people that you\'ll learn great things from.',920,'CAD','weekly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhi00hn01jvdt98edz3','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','plenty of voluntary overtime work. experience is worth it.\nhaving beach is nice, great manager.',24655,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhi00ho01jvhkjxf9rx','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','My internship with Interset was great thanks to fantastic mentorship and challenging/interesting work there. I\'ve had the opportunity to work on high impact tasks \n and build up a set of skills in the area of my interest. The company culture was a 10/10 with flexible work hours/team bonding events/etc.',21,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhi00hp01jv03cm51b2','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Pros: Good culture, socials are fun on Fridays, interns are treated as full times with similar responsibilities. Pair programming is practiced rigorously which may be a pro/con depending on the type of person you are.\n\nCons: Low pay, long hours (9-6 not including overtime which is unpaid but isn\'t too common). Also, depending on your project (can very greatly), may be stuck with something boring for many weeks/months.',2800,'CAD','monthly',3.0,3.0,4.0,2.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhi00hq01jvfb58ap5w','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Interned with Yahoo Finance. Great mentorship, learned a lot of new technologies and given impactful projects featured on the homepage. Manager was very involved with making sure I was working on things I found interesting and overall had a great time with great perks. Corporate culture could be improved - team was a bit boring but all in all a fantastic learning experience.',41,'USD','hourly',4.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhi00hr01jva24m4ys8','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Good for earlier coops.',4400,'CAD','monthly',4.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhi00hs01jv87qf47u9','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','I had great mentorship and social experience at the company. I feel that the work could be more meaningful (I didn\'t get into the team I wanted), so that could be the reason I found the work somewhat lacking.',7500,'USD','monthly',4.0,5.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhi00ht01jv16lrb8ii','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Worked there in Fall 2017. Environment was super hyped and everyone is happy to help you with anything. Company covers your moving cost, and half of your housing. Catered breakfast and lunch are provided, and they are indeed fascinating and tasty.\nGood:\n  - You\'ll be assigned with a mentor, and usually have a weekly checkup.\n  - Intern retreats, and sometimes team offsite.\n  - Good working environment where you can make a lot of friends in your field.\n  - Pay is good.\n\nEhhh:\n  - Ottawa is just not for me, I felt kind of bored. But with all the interns it was not that bad.\n  - I joined in a special time when everyone is pressured with releasing date. Do expect some overtime.',5200,'CAD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhi00hu01jv2pxw71k7','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Worked at Innovation team in 2017 which you probably will build prototypes. If you\'re lucky you might stick with one project for the whole term.\nPros:\n- People are really helpful when you have questions for them.\n- Took a super interesting project that term. Built it from scratch, and learned lots of stuff.\n- Work env is very chill. There was no rushing and fast due dates, as long as you take your time learning stuff.\n- Able to get in touch with lots of new-born technologies, and learn from scratch how things work.\nCons:\n- Mentorship is not good. Supervisor did know lots of stuff but there\'s no regular checkup, nor code review, which is super important for your learning. Not sure if they changed it or not.\n- Internal technologies were old, and lots of things need to be changed and improved. Hard to get started due to lack of documentations.\n- Location is not bad but also not good. Looking for food is kind of hard even compared with Waterloo (at least there\'s plaza for us). Also they don\'t have free pop... :(\n\nOverall, a really nice place for the first couple coop terms!',3300,'CAD','monthly',4.0,3.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhi00hv01jv4aye2uvu','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','While a solid tech company to work for overall, your experience at Shopify is largely dependent on which team you\'re placed on. Shopify is also a great launchpad is you\'re looking to coop in the states next.',4800,'CAD','monthly',3.0,1.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhi00hw01jvctrw4emh','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Hubdoc is an amazing start-up to work for in your earlier coops. A talented and hardworking group of people make it a very enjoyable and exciting place to work for. Everyone is super nice and you\'ll learn a lot during your coop term, as well as provide significant, tangible impact to the company. Would 100% recommend to anyone looking to work in a startup environment!\n\nPerks: Lots of free snacks and drinks, catered lunches once a while, team outings\n\nCons: They pay a bit above the Waterloo coop salary average, no commuter pass. The work, while meaningful, can get repetitive after some time.',21,'CAD','hourly',5.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhi00hx01jv8r8xgdao','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','I did a lot of R&D work with new technologies. The experience you get really depends on your manager/team that you get to work with. There isn\'t a lot of co-op specific stuff; with only one coop event in the whole term (escape room). The work is not really meaningful as you are working to improve their current system.',19,'CAD','hourly',4.0,5.0,2.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhi00hy01jv2p8qcffn','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Fun start-up like culture at zero gravity labs. A lot of the internship has to do with using new technologies to explore possible implementations. There\'s a lot of free food and co-op events. They also give you 20% time to work on any side-project. You also get a lot of perks like Uber, Netflix and ritual credits. \nThe salary is standardized for waterloo coops regardless of term. (Unless you\'re a master\'s student)',26,'CAD','hourly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhi00hz01jv32ew1j3x','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Took a position in the Institutional Relationship Management desk of BMO Capital Markets. Work was not meaningful and offered neither new opportunities to learn new tools/skills or interesting problem solving.\n\nThis only reflects placements on \"Institutional Relationship Management\" specifically, and shouldn\'t count against any other positions offered by Capital Markets.',6600,'CAD','monthly',1.0,1.0,1.0,2.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhi00i001jv5thpeccb','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Worked there from sept to dec of 2017. Great company to work at! I worked on full stack development for one of Nvidia\'s internal platform. I included the $2250 monthly housing stipend to the salary. The mentor is very willing to help and the general culture in very positive. Nvidia provides subsidized food, so that was pretty good. I would highly recommend this job to anyone!',8450,'USD','monthly',4.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhi00i101jvfmgn0s4d','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Worked there from sept to dec of 2017. Great company to work at! I worked on full stack development for one of Nvidia\'s internal platform. I included the $2250 monthly housing stipend to the salary. The mentor is very willing to help and the general culture in very positive. Nvidia provides subsidized food, so that was pretty good. I would highly recommend this job to anyone!',8450,'USD','monthly',5.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhi00i201jvezyieytt','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I was working at Salesforce at Fall 2017. Overall, the internship experience is awesome. There are lots of intern only events. The corporate housing is wonderful, large and clean.  And it is 10 minutes walk to the office, right in the downtown of Bellevue. There are gyms downstair and gym at your apartment. You got 100 dollar every month for your well being and you got to participate lots of VTO events.  My manager gave me a lots of freedom to choose the project I would like to work on. My mentor is super helpful with scoping the project. Would recommend this internship to anyone.',44,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhi00i301jv226tansf','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked at Veeva for my first co-op in Fall 2017. I had a really positive experience here. There are some very cool, meaningful projects to work on, and interns are treated very much like full timers. \n\nPeople at the office were generally friendly and approachable. Even though there was often ample work to be done, the work atmosphere was still quite relaxed and not stressful. Throughout the term, there were also events for interns. \n\nMy only complaint was that the salary was a bit low compared to other similar jobs (although I heard that they were increasing it after I left).',3000,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhj00i401jvdclh6wg1','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Worked here 4 months in Winter 2018.\n\nInteresting work. You get to work pretty independently, but mentorship is really good and the staff are pretty highly skilled.\n\nPros:\n\n-management was very easy to work with\n-paid overtime at time and a half, of which you can have plenty. (the salary I gave it the straight money/hours worked, I worked pretty standard times for my team)\n-housing stipend of $1300\n-awesome location in midtown\n-breakfast and lunch provided, dinner as well past 6:30\n-very interesting technical problems in software and hardware\n-no useless meetings\n-flat company structure, you get to work very autonomously.\n-company outings fairly often.\n\nCons:\n\n-I rated work life balance five stars because you work however much you want, but generally people work longish hours (9-10hr daily). It\'s finance, you get used to it pretty quickly.\n-I\'d say the work is pretty tough, so hopefully you\'re up for it. Not a con so much as a word of warning.\n\nDefinitely would recommend',33,'USD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhj00i501jv4i3efz8u','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','There are definitely some organizational pains that come with a company trying to grow. They were aggressively hiring full-time employees when I worked there for both the San Francisco and Waterloo offices, as there was an extra signing bonus for new employees going on. However, at least 5 full-time employees left the company or were fired in the 4 months I was there, so take that how you will.\n\nMost of their old monolithic application is still written in PHP, with most of the newer services written in Ruby on Rails and Golang. Mobile applications are written in Java (Android) and Objective C (iOS), although they’re planning on rewriting in Swift at some point. Some custom firmware and other things are written in C, although for the most part this is legacy or pretty stable and doesn\'t really need to be touched. Web stack was pretty standard. Git is used for version control. CI builds run on most of the important repositories, and backend deploys daily.\n\nI worked alongside full-times mostly on backend (although I did fix a few CSS bugs and worked a bit on Android, iOS, and the ops side of things). You\'ll probably ship your first PR within the first 1-2 days. They have some smart Senior developers and ops-guys (and ex-Big 4 UI/UX designers) who know what they\'re doing. Unfortunately, most people have only been at the company for about 2 years, and are probably out of their element in many problems you\'ll encounter. iOS guys are generally good considering they’re all senior, and there’s a few who know Android really well.\n\nThere\'s a bi-weekly Town Hall where Finances, company updates, and product direction are discussed. User metrics are always available to everyone. This flat organizational layout means that things can get bumped up the priority list if \"higher-ups\" see a bug, and they will demand that it get fixed ASAP (usually via hot-fix the day of). Some of the business decisions regarding product direction are questionable, yet nobody seems to say anything about it. However, most people are pretty chill, and lots of people hang out by the corner outside to smoke/vape or talk about games/anime/sports on Slack.\n\nA lot of the full-time employees worked 45+ hour work weeks. As a co-op, I didn\'t really have to deal with that, and pretty much worked 35 hours/week on average, as long as I got the work done. My manager and mentor regularly checked in with me, and they understand that you\'re probably there to get experience and care about your career goals. With that said, your experience will likely vary depending on your team lead, and it’s definitely not the case across all teams. According to the last co-op here, unless you put in like 50+ hours a week and implement features off the backlog “for fun”, you probably won’t be getting an Outstanding.\n\nThey do have some nice perks, including unlimited vacation days. There’s the typical tech company benefits with monthly social events, flex hours, free swag, a Christmas party, trips if the company meets their OKRs, foosball table, free pop, beer on tap (usually some craft beer), onsite massages every month, onsite gym and trainer, free snacks, 3 meals (restaurants are on a 3-4 week rotation). The food rotation is pretty sweet, and pretty much everyone goes for lunch as clockwork, which is nice. If you stay late, there usually is a dinner food order going on.',1200,'CAD','weekly',4.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhj00i601jv4orv1qmk','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','The experience is very team dependent here. For people working on high-profile teams like AutoPilot, which is essentially its own organization, the hours are pretty intense and there’s a lot of pressure to deliver. And when there’s a deadline approaching (like Model 3 launch), there might be some pressure there. I know one of the interns working on critical components of Model 3 was putting in upwards of 70 hours per week.\n\nThe pay isn’t the greatest in the Bay area, but you’re eligible for overtime, so most interns end up working an extra few hours here and there. Some managers aren’t about that life though, and one of my friend’s managers told him to stop working so much overtime (he was only working 3-4 hours extra per week). They’re pretty chill about hours though, and taking time off to go explore California.\n\nThere’s a few intern events that go on throughout the term, and at least one off-site event. \n\nAt DC, there’s free cereal (Happy Shapes, Crisp Rice, Raisin Bran, Corn Flakes) and drinks (soft drinks, coffee, orange juice, regular/almond/coconut milk). Some of the new offices have different cereal flavours or new drinks. There’s lunch and dinner from Rebecca Jean’s Catering that comes to around $7-12 per meal, depending on what you get. There’s also vending machines that sell food and a salad bar if you’re into that. Food trucks come by at lunchtime.\n\nOrientation happens at Fremont, regardless of whether you’re working at Fremont or DC (not too sure what happens with Gigafactory interns or Design interns). You’re supposed to have weekly 1-on-1 meetings with your mentor to go over how you’re progressing, but some totally ignore it. There’s a midterm and final evaluation that Tesla does as part of their internship program, which is available to other managers if you’re returning.\n\nCulture-wise, I’d say it’s fairly open. I found out about new products and direction pretty easily, although they’re trying to make that harder. Some projects have been becoming more secretive, which people are unhappy about.\n\nI ended up working on stuff that was actually going into the cars, and learned a lot from my mentor and the people on my team. DC is an open concept office, so most people are pretty approachable (unless you’re in the labs downstairs). I finished my project pretty quickly, and then my mentor seemed to use that to gauge my abilities to assign more interesting work afterwards. Other interns barely finished a single project, and their evaluations reflected that. Overall, I’d say the internship is what you make out of it, and if they realize that you’re doing good work, they’ll give you more interesting work to do. Some of the new hires’ abilities seem suspect, but the Senior and Staff Engineers (at least the ones I interacted with) definitely know what they’re doing.\n\nTesla uses the TN visa, so they’ll probably have you fly through YVR. A lot of full-times are Canadians! They’ll cover round trip flights and provide a $2,000 relocation bonus (after tax), and will reimburse the visa fees. Returning interns get a $1 raise which I’m not sure is negotiable, but everyone I’ve talked to wasn’t able to negotiate anything higher. This includes 8-month co-op terms. There’s the standard tech company perks like a table-tennis table, etc. There\'s a small on-site gym, and you\'re eligible for a Wageworks card that gives you $120 for UberPool/Clipper Card per month. There\'s also biking benefits, which nets you $5 each day you bike to work.',28,'USD','hourly',4.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhj00i701jv17m44cve','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459551,'ck1n1du49000501jo4pwygsav','Great workplace environment and culture. People are very friendly and you get complete ownership of a feature. Highly recommended',6500,'CAD','monthly',4.0,4.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhj00i801jv1vz9hzmc','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked there W2017. Terrible experience all around.\n\nPros\nThe developers know what they are doing\nThe tech they use is modern\n\nCons\nPretty much everything else\n\nCompany Culture\nThe company culture at Bespoke is the worst culture I have seen in a company. The full-timers are a close-knit group. They frequently make insulting remarks towards the interns and this behaviour is enabled by the group and CEO. People at the company do not understand proper workplace conduct. They are aware of this, and joke that they need HR but make no attempt to correct their behaviour.\n\nWork-Life balance\nInterns are urged to stay late, even though this is a 9 to 5 job. The CEO makes passive aggressive remarks when you leave early. This occurs even if there is no work. For a start up, it is normal to stay late and work hard, but the company culture was so terrible that no one bothered. Pro-tip, if you want interns to stay late, the trick is to make them want to stay late instead of shaming them into doing it.\n\nWork Content\nInterns often didn\'t have any work to do. On the team I was on, there was four interns being managed by one full-timer. He struggled to give any meaningful work to us. Often, there was no work in the backlog so we were assigned to write tests for code that he wrote. This was a failure of both management and the full-timers. The management has to ensure that there is always features that need to be developed and deployed and it is the full-timers responsibility to constantly update the backlog. None of this was done effectively. \n\nThe CEO\nMichael promotes this toxic company culture. He makes racist remarks, acts like an asshole and seems proud of the fact that no one can call out his behaviour. He has an astounding lack of self-awareness. He told the interns about the time he was working at a company and they told him to do HR training and he told them to fuck off. He also told a story about how he was competing with another white guy for a high ranking position at a company, he got in a competition with him and won, but did not get the position. He blamed it on the fact that the company management was racist. You don\'t think the two stories are related? I think it is likely that they didn\'t give him the position because he is a toxic, racist jerk that doesn\'t know how to interact with the people working under him.\n\nIn summary, the work is good and meaningful (when you get it). The company culture is terrible. The CEO is terrible. If you have another job on Waterloo Works, take that job instead.\n',2200,'CAD','monthly',1.0,2.0,2.0,1.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhj00i901jv6gqy1m90','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Great experience - friendly coworkers, well built tech, and gave a lot of freedom.',8500,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhj00ia01jvgvxe9l4g','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Working at D2L was for my third work term and I could not ask for a better internship. My mentor was very passionate about explaining stuffs and providing technical resources. My co-workers were talented, friendly and nerdy developers who motivated me to stay focused and grow. They have pride in their works and care about the quality of codes over the quantity. They follow good practices and use the latest technology to monitor, build and ship their works which helped expanding my skill sets. Work-wise, I sometimes had a bit of too much free time, but most of the time, was occupied on meaningful works. Highly recommended for students in their early co-op career.',3760,'CAD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhj00ib01jv7b6k3x8j','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Great place to work at. Great team. Company culture is great, lots of events. Free snacks / food in the kitchen. Given meaningful work to do, your contributions will noticeably be seen in the product. ',3553,'CAD','monthly',5.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhj00ic01jvdj1rdv4l','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Worked on a new team for one of the company\'s products. Most of the team consisted of new hires, so there was a positive experience of learning along side full-time employees. Mentorship is great, everyone is very helpful and easy to talk to. The atmosphere is positive, with a lot of office events including weekly massages, pizza Mondays, and Yoga. ',28,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhj00id01jv8ewn9oxl','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I had my best internship here for my second last coop term. I worked on the 3D team and had a blast with the team. Since the 3D product is a fairly small team (the company at the time was also fairly small of only 60 people including sales), I got to work on everything from product management to deployments. I learned a lot and the stack they were using was really advanced and modern. As well, we had tons of team events such as cabins, cross country skiing, drinking + video/board games, curling etc. Overall it was a great time!\n\nNote: the food was amazing, definitely better than that of many company in the bay area. As well, the company pays for phone plan, your travel to/from Norway and visa costs.',250,'NOK','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhj00ie01jvga2y0wxm','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked at Capco as a Software Engineering Consultant Intern from January 2018 - April 2018 in the Toronto office. I\'d say that this experience was one of the best work experiences I\'ve had so far. \n\nFrom a technical/educational perspective, I worked with Java Spring on the back end team. When I first started I was given the right resources to get myself set up and familiarised with the code base. My teammates were highly experienced in the field but were also very helpful and approachable. I first started off with some simple tasks, but as time progressed I got assignments that were as important as any other full time developer\'s. One of the best educational advantages was that I had top tier programmers reviewing my PRs and giving comments/suggestions on how to improve my code. There is also plenty of opportunity to work on side projects through out the term. I had the chance to work on one of them and in the process gained practical experience with Angular, Node, and MongoDB. Different projects use different tech stacks, so there\'s room to learn a lot (including Machine Learning).\n\nFrom a non-technical perspective, I met dozens of enthusiastic and laid-back people. Everyone knew how to have fun and understood that work isn\'t all about pushing out code. There was a ping pong table in the area where anyone could set up and play at any time. There were also free refreshments in the kitchen and almost always someone that was willing to sit down and just talk for a bit. Capco is well known for having one of the best work place cultures and after working there I can completely agree.\n\nOverall, working at Capco was great for both learning new things and making great connections. I\'d definitely recommend working there.',4000,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhj00if01jv55sc31x2','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked at Bazaarvoice in Winter. I got a chance to work with some really smart people, do interesting and meaningful work. Company culture is also great with occasional celebrations and lot of team activities. Honestly, I couldn\'t have asked for any better.\n\nSubsidized corporate housing and a subsidized shared rental car is provided with insurance paid for.\n\nAs far as Austin is concerned, its an amazing city with a lot of stuff to do and good food. In winter, the weather is also great and I got to attend SXSW which was pretty awesome.',27,'USD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhj00ig01jvdr95ex0r','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','As for mentorship, people are willing to help but they won\'t babysit you. In other words, you can\'t just wait there and hope someone is going to check in with you every hour. Being in a rapid startup environment (NYC life), I learned the importance of effective communication. I learned how to ask good questions to right people so that I can get things done quickly.\n\nI rated work/life 4/5 balance because the work is so interesting and I ended up working overtime sometimes.\n\nWhat makes Datadog unique is the scale of its engineering team vs the scale of its infrastructure. We are a relatively small team of engineers (<60 people working on the distributed system as of winter 2018) but because of the nature of our product, we are handling a crazy amount of traffic. You are able to work on a huge distributed system in a small team. As an intern, I got to own a service and make a lot of impact.\n\nI really enjoyed working at Datadog and I will consider coming back full-time after I graduate.',45,'USD','hourly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhj00ih01jv8b162la0','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','[Fall 2017] \nI worked at The Coalition, a game studio owned by Microsoft best known for the Gears of War series. They have an office in Downtown Vancouver (15 mins away from \"Big Park,\" the other MSFT office)\n\nWORK:\n\nGame development is hectic and haphazard, and unfortunately, I came in during a particularly busy time for my team. I didn\'t really have a chance to sit down with someone and \"learn the ropes,\" and I was instead thrust head-first into a task and told to \"figure it out.\" \nNow, Unreal Engine 4 is a BEAST, and is not something that easily lends itself to \"self learning.\" Pile-on all of the game-specific things you need to know, getting started in the codebase was incredibly difficult... \n\nRegardless, one of the (few) nice things about the \"diving in head first\" method of learning a codebase is that after you thrash around a bunch, you eventually get pretty good at figuring things out yourself! By then end of the term, I wrote code fairly quickly, and learned a bunch of invaluable skills in terms of navigating my way around a gargantuan C++ codebase.\n\nLIFE:\n\nThis was the real highlight of the internship :D\n\n1) I supremely lucked out with my team. The Audio Team at the coalition were some of the coolest and nicest people i\'ve had the pleasure of working with. They really made the day interesting, and banter was always on-point. DISCLAIMER: i\'ve heard from other interns that other teams were not as good, so YMMV\n2) The Coalition has a super laid-back culture, with free beer and snacks every-other Friday\n3) The intern-group I had was awesome, and made after-work events and weekends a ton of fun\n4) Vancouver is a really awesome place to live. There is a ton to do, both within the city, and in the surrounding cities. There are lots of really cool hikes (if you\'re into that!)\n\nMISC:\n\n- Microsoft doesn\'t set you up with housing, which is annoying :( I was lucky enough to live with a friend from Vancouver, so his parents scouted out the place first, but otherwise you\'d have to go in blind\n- Housing is bloody expensive in downtown (I paid 1500/mo for a queen-size bed in a closet)\n- The 5800 salary = 4400/mo base + 5000/term housing stipend + misc bonus monies\n\nTL;DR: It was a pretty good time!\n\nLearned a lot, and had a lot of fun doing it.\n8.5/10 would intern again.',5800,'CAD','monthly',5.0,1.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhj00ii01jvcm1zbsnp','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','The people were really nice and the work life balance was relaxed. Work seemed pretty menial at times, and you\'ll work with offshore doing similar tasks as them. Management is pretty absent starting from regular engineering managers who came to work twice a week to a senior director who showed up to the office once in the 4 months I was here. Given that key employees rarely show up, it follows that mentorship was pretty lacking in all aspects. \n\nThey company has a high engineer turnover rate, and I feel like that kinda contributed to a slightly negative atmosphere. With that being said, everyone was super friendly and welcoming, which is why I\'m giving it a 3/5 overall instead of something lower.',6200,'USD','monthly',3.0,2.0,2.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhj00ij01jv8wc303x1','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Had a nice term at Yahoo. Great perks and nice people. Learn a lot. ',41,'USD','monthly',5.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhj00ik01jv2iqv9clk','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Really smart people working on technical problems.',10300,'USD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhj00il01jvdxnsbl18','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','YIP (Yelp Intern Program) is awesome and their dedicated team for handling interns is the best I\'ve come across. They host weekly events that allow you to really get to know the other interns and explore San Francisco which is honestly a major plus.\n\nThat being said, the work depends on what team you end up on and what projects are available. I personally did not get much mentorship and worked independently on an intern project for most of the term which does not give me a good feel of what it is like to be a full-time at Yelp. However, some of the other interns had good experiences and caring mentors, so that is not to say you will not find any meaningful work.\n\nCulture-wise, Yelp is great and all the people I met and interacted with were friendly and made me feel welcome. The people at Yelp are what makes working at Yelp awesome in my opinion.\n\nOverall, I had a great time as an intern and would definitely recommend it for a coop just because of how well run the intern program is!',7360,'USD','monthly',4.0,3.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhj00im01jve0rw8j2d','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Worked @ Quora during Winter 2018 and had the time of my life.\nI was the only intern there, but did not feel like I was given any \"intern treatment\". I was welcomed and treated as a full-time.\nManagers + mentors put a lot of effort into making sure the work you\'re given aligns with your interests and goals, whether that be a long-term project or many shorter-term tasks. I personally preferred full-time tasks over an intern project and was placed on an ML team despite not having any previous practical ML experience. Interns are given real work with huge impact. They put a heavy focus on working efficiently, enabling them to respect work-life balance. You get to learn from, work with, and hang out with insanely smart people - there are social groups for every interest imaginable.\nIn terms of perks, they offer all three meals, a free Caltrain pass, and a housing stipend or provide housing (depending on the term).\nThe company culture is awesome - everyone is excited about the product, extremely welcoming and very approachable. There\'s no doubt you\'ll learn lots and make meaningful contributions.',8250,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhj00in01jverdv8ywp','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked here in 2017. Interns are assigned projects on the infrastructure team that they are responsible for. Each intern is assigned a mentor that is responsible for helping them with their project. The projects were all very useless; the kind where you know it won\'t be in use at all after you leave. Overall, the work was very meaningless and I didn\'t learn much from this experience. The perks were nice though.',9500,'USD','monthly',2.0,2.0,2.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhj00io01jvberg0pov','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Overall, I really enjoyed my time at Uber. I thought that the work I was given was really meaningful and I could see the direct impact it had on my team and the company\'s OKRs. I loved that I was treated just like any other engineer. I was invited to all my team\'s meetings, my thoughts and input were actively sought out, and I got to work with some really smart people both on my team and across the company.\n\nThe bad stuff: Now that Thomas (the old UW recruiter) left for Lyft, the recruiting team is a complete mess. They don\'t seem to care at all about the current interns, most of the recruiters seemed to forget we even existed and they didn\'t even respond to emails. The food is free, but not great. The internship program also doesn\'t seem to be very established even though there\'s a ton of interns, the events were okay but pretty infrequent, and there\'s barely any swag.',7750,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhj00ip01jve4xrgbj7','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','You\'ll never meet a nicer group of people! I pulled tickets from the same backlog as the rest of my team that was meaningful to the company\'s goals. They use the latest tools and have really good software development practices. The one-on-ones with both my mentor and my manager were tremendously valuable as well. The company and intern events were also really fun and made the 4 months an amazing experience.',5750,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhj00iq01jv3z4n6wnb','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','- Best culture out of all the companies I\'ve worked at so far\n- Smart people\n- Encouraged to take risks and try new things to learn',7794,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhj00ir01jv5gyqe7gg','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Really team dependent. I was in a newly formed team so every person on my team had a lot of responsibilities. We were in charge of a lot of things so we learned a lot too. Our team had a start-up culture while being backed by a large corporation like IBM.',4050,'CAD','monthly',4.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhj00is01jv65w075u9','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Worked here in Winter 2018. Originally hired as a mobile developer working on cross-platform (Xamarin), later moved on to an internal project as a full-stack developer. Office culture is a little boring at times but everyone is friendly and open to questions. Lots of smart people in the office, potential for great mentorship depending on project assigned. ',4250,'CAD','monthly',4.0,4.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhk00it01jv1bcc5k8w','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Top Hat was a place to do an internship. They are huge on board games and if you love playing board games, you will fit right in. Everyone on the engineering team is super smart and talented; definitely some of the smartest people I have ever worked with. ',5300,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhk00iu01jvcjw9a987','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Great culture, people are really willing to teach you and let you learn. You\'re able to get involved if you take initiative. Free food all the time and on-site free gym are added benefits. They treat you like a full-time employee.',18,'CAD','hourly',4.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhk00iv01jv9pyydryd','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Really great place to work for an early co-op.\nNice people, meaningful work. Relaxed work environment.\nThe CEOs are really cool people, amazing role models. Lots to learn.\nEveryone is willing to answer any questions you have about software development. It\'s a really great learning environment all around.\n\nOnly real complaint is the pay was pretty low (compared to other software developer co-ops), but seeing as it was an early co-op, the experience was more important than the money for me. Also expected since they are a startup and hire around 13 co-ops per term.\n\nAbsolutely recommend Hubdoc for an early co-op.',18,'CAD','hourly',5.0,4.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhk00iw01jv3skebcbe','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Spring 2018, work was great, join infra teams for meaningful work',7000,'USD','monthly',4.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhk00ix01jv0hex57ro','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','People were nice and good work culture even though it\'s a government office. Many people there are French first.',18,'CAD','hourly',3.0,4.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhk00iy01jvcjskacjz','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Learned a lot about battery chemistry. Since the company is so small ~20 people, the interns can make a pretty big impact. People are friendly.\nManagement can be improved.',19,'CAD','hourly',4.0,4.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhk00iz01jv0lqf33xl','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','- didn\'t find the work that rewarding (doing mainly back-end stuff) because I realized I wasn\'t interested in accounting software\n- my mentor was amazing. very helpful and knowledgeable\n- work atmosphere was very chill and the people here are awesome\n- catered lunches every Thursday\n',5800,'CAD','monthly',3.0,5.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhk00j001jv5lts05bf','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I had a great experience interning at Redfin. The compensation package is pretty standard and fair - housing stipend, relocation bonus and transportation subsidy. There are many incredibly smart people who have worked at other top companies before coming to Redfin. On my team, the work life balance was excellent - I had an extremely good manager who hit the perfect balance between pushing the team to work while giving enough flexibility to allow the team to work. The internship program is fairly well structured and they try their best to provide meaningful mentors, but it does depend a bit on personality types. To me, Redfin is the perfect size for a company - large enough to give comfortable compensation and in house infrastructure, while small enough such there are plenty of opportunities for an intern to impact the larger organization. ',7500,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhk00j101jvc0jz6cug','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I interned at Yelp in Winter 2018. Yelp has a really solid internship program. They really try to give the interns the best experience with weekly events. It helps to have a smaller intern group in the Winter term because you can really get to know everyone.\n\nIn terms of actual work, I mainly got worked on their backend APIs and business logic. Nothing too challenging, but still pretty fun. The mentorship I got from my mentor was exceptional, but this is very team/mentor dependent.\n\nThe culture at Yelp is definitely one of its major perks. Everyone is super nice and chill, no overtime expectations.\n\nThe salary was 8000$/month with a 1500$ monthly stipend.',8000,'USD','monthly',4.0,5.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhk00j201jvfxixbbhs','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','A fun experience, but don\'t expect too much free time as it\'s still a startup. Work hard play hard culture, so you\'ll spend most nights there past 8-9 but there\'s lots of great people there to spend the rest of the night with! Free food is amazing, terrific snacks and great location at Trinity Bellwood\'s! Also great product, would recommend investing!',700,'CAD','weekly',3.0,2.0,5.0,2.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhk00j301jva82fb5z9','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','As mentioned in other reviews, Microsoft is the biggest software company in the world and your internship experience varies drastically depending on what team you are assigned.\nI would like to emphasize the compensation in this review. Microsoft literally makes it rain for interns. For first time Microsoft interns (not explorer), you will get paid $7200 per month (per tax). If you were to return to Microsoft as an intern, your salary will get bumped to $7650 and you will receive a one-time bonus of $5000. On top of the base salary and bonus, you can either choose to live in a corporate housing (hella fancy one, with bi-weekly cleaning service) or a one-time $9000 housing stipend for your 4-month internship. So if you are a returning Microsoft intern, who chooses the $9000 housing stipend, your total compensation for the internship would be close to $45k USD (equivalent $135k annual salary). In addition, Washington state (where Microsoft headquarter resides) does not collect state tax, so you would definitely get more money in your paycheque than your cali friends.\nLast but not least, Microsoft also provides rental car program to interns. Basically, you can rent a car from a Micorosft-partnered car rental company with a subsidized price of ~$700 a month (Insurance and toll included). Having a car is blessed because you don\'t have to wait for the bus / uber everywhere.\nIn conclusion, I am so thankful that Microsoft really takes care of their interns money-wise and I would highly recommend Microsoft if you wanna cash out.',7650,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhk00j401jv9mqk8oyr','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I was hired as a Software Engineer but managed to be placed on the Data Platforms team doing Machine Learning stuff after a quick interview with the Engineering Manager on the team.\n\nMy manager was great at figuring out what kind of skills I want to develop, and then create relevant tasks for me to do based off of that. There\'s always an excess of stuff to do on the Data team; things like building ETLs tasks on Airflow to developing ML models. People from other teams were extremely open for you to book a meeting room and then teaching you all about the stuff they\'re working on, it\'s a great way to develop skills for a specific field if that\'s what you\'re into.\n\nThe on-site gym is not the best, but it gets the job done (no bench press or squat rack, just a smith machine, treadmills, free weights, and some machines). There\'s a lot of variety with the snacks, and drinks. In the lobby, there\'s a $20,000 espresso machine where you could make the best coffee you\'ll ever have (after taking a barista course). Happy hour every Thursday, lots of team outings, workout classes 2 times a week. You get a 1-year cal-train pass which you could use even after your internship is over as long as it\'s within that calendar year. ',8200,'USD','monthly',5.0,4.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhk00j501jv4t24goll','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Pros:\n- great company culture\n- new projects are built with modern tech\n- catered lunches, unlimited snacks and coffee\n\nCons:\n- potentially uninteresting projects (since team assignment is random)\n- certain projects contain legacy perl code + tech debt',23,'CAD','hourly',3.0,3.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhk00j601jv6xe4hhr5','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Great experience',40,'USD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhk00j701jvazch4eit','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Worked at the Autonomous Vehicles team. Super meaningful work. Extremely flexible hours. I literally went to work sometimes at 11:00. You own your project. Best place to work at. If you like C/C++, choose NVIDIA over any other BigN in a heartbeat.',50,'USD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhk00j801jvaghw2sf5','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Definitely one of the best places in Canada to work. Great pay, culture, and development seems pretty well run.\nGreat opportunities for mentorship, but you may need to actively seek it out. Learned a huge amount from the various engineering talks as well as chatting with teammates.',5500,'CAD','monthly',5.0,4.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhk00j901jv6knig0cm','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Best coop I\'ve had to date. Work environment is very chill, the manager at the time (Danny) is an amazing person who truly cares for the coops. It\'s also very informal so you have the ability to discuss things/projects however you want. You get to take on multiple tasks and you get to choose/use as many technologies as you like. By the end of the term you can be an expert in Javascript, Python or whatever you\'ve wanted to become an expert on. The roles are also very flexible. Even though you may be hired in as a fullstack, if you want to do some data science/machine learning on a project, no one will stop you from putting heavy emphasis on machine learning while your team-mates work with the backend etc.. There is low stress on the job so you don\'t have to worry about spending your freetime on any of the projects. The salary ($4400/month) is also pretty good considering the region and the best of all, the office is in the Tannery Communitech hub, full of events and food! WLB is 10/10. \n\n\nOverall 5/5, this is a fantastic coop and I definitely recommend it to everyone in their lower years. You\'ll have a great work environment, superb manager and lots of opportunity to learn.  ',4400,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhk00ja01jv50gp644m','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','OANDA was my second co-op and I definitely learned a ton. I worked on the core application and got to work on a lot of user-facing features and bugs as well as internal networking frameworks. There was a lot of autonomy in terms of how I approached features and was given lots of freedom on the work I wanted to do. Co-workers were super nice and willing to help whenever I approached them. The perks were pretty nice, we had breakfast on Mondays, pizza dinners on Tuesday, lunch on Wednesdays, and snacks and drinks. There were also some events throughout the term in the office. Overall pretty good company and would recommend.',3500,'CAD','monthly',4.0,3.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhk00jb01jvg2d08r95','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','This was my first co-op so I was just happy to be doing any programming. That being said, the applications that I worked on were very internal to RBC and not sure if they were too useful. I mainly worked on UI features, and bug fixes from time to time. There were definitely lots of times where I did not really have anything to do, and I\'d just play games on my laptop or left early. My team was very small, one other co-op (which was nice considering how boring lunches would have been alone), one lead developer, and a project manager who was non-technical really. I\'d say its a decent first co-op, no fancy perks or anything, but there were always events going on since I interned in the summer and they usually had free food and stuff at the events.',2850,'CAD','monthly',3.0,2.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhk00jc01jv0lqce9f5','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Outstanding experience, competitive pay, very smart co-workers + intern cohort. ',11000,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhk00jd01jv1ver3184','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Mentorship really depends on your team. It can be very good or very bad. There seems to be a lot of growing pains with the code base and some of the code is very difficult to work with. There is great work life balance however and you will have time to explore Boston. ',6000,'USD','monthly',3.0,3.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhk00je01jvbc9m0sab','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Docker was a great experience for me. The mentorship was excellent and everyone was eager to help me out with my problems. Great work-life balance, I was allowed to WHF whenever I needed to. Lunch was Monday, Wednesday and Friday with three fully stocked kitchens.',7000,'USD','monthly',4.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhk00jf01jv1oyz0f5f','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','The experience is highly team dependent, and there are a lot of possible teams for interns to work on. Take the mentorship/w-l balance/meaningful work/overall rating with a grain of salt; this is not indicative of the entire company, but rather to my one experience.\n\nSometimes the work gets a little dry and it\'s not the most interesting, but honestly, that\'s what you get when you ask to be treated like a full-time employee; you do everything which includes features, tech debt cleanup, tests, documentation, etc.\n\nThere are some really smart people at the company and they run different groups/workshops (such as a Ruby monthly group and a Frontend monthly group) where they discuss best practices for those technologies and how they\'re used across different teams at Square. Square has a lot of engineers working on open source projects, eg. okHTTP, Ember.js, Decaffeinate, etc. \n\nThere are lots of groups for other activities such as sports groups, different cultural groups, acapella, board games, movies, bubble tea, etc.\n\nIn terms of perks, you\'ll get a housing stipend (depending on term it\'ll be either a $2000 stipend or corporate housing, though corporate housing is extremely rare now). This brings total comp up to around $9000/month.\n\nFor food, breakfast/dinner is completely free. For lunch, you pay $10, and then get it reimbursed on your paycheck (so you have to pay income tax on the reimbursement). After 90 days, interns can elect to receive benefits (eg. medical/vision/dental, health plans, transportation plans) or opt out and get a flat taxable fringe benefit added to your paycheck.',44,'USD','hourly',3.0,3.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhk00jg01jvgmoz94d3','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Was very happy with choosing SAP for my work term as it was definitely a formative experience in the development of my career and skillset.',3699,'CAD','monthly',4.0,3.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhk00jh01jv9fve0tgx','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Pay was not \"competitive\" like they said during the interview. But constant flow of work so you usually aren\'t sitting there bored. Able to do more if you ask.\n\nOnly free coffee, nothing else.',760,'CAD','weekly',3.0,4.0,3.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhk00ji01jv3abz94qm','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Pretty great place to work for in Toronto. Pay is competitive and there\'s also a $2000 signing bonus. Area is kinda hard to get to by TTC since it\'s not super close to downtown, but there\'s lots of good restaurants around. It\'s a dog friendly office, so if that\'s you\'re thing then its a huge plus.\n\nThe management and my mentor was great, and the work was pretty good - but you have to be pretty interested in accounting to enjoy it.  They truly care about your personal development here though. They\'ll be pretty adamant in getting you to voice your opinion on what you want to do/learn, as well they give money to buy books for anything you\'re interested in. Overall an amazing place to work and i\'d highly recommend it.',34,'CAD','hourly',5.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhk00jj01jvekb563w6','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Great company.',42,'USD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhk00jk01jvbuav74rx','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Winter 2018, Salary was $36/hr + $6000 one-time housing.\nWas at Tumblr\'s original office until the last two weeks, when Tumblr moved into the Oath NY building.\nPretty team dependent. My team had 4 engineers, all with PhDs in EE/CS, and I was the only intern. Got to work between 10-10:30, and left at around 5:30, with a ~45min lunch. I still got paid for 8hrs work per day.\nWork was interesting, although there wasn\'t too much to do.',7500,'USD','monthly',4.0,3.0,2.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhk00jl01jvbfx10fl1','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Really enjoyed it!',42,'USD','hourly',5.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhk00jm01jvguu12tpy','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Worked there in my fourth work term. Good environment!',4200,'CAD','monthly',3.0,3.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhk00jn01jvfu7qhwed','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','This my first co-op term. I was doing the automation test at the beginning of the term.  After I finished the automation tests, the manager gave me an interesting project to work on. Overall, it is a great start and I have learn a lot !!!',18,'CAD','hourly',4.0,4.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhk00jo01jv5bwe82ne','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','It is my third coop term. Great work-life balance. Mentorship needs to be improved. Projects are quite challenging. You need to take more initiative to really make an impact.',25,'CAD','hourly',4.0,3.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhk00jp01jvgnuj23ac','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Free coffee, espressos, tea and a subsidized cafeteria. Work was interesting, though not much mentorship. Free beer and other drinks on Thursdays.',4600,'CAD','monthly',4.0,2.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhl00jq01jv15qd2rt5','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Free coffee and tea. Decent mentorship to my surprise--though work was not very meaningful, as expected for a large company.',3600,'CAD','monthly',3.0,4.0,2.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhl00jr01jvc96pekn1','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459550,'ck1n1du49000501jo4pwygsav','Pros\n\n- Coworkers are very friendly, helpful, and knowledgable\n- Comfortable, spacious desk and workspace\n- Company lunches every week\n- Games room, stocked fridge in the break room with drinks + beer\n- Interns are treated like full-time devs. You can expect lots of flexibility, responsibility, and independence\n- Lots of opportunity to learn modern tech\n\nCons\n\n- Management tends to be pretty opaque',27,'CAD','hourly',5.0,4.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhl00js01jvgwb34dz2','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Decent place to work, especially in your early co-ops. Work in T&O, they actually seems to operate pretty separate from the bank and it feels like you\'re working at a tech company. RBC in general is doing a ton of things to adopt tech in as many spaces as they can.\n\nIn terms of the work I got as an Android dev, it was pretty good. Was sitting idle occasionally even when I asked for work. Overall a pretty good place to work.',23,'CAD','hourly',4.0,4.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhl00jt01jv8t0zedc2','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Worked in Enterprise Continuous Delivery back in 2016. The team was cool and the work was good, especially since it was my first co-op term. Worth taking this job, you\'ll definitely learn a lot about continuous integration, which plenty of companies have asked me about since. ',775,'CAD','weekly',4.0,5.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhl00ju01jvhnl297vm','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked as a full-stack developer on an internal tool. I was given a good amount of work, and was treated like a full time employee. My mentor, manager, and senior engineers were great at giving me support.',32,'CAD','hourly',4.0,4.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhl00jv01jvdv8z6vle','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','1. Everyone at Focal has a strong belief for success and this makes them improve themselves all the time.\n2. For internship program, the mentorship is great and the interns grow very fast.\n3. The weekly meeting has many new ideas and inspirations. It also improves the communication skills of new employees.\n4. Great company culture. Work hard play hard. Every one is easy to get along with.\n5. For technical side, they research deeply into papers, classical DL repos. This builds up a solid CV/DL/ML foundation for me and helps me become a much better ML engineer.',30,'USD','hourly',5.0,5.0,5.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhl00jw01jv0q2mfx0n','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Highly dependent on the team. My team was very good and had an interesting project that I worked on. I learned a lot and there are a lot of bright people working there. Gave a one time flight stipend ($750 if you\'re from Waterloo).',4200,'CAD','monthly',5.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhl00jx01jv2nnw95s6','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Working with the mobile team, you get to work on the Dayforce app which is used by millions of people around the world so the work you do has an impact on those millions. As an iOS developer, I learned way more than I expected to learn. The other iOS developers (and even the android and API guys) are incredibly smart and they teach you a lot. Two of the iOS developers work remote so you have to be pretty comfortable using Skype and other communication tools, which also means you have to be able to work well independently. The plus side is they\'re open to you working from home or from another office when you need to.\n\nThe work environment is really relaxed and there are hardly days where you\'re bored out of your mind or you\'re swamped with so much work that you have to work weekends. So the work/life balance is fantastic.\n\nThe work environment is also not super trendy. You\'ll find a foosball table but you won\'t get perks like free swag, free daily food (there are days with free food though), couches, bean bag chairs, beer on tap, etc. Additionally, Ceridian ships enterprise code and recently went public so they\'re fairly big. That can be seen as both a pro and a con.\n\nIf you\'re okay without those fancy perks (that really do nothing in the long run), and want to ship good code, this is a great place to work and guaranteed you will learn a lot and your code quality will improve a ton. If you care more about the perks, you\'re better off going to a startup or somewhere in Cali.',5583,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhl00jy01jv4tqc9bil','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','\nUltimate Software - a hidden gem of a company. Their company motto is \"People First\" and it\'s true. It\'s the best reason to work here. From fun office events, to free food, to after hours activities with coworkers, you\'ll enjoy your time here, all the while contributing to a strong performing product, UltiPro. The business is strong, culture is strong, and you\'ll feel like you\'re part of a winning team. \n\nOn the software testing side, you\'ll be exposed to software automation, advanced tools, and parts of the SDLC that\'ll teach you more than just manual testing things, as is the case at some companies.\n\nLocated downtown on Bloor Street, the Yorkville neighbourhood is nice, and it\'s right beside the subway and GoodLife (corporate membership discount) Pay is well above the Waterloo average and based on which co-op term you\'re in.',29,'CAD','hourly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhl00jz01jvbl8m6gps','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked on the autonomous vehicle team. \n\nI had a super awesome experience working here. I got to do everything from hardware to software to product design, and I felt like I was actually an integral part of the team that I was on. I felt like I gained a lot of experience in writing well-architected C/C++ code as well as other skills more specific to building an autonomous vehicle.\n\nMost of all, I really liked the people at NVIDIA. The people I worked with at NVIDIA were some of the most humble but yet smart people I\'ve ever worked with, and I felt like I became close friends with many of the people I worked with despite stark differences in age / backgrounds / nationalities. NVIDIA is also a very diverse workplace, and I was actually the only US-born person in my entire team. \n\nI didn\'t enjoy life in bay-area that much as other cities I\'ve lived in, but the company itself made it all worth it. ',8500,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhl00k001jvejtg660k','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I recommend Zugata to anyone looking for a meaningful internship in software engineering. As a frontend intern I was fully incorporated into the engineering team and assigned the same work as FTs. You get to work with modern frontend technologies. It is a great place to grow yourself as a software engineer. The work was very fulfilling and everyone was extremely easy to get along and work with. ',5600,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhl00k101jvaeb4229q','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Worked on the Merchant Payments team(platform). It is chill as long as you code fast.',8500,'USD','monthly',4.0,5.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhl00k201jvax9v05o8','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459550,'ck1n1du49000501jo4pwygsav','Probably one of the nicest offices in the world; even by tech standards. \n\nTheir team matching was done well and placed me with a team that I was very happy with. The people at Airbnb are noticeably more friendly/outgoing than other companies I have worked at which was refreshing. \n\nWork/life balance, at least on my team, was pretty much perfect. I never felt pressured to put in extra hours and my project was well-scoped.\n\nThe perks and compensation is solid:\n1. $40/hour  ($60/hour overtime) + $4000/month housing stipend = ~$11000/month (pre-tax)\n2. Free breakfast/lunch/dinner/snacks/drinks\n3. $1000 in Airbnb credits\n4. ~$250/month in transportation credits\n5. Lots of intern/team offsites',11000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhl00k301jv82h339tg','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','The company is growing very quickly. The engineers there are very talented and, being a younger company, there are lots of opportunities to work on new and interesting projects.',7000,'USD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhl00k401jv32avc3in','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Worked there in 2017, had a good experience.\n\nMentor was very knowledgable about the work while also being very approachable and easy to get along with. Other team members were also very open to helping with any questions.\n\nWorked with SAS and Teradata, technologies aren\'t the most applicable to other jobs but still good to learn about databases and SQL.\n\nWork-life balance was amazing, hours were very flexible, if work is done no need to stick around. A perfect amount of work was assigned, enough to not sit around bored but also leaving lots of time for pool, Tim\'s runs, long lunches, or self-learning. WFH also allowed (within reason of course).\n\nFree parking was also given.\n\nThere were a few opportunities to learn about other areas of the business through lunch and learns by other teams and team members.\n\nRare team potlucks, lunches, outings.\n\nOverall would recommend it if you are interested in the data engineering field and ETL.',18,'CAD','hourly',5.0,4.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhl00k501jv70uhetu0','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Pros:\n- Great mentorship and work-life balance. \n- Flexible hours and work from home policy\n- Treated as full time member of team, with an equal say in team decisions\n- Teams have a very large amount of autonomy, supporting different working styles. Some teams are very autonomous, while others rely heavily on pairing. Many teams are split across offices.\n- Interns can lead Failure Friday, and motivated interns can go on-call for their team\n- Functional programming is applied very widely; Many teams have most of their code in either Elixir or Scala, with only legacy code in Ruby\n- Free lunch\n- The people are very accommodating to different backgrounds and lifestyles. [Daddy|Mommy]Duty, for example, is a common term for when you adjust your work schedule so that you can take care of your kid. There are also various support groups within the company, like SisterDity and VeteranDuty. PD doesn\'t use \"culture fit\" as an excuse to exclude people, like some other bay-area companies do.\n\nCons:\n- Some teams work mostly in (an exceptionally old version of) Ruby on Rails. \n- General growing pains as the company grows\n\nI have worked in both offices. I would highly recommend anyone to intern at PD, but make sure you talk to a previous intern on your team to make sure it is a good fit. The Toronto office is better in every respect except weather and pay, with a more laid-back culture and better free lunch.\n\nThe lunch is exceptional. There was a wide variety of food from many different vendors each day. If you are in the Toronto office, I highly recommend Spicy Ethiopian day. In SF, deep dish pizza.\n\nPD hires people from a wide variety of backgrounds, which is great. If you can code but you aren\'t in CS or Software Engineering, don\'t let that stop you from applying.\n\nI would also recommend asking about their policies on affirmative action if that is something that is important to you. \n\nQuestions to ask your team if you get an offer:\n- What tools does the team use?\n- How much time is usually spent in meetings? How much of the time is spent working on new services and features, vs. polishing existing ones? Ops work vs. coding?\n\n',8000,'USD','monthly',4.0,5.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhl00k601jvasa6csj4','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Culture was great, pay is decent for early on, scales with previous experience (875/week to 1000/week).\nFairly typical small company (60 people in office) but if you live nearby I’d recommend it',3500,'CAD','monthly',4.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhl00k701jvb0dh4cri','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I was on iOS team, holy **** everyone on my team is super nice and super smart. They are just amazing people to talk to. The work was super meaningful, I was able to fully ship 2 major features to AppStore in the span of 4 Months. Asana really cares about your passion and make sure you enjoy what you work on. Asana has no doubt the best mentorship program for interns in the Bay Area. 11/10 would recommend. (I am a foodie, and Asana has one of the best in-house chefs, food is 12/10)',9166,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhl00k801jvf0aef498','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Best co-op to date. Company culture is fantastic, and your mentor will do their absolute best to support you and your learning. Since it is a mature startup, there is definitely some red tape and work you do might get re-prioritized, but your manager will do their best to shield you from it.',6000,'CAD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhl00k901jv1ky4bqo5','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459550,'ck1n1du49000501jo4pwygsav','PROS\n- great people\n- interesting projects\n- free coffee / tea / large variety of drinks / beer/ chips / cookies etc\n- biweekly BBQs\n- flexible hours\n\nCONS\n- salary is on the lower side for second coop\n\nOVERALL\n\nWorked here as a Android developer, but I also worked with some Java Swing and C. Had a really good time working here, I was assigned a lot of tickets and some big features. The coworkers are very kind and knowledgeable and were always willing to give me a hand.',3200,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhl00ka01jv7n0vfjzy','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','There were a fair few co-ops, so the social life in the office was quite nice. Since it wasn\'t their toronto office, busy season was never too bad. The early months of my co-op were quite work-less (as seemed to be the case for many others in the office). Overall, I feel like I learned a good amount without being worked to death',3250,'CAD','monthly',4.0,4.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhl00kb01jv9w5t0zmb','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked at the Toronto studio during Summer 2018 on an unannounced AAA title. To start with, Ubisoft has a very thorough onboarding process as well as an awesome mentorship program that makes sure all newbies get a quick start on the project and take on whatever task that interests them the most, so I was able to understand the scope of the game and catch up with the development in the very first week. As a rendering programmer, I worked on lighting and post-fx features concerning cutting-edge techniques in computer graphics, which was fun and challenging since I had to read tons of papers before even starting to write a single line of code. I was also treated as a full-time employee and given full ownership of the features I worked on, meaning that I had to communicate extensively with artists and technical directors about the features, and was solely responsible for whatever issue that popped up. Work-life balance was pretty good as there\'s no overwork unless a deadline is approaching. Overall, 10/10 would recommend to anyone passionate about gaming and curious about how video games are developed. After all, you might have a good chance of leaving your name on your favorite game XD',5600,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhl00kc01jv25uwabuj','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Awesome company culture like Work from Home day for every Thursday. Paid Volunteer Time Off. Great Benefits. Payment is 7500 + 3900 + 100 per month.',11500,'USD','monthly',5.0,4.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhl00kd01jv4k1r6fm2','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Worked there recently, loved my time at Flipp.\n\nThe work itself wasn\'t the most exciting (not the newest technologies, more refactoring work vs new stuff), but it got better as the term went on.\n\nThat aside, what I really loved is the close rapport with most of your team. Everyone was open at any time to help, and we had weekly 1on1s to make sure everything is going well. My mentor was super knowledgeable about many topics, and it was really cool getting to know him and staying in touch in the future.\n\nWork life balance is great, the working hours are flexible and occasional WFH is also allowed.\n\nThe company itself is also awesome, weekly town halls with the whole company to discuss goals, progress etc. Biannual overnight trips with the whole team. Free Goodlife membership and TTC metropass. Tons of snacks and drinks in office. Weekly lunch. Occasional team lunches and company outings.\n\nBecause of all of this I really looked forward to coming to work every day. Loved getting work done and learning while also having fun with the team. Definitely recommend it',1080,'CAD','weekly',5.0,5.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhl00ke01jv6lzpgs92','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','forced coops to work 12 hours a day and CEO told us that we shouldn\'t be \"bound by the go train schedule\" in terms of our time in the office - aka slave driver',2200,'CAD','monthly',1.0,1.0,2.0,1.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhl00kf01jv88kobn8z','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Overall it was a great experience as I got to work on some cool projects. Danny is a great mentor but the only full time that was there during my term. He lets the co-ops have full control of the project which we respected a lot. The company had a startup feel but the projects at the time were frustrating due to head office restrictions. I would recommend this co-op for a first or second year student.',4400,'CAD','monthly',4.0,2.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhl00kg01jv8fhc6n95','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked here in 2018. The infrastructure team has subteams, although they\'re now hiring for each one individually. The infrastructure team is amazing - they\'re all more than willing to listen and help, and always encourage questions. My mentor always made sure I wasn\'t blocked.\n\nPay was $50/hr + 1 time housing stipend ($3500 before taxes) + ~$250/month for clipper. \n\nI got to work on some pretty cool projects that used a lot of modern tools, and learned a ton.\n\nCulture and work/life balance are really great, very SF startupy (they\'re a mid-sized company). Went on multiple outings, and PlanGrid frequently has events. ',8750,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhl00kh01jv4r17cm7c','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked there in summer 2018, since they only have summer internship so be sure to apply if you are gonna coop in summer. I was given 6500 a month but my colleagues from Waterloo are given 7500 so be sure to negotiate about salary. The intern program is  extremely well structured with a dedicated mentor who had a detailed project plan before I arrived. I also had weekly formal oral feedback and bi-weekly written feedback from mentor. However, YMMV depends on what team you are on, but most of them are very good and have meaningful work. In terms of intern events, they literally have multiple events every week to do stuff like hiking, cruising, kayaking, glass fusing, bubble soccer, to name just a few, so there were lots of fun. Besides, their cafeteria is the best in bay area. (Any contenders?) BTW, corporate housing was 2 people in one bedroom (not as good as FB) but was very close to Dropbox. Overall, outstanding intern experience. ',6500,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhl00ki01jv0xnvd0xe','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Salary doesn\'t include the housing stipend which was around $1200 USD/month\nSuper fast growing company, tons of interesting work. Building tools for developers help keep the code quality relatively good and enforces a strong dev-ops culture with all the engineers. Managers have a lot of trust in their interns so you generally will have full ownership over a service or feature that impacts all the customers.\n\nUnique perks include 5 PTO days (for vacation purposes, sick days/WFH days generally is unlimited within reason) and travelling to company conferences, where flights/hotels/meals are paid for and after the conference if you arrange housing you get the chance to explore a new place, so it\'s great paired with the PTO for a chance to travel in the middle of an internship. ',7200,'USD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhl00kj01jv2drf80xq','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Worked there during busy season, expect to pull at least 50 hours per week, with many people going over that. You\'re with a senior most of the time, so you can ask them lots of questions but co-ops usually do the grunt work. They had busy season events every week such as free food and massages and even an end-of-season party so if you really value those things then you\'ll enjoy the company. Be prepared to either have no work, or pull OT for all the work you have. Definitely better than Big4 though. ',2400,'CAD','monthly',2.0,4.0,3.0,1.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhl00kk01jv7rt54b6u','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Overall a good internship',15,'CAD','monthly',4.0,4.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhl00kl01jvb74oatba','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','People are great. I had an awesome manager who really cared about my learning and growth, and an amazing mentor who was always willing to help when I needed it and made sure I was never blocked. Would recommend.\n\nCompensation: $8750 monthly + $3500 stipend + clipper card (put as much money as you want on it)',8750,'USD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhl00km01jv17qh0lnu','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked here on the ELT Params team for my first co-op in Summer 2018. Everyone on the team was great to work with and I learned a lot about the Agile process as well as good software development practices in Python. The office is located at Yonge-Dundas in downtown Toronto, which makes transit to and from work a breeze. The only downside is the lower than average pay.',2700,'CAD','monthly',5.0,5.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhm00kn01jv8bsw9eeg','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I loved my internship at NVIDIA. The salary was recently increased a very large amount as I was paid $46/hour. I got along very well with my team and they really treated me like a full time. I learned a lot while working on the project assigned to me. I included the $2200 housing stipend they give every month to the salary as you keep any that you don\'t use. ',9640,'USD','monthly',5.0,4.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhm00ko01jv7uxkcob6','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Everything about the company was awesome. Everyone I met was super friendly and very talented. The work that I was given was more impactful than any other coop I had before and I was able to see the results of my work. The futureforce team organized many fun events throughout my summer internship including meeting many upper execs (including co-CEO!) in person, baseball games, all-you-can-eat food truck park, day at amusement park, day at zoo, day touring SF, etc... There was also the work-from-home day every thursday. \nThe only downside is that you are required to share the bedroom in corporate housing with another roommate. The room itself is very luxurious (free gym & spa) and is fully furnished even with kitchenware.',47,'USD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhm00kp01jvgvdv43vy','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','The studio is closed :\'(',26,'CAD','hourly',3.0,3.0,4.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhm00kq01jvaqpb6i3o','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Second co-op semester. I worked January-April 2018 for a research and development team based in Mississauga, but my position was officially in the Southcore Financial District office. Did require some travel to Mississauga. Absolutely gorgeous 31st-floor office, near Union Station. Semester started off slowly (that\'s why I rate it 4/5), but halfway through I had much more work to do. Boss was very flexible in letting me choose what challenges to tackle. Mentorship is great but you have to actively seek it! The work that I did actually impacted the teams that I was supporting. This company hires a lot of co-ops, and your experience will depend heavily on the team you end up on.',22,'CAD','hourly',4.0,4.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhm00kr01jv8a1of05b','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','The mobile team was great. My mentor on the Android team was extremely helpful and provided a ton of great feedback and support. I was given the opportunity to work on the coolest features in an app that was being redesigned. The Android team is fairly small, there were only 2 full time Android developers at the time and the mobile team was 10 people in total including the UI/UX team. \n\nYou\'re not expected to know anything about forex trading before hand. \n\nPerks:\n- Once a week: catered lunch, pizza night and catered breakfast\n- cereal and snacks\n- drinks and coffee\n\nPros:\n- Get to learn Kotlin (big push to write more of the app in Kotlin)\n- work designers on improving the UI/UX\n\nCons:\n- main app is large and has parts of legacy code \n',26,'CAD','hourly',4.0,5.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhm00ks01jvag4wdqp8','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Contributes to the data here',9000,'CAD','monthly',3.0,3.0,3.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhm00kt01jv44mf1v9i','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I loved my co-op term at GroupBy! They placed a lot of emphasis on making sure that I was constantly learning and working on meaningful sprint work. The mentorship was great, everyone was always really friendly and always more than happy to help me in any way or answer my questions.\n\n The culture was fantastic! There was some fun social event going on pretty much every week, which gave me lots of opportunities to make friends and meet new people! There was also catered lunch every Thursday, and their kitchen was always stocked with snacks, fruit, coffee and tea!\n\nOverall I think that it\'s a great company and I would definitely recommend it for a co-op term!',4000,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhm00ku01jvdi804k85','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Your experience is very dependent on the team you\'re placed in, and the manager and mentor you get. Mine was a horrible prick who had no experience working with interns, didn\'t set expectations and had basically no idea on how to mentor an intern. Was also sort of arrogant and totally not open to any opinions on how to do a task, and liked to boss around. My experience was pathetic and I would never return. Didn\'t get any meaningful work or learn much, through some other interns on better teams did have better experiences. Also compensation is very low given how expensive Vancouver is, and you will just be able to cover basic living expenses. \nTake their offer only if all your other intern offers are much worse, otherwise go elsewhere. ',3600,'CAD','monthly',2.0,1.0,1.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhm00kv01jv84m4ct6b','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','The team I was placed on was very supportive and always down to help interns. Truly made an effort to make you feel like you fit in, and the work was mostly meaningful. Besides, the job is very chill and strictly 9-5. They also lots of other interns, and many intern events planned throughout the term. Would definitely recommend for the first few coops.\nHowever, it is also very bureaucratic and you will waste lots of time on useless meetings. \n\n',2800,'CAD','monthly',4.0,4.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhm00kw01jvdgogey2b','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Very nice employees, great work life balance',26,'CAD','hourly',4.0,4.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhm00kx01jv8i9ofe1s','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Company culture was amazing. I got to experience a lot of fun intern events and had the experience to work on some very interesting technologies. Although I do feel that the projects given to me were not too meaningful to the company. The corporate housing was also pretty nice too; though you have to share it with another roommate in the same room. I highly recommend it.',7280,'USD','monthly',5.0,5.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhm00ky01jve9dwek2i','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','DISCLAIMER: I had many friends who worked at Apple and really loved it, I was just incredibly unlucky with my project and team.\n\n- I worked in the Hardware Tech org, the majority of which was situated in satellite buildings around Apple Park, but not in it. Instead of working in a bright, modern, open office, I worked in a claustrophobic, depressing sea of cubicles. \n- The manager who hired me was transferred right before I arrived, which meant no-one on the team really knew what I was supposed to be doing. I eventually worked on a project spearheaded by the team\'s former manager, but without him giving guidance and direction, the project stalled, taking nearly the entire term to finish.\n- My team was incredibly antisocial, not just with me, but amongst themselves. Lunches were quiet, with no-one being able to start and sustain conversations. Laughter came in short bursts, with long stretches of silence in between.\n\nThat said, the area was quite nice, with the housing being pretty decent (shared-room, but I lived with someone I knew, so it wasn\'t that bad). If you can get a group of friends together, there is lots of stuff to do on the weekends in and around the bay-area (not in Cupertino itself though, it\'s really boring)',7000,'USD','monthly',1.0,1.0,1.0,2.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhm00kz01jv6fau7rfr','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','The review is team specific because people have different experiences with different managers. I would say Capital One in Toronto (overall) is good for one of the early coops, but I personally did not have the best experience. I was given an intern project, which I am pretty sure never got put into production. There weren\'t any code reviews either so I didn\'t learn much (if anything) about industry coding. The salary was great for a first coop and they gave a $1000 bonus.',23,'CAD','hourly',4.0,4.0,2.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhm00l001jvei3c2vwu','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked here for my first coop in Summer 2018, mostly creating internal tools for the team. It was mostly individual work, but it is really easy to find people around the company to help you out. The overall company culture is great and you get frequent one on ones with an assigned mentor. The kitchen is stocked with fruit several times a week, and there\'s always free coffee, tea, and drinks. There\'s a Costco just down the road for cheap food as well. Unfortunately, the team tends to use older technologies for development, but other than that, it was a great experience!',900,'CAD','weekly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhm00l101jv86by2vb0','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','One of the best internships to date. Great culture and extremely smart people. The engineering projects were high impact and you could see the value they brought to the company. People really care about your growth and interests. I would definitely recommend it.\n\nThe perks and compensation are highly competitive (the salary includes $1500 housing stipend).',9000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhm00l201jv4kxs9zto','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I interned here as a SWE intern. Work was really good and my team gave me a lot of autonomy on what I could work on. The company is huge but every org works pretty autonomously so I didn\'t feel like I was doing unimpactful work. Everything is extremely team dependent.\n\nApple Park is one of the most beautiful buildings I\'ve seen in my entire life and they\'ve recently opened it to all Apple employees. The facilities, gyms, etc are all top notch and in pristine condition and exactly what you would expect from Apple. \n\nFrom my experience, at Apple you\'ll get a shared private office with another co-worker. IMO it\'s way better than the crowded open office layout all the other tech companies have. YMMV though, some (unlucky) people have cubes.\n\nEngineering orgs get free snacks/drinks but YMMV. \n\nCaffe Macs food is amazing, it\'s way better than the food they serve at Google but you have to pay a subsidized cost for it. The food quality is probably comparable to LinkedIn, Twitter, etc. \n\nBreakfast costs $2 (Avocado toast with half an avocado) or $3 (Acai bowl). There are other options like omelettes and breakfast burritos but it depends on which office you get placed in. Lunch costs between $5 (for an unlimited topping sandwich) and $12 (Scallops, Oysters, etc). Pizzas are $8 and are really good. Engineers get a $12 dinner credit past 7pm. \n\nPay seems a bit off in all of these postings for some reason. My guess is that hardware/embedded/low-level SW roles are paying less than pure SW roles. I got paid 38/hr ($6600/month) + free corporate housing but I was really early in my co-op terms. You get paid by the hour and (with manager approval), you can work OT for 1.5x the pay. You can get around $42/hr ($7280/month) if you\'re slightly more senior. \n\nCorporate housing is a really nice 2BR place. They do stuff 4 people in that 2BR place though. This is pretty common, its done the same way in LinkedIn too. If you don\'t like having a roommate, I\'d advise taking the $1000 post-tax housing stipend and finding your place around the Sunnyvale area (you can find a private room for ~1200 on PadPiper). \n\nInterns get access to Apple\'s Employee Purchase Program for substantial discounts on Apple products, both for yourself and for your friends & family.\n\nApple\'s University Relations team basically doesn\'t host any intern events other than in the summer, but even then, there aren\'t that many of them and they\'re way too large scale since Apple hires so many interns. Orientation is only for half a day, so don\'t count on meeting many other interns during your internship unless you really make an effort to. ',38,'USD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhm00l301jvhfiq4f4q','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','They grant an incredible amount of ownership and unlimited freedom to pursue any improvements or ideas you might have to help improve the company\'s products. Rob & Jasmin are also fantastic mentors.',25,'CAD','hourly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhm00l401jvholsd378','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','It\'s a very good place that is working on unfortunately a very boring product. It is ultimately a great enviornment with a cool office, sociable people and a lot of perks (free snacks, catered lunch once a week, on site gym). Mentorship was also top notch, and they made a lot of effort to aid your growth and development.\n\nThe office location is pretty awful and out of the way however (junction area) with not much around. It is also very hard to get motivated working for their product since they are playing catch up most of the time, thus having little innovation or interesting projects. ',5400,'CAD','monthly',3.0,5.0,2.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhm00l501jvcx5g9tj2','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','This was my favourite internship experience by far. No it is not a big tech company, so you miss out on many of those perks. But the work experience is invaluable. Everyday I looked forward to getting to work on my project and it never felt like work (I have not felt this way in other internships). I felt very fortunate to work on something that made an actual impact in the company which made it not feel like the typical intern role. I was given real responsibility which made the internship so much more rewarding. The team is small and fast paced, and you get a good idea of what everyone is working on. The mentorship is excellent and I walked away from this internship with even more than I put in. I would highly recommend this company to anyone considering taking an internship here. ',26,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhm00l601jvd707dj0r','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','This was a co-op from 2017. The salary was low given that it was 4th year co-op and had no overtime pay. The role was Financial Reporting for CPA, so you get your hours. The working environment is great and the company treats the co-ops really well. It provides us lots of free meals and even allowed co-ops to go on company retreats (3-day) with accmodation, tranportation, all meals paid for (and you still earn your salary). They really treated co-ops as one of their own and provide meaningful work and gave you responsibility. However, they do not retain co-ops for full-times so that\'s a downside.\n\nOverall, great experience and treated co-ops with respect and provided lots of opportunities.',22,'CAD','hourly',5.0,3.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhm00l701jv79s11o9p','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Great foot-in-the-door opportunity as a psychology student. Was afforded the opportunity to work on diverse projects of measurable impact regarding unified tobacco legislation reform. As my first co-op, this position allowed me to sharpen my professional skills and grow into more nuanced roles.',16,'CAD','hourly',3.0,1.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhn00l801jv3827efh3','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Worked there a few terms ago, the experience was great and I joined a team doing something that I had previously no experience in, so I definitely learned a lot and grew as a developer. \n\nThe work was pretty great but the team was doing some not so interesting things when I joined so I didn\'t really get to do a lot of what I wanted which is fine since what I did was interesting as well in it\'s own rights I guess.\n\nThe free lunch is dope, we get awesome food from great restaurants in TO everyday and work life balance is a blessing too, with no one expecting you to stay back too much or go out of your way to do anything.\n\nThe company events, culture and perks are all really awesome, we have intern events, DnD nights etc. and it\'s a really nice and welcoming culture imo, Really liked the other interns and fulltimes at the company, especially my mentor and people on my team -- they all were really cool and funny people.\n\nOverall a solid internship, bunch of learning and understanding how software works at scale with focus on reliability and uptime.',34,'CAD','hourly',4.0,5.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhn00l901jv08nh2s3j','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Without a doubt one of the best companies to work at in Toronto. Very talented leadership team with extremely impressive backgrounds. Culture here is unbeatable; everybody works hard, while also being laidback and very approachable. Learning and personal growth is the number one priority for employees here, and management does as much as they can to support that. The company is a leader in the Canadian AI ecosystem, has tremendous financial backing and ambitious goals.\n\nCan\'t go wrong applying for a job at integrate.ai',1700,'CAD','weekly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhn00la01jv6jdgh7qm','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Work, and Mentorship\n\nThe work was very meaningful and I felt like I made a real impact in the company. I was treated as a full time engineer from day 1 working on the same projects as other engineers on the team. I also had an amazing mentor that seemed to know the answer to everything but only gave me enough hints to help me learn on my own. \n\nCulture\n\nThe culture at Zanbato is very sports oriented. If you love basketball or football you will fit right in. Near the end of the day, all the engineers huddle up and we play Super Smash Bros or ping pong which can get very involved at times.\n\nPerks\n\nTo make my internship experience that much better, Zanbato gave me a bike and cell phone. They also have free lunch everyday, and dinner on Tuesdays & Thursdays. You also get every other Friday off to work on any project you want on the side.\n\nOut of my 5 previous in internships, Zanbato was definitely the best and I highly recommend it if you are looking to do an internship in the bay area.',4800,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhn00lb01jve59r5pk0','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I worked here in the fall of 2018 as a software engineer intern. The company culture was just fantastic, there were many events planned for both interns and full times, including happy hour every Thursday and team dinner outing every month. The perks are great - free lunch, on-site gym, and snacks every floor. I had the opportunity to work on impactful and meaningful projects and was treated like a full-time. I learned a lot about handling large data sets in a batch fashion while working there. I also had excellent mentors, and who coached me during my term. Lifion also has excellent infrastructure and a great number of resources I could leverage. \n\nOverall, Lifion by ADP is a great place to grow and learn as a software engineer.',8000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhn00lc01jvhszr19h3','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459550,'ck1n1du49000501jo4pwygsav','Really liked working here, the people were smart, kind, and a pleasure to work with. The company has serious scaling concerns but he product and engineering work behind it is pretty good. The corporate apartments were really really nice. I lived with another intern in 2 bedroom 2 bathroom place in midtown east, ~10 minute walk to work/grand central. ',7900,'USD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhn00ld01jv7tewejz7','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Great place to work overall - work environment is relaxed and you\'re surrounded by a lot of smart engineers with strong technical backgrounds. A few of the full-times have experience working at Google, Facebook, Asana etc. \n\nWork-life balance is quite good as you have flexible work hours and have the option to work from home. Company has free lunch/breakfast usually every Friday and there are a few events throughout. As a start-up, company is rapidly growing and acquiring new talent.\n\n\n\n\n',5700,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhn00le01jv0v31g8qr','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','\"When you look at someone through rose-colored glasses, all the red flags just look like flags\"\n\nWhen you\'re working somewhere, it\'s often easy to get used to your surroundings and not notice anything wrong. I thought that my time at Bespoke Metrics was average, until I went to other companies to work and realized the smoldering dumpster of a workplace that this was.  \n\nInternships should be an investment that companies make so that there are hopes that the interns will convert to a full-time employee that will require less training to get started. This is why Silicon Valley and top tech companies pay their interns an exorbitant amount of money to hire them, even though the company won\'t make that money back from the intern\'s work.\n\nHowever, Bespoke Metrics hire interns because their core product requires cheap labour and what better way to get this than to hire poor students and then use the workterm evaluation as a \"carrot on the stick\" to overwork them?\n\nIn my term here, there were many serious issues with the full-time team. Some of the people are nice (4/13), but all the people who held key positions high up were the most arrogant and tactless people that I have ever met. You can read the other reviews to see the things that certain people have said, as that topic can be itself another review.\n\nAlso, if everyone in the company and their mother is a \"senior X\" does that \"senior\" keyword even matter? It literally becomes a label to inflate your ego, and it clearly has gotten to the heads of the people working here.\n\nThe work here was also really spotty. You can either be nuked with work, often a deliverable due by the end of the day or you would literally have nothing to do even if you ask your manager (I was told to \'read up on best practices\' of certain libraries MULTIPLE times throughout the term). \n\nThe work culture here is perfectly represented as waterboarding. Everyday is a fun game of Russian Roulette where your personal physical + mental health is on the line and the bullet is a truckload of work due before you are allowed to leave. Hours are insane when you are required to finish the work because the company needs this functionality to make money.\n\nAlso, as mentioned by someone else, they pay you biweekly, so you\'re doing volunteer work if you stay past 9-5, but you can\'t leave or else they will passive-aggressively comment on you \'leaving early\'.\n\nBack to the spotty work. I cannot imagine the time that I have wasted just waiting for time to pass. I started reading CTCI, fueled by the motivation of getting as far away from here as possible and ended up getting better jobs. I would say that this job is like that abusive cheating ex that you learn what to look out for in future relationships, but made your everyday life a living hell when you were with them.\n\nAlso, the management team comes from Finance backgrounds. This means that they bring the toxic \"time at work > everything else\" mentality that you find in Finance/Big 4 firms, which is insane. You have interns that are blackmailed and guilted to start work early, stay late, while often doing nothing. I sometimes wondered if this is what jail time looked like while working here. \n\nThere have literally been times when the interns would play games together during work hours because they have no work and have asked if they can leave early for the day, get denied and then resort to doing something beside photosynthesize. Funny enough, the fulltimes would drop their work to watch. This raises a few key questions:\n\n1. If the interns have 0 work and are playing games, why can\'t they leave? It\'s literally wasting everybody\'s time and adds to the electricity bill for a poor little startup.\n2. If the fulltimes are just watching, is there no work that needs to be done? It\'s startup, there is always work. It\'s just that the engineers aren\'t doing their jobs and pulling in more work for the interns to do. I believe that work > no work, but there\'s no work and no one is trying to fix that.\n3. Did we sign a job offer or a prison sentence? I\'m locked up in a tiny and poorly lit room with a bunch of other horribly depressed people while being berated by management who literally would pace around to watch what we were doing.\n\nManagement, if you really do care about the interns, which I honestly doubt, I would start changing the way you treat them. There was legitimate harassment and bullying that happened to an intern during my term and they got depressed because they had to put up with this for 4 months. We aren\'t monkeys for you to play with or robots that idle until your next command. Please show just the normal amount of respect that you would show to someone else. Please grow up.',2213,'CAD','monthly',1.0,1.0,1.0,1.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhn00lf01jvhnrq3z2l','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Small dev team, nice tech stack, free snacks',4000,'CAD','monthly',5.0,3.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhn00lg01jv8xthg37s','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I learned a lot from this position. I was given challenging and interesting assignments/projects throughout the week.',3000,'CAD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhn00lh01jv5zw85sch','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Bidvine is a fast growing and experienced company that deals with several projects simultaneously. \n\nDan was an excellent mentor who trusted me with very big projects that went live on the site. You will not be working on \"intern projects\" while you are there and will actually make an impact.\n\nThe team is very insightful, everyone there is an expert in their own field and are very friendly people. Would highly recommend Bidvine as a co-op placement.',4800,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhn00li01jvgnqjdz00','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','$8000 + 2000 Stipend Monthly\n\nFall 2018 Term\n\nThe company is growing quickly and is expanding quite fast. Some interesting problems to tackle in terms of dealing with scaling users and data.\n\nSuper friendly people and great perks (all meals catered).',10000,'USD','monthly',5.0,4.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhr00lj01jvc0nr0evn','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Had a ton of flexibility - great work, people, laidback culture. Company is in the middle of acquisition though. ',6000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhr00lk01jv7tssc2ae','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','The culture\'s amazing and there\'s good opportunity to move from one position to another and collaborate. Interns are treated like full-times, i.e. if you\'re doing good work, you\'ll be assigned to interestig projects over full times. The company has a recognition system where the completion of major projects get you Air Miles. Loads of Co op events starting from arcades to going to watch a Raptors Game, all sponsored by the company.',35,'CAD','hourly',5.0,4.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhr00ll01jvc0y58y7o','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','It was pretty good. ',27,'CAD','hourly',5.0,4.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhr00lm01jvct3s5j20','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Work consists mostly of full-stack work. I worked a lot with React and Redux on the front-end, and Django and SQL on the back-end. Pay was good though company/team culture was lacking. Co-ops work independently and solely with mentors.',25,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhr00ln01jv0n5ahcop','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Depending on the team, the hours can vary a lot. The client-facing teams do tend to work longer hours since the company is growing so rapidly and have a lot of deadlines. Definitely learned a lot during my coop term here.\n\nDue to the pair programming nature of the job, there is a great opportunity for mentorship available from the senior engineers. Overall, a great company to work for, interesting product and some really smart and motivated people working here.',4200,'CAD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhr00lo01jv5ehh894m','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','There is the opportunity to have incredible amount of impact as an intern. My mentor was extremely helpful, and the work life balance is great.',8500,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhr00lp01jvfte77szt','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Lots of perks like corporate phone, health insurance, 17% off Uber and Eats, Uber credits, free breakfast, lunch, dinner, overtime pay, new tech (new macbook pro), free headphones/earbuds.\n\nMentorship depends on team but my mentor was great. Work was really interesting and impactful as well. I worked a lot by choice and got paid overtime. Monthly salary worked out to roughly $11000.\n\nHR is a mess though',11000,'USD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhr00lq01jv1w5cgjmm','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','It is not bad',22,'CAD','hourly',3.0,3.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhr00lr01jvajxu74v6','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459711,'ck1n1du49000501jo4pwygsav','Team was awesome, everyone was down to help out. I got to do actual important stuff and people were just nice I guess. There were all smart and it felt nice to always be in good hands.',7000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhr00ls01jvg78we2rl','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459711,'ck1n1du49000501jo4pwygsav','Had an awesome time there - great mentorship and a welcoming, laidback culture. Kitchen filled with snacks. ',5440,'CAD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhr00lt01jv5gmrguu5','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459711,'ck1n1du49000501jo4pwygsav','Worked here during fall 2018 for my 3rd coop. I did not negotiate my pay but you can if you push a bit. The company with the best culture..want to go full time here. ',5300,'CAD','monthly',4.0,4.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhr00lu01jvdt8j0auc','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459711,'ck1n1du49000501jo4pwygsav','I worked here for my third coop, and I had an amazing time! My team was very friendly and my manager really cared a lot about their team. Definitely the best mentoring I\'ve ever gotten from a manager.\n\nI worked on meaningful projects which would impact a lot of customers, and learned a lot about software development and best practices.\n\nThe company is still growing, and it\'s exciting to be part of the process.',4600,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhr00lv01jv68mpgbyc','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459711,'ck1n1du49000501jo4pwygsav','Worked there in second year. The people were nice but there wasn\'t much to work on and it was very boring overall. Also the pay is bad if you\'re not in first year.',19,'CAD','hourly',2.0,2.0,1.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhr00lw01jv0sxjhnmh','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459711,'ck1n1du49000501jo4pwygsav','I enjoyed working at Ultimate Software. The best part was how much I was able to learn as the data science team really prioritizes you having the opportunity to take on interesting problems. We had a regular reading group so I could gain a better understanding how data science works. The work is generally independent and the team is very academic focused so you will have a lot of ownership over your work.\n\nAt the office we had free lunch every Monday and Wednesday and free snacks. There were also plenty of social events and I got to meet with teams around the office. The inclusive atmosphere definitely made working here a great experience.',7000,'USD','monthly',5.0,4.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhr00lx01jv5dtt8uzi','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459711,'ck1n1du49000501jo4pwygsav','Absolutely the greatest coop I\'ve experienced there. I have no complaints whatsoever.',6969,'CAD','monthly',1.0,1.0,1.0,1.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhr00ly01jvg76t3g67','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459711,'ck1n1du49000501jo4pwygsav','It\'s fire',2750,'USD','weekly',5.0,5.0,3.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhr00lz01jve5k9ayu8','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459711,'ck1n1du49000501jo4pwygsav','Awesome',8800,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhr00m001jv85rp0n0w','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459711,'ck1n1du49000501jo4pwygsav','Great mentorship with lots of room for learning. Part of the full-time dev team from day 1.',2800,'CAD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhs00m101jv0gksfr0w','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Worked there summer of 2018 when it was under the banner of Oath, got to meet and work with really amazing people. Although there is some instability with the company due to all the restructuring, culture is very collaborative and freeing (at least in my experience).',5420,'USD','monthly',4.0,4.0,4.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhs00m201jvah017n2g','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Pretty awesome overall. Project was solid, mentor was very resourceful, great events. The only disappointing thing was the company outlook.',8000,'USD','monthly',4.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhs00m301jv4f3fav59','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','I love - love - loved my internship at Apple as a Software Engineering Intern. The work I did was developing a core production product where I was able to make valuable contributions to developing services that helped complete goals for the team that I was on.\n\nI think in terms of pay they have recently made significant increases? At least for the Siri organization. I was paid $45 USD/hour with the chance to do basically unlimited overtime (1.5x hourly).\n\nMentorship was excellent - of course this is team based - my mentor constantly checked up on me to ensure that we were in sync and that I was having an enjoyable experience.\n\nPeople were incredibly friendly in my organization. Although you have to pay for lunch (dinner is free), the food is really good.\n\nOn site gym at Apple Park is really nice and your corporate housing will be right beside the campus so it\'s a 5 minute walk to go to the gym.\n\nAll in all, a great place to work on the software side. I do hear on the hardware/product design and EPM side hours are longer, but don\'t know enough details about those teams.\n\nIn terms of other benefits you get:\n- 15% for friends and family on Apple products\n- 25% for personal use on Apple products\n- $500 off an Apple product at the fourth month of your internship\n- A bunch of other discounts for third party products',7200,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhs00m401jv9j7hh0dk','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','My internship at PlanGrid was amazing! It was by far my favourite internship. I got to work in a new role that I had never done before but got amazing mentorship and learned a lot about user research and data science. \n\nI got to lead my own project and had a large impact in shaping the direction of the product team. It definitely made me feel like I was doing good work to push the team forward.',8750,'USD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhs00m501jvcrnh4hgt','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Best internship I have ever had. I highly doubt companies at the size and scale of Uber are willing to give interns real work that has impact, but Uber definitely doesn\'t shy away from that. The work is very very interesting and challenging. You\'ll definitely enjoy your time here. \n\nPerks include breakfast, lunch, dinner, $200/month Uber credits, 17% Uber discount, fresh fruits, snacks, overtime salary, housing stipend, monthly phone stipend, fitness discount (Fitness SF). \n\nOverall, fantastic company to work at, great culture, WLB, and most of all the work is definitely something that will allow you to grow as an engineer. I\'m very strongly considering Uber for full-time over places like Google just because of the growth opportunities I see here. Definitely take this internship if you get a chance, you\'ll come out a 100% (or more) better engineer than going in.',44,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhs00m601jvfhf552h0','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Great team,  really smart people, everyone is willing to help out. I had a really good work term here. Work is meaningful and interesting. ',4520,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhs00m701jvasra73h5','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','A small company with a tightly-knit culture, and an interesting product. \nScope for personal development as a tester isn\'t too much, and have to request for coding work repeatedly. Coding work would mostly involve writing unit tests.\n\nThe team has a great culture, but need to understand an issue completely before turning to blame the co-ops for any issues that they might be facing. \n\nMentorship is very low with not much scope for personal improvement, and feedback is available once a month. They only provide the feedback after a delayed time which ends up being pointless as it doesn\'t address the entire need for timely feedback.\n\nOverall, a decent co-op experience with its own set of ups and downs. \n',2240,'CAD','monthly',2.0,2.0,1.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhs00m801jv56jk8kkr','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Interview was with the non-technical cofounder who asked deadass easy questions it was insulting',8000,'USD','monthly',1.0,1.0,1.0,1.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhs00m901jv4oi5afhl','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Great company to work for. The senior devs here are incredibly experienced and offer great mentorship. I didn\'t know anything about backend development before coming here, but was able to pick things up rapidly and learned a lot. Most people come in at 9:30 and leave between 5:30 - 6:00.\n\nThey have free breakfast, lunch, snacks, beer, etc. They also have a fitness benefit ($100 a month), a commuter benefit ($150/month), a phone benefit ($100/month) and an internet benefit ($100/month). ',4200,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhs00ma01jv8t8u3s0u','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','TLDR: Awesome experience, great company culture, full ownership over projects, good modern tech stack with lots to learn, competitive pay (especially for earlier coop terms), perfect WLB and great mentorship. I would highly recommend this position if you are self-motivated and passionate about full stack web development.\n\nAwesome opportunity to learn about all aspects of full stack web development, since there are only two full stack developer co-ops you will have full control over your projects, from ideation to development to deployment. There can be some downtime between projects, however if you take initiative and find problems to solve, you are more than encouraged to innovate new solutions for them. The projects solve real problems that LCBO faces, so your work will very likely go into production and have real users after completion.\n\nAnother great thing is the amount of freedom you have in your role, for example, the UI/UX designer on my term wanted to learn frontend development, whereas I spent my focus on backend and devops work and the other full stack spent some time on data science work. In terms of development, the tech stack is pretty widespread and modern, focused on the MERN stack for building web apps with supporting tools such as Elasticsearch, Redis and Docker, however we were highly encouraged to introduce new technologies if they see fit.\n\nCompany culture is amazing, the innovation lead and technology lead are both extremely chill and fun to be around. WLB is great, no pressure to deliver products fast, however you can accomplish a lot if you are motivated to do so. We did monthly team events on the last Friday of each month (VR, Escape Rooms), although they aren’t covered by the company, the high pay makes up for it. Mentorship used to be a problem in past terms, however a technical technology lead was hired in my term who providing us with technical help when we needed it.',4400,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhs00mb01jvco0eaj29','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Experience wise, this is a team-to-team company where some teams offer better internship opportunities versus others. My experience was on the backend team and you will have a great team full of smart, hard working guys and it\'s really easy to get along with them all and get going. The learning curve is difficult but they allocate for that, allowing you for a well paced coop. The company offers catered lunches everyday and pays in a higher bracket, so do what you want with the money. ',8000,'USD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhs00mc01jvba0i6l3l','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','- full ownership of projects and ideas\n- interesting project problem spaces\n- great pay\n- small team of 4 co-op students (2 full stack dev, 1 mobile dev, 1 UI/UX designer) and 2 full time employees\n- lots of opportunities to learn new skills and apply them to the project you\'re working on\n- awesome workspace\n- Communitech has a bunch of other innovation teams there, as well lots of cool events\n- basketball court, arcade machines, ping pong table, and Foosball table\n- super friendly manager\n\n\nawesome experience overall, highly recommended to all co-op students\n\n\n\n\n\n',1100,'CAD','weekly',5.0,4.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhs00md01jv4oo85v16','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','1. Perfect for people who know what they want to do/learn. You are always welcome to try new stuff as long as it adds value to the team. \n\n2. Fast-paced, we move on quickly. On average, each co-op would work on 3 projects per term.\n\n3. 100% ownership of the project.\n\n4. Communication is never an issue due to the small team. You can always receive feedback immediately. \n\n5. Office is located at Communitech, where you can talk with people from the other labs and learn from them.',4400,'CAD','monthly',5.0,4.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhs00me01jv9h420qok','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Pretty good overall.\nSalary is top notch for an internship at $60 an hour + 1.5k post-tax for housing.\nEveryone is friendly and energetic at the company. Project and work-life balance depend heavily on the team. Work is generally pretty fast-paced, but manageable. Things can get a little chaotic sometimes but in a good way.',60,'USD','hourly',5.0,5.0,5.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhs00mf01jv2yes41c4','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Interned in Winter 2019, overall it was a great experience, learned a lot from it.\n\nTeam was great, lot\'s of smart and chill people to learn from.',5780,'CAD','monthly',4.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhs00mg01jvefny1w5c','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Possibly my least enjoyable co-op. I would not touch this place with a 10 foot pole and a hazmat suit because it\'s absolutely toxic.\n\nFirst of all, you *will* get roasted by your manager, in front of everyone on your team during meetings. Everyone goes through this. You will get roasted for the most trivial of things, such as forgetting to update your tickets.\n\nSecond, this place is straight up corporate. Useless bureaucracy everywhere. Enterprise grade micromanagement. The team operates on waterfall. Virtually every piece of code you write (including bugfixes) requires you to write a big ass design document with a 20 page template, and you need to get that reviewed and approved by the team *before* *you* *can* *write* *any* *code*. After that\'s done, you have to provide detailed end dates for every task in your project. God forbid you miss one of those deadlines, because you\'re in for a roasting. We all know how good the software engineering industry in general is at estimating deadlines...\n\nDuring your project, you have to provide constant email updates about the status of your project. Micromanagement nuff said. Forget an update? You\'re in for a roasting.\n\nWhat\'s good? The people on the team tend to be smart, nice, and pleasant individuals to work with. Unfortunately the culture set by the leaders is straight out of office space.',52,'USD','hourly',1.0,1.0,2.0,1.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhs00mh01jvdpmp19z0','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Loved my term on the quality engineering team S/X in Fremont, CA. Less perks than a Bay area tech company, BUT lets be real, Tesla is an automotive company building cars! So perks and salary compared to automotive competitors is much above par. Experience and hands on work is unparalleled in my opinion, lots of authority (making engineering decisions) and freedom in choosing projects. Management a bit unstable but always had great mentorship. \n\nPerks: $130/month in Uber pool credits/commuter benefits (BART, Cal train etc.) (This comes two months into your internship!), $5/day for biking to work, 3 sick days after 90 days of working, $3000 post-tax housing stipend (avg rent around Fremont is $1150/mnth), Free cereal and oatmeal + Jones sodas + different kinds of tea. ',4480,'USD','monthly',4.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhs00mi01jvcokjali7','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','If mentorship = handholding, then this isn\'t the place for you. Mentorship to me means being able to push me in the right direction when I am stuck, and at the same time encouraging me to figure out something on my own. This internship taught me how to be independent. I learned how to actually navigate source code in a large repository and understand code that I did not write. By far one of the best companies that I have interned at, in terms of becoming a better software engineer. Mozilla also flew everyone in the company to San Francisco for a work week, and we were exposed to different Mozilla products (e.g. Firefox, Rust, WebAssembly, AR/VR, etc.). Interns were also given a MacBook Pro 15\" (latest model) to take home after the internship. This is one of the best places to intern at if you are really into the web and open source (+ a lot of swags and stickers). They have a ton of people on the W3C team, if that excites you. Salary is based on your location and education (Degree, Masters/PhD). It is the same for everyone in the same category.',4700,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhs00mj01jv94h6ciss','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459550,'ck1n1du49000501jo4pwygsav','Fabulous Work-Life Balance! Probably the best in the SF Bay Area. Stocks are also doing fabulous. I got paid $40 USD/hr with $8000 USD lump sum for 12 weeks. Aside from that you also get $360 USD wellness dollars to spendon anything you like.',9100,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhs00mk01jvet5k0esw','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','The culture at BMO is excellent, very welcoming and very professional. \n\nThey assigned me a mentor and helped me with everything I was assigned. There was little pressure on completing a task, there would be frequent meetings to keep everyone up to date.\n\nI find that the people working at BMO were very open-minded and friendly. I would recommend this job to anyone who would like to learn and grow professionally.\n',4600,'CAD','monthly',5.0,4.0,4.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhs00ml01jvfeeod5f2','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459710,'ck1n1du49000501jo4pwygsav','Fantastic experience. They give a 10k signing bonus (meant to be used for relocation/housing). Awesome culture, lots of events (with free food and drinks) going on all the time. Monthly engineering events, bi-yearly offsites, at least monthly intern events, etc.\n\nThey take care of their interns and engineers in general. The free lunch and dinner is $17 per meal and you order it through Seamless (basically Uber Eats but in New York).\n\nHighly, highly recommend this internship to anyone.',7800,'USD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhs00mm01jvba0rg9bw','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','- great people, learned a lot\n- no independent intern project, just take tasks from the JIRA board\n',8000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhs00mn01jv62c5d5r9','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','I had an absolute blast at Coursera. They let me pick meaningful projects that I wanted to work on, and really cared about my personal interests and growth. Would recommend 100%. ',9000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhs00mo01jvhj4jb1p1','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459550,'ck1n1du49000501jo4pwygsav','A good place to work. Extremely friendly coworkers who are always ready to help you even if they aren\'t in your team. It is like any other typical corporation. Supervisors are great mentors. You get to work on significant projects. \nDepending on what project you are working on, it might get a bit repetitive and boring. Overall a pretty good company and experience.\n\nPROS:\nWork life balance is good. 1-2 work from home days per week. Very understanding superiors if you need holidays/ time off work/ want to leave early etc.\n\nCONS:\nNo perks as such. No free food/gym etc. The only free thing you get is free coffee.',3400,'CAD','monthly',4.0,4.0,5.0,4.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvhs00mp01jv6fgv90nw','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459550,'ck1n1du49000501jo4pwygsav','The 7100 does not include the housing stipend of around another 2500CAD per month before tax.\n\nWork life balance is mediocre and the company is very frugal.',7100,'CAD','monthly',4.0,3.0,5.0,3.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvht00mq01jv967kfhhd','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Had an amazing experience. Top notch pay for a Toronto company, amazing people, cool office.\n\nPerks:\n\n- Everything the other poster mentioned\n- Fully stocked kitchen',5920,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x0zvht00mr01jvcof98nxe','2019-10-19 03:52:01.800000','2019-11-25 20:25:10.488227',1571459707,'ck1n1du49000501jo4pwygsav','Just an absolutely great place to work.\n\nThe culture was fantastic and I learned so much about full stack development.',4500,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,NULL,'wwwwaawfafwafafawfawfa',0,0,NULL),('ck1x3b44b00td01i9diauamuz','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked in the video team. Had a great mentor and learned a ton about video technology. Was able to work closely with many industry professionals from companies like Intel, Elemental, and Nvidia. Twitch also has a great culture, especially for gamers, and the perks are great :) Also, HR was very supportive and secured me a Product Management internship upon request.',7200,'USD','monthly',4.0,5.0,4.0,5.0,NULL,0,1,'2017-01-10T17:02:14.712Z','r4j4c49',0,0,NULL),('ck1x3b44c00te01i9e9n33mv7','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I had a pretty good time at Snapchat, I was on the platform team mainly doing work on performance tooling and automation testing. Most of the people who work there are pretty chill, though I don\'t think the company culture is amazing. Snapchat\'s right on the beach which is really awesome, and the weather\'s pretty amazing, so there\'s always a nice view outside the window :) ',9000,'USD','monthly',4.0,4.0,4.0,5.0,NULL,0,1,'2016-09-29T07:08:58.500Z','r2j2c42',0,0,NULL),('ck1x3b44c00tf01i9frandk0p','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked here twice and had fun each time. I had good mentors and there are some great engineers that taught me a lot at this company :)',1800,'USD','weekly',5.0,5.0,4.0,5.0,NULL,0,1,'2016-09-29T07:08:58.505Z','r3j3c59',0,0,NULL),('ck1x3b44c00tg01i95s34ar8l','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Great mentors and coworkers. I got a lot of freedom to choose my team, project and approach to solving problems.',8000,'USD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,'2017-01-21T17:54:54.786Z','r338j292c36',0,0,NULL),('ck1x3b44c00th01i99geuc9fv','2019-10-19 04:56:45.467000','2019-11-27 20:35:15.059000',0,'ck1n1du49000501jo4pwygsav','No mentorship at all. Joke of a company. Horrible Manager. You will be expected to work overtime (no extra pay) on shit projects. Pays peanuts for a place right in the middle of downtown toronto.',17,'CAD','hourly',1.0,1.0,2.0,1.0,NULL,0,1,'2017-01-21T17:57:38.570Z','r339j293c211',0,0,NULL),('ck1x3b44d00ti01i9gi5ygus0','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Absolutely loved the entire Vine team. Everyone was supportive and you are treated like a full time employee rather than just an intern. ',38,'USD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2016-09-29T07:08:58.521Z','r6j6c54',0,0,NULL),('ck1x3b44d00tj01i99sx118ug','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Blackberry is as much as can be expected from a large company/ corporate work environment. The work is dependent on the team. ',2800,'CAD','monthly',4.0,5.0,4.0,5.0,NULL,0,1,'2016-09-29T07:08:58.530Z','r7j7c62',0,0,NULL),('ck1x3b44d00tk01i99o08c9by','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Fall 2016. ',19,'CAD','hourly',3.0,3.0,3.0,5.0,NULL,0,1,'2017-01-21T18:42:38.042Z','r340j294c88',0,0,NULL),('ck1x3b44d00tl01i9envq5ikf','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Really cool place to work if you enjoy gaming. Leans more towards the embedded systems design/ embedded programming.',5120,'USD','monthly',4.0,5.0,4.0,5.0,NULL,0,1,'2016-09-29T07:08:58.553Z','r9j9c30',0,0,NULL),('ck1x3b44d00tm01i91qr44ke9','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Wattpad as a company is decent and I really liked working there. Unfortunately QA developer wasn\'t a role that I particularly enjoyed.',30,'CAD','hourly',4.0,4.0,3.0,4.0,NULL,0,1,'2016-09-29T07:08:58.558Z','r10j10c64',0,0,NULL),('ck1x3b44d00tn01i99c1x68m2','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I felt like this internship was the best yet. It is definitely one of the best places to work in Toronto (as mentioned in Canada\'s Top Small & Medium Employers). Work is very relevant and you are treated like any other developer in the company. There is no intern project and therefore will feel to be an actual part of the team as well and not just an extension. You work with the team, join in sprints, planning meetings and your inputs are definitely taken seriously.\n\nP.S. Free lunch is once a week and free breakfast includes cereal.',5250,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2016-09-29T07:08:58.564Z','r11j11c65',0,0,NULL),('ck1x3b44d00to01i9cr3i2j7o','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','This was honestly the best internship I have ever had! I worked on a small team and got to ship code from day one. I had a lot of impact on the product in the four months that I was here. My manager really cared about my personal development and encouraged me to step out of my comfort zone. For example, he asked some of us to give a tech talk at one of the mobile meetups hosted at Coursera.',8000,'USD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,'2016-09-29T07:08:58.569Z','r12j12c11',0,0,NULL),('ck1x3b44d00tp01i996jn606m','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Lots of responsibilities (and fun to match it). Great team and culture.',4000,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2016-09-29T07:08:58.574Z','r13j13c66',0,0,NULL),('ck1x3b44d00tq01i99lf5etrq','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked on the Amazon Ad Exchange team. My mentor and manager were both very supportive and the team was very welcoming. HR planned many events for interns (company offsites, hackathons, etc.). However, I did feel that as an intern, I was siloed from the rest of the team. Even though the project I was given was technically interesting and complex and I learnt a ton, I would\'ve liked to work closer with the rest of the team.',9600,'USD','monthly',4.0,4.0,4.0,5.0,NULL,0,1,'2016-09-29T07:08:58.579Z','r14j14c1',0,0,NULL),('ck1x3b44d00tr01i96fqfevnn','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I was on the Next Billion Users team. They create products for people on third world countries. I think that entire umbrella was really interesting. The perks at Google are great but the work really depends on the team you are on and how comfortable you feel with your manager. So make sure you really focus on the host matching process and don\'t just take the first manager that likes you. ',6150,'USD','monthly',4.0,5.0,3.0,4.0,NULL,0,1,'2016-09-29T07:08:58.584Z','r15j15c17',0,0,NULL),('ck1x3b44d00ts01i99feuajbk','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','ATA is great! A small company with an awesome culture and very talented people. They put a high value on interns and my team and HR were very supportive. Even now, ATA consistently invites me to dinners/lunches when they come to Waterloo to interview. On the topic of meaningful work... I thought that what I worked on wasn\'t technically exceptional/challenging most times. However, it had a large impact because of a very large userbase. Overall, highly recommend ATA, you meet great ppl, learn a ton, and Vancouver is an amazing city :D',5000,'CAD','monthly',4.0,5.0,4.0,5.0,NULL,0,1,'2016-09-29T07:08:58.589Z','r16j16c67',0,0,NULL),('ck1x3b44d00tt01i99hyy8bsz','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Venmo is an excellent silicon valley style company to work for in NY. The city is awesome and the work is meaningful. Being a part of a small team its a lot easier to make impactful changes.',8000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-01-17T04:34:56.905Z','r5j5c53',0,0,NULL),('ck1x3b44d00tu01i92uk14n69','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Excellent company to work for. Excellent work environment and great mentors.',3520,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-01-20T15:04:32.104Z','r8j8c66',0,0,NULL),('ck1x3b44d00tv01i97yho94bh','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Easily my favourite internship (been to most of the big tech companies).\n\nLots of interesting work (working with certain gov agencies), travel, customer interaction, etc.\n\nPerks are definitely a level above any other tech company (e.g. request literally anything to your local microkitchen and they\'ll get it). \n\nWork life balance is very team dependent. I never worked evenings or weekends but some interns are on busier teams did. People are generally young but super smart. More so than the average big tech corp employee in my experience (sample size of ~4 companies in the bay). \n',7500,'USD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,'2017-01-21T18:50:09.168Z','r341j295c32',0,0,NULL),('ck1x3b44d00tw01i9eurs6e72','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Only 4 coops and a full time who is not a dev. \nTasks are given but there\'s not much organization ',1100,'CAD','weekly',3.0,1.0,3.0,5.0,NULL,0,1,'2017-01-21T19:24:22.384Z','r342j296c212',0,0,NULL),('ck1x3b44d00tx01i94pf11pf0','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','This was a great experience for me because I was able to learn lots at work and travel around in Europe for the first time. I worked with Ruby on Rails for the backend projects and EmberJS for the frontend. I was able to work and lead a project by myself and the best part is that they used two of my projects to actually help the company gain more revenue! The work was challenging and I was able to help with the design process as well. I would definitely recommend Intercom as you\'ll get to work with some really amazing and fun people!',8500,'EUR','monthly',5.0,4.0,5.0,3.0,NULL,0,1,'2016-09-29T07:08:58.610Z','r20j20c68',0,0,NULL),('ck1x3b44d00ty01i9fjf1dai3','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','My internship experience was a lot of prototyping and design work since there was no actual product at the time. I got to learn about animations and graphics which was cool since this was new to me. I felt like I was given a lot of responsibility and did the exact same work as a full time. \n\nOne thing I noticed was that everyone sat in their office/cubicle all day. It would be better if there was more open space and if team members collaborated more. I would have also liked more code review and mentorship. ',35,'USD','hourly',3.0,2.0,4.0,5.0,'graphics,design,prototyping',0,1,'2016-09-29T07:08:58.615Z','r21j21c21',0,0,NULL),('ck1x3b44d00tz01i9ecnq9y1n','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I did my internship in the Lincoln Square campus. Out of my 6 internships, I think the work I did here was the most challenging and involved more algorithm design and implementation than I had ever done before. I was able to understand a little more about how other apps worked as I programmed for Android for the first time. Be careful about choosing the gym membership options as once you enroll, it doesn\'t matter when you enroll, it will count the payment days from the first day of your internship (and you can\'t cancel your membership until your internship ends).',7100,'USD','monthly',4.0,4.0,4.0,2.0,NULL,0,1,'2016-09-29T07:08:58.621Z','r22j22c27',0,0,NULL),('ck1x3b44d00u001i98xogcu7s','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I really liked this term because I got into mobile programming through what I learned at Metroland. I had a wonderful mentor who really helped me learn a lot. The pay was not good though so I would recommend this as a 1st or 2nd co-op term just for the experience.',2600,'CAD','monthly',4.0,5.0,3.0,4.0,NULL,0,1,'2016-09-29T07:08:58.626Z','r23j23c69',0,0,NULL),('ck1x3b44d00u101i93lmx6iau','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Firstly, that job title is a little misleading as I didn\'t get to do much programming at all. However, I did get to work with a lot of cool gadgets and futuristic technologies in concept design work. The worklife was good because I didn\'t have to do overtime very often and there was no pressure to bring work with me after work hours. The work I did was interesting - worked on designing a couple mental health apps for soldiers and also helped PhD students with their projects. I even got to go on a business trip to Ottawa. I would recommend this place for a 1st term co-op. (I didn\'t have a mentor but I had two supervisors because I worked on two main projects.)',2100,'CAD','monthly',4.0,1.0,4.0,5.0,NULL,0,1,'2016-09-29T07:08:58.635Z','r24j24c70',0,0,NULL),('ck1x3b44d00u201i90sz2dhgk','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','While this is a 3D graphics company and my title was 3D Software Developer, I didn\'t actually get to do any development for the 3D graphics part. Instead, I worked on developing a couple of animation library tools to help users animate characters/scenes with more ease. I worked in C++ and Python.',6000,'CAD','monthly',4.0,4.0,4.0,2.0,NULL,0,1,'2016-09-29T07:08:58.641Z','r25j25c71',0,0,NULL),('ck1x3b44d00u301i9fih89h6h','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','This position is excellent if you are interested in both the computer science and finance side of things.  I worked on valuating bonds using fitted curves based bond yields.  This work required regression analysis and running optimizations on financial modelling parameters.',1000,'CAD','weekly',4.0,4.0,4.0,5.0,NULL,0,1,'2016-09-29T07:08:58.646Z','r26j26c72',0,0,NULL),('ck1x3b44d00u401i9ajir1u5a','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Fantastic startup that\'s working on wastewater data. Very small, but everyone is a really chill person that does their job well, and can give great advice/mentorship when needed. Lots of freedom to try (useful) things that you think are interesting , as well as lots of responsibility since you\'re one of a few people at the company and your time really matters. \n\nIt was located in this cool co-working space at Bathurst/Bloor, which is fun, hipster area with no shortage of great lunch options. Co-working space has free tea + coffee that are both really good, and there are lots of interesting socially conscious startups in the building meaning you get to meet a lot of interesting people.\n\nI really enjoyed my work there and was encouraged to have a good work/life balance as well as find opportunities to grow. At the end of the day, even though I didn\'t know much about wastewater data, I felt pretty fulfilled with the work I did and had a great term.',20,'CAD','hourly',5.0,5.0,4.0,5.0,NULL,0,1,'2016-09-29T07:08:58.654Z','r27j27c73',0,0,NULL),('ck1x3b44d00u501i97nfdd8nm','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Work largely consisted of software development with financial data.  I mostly programmed in C# and SQL Server.  The full-timers are experienced, as shown in their codebase, which is well-documented and cleanly written.',30,'USD','hourly',4.0,4.0,3.0,5.0,NULL,0,1,'2016-09-29T07:08:58.660Z','r28j28c74',0,0,NULL),('ck1x3b44e00u601i9asax6xc3','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I was working on the Broadcast team which was one of the most fun teams available. Within the team there was great culture and my manager was extremely supportive and helpful whenever I needed it. The overall company culture isn\'t the best and there are some difficulties around recruiting and perks but overall it was a fun co-op and a great was to experience LA living.',9000,'USD','monthly',4.0,5.0,3.0,5.0,NULL,0,1,'2016-09-29T07:08:58.671Z','r30j2c42',0,0,NULL),('ck1x3b44e00u701i95da8asjl','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I was working at HQ in the Menlo Park office on the Messenger team. Facebook is very flexible in the way they let you choose your team and in my experience, your project as well. The perks at Facebook can\'t be beat - they provide pretty much anything you can think of that you would need for living, awesome events, shuttles, often trips to remote offices, a health and wellness stipend (on top of an on-campus gym), etc. The work experience is very team/manager/project dependent. If all of these work out then everything else about the company is great and it\'ll for sure be a great experience. Return offers are also given directly after the internship with no extra interviews required.',8000,'USD','monthly',4.0,5.0,4.0,4.0,NULL,0,1,'2016-09-29T07:08:58.676Z','r31j30c14',0,0,NULL),('ck1x3b44e00u801i96gkv9n2o','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','This was my first developer internship. I was nervous that I wouldn\'t be good enough since I had never actually done any paid work before. Everyone was really nice and welcoming - most people were happy to answer questions. By the end of my time there I had learned a lot and was even able to help out some of my co-workers with their questions :)',700,'CAD','weekly',5.0,5.0,4.0,4.0,NULL,0,1,'2016-09-29T07:08:58.681Z','r32j31c75',0,0,NULL),('ck1x3b44e00u901i99r1edgwp','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Interesting work and lots of smart people :)',5500,'USD','monthly',4.0,4.0,5.0,4.0,NULL,0,1,'2016-09-29T07:08:58.686Z','r33j32c76',0,0,NULL),('ck1x3b44e00ua01i956uggx4j','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','There were lots of opportunities to learn, lots of tech and non-tech talks during lunches. Got to go on some cool company trips and the people were friendly. The first team I was on was a little too quiet - like, often people wouldn\'t even say good morning when someone new arrived. The second team I was on was really talkative so I felt more at ease :)',6400,'USD','monthly',4.0,3.0,4.0,4.0,NULL,0,1,'2016-09-29T07:08:58.692Z','r34j33c77',0,0,NULL),('ck1x3b44e00ub01i90ylpfxtv','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I had a great time here ! My mentors were great and I really learned what it was like to do a PhD (also more about MRI imaging and physics than I\'ll ever need to know). ',11,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2016-09-29T07:08:58.697Z','r35j34c78',0,0,NULL),('ck1x3b44e00uc01i9bvws4w4v','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Yeah they weren\'t really sure what to do with me. They wanted someone to manage their social media for them but they were a cheap electronics company so their pages consisted mostly of people complaining about how awful they were. I wanted to advise them to delete their social media accounts \'cause they were so negative, but then I guess I wouldn\'t have had a job. O.o\n\nAlso it was in Markham. Ewie. ',600,'CAD','weekly',2.0,3.0,1.0,3.0,NULL,0,1,'2016-09-29T07:08:58.702Z','r36j35c79',0,0,NULL),('ck1x3b44e00ud01i9ejqw3l3z','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Hulu\'s internship program is totally amazing. Everyone is super eager to help you and they\'re no limits to what you can do as an intern. Depending on your comfort level you can work on small frontend features or design an entirely new production facing service from scratch (I did both!). They organize great intern events every two weeks like Disneyland, Hollywood Cemetery movies, beach days, etc. My friend interned at Google afterward and said she missed Hulu\'s internship program :D',7000,'USD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,'2016-09-29T07:08:58.708Z','r37j36c19',0,0,NULL),('ck1x3b44e00ue01i96f2000f3','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I had a great internship experience, working on a mobile product and able to see it in use at events and festivals. Free meals aren\'t every day, but there was an awesome smoothie room and some cool perks were being able to attend events for free. I would have wished for my team to do more social events together as I feel that\'s important (and there weren\'t many other interns), but overall I enjoyed doing the work, and had plenty of time to explore the city (good worklife balance).',38,'USD','hourly',4.0,4.0,4.0,5.0,NULL,0,1,'2016-09-29T07:08:58.713Z','r40j39c81',0,0,NULL),('ck1x3b44e00uf01i9d1so8vrj','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','In my term, Lookout starts your term as a QA for about a month or so. Then, one is switched to a developer role working on some bug fixes and an intern project. Interns are discouraged to work on projects that have big impact to the company (since they want \"someone full-time to maintain it\"). However, it was a good balance between the two roles.',7000,'USD','monthly',4.0,4.0,3.0,5.0,NULL,0,1,'2016-09-29T07:08:58.719Z','r41j40c25',0,0,NULL),('ck1x3b44e00ug01i95sva316x','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked at Vine on a four month internship at the beginning of 2016. Despite some housing-related qualms (not Vine\'s fault), I had a great time. Though Vine is a subsidiary of Twitter, it maintains its own distinct culture and feels very much like its own company. With less than 100 employees, the Vine team is a tight-knit group, who are all obviously passionate about the platform. The salary information in my review includes a prorated $2000 housing stipend, which won\'t get you the best apartment in New York, but certainly a passable one (which I would\'ve liked). Speaking of New York: it\'s a vibrant and diverse city in which you\'ll never run out of things to do. I highly recommend visiting Brooklyn Boulders if you ever happen to be in town!',8000,'USD','monthly',5.0,4.0,4.0,5.0,NULL,0,1,'2016-09-29T07:08:58.724Z','r42j41c54',0,0,NULL),('ck1x3b44e00uh01i92et3eycp','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','They give you $3500 per 4 weeks for housing stipend on top of your salary. So it\'s a lot of money of you take the stipend. Work-wise, they assign you a standalone project that most of the time is a big feature or a standalone service. I was given lots of freedom in how I want to tackle development and everyone on the team is helpful when I had questions or I needed their opinion on something. Amazon is really big on ownership and delivering results. I feel like I learned a lot during this internship.',7300,'USD','monthly',4.0,5.0,4.0,4.0,NULL,0,1,'2016-09-29T07:08:58.729Z','r38j37c4',0,0,NULL),('ck1x3b44e00ui01i9db38e04r','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Overall I had a good time at Palantir; I interned in Winter 2016 and they were in the middle of a change to their hiring process so I ended up being on two different teams. I also got to travel quite a bit which was nice. The work was pretty typical application development work, mainly with React and React Native. There\'s rumours about poor work/life balance but I think that\'s only on certain teams/offices. I didn\'t notice anything too crazy when I was there.',7500,'USD','monthly',4.0,5.0,4.0,4.0,NULL,0,1,'2016-09-29T07:08:58.493Z','r1j1c32',0,0,NULL),('ck1x3b44e00uj01i9c4p151pc','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','At Remond, I was on the Office Licensing Team working on the client side. The code was all in C++ and I had a hard time digging through the code because this is really old code with some complicated logic. Overall this team was great and the people seemed to have a great work life balance. Much like any other big company, you have to remember that the experience ends up depending on your team and your mentor. I knew people who hated it but I loved my time here! Also Microsoft doesn\'t really have an on site gym but they do give you a membership to the Pro Club which is better than any gym I\'ve ever been to and its close to the Redmond campus. Besides this, Microsoft is really generous about their intern events for the summer term (not really for the other terms) and they give an intern gift to every intern! ',7500,'USD','monthly',4.0,5.0,4.0,5.0,NULL,0,1,'2016-09-29T07:08:58.594Z','r17j17c27',0,0,NULL),('ck1x3b44e00uk01i946jo5eqi','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','This was my first internship so I was really excited to work for such a big company. I loved working with my team and I still keep in touch with my mentor even after 4 years. I even went back to visit recently. I was on the App Engine team as a technical writer so I did a lot of web development (not so much the technical writing part). I got to understand the internal structure at Google, experience the work life there (which is pretty sweet with all of those perks and fun stuff lying around - even slept in one of those sleep pods once!). The work was challenging enough for me at the time and I also learned to work with a lot of new technologies. ',5200,'USD','monthly',5.0,5.0,4.0,3.0,NULL,0,1,'2016-09-29T07:08:58.599Z','r18j18c17',0,0,NULL),('ck1x3b44e00ul01i9b81u58gx','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Microsoft Japan is unlike any other internship experience and obviously that is mostly because of the location. I\'m going to list out the pros and cons for this internship in detail since there are not many international students who intern here.\n\nPros: \n1. It\'s in Tokyo! Their office is in shinagawa and its so easy to get to any place in Tokyo. Weekends and evenings are always so fun. This is the main reason I give it a 5 star. If traveling or living in Tokyo for 4 months doesn\'t excite you then maybe this isn\'t the internship for you.\n2. They put you up in a nice studio apartment close to shinagawa. For me, my apartment was in Tamachi station but I heard some people were in a different location. Either way it is paid for and pretty nice. It\'s a little small but definitely enough for one person. \n3. The Japan team only hires international interns on the office team and the office team in Japan unlike Redmond is very small. They only have the Sway and Docs.com team and a bit of Office Lens I believe. This is a pro and a con. It\'s a pro because you get to know the team. It\'s very open concept unlike Microsoft in general. The con is that you might not want to work on these products at all. \n4. Companies in Japan have a interesting culture. People there work reallllly late but this isn\'t true for Microsoft Japan. I mean people did work late but I never felt any pressure to do so. It would be like any other company in Silicon Valley etc. \n\nCons:\n1. Salary. You will not save any money if you come here. If you\'re using your internships to pay for school then re evaluate this internship. We got paid around 2.5 CAD before tax/health insurance. They do reimburse you for the flights though. I heard that the the term after us started getting paid 400000 yen which is about 4000 CAD (at least when I interned there). But even then Japan is an expensive place and if you want to travel and eat good food this money will be enough to live there but not to save and bring back.\n2. Language barrier. Fewer people than I expected spoke English in Tokyo. Get used to using google translate or learn some Japanese. This can sometimes be frustrating because buying milk can be difficult but at the same time if you\'re considering this then I assume you have some interest in learning about the culture and language. ',250000,'JPY','monthly',5.0,5.0,3.0,5.0,NULL,0,1,'2016-09-29T07:08:58.605Z','r19j19c27',0,0,NULL),('ck1x3b44e00um01i95ieua0j8','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I interned here in 2014. Working at Minted was alright; there didn\'t seem to be much of a culture, and there seemed to be a divide between the engineering team and the non-engineers. People typically worked normal hours. The tasks I was assigned were kinda boring, but were pretty typical compared to the tasks assigned to other members of my team. It may just have been that I\'m not super interested in the sort of e-commerce they were working on.\n\nI was able to do most of my work mostly independently and got help when needed. They hire a good amount of interns from Waterloo so you\'ll have friends to hang out with after work. The pay isn\'t as great as other places, and they don\'t provide lunch very often.',6500,'USD','monthly',4.0,4.0,4.0,5.0,NULL,0,1,'2016-09-29T07:08:58.665Z','r29j29c28',0,0,NULL),('ck1x3b44e00un01i99q95clpk','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','D2L was a great place to work at. My team was comprised of talented and passionate individuals, that were always willing to help. They promoted an engaging learning environment, and presented challenging, meaningful work for me. Overall, I was very satisfied with my time there.',20,'CAD','hourly',5.0,5.0,4.0,5.0,NULL,0,1,'2016-09-29T07:08:58.742Z','r44j43c83',0,0,NULL),('ck1x3b44e00uo01i93h1n2qon','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','All I did was fix bugs my entire internship. It was my first co-op but it seemed like this was the case for returning interns as well. The technologies that I used was also not very transferable to my later internships. ',20,'CAD','hourly',2.0,2.0,1.0,5.0,NULL,0,1,'2016-09-29T07:08:58.747Z','r45j44c84',0,0,NULL),('ck1x3b44e00up01i96fm77gnt','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked here during my first ever internship. The team was working on a small part of a large piece of enterprise software, and their lack of enthusiasm for the product and their work was apparent. So as you would expect, internships feel equally unexciting and menial. The culture is very corporate. Although I did learn some practical skills on the job, I would not recommend SAP to anybody with a bit more experience.',20,'CAD','hourly',2.0,1.0,1.0,5.0,NULL,0,1,'2016-09-29T07:08:58.752Z','r46j45c39',0,0,NULL),('ck1x3b44e00uq01i97k3f9jca','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I had a great internship at Uber, and loved the team I was on. There was a lot of meaningful work to do, and everything I worked on during my internship was launched. My team was a good mix of working and also having fun. I did have some weeks of very long hours, but I was never asked to do them - I just wanted to see my project succeed. You get a $1000/mo housing stipend, $50/mo cell phone stipend, and are paid for overtime work. The company itself has a few organizational issues that I\'ve noticed, but overall not a hinderance on my experience. ',43,'USD','hourly',5.0,5.0,5.0,4.0,NULL,0,1,'2016-09-29T07:08:58.761Z','r39j38c52',0,0,NULL),('ck1x3b44e00ur01i98euf85qd','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Interns all got 2 flexible vacation days per month. I used them to take a bunch of 3-4 day weekend trips, visiting different countries in Europe.',3167,'GBP','monthly',4.0,4.0,3.0,5.0,NULL,0,1,'2016-10-26T21:44:23.774Z','r96j88c8',0,0,NULL),('ck1x3b44e00us01i92ss90ope','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I interned at Facebook in Winter 2015. They took care of everything for me so all I needed to care about was focusing on my work. They have excellent infrastructure and a great amount of resources I could leverage. I learned a lot about handling/working with large amounts of data using the industry-standard open-source software (made by Facebook) while working there.\n\nFacebook has the best culture out of all of my co-ops.',6800,'USD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,'2016-10-27T05:41:17.575Z','r98j90c14',0,0,NULL),('ck1x3b44e00ut01i9b7ybbij3','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked on the same research team at Autodesk for three separate internships, so it\'s needless to say that I really liked it there! The team is made up of immensely intelligent and impassioned individuals. You\'ll always be the dumbest person in the room (which isn\'t a new thing for me), but it\'s worth it when you get to contribute to the amazing work that the team is behind, even if only a little. ',25,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2016-09-29T07:08:58.734Z','r43j42c82',0,0,NULL),('ck1x3b44e00uu01i9dr0257cf','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','This is essentially a QA role; most of the job consisted of manually testing CRM applications. This being a company that uses the dreaded waterfall design process, you are also responsible for writing numerous design documents for those same applications. Everyone on the team is friendly and helpful, but you can\'t help but feel dispirited when you find out that few people in the company actually use the applications you are supporting.',3000,'CAD','monthly',3.0,3.0,1.0,3.0,NULL,0,1,'2016-09-30T01:54:43.780Z','r49j47c85',0,0,NULL),('ck1x3b44e00uv01i9at0tbgnx','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','My manager was nice, but he was far too busy to provide any support to me, who was basically shuffled to the corner with pointless projects. Some of my co-workers were also quite rude; they told me to go away when I asked them questions. Overall, I barely touched production code, and spent most of my time reading novels on the side.',2080,'CAD','monthly',1.0,1.0,1.0,1.0,NULL,0,1,'2016-09-30T02:02:26.343Z','r50j48c86',0,0,NULL),('ck1x3b44e00uw01i91ij4bqik','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','A very small company that does complicated online financial services. I did get a chance to do a little web development, but I was only one of three developers, one of whom was working part-time from Vancouver, and the other didn\'t believe in source control, so...',3122,'CAD','monthly',2.0,2.0,2.0,3.0,NULL,0,1,'2016-09-30T02:09:20.177Z','r51j49c87',0,0,NULL),('ck1x3b44f00ux01i92hdd24mz','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','What we did—helping doctors to bill the provincial government for the services they performed—was not that exciting, but my co-workers were all fairly knowledgeable. One of them also proved to be a very good mentor. Still, there wasn\'t a whole lot of work to do.',2519,'CAD','monthly',2.0,3.0,1.0,3.0,NULL,0,1,'2016-09-30T02:14:08.113Z','r52j50c88',0,0,NULL),('ck1x3b44f00uy01i9c7kga3da','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Palette Gear has some really cool-looking products—there\'s nothing more fun than turning a dial and watch the colours of a photo change on Photoshop. The codebase is a bit...scattered; on the other hand, it is a startup, so there were a lot of opportunities to make changes that actually impact your customers.',3059,'CAD','monthly',3.0,3.0,4.0,3.0,NULL,0,1,'2016-09-30T02:20:33.681Z','r53j51c89',0,0,NULL),('ck1x3b44f00uz01i9ed9a6p8c','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The perks were really awesome and there are a lot of organized intern events. The work itself was pretty meh. I didn\'t feel like the stuff I was working on was that important or high priority. I also feel like there wasn\'t much collaboration between team members. I was mostly doing my own thing and so was everyone else.\n\nI\'ve always been more interested in building user facing features, but this time I was working on a backend payments team. That may have contributed to my mediocre experience while other interns enjoyed it more.',8000,'USD','monthly',3.0,3.0,3.0,4.0,NULL,0,1,'2016-09-30T05:17:49.774Z','r54j30c14',0,0,NULL),('ck1x3b44f00v001i9equlhmzu','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Charity Intelligence is a charity that operates as a watchdog for Canada\'s charity sector. As a summer research analyst, you will be one of 4 students updating the profiles of charities, both in terms of financial information and social results reporting. The job will expose you to a variety of different charities, develop your critical thinking skills, and strengthen your written communication skills. You will also have the chance to interact with the charities, providing feedback that will ultimately help charities improve their reporting.',2500,'CAD','monthly',4.0,4.0,4.0,5.0,NULL,0,1,'2016-09-30T20:37:54.972Z','r55j52c90',0,0,NULL),('ck1x3b44f00v101i9848b6uz0','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Investor Relations was a relatively small team, so you will have the opportunity to jump onto a lot of different projects and meetings. In reporting, the work can be quite repetitive, but this role will definitely develop your critical thinking skills. The people are also super nice! :)',3000,'CAD','monthly',3.0,4.0,3.0,5.0,NULL,0,1,'2016-09-30T20:40:09.442Z','r56j53c91',0,0,NULL),('ck1x3b44f00v201i92aqwhgnw','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','- job was mostly related to administrative items\n- training extensive, takes up to 4 months to be fully trained\n- great Cafeteria\n- great benefits as well as holidays\n- company located in north end of Toronto, if you commute, it takes a while',26,'CAD','hourly',4.0,3.0,3.0,4.0,NULL,0,1,'2016-10-06T01:00:55.955Z','r57j54c92',0,0,NULL),('ck1x3b44f00v301i97rnedhg2','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked there summer of 2015. \n\nThe mentorship and support was low here. My manager didn\'t really talk to me much. I only had about five one on one meetings: a few at the beginning of the internship, one at the midterm review, and one at the final review. He was nice at least and when I emailed him he would respond. He did offer me resources on how to learn what I needed for my project.\n\nI didn\'t finish my project, but afterwards someone else on the team finished it and it ended up in production which is cool.\n\nI did learn stuff at this internship since I hadn\'t used the technology and languages before. \n\nThe work life balance was great because interns weren\'t expected to work the same hours as the full timers. Full time employees generally work 9 am - 6 pm/7 pm. I worked 9 pm - 5 pm.\n\nThere weren\'t many perks. There were a few corporate discounts at tourist attractions. It was also free to ride the ferry across the Hudson to NYC during the work day since there were offices on both sides of the river. \n\nI did get to meet several people in senior leadership while I was there. The managing directors all tried to make time to meet some of the interns and it was sometimes effective to reach out directly to the MDs and ask to meet them.',6250,'USD','monthly',3.0,2.0,3.0,5.0,NULL,0,1,'2016-10-06T22:48:48.916Z','r59j56c93',0,0,NULL),('ck1x3b44f00v401i9fkx683op','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The team is small and friendly, so time in the office is fun. I had no experience in iOS going in, but I was immediately given real work and I was trusted to pick up skills as I went, so I learned a lot in my time there. I felt real responsibility for the features I worked on. This was a rewarding internship, I highly recommend it!',8500,'USD','monthly',5.0,4.0,5.0,5.0,NULL,0,1,'2016-11-04T00:34:21.271Z','r108j99c106',0,0,NULL),('ck1x3b44f00v501i93evnfiyw','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Shopify has a cool blend of startup culture and having a lot of people (well, it\'s getting there.) I only worked on a small piece of the product, but everyone there is really excited about the parts they work on and happy to teach you things and help you out. Also the office and kitchen is hella rad, they have a book wall that you can just take interesting things to read from and they resupply it every week.',5200,'CAD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,'2016-11-04T00:53:15.483Z','r109j100c40',0,0,NULL),('ck1x3b44f00v601i914an6l0i','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked under the Sony Creative Software department in summer 2015. It was a small friendly office with pizza parties every Friday. Work was meaningful to some degree; it was my first co-op so I understand my assignment of the easier tasks. Mentorship was slightly difficult as supervisors were in their own offices. Enjoyed the experience overall. ',660,'CAD','weekly',4.0,4.0,3.0,4.0,NULL,0,1,'2016-11-04T00:56:57.023Z','r110j101c107',0,0,NULL),('ck1x3b44f00v701i9h1262tuc','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I was on the stability and security team. My internship was centered around ZooKeeper mostly, but I had a lot of freedom in choosing the direction that I take the project. I was given the option to change projects and even teams in the middle of my internship if I wanted to try something else. The work-life balance was the best that I have seen and people often stayed after work to play games or hang out. Even though I was the only intern for a part of the time I was there, everyone made me feel very welcome and treated me as a full-time employee. They even let me shadow couple interviews and ask a question on one. I still keep in touch with the people on my team and visit the office whenever I am in town. ',8500,'USD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,'2016-10-09T00:54:05.312Z','r60j57c7',0,0,NULL),('ck1x3b44f00v801i970yk5uir','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Enjoyed my first job here; good mentor and had a good time :)',1500,'CAD','monthly',4.0,4.0,4.0,4.0,NULL,0,1,'2016-10-11T04:31:32.847Z','r63j59c94',0,0,NULL),('ck1x3b44f00v901i92xmw3ntu','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The Toronto office has a really great, supportive culture - and you\'re treated as a full timer in every respect. There\'s a lot of focus on getting stuff done and stripping out inefficiencies / useless bureaucratic processes and \"just doing it\". Also, the whole company lives and breathes by their availability metrics. Even the smallest outage is taken very seriously - and it\'s interesting to work in a culture where no matter what you do, you shouldn\'t break anything. Even though interns don\'t go on-call, I still felt the responsibility for ensuring my code works well - and I often helped on-call devs handle incidents to get the feel. I feel like I learned a lot there, and had a lot of fun while still having relatively low levels of stress.',5000,'CAD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,'2016-10-24T01:16:51.487Z','r66j61c95',0,0,NULL),('ck1x3b44f00va01i9hmqzf2nb','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I had a terrible experience at Facebook due to having a very bad manager. He couldn\'t explain expectations, he was not available to answer questions, and he overall seemed to dislike/be bad at being a manager. Your experience will vary though. Many of my fellow interns had better teams and managers, so they had a better experience.\n\nThe perks were great though! You get paid a ton and are given quality, free housing. My corporate housing was in a good location. In my case my apartment complex was within biking distance to the office. I had my own room and bathroom and laundry in my unit. Even though the apartments were close to the apartment, we still had free shuttles to and from work. They had free food and all the other standard tech company perks.\n\nPerks, pay, and that it looks great on a resume make this at least a two out of five even though I didn\'t learn much there.',8000,'USD','monthly',2.0,1.0,1.0,1.0,NULL,0,1,'2016-10-24T03:08:32.525Z','r58j30c14',0,0,NULL),('ck1x3b44f00vb01i92h9j5w7l','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I had a good experience at Facebook, but mostly because it\'s a big company and has a lot of perks. I was doing low level programming in C++ and the codebase for that part can be messy and hard to understand. The concept of meaningful work is also very different in a big company. \n\nMy team was made up of people who had kids and wanted to go home earlier, which was good for worklife balance but made getting to know them harder. There was almost no team communication outside of the necessary -- people rarely ate together, and when we tried \"mandatory\" Friday lunch together, it felt a bit awkward. There was almost no cross team communication.\n\nThe perks are awesome though. There are also a lot of other interns, which makes for a great experience. There are often various talks, presentations and events on the Facebook campus which anyone can attend.',8000,'USD','monthly',3.0,3.0,3.0,4.0,NULL,0,1,'2016-10-24T03:08:32.533Z','r62j30c14',0,0,NULL),('ck1x3b44f00vc01i9dnja23uf','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','My team made this internship amazing. I feel like I connected to the people the most and I had the best mentor out of all my internships. On my team, there was a culture of playing a lot of fussball, working a lot and then going out together. Often, people would hang out with each during the weekends as well.\n\nI don\'t think that the work that I did was that meaningful, but that might be because it was my first internship, so I focused more on learning how to do things and not enough on knowing the impact of what I did or looking at the broader picture. I did mostly front-end work. The work was organized in sprints, which were actually done properly and people got excited about finishing them and celebrating afterwards.',6000,'USD','monthly',5.0,5.0,3.0,4.0,NULL,0,1,'2016-10-24T03:12:36.145Z','r61j3c59',0,0,NULL),('ck1x3b44f00vd01i9dz7iaj32','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Yext is a neat startup in Manhattan that provides a location management platform for business owners. The company takes very good care of its employees, with free lunch and dinner every day provided by Seamless (so you get food delivered to you from a nearby restaurant). During the middle of the term, they also took the whole engineering team on an all-expenses-paid trip to Puerto Rico. The product itself is a bit boring (like enterprise java software) but the perks make up for it.\n\nSince I was the only intern in my term, the culture felt a bit lonely at times. Much of the company culture was centered around alcohol, as every team mixed cocktails every Friday, and coworkers frequently went to bars together after work. If you like ping pong or Smash Bros, this is the company for you.',8700,'USD','monthly',4.0,4.0,3.0,4.0,NULL,0,1,'2016-10-24T03:12:36.151Z','r65j3c59',0,0,NULL),('ck1x3b44f00ve01i9gbq4bpba','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Sweet place, campus is amazing, quite an experience. Try it once if you can.',7230,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2016-10-24T03:42:22.475Z','r68j15c17',0,0,NULL),('ck1x3b44h00vf01i9gxqs6kkb','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Opportunity to have incredible amount of impact as an intern.',6800,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2016-10-24T03:42:37.020Z','r69j63c14',0,0,NULL),('ck1x3b44h00vg01i9gagbdh5p','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I enjoyed it, but it really depends on your team. Morale is really low on some teams, so look out.',860,'CAD','weekly',3.0,4.0,3.0,4.0,NULL,0,1,'2016-10-24T03:50:03.036Z','r70j64c62',0,0,NULL),('ck1x3b44h00vh01i9626ye8i0','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The work was a bit all over the place and not super organized. The culture there is definitely as good as they\'ll tell you - a fun-loving, friendly bunch. As far as mentoring goes, my mentor was not great at, well, being a mentor. I\'d have more success reaching out to the team lead instead. ',6500,'USD','monthly',3.0,2.0,3.0,5.0,NULL,0,1,'2017-01-10T02:17:37.709Z','r234j199c155',0,0,NULL),('ck1x3b44h00vi01i9fhth33dt','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked there summer 2016. Great place, the Waterloo office is super nice. Great pay for the region, and has a good amount of features that Mountain View has (not quite as much though).',1950,'CAD','weekly',5.0,5.0,4.0,5.0,NULL,0,1,'2017-01-18T07:54:39.005Z','r67j155c17',0,0,NULL),('ck1x3b44h00vj01i9gzb3h12r','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I was there for Summer \'16. I was on the Messenger Core team, working on a cross-platform data-syncing library for the Android and iOS Messenger apps. I was given the general responsibility of reducing data consumed by the library, and was given leads and general ideas to explore in order to achieve this. I felt a ton of autonomy, to the extreme where I would have liked some more guidance and concrete projects to work on. It was a great opportunity to practice directing myself and others rather than the normal developer job of working on a stream of coding tasks. The perks, salary, and housing are awesome. Tons of events for interns and tons of interns to enjoy them with. Because you live with other Facebook interns, and eat all meals on campus, there\'s a poor work-life balance. Overall, I worked on some interesting stuff (invertible bloom filters and zstd compression), and would recommend this internship to everyone.',8000,'USD','monthly',5.0,5.0,5.0,3.0,NULL,0,1,'2016-10-24T03:50:15.972Z','r71j30c14',0,0,NULL),('ck1x3b44h00vk01i9eaold65m','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Great group of guys, its a fun environment with a chance to make a lot of impact. Good experience, not great pay.',650,'CAD','weekly',4.0,4.0,4.0,5.0,NULL,0,1,'2016-10-24T03:51:15.838Z','r72j65c96',0,0,NULL),('ck1x3b44h00vl01i980oyfnlc','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','This is my fourth internship overall and second internship at the states. I have to say this is the best internship I ever had. I was lucky to have the best team in the company, where everyone is so nice and helpful. The thing I like the most is that I don\'t feel like an intern at Zenefits, the projects I did were making impacts to both the customers and internal users.',7500,'USD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,'2016-10-24T04:07:49.397Z','r73j66c60',0,0,NULL),('ck1x3b44h00vm01i9695hholf','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Really good mentorship program. They really want you to do meaningful work here.',9500,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2016-10-24T05:35:30.200Z','r74j67c97',0,0,NULL),('ck1x3b44h00vn01i9c9b85xrp','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The projects were innovative and challenging, as the team does a lot of R&D work. Work life balance is manageable, although there is not much to do without access to a car.',35,'USD','hourly',4.0,5.0,4.0,4.0,NULL,0,1,'2016-10-24T12:06:42.076Z','r75j68c5',0,0,NULL),('ck1x3b44h00vo01i91phz4z82','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The work is meaningful, although it is very busy and you need to be very self motivated to get through different issues. Work life balance is alright.',35,'USD','hourly',4.0,4.0,3.0,4.0,NULL,0,1,'2016-10-24T12:08:47.867Z','r76j69c5',0,0,NULL),('ck1x3b44h00vp01i9fbjc1fdb','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','As an electrical engineer, there\'s not too much work to be done, and the work is fairly straightforward. The perks were nice, although they have recently been removed.',36,'USD','hourly',4.0,3.0,3.0,5.0,NULL,0,1,'2016-10-24T12:10:47.011Z','r77j70c98',0,0,NULL),('ck1x3b44h00vq01i96p3qgwxr','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Fun and challenging projects that are really meaningful. Great mentorship and many activities for the interns at work and outside of work.',29,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2016-10-24T12:12:17.675Z','r78j71c99',0,0,NULL),('ck1x3b44h00vr01i99qj49vr6','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Salary was actually $43 USD. I was given a full fledged project to work on -- so a large part of my good experience was my team and the project they gave me. Other than that summer internships are the best given that they hire 200+ interns from all across the US so there are more people to meet. Great experience overall.',50,'USD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2016-10-24T13:41:20.634Z','r79j72c8',0,0,NULL),('ck1x3b44h00vs01i9hhpc3l2a','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked in the main Montreal office during the summer of 2016. The company culture is great, many small company events and volunteering opportunities. 5à7 every Friday where there are drinks and popcorn. Coworkers are very friendly and helpful, great place to learn lots of different design and modelling technology. ',23,'CAD','hourly',5.0,4.0,5.0,5.0,NULL,0,1,'2016-10-24T13:49:48.552Z','r80j73c82',0,0,NULL),('ck1x3b44i00vt01i91plu300s','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked here in the summer of 2015 as a production engineering intern. The company culture was fantastic, there were many events planned for both interns and full times. The perks are great -- they really make it seem like they value you very much, not just as an employee but as a person. The only thing that was lacking a bit was work life balance, although I think that depends a lot on the team you are on.',8000,'USD','monthly',4.0,4.0,4.0,3.0,NULL,0,1,'2016-10-24T17:36:18.095Z','r81j74c14',0,0,NULL),('ck1x3b44i00vu01i90xgs5obx','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','It was a very fulfilling experience, the work is sufficiently challenging and you are treated as a full time engineer. The project you work on will likely be high impact and definitely be in production before you depart. The company culture is very inclusive with a \"work hard, play hard\" mentality.',7000,'USD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,'2016-10-25T01:56:37.702Z','r82j75c52',0,0,NULL),('ck1x3b44i00vv01i9dspx3dzf','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I was an intern in the Microsoft Garage branch of the corporation. I worked with 3 other software engineers and a designer (all interns as well) in a team to create and design a product ground up over the span of 4 months.\n\nThere are two main offices in Boston, one on 1 Memorial Drive and the other is just across the street.  Both offer amazing views of the city and are very close to a bunch of food/grocery places.\n\nAs a team designing and building the product from the ground up, you are given basically complete control over the product you build and how you want to make it happen. Of course there are restrictions and guidelines which are clearly provided by a small team of mentors. The pace is very quick and you should be prepared to learn alot in a very short amount of time - in order to do successfully. \n\nThe one downside is that you really have no idea how plausible a project is to realize in a 4 month period, thus defining a MVP (minimum viable product) early on and committing to finishing it can range from very easy, to nearly impossible by the end of the 4 months.\n\nI worked an average of 8-9 hours a day 5 days a week. \n\n',7100,'USD','monthly',3.0,4.0,4.0,3.0,NULL,0,1,'2016-10-25T04:34:50.642Z','r83j76c27',0,0,NULL),('ck1x3b44i00vw01i91jws5p70','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Interned on the search team. Got to work on a cool infrastructure-related project that directly improved Amazon\'s search engine. If you want to do data science / machine learning work, but also want to build things, I highly recommend.',9500,'USD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,'2016-10-25T04:38:54.016Z','r84j77c1',0,0,NULL),('ck1x3b44i00vx01i9g6lp2xfz','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Was there in summer 2016, the company culture was very friendly, and the constant growth the company was dealing with was interesting to take part in.',9500,'USD','monthly',5.0,4.0,5.0,5.0,NULL,0,1,'2017-01-21T19:44:37.476Z','r343j297c104',0,0,NULL),('ck1x3b44i00vy01i91rq5a6na','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Microsoft is a different company than you think it is. It\'s now a quickly adapting behemoth, poised to reap some big rewards in the near future.\n\nI tried PM for the first time after 4 different software roles and I really liked it. You work a lot more with others and have a say over strategy. You are basically the CEO of this little product/feature and are responsible for doing whatever it takes to make it successful (be it coding stuff yourself or getting others to do what you need). Mentorship and meaningful work is highly team dependent. From what I\'ve seen, the most exciting stuff happens in Cortana, Azure, Surface, Hololens, Xbox and Office. Work/life balance is great and Seattle is really dope (I like it more than SF).',7100,'USD','monthly',4.0,3.0,4.0,5.0,NULL,0,1,'2017-01-21T20:15:23.503Z','r344j247c27',0,0,NULL),('ck1x3b44i00vz01i927db7hsk','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked at Wattpad as an iOS developer for my first co-op term in Spring 2014. Overall it was a great experience. Coming in, I didn\'t have much development experience apart from some tiny side projects that were on my resume to get me through the door. I learned a ton about iOS development, and other useful things such as Git/GitHub. The culture is quite relaxed and there is free beer, snacks, ping pong, and foosball available in the office. The work I did was really meaningful as I got to ship features that are used by everyone who uses the iOS app, such as story archiving and user profiles. The only thing I would try to improve about the mentorship is have a more structured mentorship process that focuses on helping the co-op meet their goals - I didn\'t even have weekly 1-on-1s to track my progress. However, I could always get the help that I needed on the work that I was doing.',3000,'CAD','monthly',4.0,3.0,5.0,5.0,NULL,0,1,'2016-10-25T22:26:45.404Z','r86j79c64',0,0,NULL),('ck1x3b44i00w001i96osdcn1q','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked at Bidvine back in the summer of 2015, when they were just one month into building the actual product. I had a very good time working at this new startup for my first co-op term. There were just about 7-8 employees (including 3 co-ops) in a small office space in Waterloo. We didn\'t have the traditional perks that a startup would have these days; however, just the sheer excitement of working in a real, fast-moving startup scene amazed me. \n\nWe shipped things super fast, and generally moved at a high velocity. In terms of mentorship and support, I would give this a lower score, as they didn\'t really have a system or process for this. Things may have improved over time though.\n\nOverall, I was pleased with the experience of working at Bidvine, and so were the other two co-ops working with me.',18,'CAD','hourly',4.0,2.0,5.0,3.0,NULL,0,1,'2016-10-26T15:48:51.869Z','r88j81c100',0,0,NULL),('ck1x3b44i00w101i99pzlehjo','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked here in the summer of 2015 as a production engineering intern. The company culture is pretty good and there is a push to be open and take on challenges. There is a dirth in good intern mentors in the production engineering internship program but experience may vary widely based on team.',8000,'USD','monthly',3.0,2.0,4.0,3.0,NULL,0,1,'2016-10-26T17:58:28.815Z','r90j74c14',0,0,NULL),('ck1x3b44i00w201i9f5rsg95q','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked at BitTitan during summer 2016. For the first few weeks, every new hire goes through brief training sessions and has to write unit tests to ramp up with the overall code base. After that, from a list of given projects, you rank the top 3 that you would like to work on and get assigned to one (usually your top choice but it can vary). Based on your project, you are also assigned a mentor. The work itself can vary from being important to being an improvement to an internal tool. Having the choice to do either based on how you rank your preference of projects is pretty handy. Depending on your mentor you may have more or less support from them. \n\nThe work/life balance is pretty good for interns. You are not required to stay late at all. There is catered lunches twice a week, but the sandwich/salad bar is available everyday. There are also lots of snacks and drinks. Once a month, the company celebrates birthdays during that month and there are weekly happy hour events. Finally, the company also organizes other employee events every so often like BBQ picnics, volleyball/pool tournaments etc.',5000,'USD','monthly',4.0,3.0,4.0,5.0,NULL,0,1,'2016-10-26T18:30:52.793Z','r91j83c101',0,0,NULL),('ck1x3b44i00w301i936rua6jy','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','There was a really great work environment and group of interns. I learned a lot while there and had a lot of fun. Our team would play foosball and ping pong often after lunch and after work. We had fun intern events too, such as a Sharks game and tour of SF.',45,'USD','hourly',4.0,5.0,4.0,5.0,NULL,0,1,'2016-10-26T21:28:54.734Z','r93j85c24',0,0,NULL),('ck1x3b44i00w401i95l4zg7ls','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked in Hong Kong over the summer with about a month in New York. Although Jane Street is a trading firm, they take tech seriously. Everybody dresses casually and the developers are viewed at the same level as the traders. Hours were approximately 9-6. We also had a bunch of classes about finance so it\'s a great way to get exposed to something other than tech.',83333,'HKD','monthly',5.0,5.0,4.0,4.0,NULL,0,1,'2016-10-26T21:35:38.966Z','r94j86c23',0,0,NULL),('ck1x3b44i00w501i9bcei84d1','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','What\'s great about InfoScout: the culture, transparency across functions, the flexibility in projects, the working environment, and the sheer awesomeness that is everyone that works at this company.\n\nI accepted a full-time offer at InfoScout and am working there now full-time. I\'m really excited about the future of this company!',5500,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2016-10-26T21:36:01.044Z','r95j87c102',0,0,NULL),('ck1x3b44i00w601i96rnib5in','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','A Thinking Ape is a really great company! Everyone there is incredibly intelligent- if you end up working there you will learn a lot. I personally had a suboptimal relationship with my mentor at ATA which somewhat took away from the experience but after talking to other past interns at ATA it did appear to be an anomaly and so was more than likely an issue on my end.',5000,'CAD','monthly',4.0,2.0,5.0,4.0,NULL,0,1,'2017-01-11T20:15:11.808Z','r92j16c67',0,0,NULL),('ck1x3b44i00w701i95nhxdz67','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Really open and supportive culture. There is an emphasis on maintaining work life balance and biweekly paid-for \"council\" sessions. Internship project and mentorship can vary widely based on team. ',9000,'USD','monthly',4.0,4.0,5.0,5.0,NULL,0,1,'2017-01-18T07:43:07.858Z','r89j2c42',0,0,NULL),('ck1x3b44i00w801i91dy67orm','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','While at Twitch I worked on a team that was creating the new follows API and migrating out of the core web codebase / database. I worked closely with 4 engineers (2 senior) with one of the engineers serving as my mentor / buddy. My mentor was always open to listening and helping me throughout my internship which allowed me to learn a lot through my internship.',7200,'USD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,'2017-01-20T20:48:35.293Z','r87j4c49',0,0,NULL),('ck1x3b44i00w901i92vjsh4c2','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I interned at Facebook in Winter 2016. To start off, Facebook pays very competitively when you consider the base salary, luxury housing, intern & team events, inter-office travel, and perks. Large signing bonuses are attached with a full time return offer and you will not need to do technical interview to be considered. Facebook is a large company so your experience and work largely depends on you and your team. The matching process is mostly arbitrary so you are unlikely to be matched with your dream team. Teams have different dynamics so reviews and first hand experiences are mostly based on these individual experiences. The intern program at Facebook provides resources for a intern to shape the internship the way they want it to be. Despite the variety in teams, work life balance, and the difficulty of work, it all gets normalized in the end when they compare and contrast the intern class as a whole. The culture, despite being a large company, revolves around openness and seeking your own work, so it is always possible to salvage a poor team placement. I was lucky and was placed on a great team (Live Video) which ultimately resulted in my most challenging and rewarding internship up to this point (5th term).',8000,'USD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,'2016-10-27T07:21:28.828Z','r85j30c14',0,0,NULL),('ck1x3b44i00wa01i95xn51dxf','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Mentorship at Amazon was great. My mentor really cared about what I wanted to achieve during the internship, what I can achieve, what is expected from me, what expectations I have on the internship, and other things that a mentor should care about. He was really resourceful whenever I had some technical problems explaining in detail very kindly. \n\nWorklife balance is pretty great for interns. However, for full-timers, depending on the team, everyone needs to be \'on-call\' for 2 weeks rotating between the teammates. I wouldn\'t like being an \'on-call\'. \n\nThere is no free food at all. I would give 1 star to benefits/perks category if it existed in this review website. The work time wasn\'t that flexible for my team. My team had stand up meetings at 10 am every morning. \n\nI had an internal intern project. It was both technically and conceptually adequate as an intern project. However, because it was just for internal use, I gave 3 star to meaningful work.',5300,'CAD','monthly',3.0,5.0,3.0,4.0,NULL,0,1,'2016-10-30T06:45:05.449Z','r101j93c4',0,0,NULL),('ck1x3b44i00wb01i9giwn4em4','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Best team I\'ve ever worked with. I\'ve had the chance to work at great companies in the past, but the team at Figma was something else for me. I feel like I\'ve grown the most from this internship as a person and also learned so much about design and full stack development. I would highly recommend working at Figma if you\'re passionate about design!',8500,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2016-10-30T15:30:02.148Z','r103j95c103',0,0,NULL),('ck1x3b44i00wc01i90lhf2mc1','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The impact you get to make at Wish is very significant. You\'ll mostly like make major contributions to the app, with almost full ownership through out the development cycle. A/B experiments (if they go well) will sometimes tell you that your features increased annual revenue by millions of dollars. As relevancy engineer, you will do a mix of data science work, like analyzing user behaviours and revenue trends, and engineer work, like product recommendation and product categorization algorithms.\nYou won\'t get a designated mentor and will be expected to be very self directed, but it wasn\'t hard to get help from the full time engineers. People tend to come in late (at 10-11) and leave late (at around 7-8) so the work hour tends to be a big long. \nYou get snacks, free crepes, catered lunch and dinner, which were pretty nice. ',8000,'USD','monthly',5.0,4.0,5.0,4.0,NULL,0,1,'2016-10-30T22:32:08.161Z','r104j96c104',0,0,NULL),('ck1x3b44i00wd01i9c67t8pus','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I interned here during the Winter of 2014 and had myself a pretty good time.\n\nWork: The project I was put on was to create a tool to compare how effective our trade pricing algorithms were. Overall, I thought the project was dry and not all that challenging. The project I was put on was purely done in C++, using primarily Bloomberg specific libraries and tools, so it wasn\'t exactly exciting either. What made work fun though was a great team, a fun group of alumni, and the crazy interns that I got to live with.\n\nThe city: New York City has a certain charm on it, and it hooked me in. Getting around the city is incredibly easy and it\'s very happening. From great shows to even greater food, there\'s always something new.',40,'USD','hourly',4.0,4.0,3.0,5.0,NULL,0,1,'2016-11-01T04:19:14.254Z','r105j72c8',0,0,NULL),('ck1x3b44i00we01i9awvrd5s3','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I had a great team, worked on a very interesting project and probably would\'ve come back repeatedly for more co-ops, if it wasn\'t for the fact that the company didn\'t seem to be doing so well financially.',28,'CAD','hourly',5.0,4.0,5.0,5.0,NULL,0,1,'2016-11-03T14:17:53.170Z','r106j97c99',0,0,NULL),('ck1x3b44i00wf01i94nrfgsz3','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Had a fairly good experience working here. I felt like I was able to work on a lot of interesting things, but it was in a startup phase at the time, so it often felt like things were moving too fast, and that I\'d have to stay late to finish things.',21,'CAD','hourly',4.0,5.0,4.0,4.0,NULL,0,1,'2016-11-03T14:21:23.602Z','r107j98c105',0,0,NULL),('ck1x3b44i00wg01i91fc2hvym','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Unlike many other interns, I was not given an \'intern project\' but rather tasks after tasks from my mentor. Therefore, I didn\'t really feel like I owned anything substantial. So for me, the work wasn\'t meaningful. Also, the mentorship/support from my mentor wasn\'t great. I told my mentor many times that I want some more tasks that involve much more coding. However, I was given tasks that had very little coding but require a lot of manual A/B testing done through web ui. \n\nI love Facebook culture and food though. 3 buffet meals a day every work day is too awesome. Not only there are a lot of variety of food but the taste of them are indescribable. I really miss their food. Also, intern life is great. Intern events, corporate housing, etc.',8000,'USD','monthly',4.0,2.0,2.0,5.0,NULL,0,1,'2017-01-18T08:06:09.051Z','r100j30c14',0,0,NULL),('ck1x3b44i00wh01i98mcr8kfy','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Really fun studio to work at! Highlights of my 2016 Winter co-op term here include being invited to perform in a Legendary Pictures movie production based off of one of our past games, and given a gaming computer to take home after they changed to using newer machines! All of this is in addition to really flexible work hours, catered dinner everyday (if you work overtime), and an amazing charismatic influential studio director. Supervisor tries to assign you projects based on your interests. I said I was interested in audio and databases, and was literally given tasks to improve their current audio database',25,'CAD','hourly',5.0,4.0,5.0,5.0,NULL,0,1,'2016-11-04T01:00:59.003Z','r111j102c108',0,0,NULL),('ck1x3b44i00wi01i959ntbehd','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Working at FairVentures was definitely an awesome experience, getting to know a lot more about the insurance industry and team is super helpful and supportive. Environment is very open and you are encouraged to share your ideas.',3400,'CAD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,'2016-11-04T01:01:02.681Z','r112j103c109',0,0,NULL),('ck1x3b44i00wj01i9ezfl4ng1','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','It was my best co-op hands down. It was my very first dev co-op - I never had a job in the valley as of yet. Even though I was basically a noob, I was treated as a full-time, working on projects that made a big impact that even got customers to sign up because of the features I built! Free food and games of Avalon/Secret Hitler every day at lunch was the best! Only downside was that I didn\'t get much exposure to the backend, but got tons of exposure to the frontend as a result.',27,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2016-11-04T01:02:12.215Z','r113j104c110',0,0,NULL),('ck1x3b44j00wk01i94vjqfvnv','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Great people, very friendly environment. Only downside is the relatively low pay.',700,'CAD','weekly',4.0,4.0,4.0,4.0,NULL,0,1,'2016-11-04T01:14:08.809Z','r115j106c112',0,0,NULL),('ck1x3b44j00wl01i9cez6a1by','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Great time, really tight company. ',9300,'USD','monthly',4.0,3.0,4.0,4.0,NULL,0,1,'2016-11-04T01:24:16.519Z','r118j109c114',0,0,NULL),('ck1x3b44j00wm01i9brmu3dxa','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Very exciting company to work at. ',8500,'USD','monthly',4.0,3.0,4.0,3.0,NULL,0,1,'2016-11-04T01:30:05.751Z','r119j110c52',0,0,NULL),('ck1x3b44j00wn01i99uaq1xid','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Amazing company with wonderful company culture. Everyone is very nice and supportive. ',7000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2016-11-04T01:33:35.856Z','r120j111c45',0,0,NULL),('ck1x3b44j00wo01i9allgc7pg','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked in the Boutros Lab at the Ontario Institute for Cancer Research during the Summer of 2015. This was a research lab which applied machine learning techniques to cancer research. The lab actively participates in machine learning competitions related to bioinformatics such as the DREAM challenges (as it is similar to the work done in the lab and it can improve your skill with similar datasets).\n\nAs a software engineer here I got to work on both machine learning competitions and software engineering work. For the machine learning competitions I cleaned and transformed data in R, then ran it through the pipeline of feature selection and extraction, then the actual algorithms, then maybe some stacking. The software engineering work was pretty standard and related to maintaining and improving the libraries that are in use by the lab. At the time of my internship the codebase was R (for science related tasks) and perl (for systems related tasks). There are some libraries which have grown convoluted over the years being written as one-off research code which then is hacked to be reused. As a software engineering intern I had to refactor some of this spaghetti code.\n\nEvery week there was a lab meeting where there was one small and one large presentation by lab members. This was interesting to me as I got to learn about the different projects people had and how they used different ML models in order to make sense of the biological data. Sometimes it was very biology heavy which did offset me from understanding what they were presenting.\n\nThe lab members were very friendly and helpful, being experienced in their respective fields of expertise. Usually there are also other interns doing either similar software engineering work or bioinformatics research. Most of the full time lab members are bioinformaticians with a handful of software engineers which was kind of intimidating since I don\'t know much biology so I feared talking to the bioinformaticians (which was probably a mistake as they are strong programmers for academic work, which has different priorities but nonetheless they probably know many tricks that I could have learnt, especially with manipulating data in R).\n\nThe lab is in downtown Toronto right next to a subway station and there is a food court at the bottom of the building with ~10 selections. Exiting the building there are many great food places just a 5-10 minutes walk away.\n\nOverall the experience was great and I learnt a lot. The things that I have learnt about and value most probably is the data science experience as I use it in the current internships that I have.',3000,'CAD','monthly',4.0,4.0,3.0,3.0,NULL,0,1,'2016-11-04T01:44:20.382Z','r122j113c115',0,0,NULL),('ck1x3b44j00wp01i95s1i9p4a','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','A heavily funded and brand new start-up based in Toronto provided an awesome co-op experience. It\'s rare to get an opportunity to join such an early stage startup that is so strongly backed. I would definitely recommend a job here to anyone who is interested in the start-up scene. I\'ve been given tons of important work and had lots of involvement in steering the direction of the company. The company culture is open, friendly and extremely welcoming. Although it is a small team, the knowledge from your mentors is outstanding and you have the potential to learn a lot.',1500,'CAD','weekly',5.0,5.0,5.0,5.0,NULL,0,1,'2016-11-04T03:11:44.500Z','r123j114c116',0,0,NULL),('ck1x3b44j00wq01i97vmahzu7','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Overall a pretty good co-op term, catered lunch every day is great. There were some growing pains during the time I worked there so the organization of teams and the prioritization of projects were still being figured out.',3800,'CAD','monthly',4.0,4.0,3.0,4.0,NULL,0,1,'2016-11-04T04:41:01.739Z','r124j13c66',0,0,NULL),('ck1x3b44j00wr01i96raleelz','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Loved the people I worked with! The projects were great and as an intern I was always valued and given lots of opportunities to contribute. The company has great values it likes to live by and really tries to make you feel part of a family',5000,'USD','monthly',4.0,5.0,3.0,5.0,NULL,0,1,'2016-11-04T14:25:50.349Z','r125j115c117',0,0,NULL),('ck1x3b44j00ws01i9bwp51y3f','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I loved it here, my mentor was amazing & I learnt ALOT. I was even placed on site and work directly with clients to put together what they needed. If you\'re not a fan of the Microsoft Stack, I\'d say steer clear. This isn\'t for you, otherwise its amazing :) Lunch and learns on Fridays (with Pizza!), great, supportive management. All in all a nice place to work.',27,'CAD','hourly',5.0,5.0,5.0,4.0,NULL,0,1,'2017-01-10T02:21:24.649Z','r235j200c164',0,0,NULL),('ck1x3b44j00wt01i9drzfd2bg','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','It was a comfortable job, there wasn\'t much to do. Lots of free time to play pool and ping pong.',800,'CAD','weekly',3.0,3.0,2.0,5.0,NULL,0,1,'2017-01-18T07:26:30.816Z','r116j107c39',0,0,NULL),('ck1x3b44j00wu01i932w4d2e7','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Interesting work, nice people, lots of perks.',7000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-01-18T07:30:56.535Z','r117j108c57',0,0,NULL),('ck1x3b44j00wv01i99crpdjkr','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Currently interning here (Fall 2016), and it has one of the best company cultures I have ever experienced. You are treated as a full time, and given tasks that really make you feel like you\'re driving the company forward. There\'s a free beer on tap party every Friday afternoon. There are yoga, nap, and music rooms. Best of all, there are dogs everywhere. Interns are also paired up with a super friendly and helpful mentor, who truly makes efforts to make you feel fit in. ',4167,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-01-20T20:50:20.480Z','r114j160c111',0,0,NULL),('ck1x3b44j00ww01i9e9f1cq5w','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked there in Winter 2016, and the work-life balance and culture were really subpar. There was no effort to make the workplace enjoyable, and people seemed to live to work instead of the other way. People would come to work and stay until 9pm like its a normal thing, and the free dinners encouraged that. That being said the work was certainly plenty and meaningful to the company. It was a tougher time culture wise but the product and engineers they have are still top notch.',7000,'USD','monthly',3.0,3.0,4.0,2.0,NULL,0,1,'2016-11-04T14:31:07.847Z','r126j66c60',0,0,NULL),('ck1x3b44j00wx01i96te00slw','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','With some of the best mentorship and support I\'ve ever experienced at any company, it\'s  difficult to overstate how positive my experience was at PagerDuty. I can\'t think of anything you\'d want in a job that it doesn\'t provide: \n1. Work life balance: The office is empty by 6pm, and I was actually discouraged from working more than 8 hours. \n2. Quality of work: PagerDuty tackles some very interesting problems and as a devops company, the way it handles its infrastructure is absolutely superb; even the most seasoned developers will learn a lot from their solutions.\n3. Co-workers: It\'s not unprecedented for a successful company located in SV to have so many intelligent engineers. However, the way it stands out from most other companies in the bay area is the empathy, humility, and genuine goodness of the people there. The most skilled engineers have the smallest egos and would often give me credit for work that I had a part in, even if it was mostly facilitated by them\n4. Pay: Scales by around $500/month as you are promoted every term (for SF office). The pay for the fifth work term is 1.5K stipend + 7.5k. Extremely generous, and is higher than the pay of many top tech companies.\n5. Perks: Free lunch everyday, free breakfast every Wednesday, planned fitness room, nap room, beautiful office space, freedom to work from home at your own discretion, monthly company wide hackdays.',9000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2016-11-04T17:13:54.451Z','r127j116c95',0,0,NULL),('ck1x3b44j00wy01i929gi9369','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked there from January to April 2016 and had a fantastic experience. Software consulting is very fast paced, so I was forced to learn mobile development quite quickly, but not without support from senior developers. It was great to see a product end-to-end in only a few months, very rewarding experience. We often had team lunches to increase bonding. ',920,'CAD','weekly',5.0,5.0,5.0,3.0,NULL,0,1,'2016-11-05T03:13:41.129Z','r128j117c118',0,0,NULL),('ck1x3b44j00wz01i9e1aq2w59','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','My mentor and manager are very supportive. There is overtime pay here so I choose to overwork myself. The software that I write is actually used by others, which is great.\n\nBreakfast and lunch are 6 dollars per \"dish\". Dinner is 1 dollar for your first dish, and 6 thereafter.\n\nAll in all, a wonderful place to work.',40,'USD','hourly',5.0,5.0,5.0,4.0,NULL,0,1,'2016-11-05T21:43:23.355Z','r130j119c30',0,0,NULL),('ck1x3b44j00x001i98si03y1k','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I had a wonderful work term here, with the best team ever. The software I wrote here was open-sourced and now used by many. My desk was huge with 4 monitors, and the desk was adjustable in height (really expensive desk!). Cubical walls were low, so we can see everything when standing. Pay is low, but we do internships for experience, not money.',20,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2016-11-05T21:53:52.143Z','r131j64c62',0,0,NULL),('ck1x3b44j00x101i98dpdfzun','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','CEO was awful. This was absolutely awful for skill development as the lack of competent mentors means that you write and get taught to write shit code. The CEO is an absolute nightmare to work with. But they\'re trying at least. Overall I did not enjoy this and would rank this as one of my worst coop experiences.',20,'CAD','hourly',2.0,1.0,2.0,4.0,NULL,0,1,'2016-11-07T00:18:23.717Z','r132j120c120',0,0,NULL),('ck1x3b44j00x201i9cg252h7l','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Winter \'16',8800,'USD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,'2016-11-07T03:07:36.499Z','r143j127c44',0,0,NULL),('ck1x3b44j00x301i9fc7x47cp','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Generally older culture due to manufacturing background of the company. Not very social but the support to get your work done is helpful. Meaningful work at the end of the day. Cool to learn about how steel is made. Do note that the salary won\'t be like Toronto area so keep that in mind.',3000,'CAD','monthly',3.0,3.0,3.0,2.0,NULL,0,1,'2016-11-08T03:31:47.489Z','r145j129c123',0,0,NULL),('ck1x3b44j00x401i95z8h06js','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked there in the Summer of 2015. The company\'s core competencies aren\'t technology, and it shows. They were using very old and outdated monolithic Java applications, and it was rare that most people were all in the office at once. The workload was very small, and there were times when my manager actually said he has no work for me to do at the moment because the rest of the team, and many other people, were on vacation or working from home.',18,'CAD','hourly',1.0,1.0,1.0,2.0,NULL,0,1,'2016-11-08T16:01:34.885Z','r146j130c124',0,0,NULL),('ck1x3b44j00x501i9g75pa7kx','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Each team is VERY different, as one co-worker put it, IBM is essentially a massive company full of mini-startups (a.k.a individual departments or teams). My team had excellent mentorship/support, the team was very approachable and knowledgeable and were always willing to explain concepts to you.\n\nThe work itself was somewhat interesting, but felt like IBM was trying to \"catch up\" to the data science hype. This is expected for a large company though. Similarly, the work hours are very flexible but some people work insanely long hours due to the large amount of work that can get handed to you.\n\nFinally, one of the biggest negatives to IBM is the workplace politics. There are so many different levels of management that information can get diluted down the management chain which may also lead to unrealistic expectations. My direct manager(s) did their best to shield us from that, but things occasionally leak through.',25,'CAD','hourly',4.0,5.0,3.0,4.0,NULL,0,1,'2016-11-08T16:09:13.223Z','r147j131c84',0,0,NULL),('ck1x3b44j00x601i91sgv4ola','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Did an internship in Winter 2015 on the main campus and it was probably the best internship experience I\'ve had. Lots of perks and you\'re around really great people that want you to make the most of your internship experience. Would definitely recommend checking it out!',6667,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2016-11-13T15:44:54.009Z','r148j15c17',0,0,NULL),('ck1x3b44j00x701i90n0w7ibw','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked here for my first co-op term as a QA Analyst manually testing websites. The work itself wasn\'t super interesting but the hours were really flexible and the team members were really nice. It was a good learning experience for my first time working though.',15,'CAD','hourly',3.0,4.0,3.0,5.0,NULL,0,1,'2016-11-13T15:50:03.840Z','r149j132c69',0,0,NULL),('ck1x3b44j00x801i943v68e52','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I just hate commuting there but it\'s a professional company that treats their interns with respect and assigns them real work.',25,'CAD','hourly',5.0,5.0,4.0,5.0,NULL,0,1,'2017-01-18T07:37:10.674Z','r129j118c119',0,0,NULL),('ck1x3b44j00x901i94a4f0ede','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked on the test automation team here for my first coop, and really enjoyed the experience. Great people to work with, great culture, good office with a very nice espresso machine :), and I find Vancouver just a beautiful place to be (especially in the summer). As for the work, I felt I was doing useful work, and I believe what I worked on is still in use today. Talking to other interns while I was there, they said they were enjoying the term and liked it better than other coops they\'ve had.',4000,'CAD','monthly',4.0,4.0,3.0,4.0,NULL,0,1,'2016-11-15T00:42:25.377Z','r150j133c125',0,0,NULL),('ck1x3b44j00xa01i9b18c4iwl','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Zenefits was a phenomenal coop. I worked on the Affordable Care Act automation team, and it was one of the best experiences I\'ve ever had. It varies per team, of course, but I would say it\'s not for everyone. You work on really impactful projects meaning you also get very tied to its deadlines. Many employees work long, busy days. I would say, however, that for an internship it really kicks you into shape and even if you work a day or two in the weekends here and there it\'s absolutely worth it since you know you\'re doing valuable work and the customer impact is very direct. And at the end of the day an internship is only for 4 months or so. When I was there we also did plenty of fun things with the other interns (and full timers).',6500,'USD','monthly',5.0,5.0,5.0,2.0,NULL,0,1,'2016-11-15T00:49:56.000Z','r151j134c60',0,0,NULL),('ck1x3b44k00xb01i99xeway5n','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Great place with lots of things to do, and a lot of excitement around the product. The company is moving super quickly, so naturally there are a few growing pains here and there. Overall, the engineering team is world class and I would not hesitate to come back again.',4680,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2016-11-18T04:28:26.094Z','r153j136c40',0,0,NULL),('ck1x3b44k00xc01i9hn870xzq','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The vancouver office is super nice and in a great location downtown. The work I was doing is super fun and rewarding (got to work on a hololens project), although I was pretty stressed and busy sometimes since I joined the team at a very busy time. That\'s very team dependent though. I know of a lot of other teams that are super chill. No snacks and free food which is a letdown, but that\'s expected from a Canadian office. There\'s tons of free fruit and drinks though! I really loved working with my team members - everyone is super nice and smart too. There are also lots of fun company events and it didn\'t feel like a corporation at all. The only big disappointment is that the internship salary is so low compared to the redmond office.',4000,'CAD','monthly',4.0,5.0,5.0,3.0,NULL,0,1,'2016-12-05T04:13:47.564Z','r154j137c27',0,0,NULL),('ck1x3b44k00xd01i9g9w5390p','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Their platform is very different, and probably suits more mathematically inclined people. Learning intentional programming was difficult for me (very different paradigm) but the mentorship and guidance was excellent. The intern group when I was there were some of the brightest people I\'ve met.\n\nI interned on the graphics team, which was a lot of fun. Learnt a lot about how GPUs work, and how to design and implement data pipelines in a rendering engine. There are a lot of interns, especially on the graphics team, so you\'ll often have to figure stuff out yourself.',35,'USD','hourly',4.0,5.0,4.0,4.0,NULL,0,1,'2016-12-06T03:05:50.855Z','r156j21c21',0,0,NULL),('ck1x3b44k00xe01i92hgt4h4h','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I was given a lot of responsibility and ownership in my work which was rewarding. I learned a lot from my mentor as well. However, I feel like I didn\'t have as much fun here as I did in my other internships at other companies. ',7000,'USD','monthly',4.0,5.0,5.0,4.0,NULL,0,1,'2016-12-20T23:33:18.752Z','r155j138c11',0,0,NULL),('ck1x3b44k00xf01i95w7laqov','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','My favorite internship to date! From a perks perspective, I was treated fantastically. The Operations team hooked me up with an amazing corporate apartment in midtown Manhattan. Food was always fantastic. \n\nFrom a learning perspective, this internship blew my expectations away, both professionally and personally. My coworkers were fantastic, projects were meaningful, and the culture overall was great. My only nit-pick would be some teams work too hard, but again that\'s New York culture to you. I didn\'t mind it, since I learned so much.',7000,'USD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,'2017-01-08T01:52:13.510Z','r159j141c2',0,0,NULL),('ck1x3b44k00xg01i980hj4l9g','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I was the first product management intern at Twitch and I PM\'ed on the Clips team. Despite this being a new internship program, I had an amazing time and was able to grow significantly through the internship. I had a large support structure and my team was very welcoming. I was encouraged to and given opportunities to take on more and more responsibility, and eventually was able to be product lead for two major products, coordinating between engineering, design, UX research, and marketing. The Clips team was amazing as well... everyone was very friendly and supportive and there were lots of off work activities, Twitch-sponsored and not. Overall, I definitely recommend working at Twitch. The company has a startup culture with the resources of a big company (Amazon, AWS) and you\'re really given a lot of opportunity for growth as an employee.',10800,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-01-08T01:52:31.112Z','r158j140c49',0,0,NULL),('ck1x3b44k00xh01i99rzjhbdc','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The internship at Mozilla (in Toronto) was 12 weeks, including one work week somewhere around the world (they have a semi annual work week where the global teams meet together), in my case it was in London. The work week in London was really fun, and a great experience to get to know the people (from all around the world) you may work with on the daily. The internship itself requires you to be very independent, though depending on the mentor, you may have a different experience. The environment is very pro open web and open source, and is a very geeky, but overall a fun place to learn and intern.',6000,'CAD','monthly',5.0,3.0,5.0,5.0,NULL,0,1,'2017-01-09T21:20:06.571Z','r186j159c29',0,0,NULL),('ck1x3b44k00xi01i9h3bu3kir','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','People are very down-to-earth and nice to hangout with. Getting to know the other interns in the city was also great! The work itself was frontend web development which isn\'t my cup of tea, but still a good learning experience for an early co-op placement.',3750,'CAD','monthly',3.0,3.0,2.0,5.0,NULL,0,1,'2017-01-09T21:21:39.049Z','r187j160c111',0,0,NULL),('ck1x3b44k00xj01i9bozac73f','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I love love love loved my internship experience at LinkedIn. One of the things I liked the best is that they really value craftsmanship there and designing things the right way. We get a day off every month where special events are provided as \"InDay\". The people are pretty chill and I had a lot of fun. They also put in a lot of effort to make sure you get a project you\'re happy with.',45,'USD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-01-09T23:58:01.869Z','r217j185c24',0,0,NULL),('ck1x3b44k00xk01i94wao2g5i','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I interned at Benchling in Fall 2016. They\'re a small biotech startup with around 35 people and most people are pretty down to earth. At times I noticed people working a bit late or on weekends which is somewhat common for a startup, but as an intern I didn\'t really work much more outside of 10-6. I got to work with fairly modern tools (aside from some legacy coffeescript and backbone) like React, ES6, and Flask (python web framework).\n\nBenchling is in a pretty different space compared to a lot of tech companies, so I got to learn quite a bit about the industry and how a startup at this stage functions. Through weekly product demos I got to see what everyone else was working on and learn a bit of biology too!\n\nOverall I\'d highly recommend Benchling. They\'ve got a lot of great people working there and you can tell the people really care about the product.',8500,'USD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,'2017-01-08T03:44:47.548Z','r160j142c128',0,0,NULL),('ck1x3b44k00xl01i96cei3eiv','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Everyone at Strava is super interested in health and fitness. The worklife balance here is really good. People leave work in the middle of the day to go for group runs and workouts. If you are really interested in biking or running this is the place for you. If you aren\'t, then not so much as it can feel a bit excluding at times. \n\nEngineering-wise it was pretty standard. I worked on a lot of different high-impact features and got to pick what I wanted to work on. I didn\'t receive much mentorship though. ',6400,'USD','monthly',3.0,3.0,4.0,5.0,NULL,0,1,'2017-01-08T05:04:41.363Z','r161j143c129',0,0,NULL),('ck1x3b44k00xm01i9fd0vh28s','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The company culture at Airbnb is really open and friendly. Right from the get go I was able to notice a difference from other companies I have worked at. They highly value diversity and put effort into making sure everybody feels like they belong. The office space is also really nice.\n\nEven though the company has grown substantially, I still feel like I was able to have an impact through the work that I was doing. I could build features fast and get the help that I needed pretty quickly. ',10400,'USD','monthly',4.0,4.0,4.0,4.0,NULL,0,1,'2017-01-08T05:29:15.055Z','r162j144c3',0,0,NULL),('ck1x3b44k00xn01i957jz2qnc','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Your experience is gonna vary a lot depending on your team. I had a good time at Amazon and was working on code that shipped while I was there.  My mentor was a great resource and super helpful in guiding me through the project. My project was also well-scoped to be finished in 4 months.\n\nMy biggest learning experience was architecting my project from scratch. At most tech companies, I\'m expected to implement projects that are already architected. Here, I owned the execution of my project from start to finish. It gave me a lot more responsibility and was a new thing for me. \n\nMy team had a low operational load, so the on-call lives of my full-time peers didn\'t seem that bad either. However I\'ve heard of insane operational loads in other orgs/teams, so keep that in mind.\n\nOn the perks side, there isn\'t a lot to report about. You only get a 10% discount on all items \"sold by Amazon.ca\", which is pretty good. But you don\'t get free food or anything - even snacks are for purchase. Only coffee/tea is free. You do get corporate housing though, or a generous stipend.',5300,'CAD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,'2017-01-09T03:28:30.345Z','r163j93c4',0,0,NULL),('ck1x3b44k00xo01i9bamt85u2','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked here during Fall 2016, and it was a great experience for me. The culture here was very immersive and supportive of all employees including interns. The work that I did here was very impactful and was in use immediately. I learned a lot.',35,'CAD','hourly',4.0,3.0,4.0,5.0,NULL,0,1,'2017-01-09T18:12:44.406Z','r164j145c130',0,0,NULL),('ck1x3b44k00xp01i982g1eakc','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked on the Fusion 360 project as a software developer intern. I really loved the project, I was doing alot of feature work as well as challenging bug fixes. I felt like I made a significant difference in the project, and the coworkers were really nice and supportive. \n10/9',3500,'CAD','monthly',4.0,4.0,5.0,5.0,NULL,0,1,'2017-01-09T18:29:16.140Z','r166j147c82',0,0,NULL),('ck1x3b44k00xq01i9g03yb2ce','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked at Odyssey for my first co-op back in 2013. I got to work on very high level regulatory submissions for their international offices, which is a pretty unique experience. However, I don\'t think they anticipated the working ability of their co-op students, and as a result I did not feel very challenged. The working hours were very standardized, and there was a great work life balance. Overall, I definitely think it was a great experience but would definitely recommend management to put more effort in finding challenging work for their co-ops.',25,'USD','hourly',4.0,5.0,4.0,5.0,NULL,0,1,'2017-01-09T19:18:55.091Z','r167j148c132',0,0,NULL),('ck1x3b44k00xr01i9h6xv8550','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I interned at Minted in Fall 2014. The work was on par with what full-time engineers worked on, with a mix of front and back-end. The company\'s not huge, so it\'s fairly easy to get to know a lot of the engineers there and what\'s being worked on etc. My team was really friendly and patient with me throughout the whole experience. ',6500,'USD','monthly',4.0,5.0,4.0,5.0,NULL,0,1,'2017-01-09T19:23:01.658Z','r168j29c28',0,0,NULL),('ck1x3b44k00xs01i9bzekf6c5','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked at Facebook in Fall \'16. The compensation and perks speak for themselves. The work will vary depending on the team you\'ll end up on (based off your preferences and skill set to a certain degree). Your intern project and its impact will largely determine how successful the internship will be.\n\nFor me personally, I\'ve always preferred back-end a bit more, but my main project was a front-end one (ironically, my team was almost entirely backend and infra-related). That being said, I was still fine with getting more front-end experience, especially with React. After expressing my interest in doing more back-end stuff, I\'d help with some back-end items after finishing my main project. Admittedly, the stuff I was working on wasn\'t going to launch fb into a new era or anything, but I was perfectly happy with working on something that helped my team grow towards its goal.\n',8000,'USD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,'2017-01-09T19:35:57.884Z','r169j30c14',0,0,NULL),('ck1x3b44k00xt01i9f9t308k2','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Given that it\'s a bank, it should go without saying that the culture was very corporate. As an eBusiness Specialist, you are pretty much given mindless tasks with very little coding involved. You will be asked to modify html and upload files/images into a content management system. There are very few meaningful projects for interns to work on. Spent at least half of my time either doing self-learning or wasting time on YouTube. Next to no mentorship was available.',17,'CAD','hourly',1.0,1.0,1.0,5.0,NULL,0,1,'2017-01-09T20:01:00.333Z','r170j149c133',0,0,NULL),('ck1x3b44k00xu01i9cs56bpug','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Extremely intelligent people working here. I learned a lot from just reading the codebase and talking with my mentor. Culture could feel a bit cliquy at times & I didn\'t get to work on a particularly interesting project.',8000,'USD','monthly',4.0,5.0,4.0,4.0,NULL,0,1,'2017-01-09T20:10:07.203Z','r171j150c11',0,0,NULL),('ck1x3b44k00xv01i90b26bwfm','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Excellent opportunity to learn in-depth about nanotechnology research, as well as getting a broader understanding of the materials science and electrical engineering involved in the design of nano-systems.',77000,'JPY','monthly',4.0,5.0,5.0,4.0,NULL,0,1,'2017-01-09T20:14:12.031Z','r173j151c134',0,0,NULL),('ck1x3b44k00xw01i96wpld79v','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked for four co-op terms as an auditor in the Toronto practice focusing on clients in the financial institutions industry. Taught and mentored by some of the best in the field. Exposed to a multitude of companies and was able to exposed to how different companies both within an industry and across various industries operate. Great place to start a career!',4580,'CAD','monthly',4.0,5.0,3.0,2.0,NULL,0,1,'2017-01-09T20:14:24.316Z','r174j152c135',0,0,NULL),('ck1x3b44k00xx01i98z9x3e2q','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','* My manager and mentor were both extremely knowledgeable and invested in my growth as an engineer. \n* I got the chance to work on a newer product and add useful features.\n* No intern events or any fun stuff',6000,'CAD','monthly',4.0,5.0,4.0,5.0,NULL,0,1,'2017-01-09T20:15:43.390Z','r175j153c136',0,0,NULL),('ck1x3b44k00xy01i9ddnwfp0k','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Company culture isn\'t the best, but the location is key.',9000,'USD','monthly',2.0,3.0,4.0,2.0,NULL,0,1,'2017-01-09T20:18:42.598Z','r177j2c42',0,0,NULL),('ck1x3b44k00xz01i9hexbdie6','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Tremendous learning opportunity. Students get involved immediately into the group\'s research, and get a comprehensive background, ranging from the design of experiments to the publication of scientific literature.',2000,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-01-09T20:19:44.219Z','r179j154c137',0,0,NULL),('ck1x3b44k00y001i934nl4neu','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','At Google, you can be extremely productive because everything actually \"works\" as intended. It\'s true that the impact is diluted at such a big company, but on the bright side, it\'s extremely flexible to switch to a team that interests you.',6000,'CAD','monthly',4.0,5.0,4.0,5.0,NULL,0,1,'2017-01-09T20:21:32.276Z','r180j155c17',0,0,NULL),('ck1x3b44k00y101i96rb529fn','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Facebook has a great culture and everyone treats each other really well. Team-matching does a pretty good job finding a team that would interest you. With all big companies, there is a concern with the amount of impact one can have, but aside from that, I can\'t think of any other cons.',8000,'USD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,'2017-01-09T20:23:36.121Z','r181j30c14',0,0,NULL),('ck1x3b44k00y201i900s86u84','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','* Amazing team. My manager did bi-weekly one-on-ones where he asked me for feedback, mentored me on leadership, helped me solve problems related to my work, and pushed me to grow as an engineer. My mentor was really supportive as well and was always willing to help me.\n* Great social life. Team went after work weekly, plus we did lunch together every day.\n* Project was perfectly scoped for 4 months and interesting. Got to see it deployed & used before I left.\n* Annoying restrictions on doing things with the Bloomberg platform because I was an intern (like deploying my code)\n* This is Bloomberg so lots of very business-y meetings that are long and ... business-y.\n* Project was planned/designed before I started my internship, so that left less room for me to come up with my own architectural ideas.\n* Typical big company politics going on in the background',3000,'GBP','monthly',4.0,4.0,4.0,5.0,NULL,0,1,'2017-01-09T20:24:15.424Z','r182j156c8',0,0,NULL),('ck1x3b44l00y301i9g2841p2q','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked there in 2016. Truly great people (\"not jerks\"). Lots of opportunity for learning and growth. Invested in your interests and preferences, happy to give you opportunities to learn whatever interests you - just ask!',1200,'USD','weekly',5.0,5.0,5.0,4.0,NULL,0,1,'2017-01-09T20:28:22.221Z','r183j157c138',0,0,NULL),('ck1x3b44l00y401i94sav6cw0','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','-Good first internship into corporate world\n-The corporate structure is a bit excessive. Strict hierarchies are in place and designers are from separated from technical to design. The dress code is business casual, which I wasn\'t too fond of.\n-Every intern is assigned a mentor, which was nice. \n-Interns were encouraged NOT to work overtime to reduce spending on company\'s part.\n-Perks: free taxi and free dinners after a certain time (8pm?)',3300,'USD','monthly',4.0,4.0,2.0,2.0,NULL,0,1,'2017-01-09T22:49:06.854Z','r201j172c146',0,0,NULL),('ck1x3b44l00y501i99pp10die','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked here in Winter 2016. I was assigned a team that had a lot of projects in progress. There is pretty good mentorship from people in your immediate team, but since the company is expanding very rapidly, it may not be as simple to grab a hold of people to ask questions. Work-life balance varies by team, with some people working pretty long hours, but as an intern, you aren\'t expected to work long hours.\n\nThe work you do at Snapchat will almost always be meaningful and be put to use. Those working on mobile will most definitely be able to point to something important or relevant in the app by the end of the internship.\n\nThere are many free food options around and a solid chef in the cafeteria for lunches and dinners. Although there\'s no on-site gym, you can get a subsidized gym membership at the one and only GOLD\'S GYM.',9000,'USD','monthly',5.0,4.0,5.0,4.0,NULL,0,1,'2017-01-18T07:43:07.851Z','r184j2c42',0,0,NULL),('ck1x3b44l00y601i954fadhn6','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked at Facebook in Fall 2016 on Infrastructure. Work-wise, Facebook\'s internship program is very well structured; they really focus on providing mentorship and tools that allow developers to come in and ramp up quickly. I had a great relationship with my team and a lot of respect for both my team manager and internship manager; they were all very keen to make sure I was enjoying my time there. Dev experience is very polished, I was never blocked on infrastructure not being available for me to work on my project.\n\nBenefits are probably top-tier in comparison to other tech-internships, you also really bond with other interns outside of work. This is a great choice!',8000,'USD','monthly',4.0,4.0,4.0,5.0,NULL,0,1,'2017-01-18T08:02:26.066Z','r185j91c14',0,0,NULL),('ck1x3b44m00y701i97jkn52qo','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked here during Summer 2015. I was assigned a team, but they are very flexible with regards to what you actually end up working on. For instance, I was put on a back-end team, but ended up doing mostly Javascript because of the project I chose. Everyone around you is pretty eager to help and support you learn. There\'s generally a lot of cool things to work on, but because of sheer size of the company, it may be difficult to make meaningful impact. Overall, Facebook has amazing perks and is great place to grow and learn as a software engineer.',8000,'USD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,'2017-01-18T08:06:09.045Z','r178j30c14',0,0,NULL),('ck1x3b44m00y801i98sune06o','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The work was demanding and challenging which was exciting. Amazon emphasized a lot on taking ownership of your own work and spear-heading your own project by yourself. I did not like the company culture as much. Working at such a large company makes you feel like you are not as important. My project itself was being used by vendors so the work was fairly meaningful. The biggest disappointment was the perks available, especially compared to other companies in the Seattle area like Microsoft and Facebook (Amazon emphasizes a lot on being frugality). The corporate housing was quite generous, bi-weekly cleaning comes in clutch.',6000,'USD','monthly',3.0,3.0,4.0,3.0,NULL,0,1,'2017-01-09T21:22:35.398Z','r188j161c4',0,0,NULL),('ck1x3b44m00y901i91wfa5ycn','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Great team and best experience of my life!',3750,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-01-09T21:24:22.069Z','r189j162c139',0,0,NULL),('ck1x3b44m00ya01i9eetvgi33','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','In terms of meaningful work, I think internships at Uber give their interns the meatiest projects, from technical and impactful perspectives. They really put a lot of trust in their interns to take on and deliver projects that are core to their teams.\n\nMy team was very tight-knit and genuinely enjoyed each others company; I was very sad when I said goodbye on my last day. Mentorship was also very strong, my mentor would always point me in the right direction if I needed any help.\n\nBenefits are really great; they provide monthly housing stipends and Uber credits. Also, they paid hourly when I was there, so overtime pay was amazing! Really recommend this experience. :)\n',7000,'USD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,'2017-01-09T21:24:27.436Z','r190j38c52',0,0,NULL),('ck1x3b44m00yb01i9cwndgp86','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The internship, I believe, is very dependent on the team. In my case, I was in an excellent team, that allowed me to pick up almost any project or task that I wanted, while giving me the support that allowed me to be effective. Hours were not predefined, and you were able to occasionally work from home. Though the company does not have the same perks as other internships, it was a great place to grow as a software engineer.',4200,'CAD','monthly',4.0,4.0,5.0,4.0,NULL,0,1,'2017-01-09T21:25:24.226Z','r191j163c140',0,0,NULL),('ck1x3b44m00yc01i9862w9gkh','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked on a machine learning team and not a games team, so I may have had different experience. \n\nOverall, the work was very laid back and fun, I got full control of where my project was headed. There were hackathons, ping pong tables, and video games. Worked with incredibly smart people and had a lot of fun.',4250,'CAD','monthly',5.0,4.0,5.0,5.0,NULL,0,1,'2017-01-09T21:57:02.503Z','r193j165c61',0,0,NULL),('ck1x3b44m00yd01i9g174b09x','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Nice environment. Coworkers were patient and helpful.  I worked as a full stack engineer on an insurance salesman management software. Hours were flexible. Work itself was a little dull. Lacks perks.',4200,'CAD','monthly',3.0,5.0,2.0,5.0,NULL,0,1,'2017-01-09T22:00:58.363Z','r194j166c131',0,0,NULL),('ck1x3b44m00ye01i9cp5f7sbe','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Overall, the company seems stingy. Dinner starts at 8:15 pm. The free rides program was changed from a credit based system to a ride based system, greatly reducing the usefulness. I personally did not get any transportation stipend.\n\nThere were a handful of engineers that were without a doubt overworked. However, I did not have bad worklife balance.\n\nThe work, the projects and the problems Uber is solving are very interesting.',43,'USD','hourly',4.0,4.0,4.0,4.0,NULL,0,1,'2017-01-09T22:01:46.040Z','r195j38c52',0,0,NULL),('ck1x3b44m00yf01i9drbtcb4u','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','1st coop term - worked on an internal service that searches through the catalogue of employees. Learnt Web dev and 3 tier architecture systems using C# .NET.',15,'CAD','hourly',4.0,4.0,4.0,5.0,NULL,0,1,'2017-01-09T22:13:38.764Z','r196j167c141',0,0,NULL),('ck1x3b44m00yg01i9aa3p1dhh','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked this past summer at Smucker\'s. The highlight for me was the company culture. Everybody was friendly, supportive and encouraging. There was an open door policy, lots of free merchandise and I would definitely hang out with my co-workers outside of work. It was a wonderful 4 months!',2414,'CAD','monthly',4.0,4.0,3.0,4.0,NULL,0,1,'2017-01-09T22:26:14.656Z','r197j168c142',0,0,NULL),('ck1x3b44m00yh01i9f2352ahq','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','-Lots of long nights and weekends, but the hours are much worse for those doing competitions (also pressure). \n-Less pressure if you are put on a long term project than if you\'re put on a competition\n-Hiring process is ridiculous. From interview to being hired to being expected to work can all be within one week.\n-Model making sucks but it can be a break from staring at a computer all day. \n-Best part of the internship is making close connections with interns and being in Europe. 70 euro flights to many places! The Netherlands is also cool beans.',600,'EUR','monthly',4.0,3.0,5.0,1.0,NULL,0,1,'2017-01-09T22:30:42.856Z','r198j169c143',0,0,NULL),('ck1x3b44m00yi01i94okp2kjw','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked at trans-plan in summer 2015, up to that point they had only hired co-op students for software development. There were 6 co-op students in Traffic Operations and until the universities (Waterloo and Guelph) intervened midway through the term, we were working schedules that would be considered erratic at best and no-where near the university\'s requirtements. Some weeks we worked 10 hours, others we worked 25, but never the promised 35hrs and our paychecks were coming a month late and CECA had mentioned that the co-op term might not count at all even though I got the job through jobmine. At some point our supervisor said he doesn\'t have any more traffic jobs for the summer so he was thinking of letting some co-ops go. I spent the second half of the term in the office coding and designing products in solidworks (both things that weren\'t anywhere in the job description and requirements), which basically meant that the obly meaningful work I did that term was work that wasn\'t initially going to be worked on by me.',12,'CAD','hourly',2.0,1.0,2.0,3.0,NULL,0,1,'2017-01-09T22:38:42.241Z','r199j170c144',0,0,NULL),('ck1x3b44m00yj01i9e94ehr0b','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked at the CIW for 8 months this past year, and I loved the experience! I was able to put my research, communication and interpersonal skills to use, as well as developing a strong technical skill set on the job. My supervisors were supportive and helpful every step of the way, and I was constantly taking on new, meaningful projects. My work at the organization had real-world impact in the sense that I got to work hand-in-hand with the community to investigate measures of wellbeing and report on them to help real people! I would definitely recommend working for this organization, and I would certainly go back to this position again!',18,'CAD','hourly',5.0,5.0,5.0,4.0,NULL,0,1,'2017-01-09T22:42:18.441Z','r200j171c145',0,0,NULL),('ck1x3b44m00yk01i9399f51yi','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Being a summer student at PHO was great. The people at the company are really kind, the PI and RTs give good guidance, and there are a lot of learning opportunities via journal clubs and guest presentations. ',400,'CAD','weekly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-01-10T11:22:39.058Z','r250j209c172',0,0,NULL),('ck1x3b44m00yl01i95oc94zt6','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Great place to work if you\'re looking for experience in all areas of software development. The small team size lets you work on a variety of tasks. Additionally, the co-founders provide excellent mentorship and are always willing to help.',4000,'CAD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,'2017-01-21T16:51:10.445Z','r335j290c209',0,0,NULL),('ck1x3b44m00ym01i93ckv4ozp','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked for the Waterloo Cases in Design Engineering group in Winter 2016. It was a very interesting term in that I got to see what gets done with work-term reports and I was exposed to the steps that the faculty generally needs to go through to create new class material as well as getting professors to adopt these materials and incorporate them into their courses. Writing the case studies involved reading work term reports, released by the students, taking the parts relevant to the course the case study is being prepared for and developing a solution as well as a teaching note that guides the professor through potential implementations. Everyone was so nice and helpful and I was exposed to some professors\' research (another source of case studies) and learned about topics in other disiplines that I would not have been exposed to otherwise. But this position is also a true case of you get what you put in; while there are weekly progress meetings there are no deadlines beyond an expectation of 4 cases per tem, so you have to gauge how well you\'re doing and how good is your pace.\nWorking on campus also meant that I didn\'t have to pack up and move, I didn\'t have to sublet my place and I got to also take courses during the co-op term.',3065,'CAD','monthly',5.0,4.0,5.0,5.0,NULL,0,1,'2017-01-09T22:51:46.820Z','r202j173c147',0,0,NULL),('ck1x3b44m00yn01i9d1521i6s','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I loved my time at Argus. Even though it didn\'t pay that well, it was such a great experience. I got to meet such wonderful women, and I got to learn so much about shelters, and the way they worked. I also learned a lot more about mental health, and even my own personal mental health.\n\nWhat was also invaluable was the opportunity I got to truly be open minded, and to open my heart to others. I was able to learn some administrative skills, ontop of problem solving, communication, leadership, and many more that are hard to come by in traditional student positions. All in all, I had a wonderful time at Argus and I would most definitely do it again! ',11,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-01-09T22:59:12.316Z','r203j174c148',0,0,NULL),('ck1x3b44m00yo01i9458obn7z','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Part-time teaching kids different sports. People in the company are nice and really relaxed. ',12,'CAD','hourly',4.0,4.0,5.0,5.0,NULL,0,1,'2017-01-09T23:01:38.925Z','r204j175c149',0,0,NULL),('ck1x3b44m00yp01i9hxsa2ds1','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The employers were very friendly and supportive which created a positive work environment. This opportunity provided a great experience for gaining different technical skills. In addition, being able to assist in organizing a research project gave me insight to how research careers in the work field are conducted. It was at a great location and overall, a good co-op term.  ',1600,'CAD','monthly',4.0,5.0,4.0,4.0,NULL,0,1,'2017-01-09T23:03:08.861Z','r205j176c150',0,0,NULL),('ck1x3b44m00yq01i9a8orbl09','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked summer 2016. Was at front reception greeting clients for multiple departments. Great way to learn more about the public sector, gain great admin and social skills. Very understanding supervisor. ',19,'CAD','hourly',4.0,5.0,4.0,5.0,NULL,0,1,'2017-01-09T23:08:11.832Z','r206j177c151',0,0,NULL),('ck1x3b44m00yr01i9dsh94kg7','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Smart coworkers, and meaningful work. Also has great perks for a startup.',8000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-01-09T23:14:00.499Z','r207j150c11',0,0,NULL),('ck1x3b44m00ys01i9dgv9hdbc','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Pretty good but most of the team was remote so there wasn\'t a lot of mentorship.',6700,'USD','monthly',4.0,3.0,3.0,5.0,NULL,0,1,'2017-01-09T23:16:24.559Z','r208j178c29',0,0,NULL),('ck1x3b44m00yt01i9fkij7pe2','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked at Google Kirkland office during summer term of 2016. I was assigned to the Cloud team. It was a great experience. My host and my team were very helpful and flexible. They gave me constructive feedback and helped me improve and acquire new skills in software development.',6000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-01-09T23:19:42.196Z','r209j179c17',0,0,NULL),('ck1x3b44m00yu01i96rux6tz2','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked there during Summer 2016. The company doesn\'t provide corporate housing, so interns have to find their own, but there is an extensive shuttle network and they also provide a bike for the duration of the internship.',6667,'USD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,'2017-01-09T23:23:17.842Z','r210j15c17',0,0,NULL),('ck1x3b44m00yv01i99gq3809f','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I interned at AdRoll winter term of 2016 on their data team. It was an interesting experience. I learnt a lot about the world of serving ads. Sometimes I was assigned work that I felt wasn\'t relevant. The culture at the company was great. People were friendly and approachable.',6400,'USD','monthly',4.0,4.0,3.0,5.0,NULL,0,1,'2017-01-09T23:23:44.746Z','r211j180c152',0,0,NULL),('ck1x3b44n00yw01i9106101t8','2019-10-19 04:56:45.467000','2019-11-27 20:34:31.672000',0,'ck1n1du49000501jo4pwygsav','I interned at Canadian Tire on their innovations in CommuniTech hub during the summer term of 2013. It was my first internship and also one of the first hires for the innovations team. There were more interns than full time employees on the team which contributed to a slight lack of mentorship. However it was a great experience and I learnt a tremendous amount because the environment forced us to work independently. Manager was great and approachable.',22,'CAD','hourly',4.0,3.0,5.0,5.0,NULL,0,1,'2017-01-09T23:33:51.248Z','r212j181c153',0,0,NULL),('ck1x3b44n00yx01i9dn5wao06','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','In the fall of 2016, I had the pleasure of working on the Fabric team as a full stack developer. Every intern at Twitter is assigned a mentor and a manager. Intern mentors work with their mentees every day of the week and provide them the resources and support they need to succeed at their internship through weekly one-on-one meetings and frequent feedback. Managers address any career-related questions you may have, and provide general career counselling. \n\nThe culture on the Fabric team was the best I\'ve ever seen on an engineering team. There is an emphasis on openness and enthusiasm that is seen and felt on a daily basis. Team meetings rarely feel extraneous, and I left most of them feeling like progress was made or work was accomplished. \n\nIncluded in my salary was a $2000 housing stipend. The food is phenomenal.',8500,'USD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,'2017-01-09T23:37:17.265Z','r213j182c50',0,0,NULL),('ck1x3b44n00yy01i93wk2b4ou','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I interned at Meta during the term summer term of 2015. I was on the data team. It was an interesting experience because it a startup/small company. The team members are tight-knit and very intelligent.',4000,'CAD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,'2017-01-09T23:38:37.824Z','r214j183c154',0,0,NULL),('ck1x3b44n00yz01i9f7emdg3m','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I also received a housing stipend of $5000 USD and $400 worth of Uber credits every month (I believe they don\'t provide the Uber credits anymore though). I had a great experience here and learned a TON. Unfortunately, the workload was huge and the company moves at a very rapid pace, so I was incredibly stressed out. I don\'t think I\'ve ever been more stressed out in my life. ',44,'USD','hourly',3.0,5.0,3.0,1.0,NULL,0,1,'2017-01-09T23:54:33.660Z','r216j38c52',0,0,NULL),('ck1x3b44n00z001i9g8m4cpbq','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I had an internship there in 2014. There was a big focus on the team and I was able to work on a number of client projects. ',4120,'CAD','monthly',4.0,3.0,3.0,5.0,'',0,1,'2017-01-10T00:10:39.887Z','r219j187c157',0,0,NULL),('ck1x3b44n00z101i96hkh7qcy','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','ThoughtWorks is a very friendly and educational workplace. By adhering to Agile principles (Standup, pair programming TDD, etc), I felt that I quickly gained context on the entire text stack and became close with my co-workers. As well, I was given the opportunity to shadow both the business analyst and the project manager and learned about work outside of the programmer role.',22,'CAD','hourly',5.0,5.0,5.0,5.0,'pm,business,agile',0,1,'2017-01-10T00:31:11.720Z','r220j188c156',0,0,NULL),('ck1x3b44n00z201i98ybl9aee','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked in a research lab in the summer of 2013. It was a great learning experience and I received a lot of support from my supervisor as well as my lab mates. I was able to start work on my own long term project and it culminated in a oral presentation at an undergraduate research conference. ',10,'CAD','hourly',4.0,5.0,5.0,3.0,NULL,0,1,'2017-01-10T01:08:04.267Z','r223j191c137',0,0,NULL),('ck1x3b44n00z301i90rcrari6','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','It was great! Worked on a variety of optimization and data problems for various Consumer Packaged Goods companies.  Dynamic and hilarious team to work with and lovely weather in the fall/winter.',4000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-01-10T01:13:32.154Z','r224j192c159',0,0,NULL),('ck1x3b44n00z401i96ftveu94','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I think the culture highly depends on the team that you work at. Out of the big companies, Amazon is definitely the most frugal in terms of taking care of their employees. There is not much random perks but the work is definitely challenging and rewarding especially when placed on the right team. Amazon, as I see it, is definitely an innovator and will see success for future years to come.',6000,'USD','monthly',4.0,5.0,4.0,3.0,NULL,0,1,'2017-01-10T01:13:41.035Z','r225j161c4',0,0,NULL),('ck1x3b44n00z501i91rikhig9','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I interned at LinkedIn for my last coop term.\nThere are a lot of pros about LinkedIn and I\'d like to highlight them:\n- I learned way more about engineering here than I did at other large companies\n- I was surrounded by extremely talented people (ex-members of tech giants)\n- My team valued code quality which leads to self-improvement -> code not breaking in prod -> stress-free deployment\n- Put into housing with other interns\n- Lots of random day events (eg. chili cook-off, runs)\n- Breakfast, lunch, dinner all provided with great snacks\n- InDays - once a month, take some time for self-improvement if you want\n- Tennis courts, sand volleyball court, basketball court behind their office\n- Just lots of opportunities to succeed and live a good life\n\nThere were no real major cons while I interned here but if I were to point out some minor ones:\n- Sometimes your code reviewer is too busy with their own stuff to review yours (this is common to FB, Google, etc.)\n- South bay is pretty boring\n- Without a car, commute can be very inconvenient\n\nLikewise with all companies, your experience might be different but mine went beyond my expectations. I will be returning for full-time.',45,'USD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-01-10T01:32:52.370Z','r226j193c24',0,0,NULL),('ck1x3b44n00z601i92vd500j2','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked during the summer months, particularly July and August. I had a great time working for Habitat. The employees were absolutely amazing and I had a lot of support from my managers. ',1200,'CAD','monthly',4.0,5.0,4.0,5.0,NULL,0,1,'2017-01-10T01:36:28.037Z','r227j194c160',0,0,NULL),('ck1x3b44n00z701i94lkq8cah','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Great work environment!',1350,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-01-10T01:38:37.863Z','r228j195c161',0,0,NULL),('ck1x3b44n00z801i9d75o4gr0','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked there in Fall 2016. This was the first time I got to work on real machine learning - I got to build a model and work on feature engineering. I had superb teammates who were technically strong, and the work I did at Uber had the most impact on the compared to all my other co-ops. The infrastructure at Uber is not as mature as companies such as Facebook but there are tons of challenges to solve and it is an exciting place to work at!',7500,'USD','monthly',5.0,4.0,5.0,4.0,NULL,0,1,'2017-01-10T01:39:21.445Z','r229j38c52',0,0,NULL),('ck1x3b44n00z901i9eaf9094a','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Very good Front End experience, great team dynamic and good exposure to UX/UI design. There is a variety of project selection and many interesting projects depending on when you intern there.',5600,'USD','monthly',3.0,3.0,3.0,3.0,NULL,0,1,'2017-01-10T01:44:41.004Z','r230j196c162',0,0,NULL),('ck1x3b44n00za01i9cpepaoxg','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I took this job during continuous round in 2014 and the interview was discussing past experience. It was essentially a walk-on job. My overall experience at the Ottawa branch left a lot to be desired of.\n\nMeaningful Work\n- Bug fixing for days with the occasional small feature\n- Eventually got to do a proof-of-concept that led to a patent\n- POC was fun to do\n- Proof-of-concept likely scraped a few months after I left and patent was finalized\n\nMentorship\n- At first, I had no mentor but was eventually (luckily) paired up with one\n- Rarely got my code reviewed so I did not get as much constructive criticism as I hoped (POC only got design reviewed but not code)\n\nWorklife Balance\n- As an intern, you get to decide how much work you want to do\n- Was able to go to the gym often\n\nLiterally no perks.',920,'CAD','weekly',2.0,2.0,3.0,4.0,NULL,0,1,'2017-01-10T01:45:48.978Z','r231j197c84',0,0,NULL),('ck1x3b44n00zb01i94yveacyo','2019-10-19 04:56:45.467000','2019-11-27 20:33:57.507000',0,'ck1n1du49000501jo4pwygsav','I Interned for Street Contxt in there Toronto office. It was a very good experience, they are a fast growing startup that values interns and offers great mentorship.',27,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-01-10T01:46:25.664Z','r232j198c163',0,0,NULL),('ck1x3b44n00zc01i9cdzu1em9','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','SMART has a great internship program and offers many interesting teams for coop students to work on. I worked for SMART amp which is an online real time collaboration software for classrooms. It offered me a great learning experience. ',4500,'CAD','monthly',3.0,5.0,5.0,5.0,NULL,0,1,'2017-01-10T01:50:34.953Z','r233j97c99',0,0,NULL),('ck1x3b44n00zd01i9a8oj8obc','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','This was by far the worst experience I\'ve ever had. Half the time I had no work to do, so I was bored out of my skull. Then whenever there actually was work, they put multiple interns on it and let them \"battle it out\" and selected the one that produced the best product. Like wtf?! Also almost the entire office had been relocated to work on projects in other countries, so there was basically 2 other people in the office. Would not recommend.',22,'CAD','hourly',1.0,1.0,1.0,5.0,NULL,0,1,'2017-01-20T20:56:28.209Z','r218j188c156',0,0,NULL),('ck1x3b44n00ze01i9222x62a5','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Super chill workplace, work I did was shipped and overall rate this job. Take it if you get the chance in lower years.',17,'CAD','hourly',4.0,5.0,4.0,4.0,NULL,0,1,'2017-07-06T18:48:46.797Z','r527j456c279',0,0,NULL),('ck1x3b44n00zf01i92lle8n6w','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Very relaxed workplace with little direction in task, recently adopted agile development however most leadership is in disarray, moreover mentorship for a first / second year coop is there with the standard that you put in some self work and learning. Status of the company overall is reflected at the office with environment being  terse at times. would rate a solid 3.5/ 7',3250,'CAD','monthly',3.0,4.0,1.0,4.0,NULL,0,1,'2017-07-06T18:59:31.558Z','r528j457c294',0,0,NULL),('ck1x3b44n00zg01i9102lcjc8','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked for the Government of Canada as a summer co-op student. The office was relatively small, comprised of no more than 40 individuals, so the team was tightly-knit and friendly towards each other. Everyone would eat lunch together in the kitchen and share laughs. After an employee comes back for vacation, he or she would bring back souvenirs (often edible, like chocolate) for the entire office to enjoy.\n\nAs a co-op student, I was warmly welcomed by all the employees. Everyone at the office offered help and made sure I was not having a hard time understanding my tasks. They also ensured my workload was appropriate. My manager would also meet with me frequently to see my progress and suggest improvements. The tasks varied everyday depending on the work that was given to me so everyday was different.',16,'CAD','hourly',4.0,3.0,3.0,5.0,NULL,0,1,'2017-01-10T02:24:12.661Z','r236j201c165',0,0,NULL),('ck1x3b44n00zh01i9cavm3nqy','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','This was a really great place to work in terms of work. In terms of culture maybe not? I really liked it, but I feel like its a very fake-faced culture in that not everything is communicated clearly. I know this is not possible in a normal work environment, but I feel like somethings should be communicated clearly and early. ',6000,'USD','monthly',3.0,5.0,5.0,5.0,NULL,0,1,'2017-01-10T02:24:22.049Z','r237j202c166',0,0,NULL),('ck1x3b44n00zi01i9dot6aes9','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked here in my first year and loved it so much I went back for another internship. The team lead was super friendly and incredibly supportive, but there was a contractor I worked with that wasn\'t as nice. I ended up doing a lot of work he was assigned to do, which is great for me because I learnt a lot. In terms of getting credit for what you do, this may not be the best, otherwise it was a great start to my career. ',14,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-01-10T02:26:56.907Z','r238j203c167',0,0,NULL),('ck1x3b44n00zj01i9ffhhbvtm','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked at eHealth Ontario as a business analyst, though the role itself was more of a project management role. During the term, I was responsible for collecting weekly status reports from the various project managers, clarifying the report contents and developing a summary status report for senior management. My manager that term was a great mentor and provided me with many opportunities to take on more advanced and interesting tasks as the term progressed.',16,'CAD','hourly',4.0,4.0,4.0,5.0,NULL,0,1,'2017-01-10T02:45:19.635Z','r239j204c168',0,0,NULL),('ck1x3b44n00zk01i97vkt6r7m','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked here in 2B. Mileage will vary depending on the team. Worked on the cryptography team. I was the only non-PHD. I love cryptography',10000,'USD','monthly',3.0,4.0,3.0,2.0,NULL,0,1,'2017-01-10T03:03:27.844Z','r240j15c17',0,0,NULL),('ck1x3b44n00zl01i9epuz6ua7','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Pretty awesome place to work, everyone is smart, and helpful. A lot of different personalities, and everyone gets their work done.',8000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-01-10T03:13:01.667Z','r241j150c11',0,0,NULL),('ck1x3b44n00zm01i9bjx90zv9','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Fun place to work when I was there 2014, a lot of young link minded engineers. Although I have heard many of them have left the company since, so I can\'t be too sure of its status now.',7500,'USD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,'2017-01-10T03:15:12.142Z','r242j29c28',0,0,NULL),('ck1x3b44n00zn01i9hc4n4088','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Cool place to work at if you are into the startup scene in Canada. They are a YCombinator  company, and they put a big emphasis on company culture. I had a mini project for myself, and I was able to touch parts of the entire stack from front end to back end. ',4000,'CAD','monthly',4.0,4.0,4.0,5.0,NULL,0,1,'2017-01-10T04:35:05.727Z','r244j205c169',0,0,NULL),('ck1x3b44o00zo01i9asvj0ins','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The people are really nice, driven and smart. Worklife balance is great, I found myself having a lot of free time. This was mostly due to the nature of the work, which mostly consisted of bug-fixing and new features. Overall a great place to work.',4800,'USD','monthly',4.0,5.0,3.0,5.0,NULL,0,1,'2017-01-10T05:45:27.224Z','r246j206c170',0,0,NULL),('ck1x3b44o00zp01i90tc7cvmh','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The work was fairly boring as I did not believe in their product. The people there are really great and intelligent. They recently got purchased by a larger company so the culture might be different now.',5000,'USD','monthly',3.0,2.0,2.0,5.0,NULL,0,1,'2017-01-10T05:48:06.936Z','r247j207c171',0,0,NULL),('ck1x3b44o00zq01i98gel7int','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I had a co-op at Wattpad for two terms, spanning the Fall 2012 and Winter 2013 terms. I joined the engineering team when there were ~50 employees and everyone worked in the same room. My first term was enjoyable because I was given a lot of ownership over the codebase and developed end-to-end features. My second term gave me an opportunity to grow my leadership skills by on-boarding and supporting several new full-time iOS developers.\n\nOverall, Wattpad was a very warm and welcoming place to work. Allen and Ivan are two very intelligent and devoted co-founders. I hope to see Wattpad continue to grow as one of Toronto\'s most successful startups.',3600,'CAD','monthly',4.0,4.0,4.0,4.0,NULL,0,1,'2017-01-10T07:41:26.115Z','r248j79c64',0,0,NULL),('ck1x3b44o00zr01i9gks14thf','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked at Coursera as an iOS intern during the Fall 2014 term. It was my first time working in Silicon Valley, and I was looking forward to meeting many smart engineers working at the cutting edge of the software industry. I found this in my internship at Coursera, working alongside some of the most inspiring engineers I\'d met thus far. During my four months, I focused on features around internal tooling, event tracking, and the lecture video player. I learned a ton of iOS development thanks to working closely with my mentor and teammates, as well as attending meet ups in the Bay Area.\n\nThere\'s a lot going on everyday at Coursera across all the different teams, but one thing is constant-a lot of the employees empathize with the mission of making online education accessible to anyone, anywhere in the world.',8000,'USD','monthly',4.0,4.0,4.0,4.0,NULL,0,1,'2017-01-18T07:49:21.862Z','r249j208c11',0,0,NULL),('ck1x3b44o00zs01i981ju0cdp','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The mentorship that was provided by my particular PI and the grad student I helped was amazing. However, I felt I wasn\'t contributing much to their project - I was doing very laborious things like maintaining cell culture. There was less actual experimentation than I had anticipated but that was due to the nature of the project, with primary cell lines increasing the down time between experiments.\n\nYour lab experience largely depends on your lab and your assigned project so discuss it thoroughly with your PI!',1200,'CAD','monthly',3.0,5.0,2.0,2.0,NULL,0,1,'2017-01-10T22:13:18.991Z','r251j210c137',0,0,NULL),('ck1x3b44o00zt01i9f80k8erh','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked there from Aug - Dec 2016. Really engaging place to work, doing something new every day. People are really cool and helpful!',775,'CAD','weekly',5.0,5.0,5.0,4.0,NULL,0,1,'2017-01-11T19:25:14.283Z','r252j211c173',0,0,NULL),('ck1x3b44o00zu01i95mrs6hc8','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Yelp was a great learning experience. I found the mentorship and atmosphere to be incredibly chill and inviting. Experience varies widely from team to team, but I found that most teams on search had fun and interesting work. Would recommend 5/5.',9000,'USD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,'2017-01-11T19:38:05.501Z','r255j213c58',0,0,NULL),('ck1x3b44o00zv01i9gwyebvcp','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Capital One KW labs was a poor internship experience overall. You\'ll get an intern project to do amongst other interns that is likely to never see the light of day. There is an extremely low quality requirement, and you won\'t get much mentorship to actually learn anything. Would not recommend, unless you explicitly want a self learning experience.',25,'CAD','hourly',2.0,1.0,2.0,5.0,NULL,0,1,'2017-01-11T19:42:51.401Z','r256j214c175',0,0,NULL),('ck1x3b44o00zw01i9751mfoek','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Team Viking was an awesome team! The team is extremely welcoming, and experienced. You get to work on cool distributed systems. One caveat is the team is R&D so your work might not actually see production. A great first work term!',19,'CAD','hourly',4.0,4.0,4.0,5.0,NULL,0,1,'2017-01-11T19:44:39.422Z','r257j215c176',0,0,NULL),('ck1x3b44o00zx01i94y8r3gh6','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I was very lucky with the mentor I got at BlackBerry - he was very helpful and I learned a lot from him but the biggest issue is that there is not a lot of work to do in the first place. I sat around making myself look busy for at least 50% of the term and the work I was doing did not seem very meaningful. Kanata is a pretty boring place - would not recommend in the winter unless if you bring a car. The bus service needs work, it\'s hard to get around, and there\'s not much to do.',800,'CAD','weekly',3.0,4.0,2.0,4.0,NULL,0,1,'2017-01-11T19:50:12.976Z','r258j216c62',0,0,NULL),('ck1x3b44o00zy01i93n508g2z','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','People are very passionate about what they\'re working on. I was on the server team which was quieter but they were friendly and approachable. Company culture is good, they do lots of events. Company was growing a lot and in an exciting place when I left.',24,'CAD','hourly',4.0,3.0,3.0,5.0,NULL,0,1,'2017-01-11T19:56:56.769Z','r260j217c177',0,0,NULL),('ck1x3b44o00zz01i9hcaaabji','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Technology department only had about 15-20 people. Worked on a web app that promotes coding with coding challenges.\nThere were problems with management, but people were friendly and nice and Japan was fun. ',150000,'JPY','monthly',3.0,2.0,3.0,5.0,NULL,0,1,'2017-01-11T20:06:45.814Z','r261j218c178',0,0,NULL),('ck1x3b44o010001i9e5o3ejjy','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I was working on Fusion 360 web which was a product in beta at the time. Since it was in beta, there was also a lot of bug fixing that came with it. However, the bugs were substantial enough to require significant changes and a great deal of learning, which resulted in some meaningful work. I would recommend working here, especially this team, if you are looking to dive into 3D graphics on the web. The office space is also beautiful and conveniently located in Old Montreal near downtown.',3600,'CAD','monthly',4.0,4.0,4.0,5.0,NULL,0,1,'2017-01-11T20:10:06.215Z','r121j147c82',0,0,NULL),('ck1x3b44o010101i9b5966bje','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','A Thinking Ape is by far the best workplace I\'ve worked at.\n\nWork time is very flexible that I can come to the office at 1 pm. Working from home is also a common thing. You can also bank statutory holidays by working on a holiday and increasing your vacation day. A very flexible working environment.\n\nSince it\'s in Canada, you don\'t get free food like in the Bay area. However, you still get a catered lunch every Wednesdays. There are many companies in Van that don\'t even give you one free lunch a week.\n\nSupport was also great. Both my mentor and my team lead tried their best to give me tasks/features that I want to work on and that are meaningful. The features I worked on are being used by actual people all around the world right now through the game I worked on.\n\nAs I really loved working at A Thinking Ape, I actually returned here and am working as a full time right now.',4500,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-01-11T20:16:25.961Z','r102j16c67',0,0,NULL),('ck1x3b44o010201i95841a2ip','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','ATA tries to get you to push code to production within 48 hours! They definitely treat you like a full-time engineer and are willing to give you interesting work. At first I wasn\'t quite sure what I wanted to do, but narrowed it down over the course of the term. Teams are about 4-6 people (including co-ops in my case). While I was working there, the office was fairly close - there were several intramural teams (Dodgeball, Hockey, etc).',30,'CAD','hourly',5.0,5.0,5.0,4.0,NULL,0,1,'2017-01-11T20:17:10.252Z','r222j16c67',0,0,NULL),('ck1x3b44o010301i921uf9lql','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The co-workers on my team were all very helpful and extremely smart, and the hours were not as bad as I\'d thought they\'d be, but I disliked having a single intern project to work on for the entire term.',6000,'USD','monthly',3.0,3.0,2.0,3.0,NULL,0,1,'2017-01-11T22:05:34.684Z','r262j219c4',0,0,NULL),('ck1x3b44o010401i961zt9eab','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked in Fall 2016 and it was an amazing learning experience. I was placed on a machine learning project without previous experience in this area. I had a lot of freedom in trying out different approaches so I was able to experiment with a lot of different approaches. It was challenging work but at the end rewarding. The culture is academic, which was new to me and I liked. There are also a lot of clubs/interest groups that allowed me to meet a lot of the people at the company. The people were amazingly smart, humble and fun to hang out with.',8250,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-01-13T21:29:36.636Z','r264j220c37',0,0,NULL),('ck1x3b44o010501i93t3b8oy8','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Fun company to work at. Lots of social events and the average full time employee is pretty young so there was a lot to do as an intern. Work was cool due to the scale at which Uber operates. The work-life balance is lacking since most people stay late and there is an expectation to work overtime. Also, dinner is at 8:15 pm.',39,'USD','hourly',5.0,5.0,5.0,4.0,NULL,0,1,'2017-01-13T21:35:19.119Z','r265j38c52',0,0,NULL),('ck1x3b44o010601i94od8cglr','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Project was engaging, but mentorship and support in engineering could\'ve been more experienced. You end up having to learn a lot on your own, but you do get to own the project entirely.',750,'CAD','weekly',3.0,3.0,5.0,3.0,NULL,0,1,'2017-03-03T22:23:21.375Z','r253j212c174',0,0,NULL),('ck1x3b44o010701i94f1mdf0t','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Slow public sector job. Great pay for the work you do, and if you\'re into transportation planning and engineering it may be worth a try.',21,'CAD','hourly',3.0,3.0,2.0,5.0,NULL,0,1,'2017-07-07T01:15:49.529Z','r529j458c151',0,0,NULL),('ck1x3b44o010801i9dcx5bbdu','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Working in the now defunct BB10 web browser team while it was on its last legs was a great experience. The team was wonderful, I was assigned a mentor/supervisor who took me under their wing and taught me a lot, but I found out that the work wasn\'t for me. I was doing a lot of testing and automation, which isn\'t really my thing but it might be for you!',21,'CAD','hourly',4.0,5.0,3.0,4.0,NULL,0,1,'2017-01-13T22:36:00.677Z','r266j221c62',0,0,NULL),('ck1x3b44o010901i9cfji6a86','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Learned a lot at this company; coworkers are supportive and fun. Overall a great term!',900,'CAD','weekly',4.0,5.0,4.0,4.0,NULL,0,1,'2017-01-16T14:12:16.631Z','r267j222c179',0,0,NULL),('ck1x3b44o010a01i9fxkig8a4','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Casual work environment and very youthful culture. Many events and games held regularly. You\'re treated like a full-time employee, so you things you do actually matter within the game and engine. Tight deadlines to meet for releases while I was there, which meant lots of overtime, but I was assured that this was only specific to the project that I was working on. A bit of growing pains in the development process, but it has improved a lot since I started.',30,'CAD','hourly',5.0,3.0,5.0,3.0,NULL,0,1,'2017-01-16T14:20:48.296Z','r268j223c180',0,0,NULL),('ck1x3b44o010b01i92wzi8r2x','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Welcoming culture. Great learning experience for me, especially since other employees also have a learning mindset. (It is an education company after all, I guess)',7000,'USD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,'2017-01-17T04:23:24.876Z','r270j150c11',0,0,NULL),('ck1x3b44o010c01i97n3n7w9l','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Was a small company when I was there. There were a few people that brought the internship experience up. Did not interact with the rest of the company much. Was given full autonomy over my project, but did not receive much feedback.',9000,'USD','monthly',4.0,3.0,4.0,3.0,NULL,0,1,'2017-01-17T04:25:19.810Z','r271j2c42',0,0,NULL),('ck1x3b44p010d01i9grp55tg6','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Travelled a ton, so my work life balance was shot. Work is interesting. I personally got to work with many clients and found it rewarding learning about the data and sometimes inner workings / politics of other companies. Did not grow technically as much since the work was more business-application heavy. Lots of learning opportunities in business skills in this role though.',7500,'USD','monthly',3.0,3.0,4.0,1.0,NULL,0,1,'2017-01-17T04:31:49.643Z','r273j225c32',0,0,NULL),('ck1x3b44p010e01i976xnb189','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Good work life balance. ',5800,'GBP','monthly',4.0,3.0,3.0,5.0,NULL,0,1,'2017-01-17T04:35:17.943Z','r274j226c32',0,0,NULL),('ck1x3b44p010f01i99nxo329h','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Summer 2014, the emerging technologies team is a small team (30 people) within the company working on a lot of cool projects, many of them are prototypes, and iterate quickly on interesting technologies',3200,'CAD','monthly',5.0,4.0,4.0,5.0,NULL,0,1,'2017-01-18T07:26:30.807Z','r144j128c39',0,0,NULL),('ck1x3b44p010g01i98xyo80f6','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Perks: \n$1500 Housing stipend\nSnacks & Drinks\nCatered lunch on Friday\n\nYelp has a very solid internship program. The work experience might vary depending on the team, but YIP (Yelp Internship Program) does an amazing job at engaging interns with activities at least once a week (e.g. street art painting, indoor mini golf, Giant\'s game with the mentor, trip to Angel Island, just to name a few). I participated in most of them and it was a great way to get to know the other interns and explore the city.\n\nI enjoyed the work; it\' was not a \'let\'s add this small feature on the internal tools\', but actually directly working on the Yelp platform. One drawback for me was that my mentor was leading a big project and had a lot of responsibilities when I started my internship. I wished I received more guidance / mentorship throughout the term.',7360,'USD','monthly',4.0,3.0,5.0,5.0,NULL,0,1,'2017-01-18T07:33:24.290Z','r245j213c58',0,0,NULL),('ck1x3b44p010h01i9fh634lyk','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked here in Fall 2014. Snacks and Friday catered lunches were provided. There was also a $1000 /mo stipend.\n\nI was assigned a team and given a designated mentor. I wasn\'t really given many options to branch out into what I was interested in. I worked mostly modifying internal API responses to facilitate the building of a few smaller features. The main feature I worked on wasn\'t particularly that complex or interesting; hence, the low rating for the quality of work.  Work-life balance was essentially enforced for interns, since interns are paid hourly and overtime is discouraged. However, because of this hourly system, interns are also not paid for any holidays (i.e. I was only paid for 24h during the week of Thanksgiving).',36,'USD','hourly',3.0,3.0,2.0,5.0,NULL,0,1,'2017-01-18T07:33:24.297Z','r172j213c58',0,0,NULL),('ck1x3b44p010i01i96eko7hy6','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','For my final co-op term, I worked for the Performance team at Yelp. I learned a lot at Yelp and really enjoyed my experience there. The culture is quite chill, and the workload is very reasonable.\n\nDuring my term, there was a large group of (30 or so) Waterloo interns, and the company organized group events for us once or twice a week. These events were a good way of getting to know people. Another perk is they provide a housing search service, so you don\'t have to spend hours combing through Craigslist -- this proved to be super useful. There is only free lunch on Fridays, but the pantry is stocked generously with snacks and drinks. I would definitely recommend working here!',8800,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-01-18T07:33:24.301Z','r64j213c58',0,0,NULL),('ck1x3b44p010j01i9em23h0e4','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The people that work at Side Effects are some of the smartest engineers I\'ve ever met. This is easily the most technically challenging co-op position in Canada. By like a mile. They have experts on rendering, cloth simulations, explosions, sand, crowds, etc, basically everything used to make visual effects.\n\nA lot of independence is required to succeed (well depending on who\'s mentoring you). You\'ll never be bored, but you\'ll probably be frustrated at times. C++, Python, and VEX (their custom scripting language).',33,'CAD','hourly',4.0,3.0,5.0,3.0,NULL,0,1,'2017-01-18T07:38:01.695Z','r157j25c71',0,0,NULL),('ck1x3b44p010k01i94qxy3k2x','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked on one of Bloomberg\'s ML teams during summer 2015; the work itself was challenging, and I got to work on and learn about infrastructure/data science at a big-data scale. My mentor and team were very available and knowledgable, and were happy to answer questions when I needed help.\n\nNew York is a blast! They provide corp-housing, which is a huge plus in terms of bonding with other interns and exploring Manhattan.',6400,'USD','monthly',4.0,4.0,4.0,4.0,NULL,0,1,'2017-01-20T15:09:30.697Z','r192j72c8',0,0,NULL),('ck1x3b44p010l01i9goe79ffk','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked there for my internship after the 2B academic term. I absolutely loved the people there, it was like working with friends. Unfortunately, my mentor didn\'t seem to understand the role of mentors and did not provide any support at all. The work was rather boring because the product is boring, but I did get to put something out to production. ',33,'USD','hourly',3.0,1.0,2.0,5.0,NULL,0,1,'2017-01-20T15:14:29.775Z','r215j199c155',0,0,NULL),('ck1x3b44p010m01i9f20m0l20','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Fall 2016 - Sept to Dec\nHighlight: The people I directly worked with were great! I would totally go and visit just to see them again after I recover from my monetary loss.\n\nThe culture there isn\'t great for interns, because corporate full-times tend to look down on you because you\'re a student. I worked with programmers so there was none of that, but it showed with the university management. There\'s a lot of office politics which made everything 1000x more complicated, and the lack of proper management made everyone\'s work excessively harder. Also the pay was incredibly low while nothing except the visa was subsidized, which was almost not because they didn\'t know we had to pay another fee when we pick it up. HR rejected to pay it until the full-times talked to finance and clarified that it\'s supposed to be paid.\nWe had some exciting events and things in the road map, but in the end all I got was marketing and administrative work even though I wanted to do more hands-on work. I ended up spending a lot of time self-studying or helping people meet their deadlines.',1176,'SGD','monthly',1.0,1.0,2.0,1.0,NULL,0,1,'2017-01-20T16:09:36.149Z','r276j227c182',0,0,NULL),('ck1x3b44p010n01i9adt353xe','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Great people and great workplace. Lots of responsibility due to the small team size (which has since exploded to something much bigger), but that also means the work was satisfying and significant within the game.',21,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-01-20T20:46:44.238Z','r269j224c181',0,0,NULL),('ck1x3b44p010o01i90bjq9963','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked there Jan-Apr 2016 on their Internal Platform team. I was in a team of 6 people (including me) and we worked on one of their most critical microservices that would propel their future features. It was mostly modernization, but the technical challenges we faced during this made it much more interesting than \"refactoring code\". The people were great, got along with the interns very well and I still keep in contact with the full-times via Facebook or LinkedIn. I\'m still considering going back for full-time, even though it was my second internship so I\'d need to reapply.',3750,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-01-20T20:50:20.474Z','r275j160c111',0,0,NULL),('ck1x3b44p010p01i92cs9bx4p','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I interned at Reflektion for 2 co-op terms and the first term I was there I learned more about software engineering than I did during any other co-op term.\n\nI got the chance to use a wide range of technologies during my internship and had the freedom to work on 2 different teams. I took on a lot of responsibility, from getting the product ready by a tight deadline to demo to potential customers to being the main engineer/owner to work on critical tools and infrastructure. The engineers I worked with had a lot of industry experience and I learned many best practices and tricks from them.\n\nThere were monthly company outings and we had a huge Christmas party. However, there were no company-organized intern events.',5500,'USD','monthly',5.0,5.0,5.0,3.0,NULL,0,1,'2017-01-20T20:53:38.238Z','r97j32c76',0,0,NULL),('ck1x3b44p010q01i96myc07sl','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked here during the summer of 2015. It was a very immersive and satisfying first work term for me, as it helped me develop professionally and improve myself technically.',22,'CAD','hourly',4.0,5.0,4.0,3.0,NULL,0,1,'2017-01-20T20:55:15.418Z','r165j166c131',0,0,NULL),('ck1x3b44p010r01i91skk3dq7','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Fall 2016 Coop. Got to work on a wide variety of projects. A lot of self-guided learning in really interesting areas. Supervisors were often busy or out of town and difficult to reach.',4000,'CAD','monthly',4.0,2.0,3.0,5.0,NULL,0,1,'2017-01-20T22:18:08.617Z','r277j228c183',0,0,NULL),('ck1x3b44p010s01i91bvabbyn','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','http://blog.shreyanssheth.com/2017/01/08/winter-at-wingify/\n\nAmazing Perks (PS4, Ping Ping table, Skateboard, BMX all in-house. Free catered lunch, in-house chef, and tons more), Great peers, Talented engineering team. Making a shit ton of revenue on their products. Interning at one of India\'s best startups was one hell of an experience. ',20000,'INR','monthly',5.0,4.0,5.0,5.0,NULL,0,1,'2017-01-20T22:19:07.966Z','r278j229c184',0,0,NULL),('ck1x3b44p010t01i95sjkdpar','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','- It was a two man QA team therefore no automation\n- Great people\n- Everyone has a different idea of the where the company is and where it is going\n- I interned while they hired new management who turned out to be great\n- Catered lunch on Fridays',17,'CAD','hourly',3.0,2.0,1.0,4.0,NULL,0,1,'2017-01-20T22:19:54.916Z','r279j230c185',0,0,NULL),('ck1x3b44p010u01i994nj9vrn','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Built a lot of internal tools, and managed internal (ie build) processes. Very open culture and friendly people. Free lunch on thursday, and fun company events.',3500,'CAD','monthly',4.0,3.0,4.0,5.0,NULL,0,1,'2017-01-20T22:21:49.553Z','r280j231c186',0,0,NULL),('ck1x3b44p010v01i9aesmdneu','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','It was lit',26,'USD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-01-20T22:23:42.536Z','r281j232c187',0,0,NULL),('ck1x3b44p010w01i9as97evqk','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','It was lIT',3500,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-01-20T22:24:22.715Z','r282j233c188',0,0,NULL),('ck1x3b44p010x01i9eha2gwyb','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Your experience at RBC while vary with each team, however during my time there I found that I was given a lot of responsibility, and opportunity to learn and make an impact for the bank. The people there were always very nice, and are often used to being around co-op students. Managers are very helpful, and understanding at the same time. I would highly recommend this position for anyone who is entering their 1st or 2nd co-op term.',18,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-01-20T22:40:49.523Z','r284j235c189',0,0,NULL),('ck1x3b44p010y01i92bue85me','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Winter 2016. Amazing work life balance and culture, but not very interesting in terms of projects you will get to work on.',16,'USD','hourly',4.0,4.0,2.0,5.0,NULL,0,1,'2017-01-20T22:43:06.118Z','r285j236c190',0,0,NULL),('ck1x3b44p010z01i90xm91a8k','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Definitely more of a tech company than a finance company. The office is pretty nice with around 100 people and located in downtown Toronto. All the teams are actively working towards goals and there are a lot of interesting projects going on. On product focused teams, you are treated as a full-timer and have input on new features, etc, which is really nice. The people are very kind and approachable and there are office events that go on throughout the term for example ping pong tournaments. Cons are lack of internship events and they don\'t hire a ton of interns (1 per team), so it can be lonely sometimes, but it also forces you to make friends with your team :)',4000,'CAD','monthly',4.0,4.0,4.0,5.0,NULL,0,1,'2017-01-20T22:45:20.423Z','r286j153c136',0,0,NULL),('ck1x3b44p011001i9e1x3198d','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Vena is a pretty chill company to work for. Although the work I did was not the most interesting, I still learned a lot on the job. ',3600,'CAD','monthly',4.0,4.0,4.0,5.0,NULL,0,1,'2017-01-20T23:57:54.890Z','r293j98c105',0,0,NULL),('ck1x3b44p011101i90nvm4wf6','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','While on the Android team at RBC, I was given a good amount of work, and was treated like a full time employee. My manager was quite good at managing co-op students, and providing support when needed. Everyone there was always very nice, and respectful despite being a co-op. There\'s also lots of other co-ops at RBC, and lots of organized student events to network and meet new people. \n\nAlthough the bank\'s dress code is usually business casual, anyone working in tech (Under T&O) can wear casual clothing. ',23,'CAD','hourly',4.0,4.0,4.0,5.0,NULL,0,1,'2017-01-20T22:47:10.248Z','r287j237c189',0,0,NULL),('ck1x3b44p011201i91qbl3efg','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Very nice people and they often hire a ton of coops, so in terms of fun, this is the place to be. The mentorship is lower since the full time to coop ratio is so low. The work is not that meaningful since you just develop prototypes, however there have been projects that have been passed onto the accelerator (TD 55) which was the case for my term project. However, this is fairly rare (only 1 project made it to accelerator in my term), so I have to give a low rating for meaningful work. I would recommend this place for a 1st or 2nd coop especially if you lack industry dev experience. Throughout the term you will be exploring all kinds of tech stacks, so it is a good place to get breadth.',18,'CAD','hourly',3.0,3.0,2.0,5.0,NULL,0,1,'2017-01-20T22:50:50.812Z','r288j238c191',0,0,NULL),('ck1x3b44p011301i9cvo40yx2','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The work was very interesting and my mentor was great! Make sure to be self-driven for this job since some coworkers are located across time-zones.\n\nI cannot give 5 stars for this job for the following reasons:\n - The Austin office doesn\'t have a lot of interns\n - The Austin office is 30 mins drive away from downtown Austin\n\nAustin does not have good public transit. If you want to have fun outside of work, buy/rent a car and be 21.',5120,'USD','monthly',4.0,5.0,4.0,5.0,NULL,0,1,'2017-01-20T22:52:11.140Z','r289j239c30',0,0,NULL),('ck1x3b44q011401i932dxdn16','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','When I was here, the testing was all manual unfortunately even though during the interview, they mentioned scripting and automated tests. I would only recommend this place for a first coop if you seriously lack experience. You get free lunch, the people are nice, the office is nice, dogs roam around, but at the end of the day, I would not recommend this place for people in CS or related simply due to the fact that testing is manual. Perhaps this has changed, but this was back in 2013.',18,'CAD','hourly',2.0,2.0,1.0,5.0,NULL,0,1,'2017-01-20T23:26:05.203Z','r290j240c61',0,0,NULL),('ck1x3b44q011501i9423z4snb','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Interned at 2015 summer. ',6666,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-01-20T23:26:46.868Z','r291j241c17',0,0,NULL),('ck1x3b44q011601i9efqp5gtq','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','This was my first big internship however I had the worst experience here. The environment is extremely laid-back. Employees are not passionate about their work and job. The management is biased and skewed. A partner because my manager who barely cared about my progress, even forgot my day of presentation, one which managers have to let them intern know about. If it does not work out with a mentor for you, then it is a bad bad sign. You are typically not supposed to express what you think about the  environment and your thoughts about mentor. No one check in to really see if all is going well. When you stand up to speak for yourself, you are not taken positively. This was my experience of this place. I know you can have a very different experience. This is because the orgs in this company are very disconnected from each other. The culture across the company is very varied, and I happened to get into a bad apples basket:(',7100,'CAD','monthly',2.0,1.0,4.0,4.0,NULL,0,1,'2017-01-20T23:39:43.257Z','r283j17c27',0,0,NULL),('ck1x3b44q011701i9fvjw0efo','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The people here are outstanding and many have advanced degrees. The work is very technical and challenging. I was fortunate to receive very good mentorship, but your experience may vary from team to team. Downtown Toronto is fun and the proximity of the office to the University of Toronto opens up opportunities to get engaged with student life there.',32,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-01-20T23:57:11.537Z','r292j242c20',0,0,NULL),('ck1x3b44q011801i9clfu7j14','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked on a cook project with a remote team. By the end of the summer, the work had gotten repetitive, but it was a really collaborative environment and there were fun intern events. At the end of the summer there was a poster fair competition, which I won (the prize was a laptop, which I still use)',23,'USD','hourly',5.0,5.0,4.0,5.0,NULL,0,1,'2017-01-21T00:09:54.109Z','r294j243c192',0,0,NULL),('ck1x3b44q011901i9f7ew6zo6','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked on the AutoCAD team summer 2016. Absolutely loved the place, team and work I did. Most of my work was close to research and development but was happy to know that my project blew expectations and is now going to be integrated into the product. Also got $1000/month post tax for housing stipend. Highly recommend working here!',27,'USD','hourly',5.0,5.0,4.0,5.0,NULL,0,1,'2017-01-21T00:17:35.157Z','r295j244c82',0,0,NULL),('ck1x3b44q011a01i9e9w8fxyk','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','This isn\'t a typical startup in the Bay Area, but they really take care to teach you (the interns) the ins and outs of the industry. The company is small, so you get to do pretty much everything important. You work on a project with the CEO separately and present it to the company. If it\'s good enough, they\'ll actually use it, which is really cool. Since it\'s quite small, you\'ll learn a ton about UI/UX, business, and marketing if you want to.',25,'USD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-01-21T00:49:42.704Z','r296j245c193',0,0,NULL),('ck1x3b44q011b01i98p00cyzi','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Absolutely loved the company and the company culture. The company culture was very open and there were monthly meetings where they would update everyone on what was happening and what direction the company was going in.\n\nThe people at the company were also amazing. Anytime you had a question about how to do something or how something worked, you could just walk up to the person who wrote that piece because they just sat a few rows away at most. While I was there the company was about 800 strong with 150 devs in total.\n\nInterns were paid hourly and also allowed 10 hours of overtime per week which is great if you\'re trying to dish out a little more cash. Intern housing was also amazing with most interns living right across the street from the office (literally door to door was around 5 minutes). While they don\'t provide free meals, there is are a few well kept snack walls and fridges full of basic commodities like eggs and milk.\n\nThe intern situation was amazing with a tight knit group of ~20 dev interns. Intern events were also absolutely amazing, with great events such as touring Hollywood, going to Disneyland, and going to concerts on the beach. Another added bonus was that all intern events were paid events (and with Disneyland being a 16 hour day...).',35,'USD','hourly',5.0,5.0,4.0,5.0,NULL,0,1,'2017-01-21T00:50:03.853Z','r297j36c19',0,0,NULL),('ck1x3b44q011c01i9273b6l3z','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked at Goddard Space Flight Center during the summers of 2015 and 2016, for 10 weeks each.  My boss was awesome, and the work was extremely interesting and rewarding.  Overall mood of the place was very chill and everyone there took their job seriously but were not high strung.  Everyone I worked with was very kind when I would ask for help and I never felt like a burden.  Overall this was an absolutely wonderful experience and if you get the opportunity, while the pay is not great, you should absolutely take it.',600,'USD','weekly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-01-21T17:16:23.756Z','r336j291c210',0,0,NULL),('ck1x3b44q011d01i968eh2s78','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Mentorship\n- This is my third internship at Amazon so the mentorship was minimal as I was driving the project by myself. Teammates are chill and helpful if you have questions. I\'ve never come across any smug arrogant engineer or manager working at 3 different teams and locations and most of  the people are chill and nice.\n\nWork/life Balance\n- This depends on how qualified you are for the job tbh. Most of the time, teams will give you an independent project that is scoped correctly. And if it wasn\'t, then well, the complexity of the project and any mis-scope is taken into account when deciding upon giving you a return offer.\n\nMeaningful Work\n- Amazon is really big on Ownership. I sort of worked like a 1-man-startup to deliver my project. They give you an independent project and most of the time it is internal. Some of the projects given are simple but some of them can be really complex. Be prepared to learn a lot.\n\nPerks\n- You get USD $2500 / 4 weeks housing stipend so make sure you get this option. The corporate housing will deduct USD $500 / 4 weeks on your salary and given the conversion rate, it will just suck.',5700,'CAD','monthly',4.0,5.0,4.0,5.0,NULL,0,1,'2017-01-21T00:50:21.546Z','r298j246c4',0,0,NULL),('ck1x3b44q011e01i97vx37scd','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','This company is highly dependent where you end up. I got paired with a great mentor and did semi-interesting work. They definitely taught me a lot about being a product manager, but the work wasn\'t that fascinating. Again, it really depends which area of the company you work on. They treat employees very well, and you can\'t beat Seattle life in the summer. ',7200,'USD','monthly',4.0,5.0,3.0,5.0,NULL,0,1,'2017-01-21T00:51:56.701Z','r299j247c27',0,0,NULL),('ck1x3b44q011f01i90njg5bcl','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Had a good experience working here. Team was supportive and I was always busy working on things that were impactful to the team.  In large companies like this, it really seems to depend on which team you end up in though.',20,'CAD','hourly',4.0,4.0,3.0,5.0,NULL,0,1,'2017-01-21T00:58:14.708Z','r300j248c194',0,0,NULL),('ck1x3b44q011g01i9h9hsda2n','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','My first internship and overall I enjoyed it. I felt that I had a fairly different experience from the rest of the interns. Most intern projects were silo\'ed off from the rest of the company (mine included) so they could have done better with that, but overall I felt that my project had a decent amount of impact.\n\nNo real benefits outside of work other than subsidized housing and a few intern events.',20,'USD','hourly',4.0,5.0,4.0,4.0,NULL,0,1,'2017-01-21T01:00:45.083Z','r301j249c195',0,0,NULL),('ck1x3b44q011h01i92y1qdd2p','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Mentorship\n- Smart, kind, helpful mentors and teammates\n\nWork/life Balance\n- If project is scoped correctly and you\'re qualified for the job, then this is 5/5.\n\nMeaningful Work\n- I worked on Amazon Echo during the term it was launched for Beta (invite-only). Being part of the launch and seeing all those unboxing videos and the positive feedback of the community and customers with your team is an experience I\'ll always cherish.\n\nPerks\n- Really nice housing stipend. Downtown City life. When you get a return offer, you can choose any team and any location to work on (they have offices in pretty much every major city in the world. Seattle, New York, Toronto, Vancouver, SF, and so on)',6000,'USD','monthly',4.0,5.0,4.0,4.0,NULL,0,1,'2017-01-21T01:04:53.397Z','r302j250c4',0,0,NULL),('ck1x3b44q011i01i9e3u6c2r7','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Summer 2016 | 10 weeks\nGot every other Fridays off. worked 8am-5pm on days I did have to work.\nGot tours of different JPL facilities.\nGot to attend talks by JPL engineers, Caltech professors, engineers from other companies.\nPretty easy to chat with full-time employees.',15,'USD','hourly',4.0,4.0,4.0,5.0,NULL,0,1,'2017-01-21T01:18:07.513Z','r303j251c196',0,0,NULL),('ck1x3b44q011j01i914oa0d8s','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Mentorship\n- shitty team with shitty engineers = shitty mentorship\n\nWork/life Balance\n- this is where old people with kids work because work life balance is top notch\n\nMeaningful Work\n- depends on the team. My team was really bad but some of them can be really good.\n\nPerks\n- $300 for transportation\n- $1200 or you can get a car for the term instead\n- Subsidized cafeterias. Their cafeterias are the best in the world! Really good food and super cheap!)\n- Corporate housing\n- Free starbucks coffee and drinks (pop, juice, etc)\n- Signature event where you receive a laptop worth $2k+\n- $5k signing bonus if you\'re a returning intern (this $5k signing bonus is for an internship NOT for full time)\n- Best recruiters in the world.\n\n*NOTE: I had a shitty internship but in no way I am exaggerating or lying about the perks',7100,'USD','monthly',3.0,3.0,1.0,5.0,NULL,0,1,'2017-01-21T01:21:56.659Z','r304j252c27',0,0,NULL),('ck1x3b44q011k01i98hn82guk','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','During your beginning 2 or so weeks at RBC, you may find yourself not doing much. When you do start doing more work, you\'ll notice that you\'re very involved with the company. RBC has evolved their coop program to give coop students meaningful work on interesting teams, because they\'re really looking for people that they would want to have come back, either full-time or for future coop terms. The culture in RBC is all about your development, making it a welcoming, unique, and student-oriented culture. I would definitely recommend RBC for a junior-intermediate coop student looking to build their skillset, or learn new and marketable skills.',3000,'CAD','monthly',4.0,5.0,4.0,5.0,NULL,0,1,'2017-01-21T01:28:32.998Z','r305j253c189',0,0,NULL),('ck1x3b44q011l01i96u37bxib','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Jan - Aug 2016\n\nA lively, friendly bunch.',3100,'CAD','monthly',5.0,4.0,5.0,5.0,NULL,0,1,'2017-01-21T01:58:34.927Z','r306j254c197',0,0,NULL),('ck1x3b44q011m01i93h3760i1','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Great company, highly recommend. Great office, work environment and coworkers. Work is interesting enough, tooling is great, lunch is great. \n\nDespite the fact that sometimes I was working on CRUD Ruby on Rails apps, I actually really enjoyed my job. The fundamentals of the work didn\'t seem to matter when the tools, coworkers and everything else were perfect.\n\nOne thing I really liked is having the opportunity to be just a normal team member. There\'s little structure and no sandboxing, you get a lot of autonomy and get to basically be like any other member of your team.',4333,'CAD','monthly',4.0,4.0,4.0,5.0,NULL,0,1,'2017-01-21T02:05:25.172Z','r307j255c40',0,0,NULL),('ck1x3b44q011n01i9aw9n3hyf','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','You\'ll meet some of the best engineers in Silicon Valley at Square, many originally from Google and Apple. The team you work on is very, very important. It determines your work/life balance and learning experience. You can either work ~40/h if you are on a less user facing team, or up to ~50-70/h if you are on a critical team, maybe even on-call. You are paid by the hour with California overtime.\n\nAmenities:\n - Breakfast, Lunch, and Dinner usually cost around $1 (to test the Square Reader), it might still be reimbursable but it\'s not a lot of money.\n - There is an amazing free smoothie bar, and coffee shop (also $1 to test) on-site. \n - Micro-kitchens everywhere for a quick snack.\n - Showers on-site (Harder to find in San Francisco!)\n - Pool Table, Hidden Game Room for N64/Mario Kart.\n\nSalary for first/second year in 2014/2015: $36/h + $1500/m stipend => ~$46/h w/o overtime.',46,'USD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-01-21T14:56:11.542Z','r329j286c44',0,0,NULL),('ck1x3b44q011o01i9dgc7cxut','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Very friendly people. Codebase and product roadmap were both somewhat less organized than they could have been.',40,'USD','hourly',3.0,3.0,4.0,4.0,NULL,0,1,'2017-01-21T17:52:28.542Z','r337j144c3',0,0,NULL),('ck1x3b44q011p01i95wn3ewr4','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Great company, super interesting and a great place. Good food, outstanding pay, coworkers are awesome, get to work in OCaml, nice office. There\'s also fun dinners and events for interns and mentors. It\'s a fun and casual work environment with interesting technology, far from a stereotypical finance company.\n\nThe program is pretty structured. You do 3-5 self-contained small-ish projects, each one with a different mentor. Each one is interesting, takes a few weeks, and are often in a variety of different areas, which is nice. You don\'t get the same experience as a full time employee working on a team though.\n\nIf I was forced to find cons it would be the intern sandbox and the corporate IT setup. Interns are heavily firewalled with little access to the intranet and internal data, which is a bit sad since you can\'t actually see the things you make running in production. Also you need to use a CentOS computer without root access, the IT people are helpful and can install things for you, but only from the sparse and outdated CentOS repos. They have good reasons for both of these, but it doesn\'t stop them from being minor annoyances. You also have to do all your work on a remote server (but with sub-millisecond ping and gigabit bandwidth), which makes GUI editors like Sublime Text harder to use.\n\nDon\'t get me wrong though, that\'s just nitpicking. It\'s really a great place to work. I enjoyed it so much that despite getting 6 days of vacation I only took one, despite not knowing that I\'d be payed out for the days I didn\'t take. I was a short flight away from all sorts of neat European destinations, and the thing I wanted to do most was work there more. Taking them was actually encouraged, I just didn\'t want to.',7500,'GBP','monthly',5.0,5.0,5.0,4.0,NULL,0,1,'2017-01-21T02:37:46.425Z','r308j256c23',0,0,NULL),('ck1x3b44q011q01i9c2w13pyo','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked at Shopify in the winter and fall 2016 term. The nice thing about Shopify is that you\'re treated like any other full-time member. You all do work from the same pot. The culture is also amazing. They give you a lot of flexibility for what team and office you want to be in, if you ask. Also free lunch, amazing office, nice housing, etc.',4680,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-01-21T02:42:53.876Z','r309j257c40',0,0,NULL),('ck1x3b44q011r01i91wnl1s4s','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked at Veeva for my first co-op, and I really enjoyed it.\n\nMy manager did a great job of starting me off with things I felt comfortable with, and allowed me to gradually take more and more ownership of the projects I was working on. He was also happy to listen to feedback and consider input about what I wanted to work on and what could be done to make my experience better.\n\nThe company culture is a little more mature, but the company is still growing very fast. Everybody was super friendly and a pleasure to work with. Some of the perks include: kitchen with snacks and drinks, lunches once a week, beer on Fridays, and (most importantly) a ping pong table.',18,'CAD','hourly',4.0,4.0,4.0,5.0,NULL,0,1,'2017-01-21T02:50:11.641Z','r310j268c198',0,0,NULL),('ck1x3b44q011s01i9fq910oak','2019-10-19 04:56:45.467000','2019-11-27 20:35:21.546000',0,'ck1n1du49000501jo4pwygsav','It\'s a fun place to work with great people. The work can be quite boring depending on the project you get put on. Also, pair programming isn\'t for everyone.',16,'CAD','hourly',3.0,2.0,2.0,5.0,NULL,0,1,'2017-01-21T03:35:42.348Z','r312j270c199',0,0,NULL),('ck1x3b44q011t01i92r8u7scn','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked here for 2 terms as a developer and 1 term doing QA. Loved my time here, learned a lot, the full-times and other co-ops were really nice and helpful, and there are a ton of things to do when you want a break (Wii U, PS4, Xbox One, pool, ping-pong, arcade machine, mini basketball nets), and things to do after work with your co-workers (ex. Friday socials, hardware hacking club, cooking club, etc...).',22,'CAD','hourly',5.0,5.0,4.0,5.0,NULL,0,1,'2017-01-21T03:59:26.920Z','r313j271c199',0,0,NULL),('ck1x3b44q011u01i9ec5z8zob','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked there for my first two co-op terms. I was able to learn quite a bit about web development there, although this was mostly from my own initiative. You won\'t really get a mentor assigned to you, but everyone will be happy to answer your questions, or forward to the right person.',18,'CAD','hourly',4.0,2.0,4.0,5.0,NULL,0,1,'2017-01-21T04:31:14.366Z','r316j272c200',0,0,NULL),('ck1x3b44q011v01i9hme12er4','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked here Fall 2016. It was a good introduction to low-level C/C++ embedded stuff. I was assigned a major feature that was part of an upcoming release so the work was pretty meaningful. Mentorship was really good when I could get it, but that was often difficult as many people work from home or are frequently unavailable. Work life balance was great, was never asked to work OT and only did so by choice. Tools are pretty outdated but they are slowly transitioning. Overall a good Waterloo tech company if you want to get into low-level firmware.',5200,'CAD','monthly',4.0,3.0,4.0,5.0,NULL,0,1,'2017-01-21T05:07:12.888Z','r317j278c183',0,0,NULL),('ck1x3b44q011w01i9aekl9g0r','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Everyone there is really chill and super smart. Office is great and you\'ll make some life long friendships',9300,'USD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,'2017-01-21T05:13:47.138Z','r318j109c114',0,0,NULL),('ck1x3b44r011x01i9csm1cu82','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The best place to work if you are passionate about cryptocurrencies. Also the only place I\'ve seen in Silicon Valley where I\'ve seen almost everyone leave at 6pm (a very good thing). \n\nDo note that you will mostly be expected to be self-driven, as it is a younger company with a less formal internship program. Being self-driven largely comes from their headphone-policy, meaning you can\'t disturb people if when they have their headphones on. (So if they don\'t see your Slack message asking about something...)\n\nAmenities/Perks:\n - Catered lunch, breakfast and snack room\n - Occasional Hackathons\n - Get paid your salary in bitcoin\n\nA typical salary in 2014/2015 would be $6000/month + $1500/month stipend. They usually tend to pay all their interns the same.',7500,'USD','monthly',5.0,2.0,5.0,5.0,NULL,0,1,'2017-01-21T15:08:08.178Z','r330j109c114',0,0,NULL),('ck1x3b44r011y01i9hpb8hfhd','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked here for my second co-op as part of the ELT Params team. Mentorship was really great and learned a ton throughout the term. Don\'t remember ever having a moment where I was sitting having nothing to do. Had code reviews for all changes and really improved my coding style.\n\nOnly downside I would say was the lack of perks and lower than average pay.',18,'CAD','hourly',4.0,5.0,5.0,4.0,NULL,0,1,'2017-01-21T15:57:06.072Z','r331j287c206',0,0,NULL),('ck1x3b44r011z01i9dcff2ffi','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Loved my time at Zynga. Worked as an Android developer and the office, people, work life balance, etc were great. They also hire a lot of interns so it\'s fun to be there. Perks included free lunch, snacks/breakfast bagels, video games, ping pong, beer fridge.',28,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-01-21T16:03:59.729Z','r332j165c61',0,0,NULL),('ck1x3b44r012001i95ea7h5ub','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked here in the W16 term. I learned how to use industrial machine vision cameras and program PLCs with no prior experience. The mentorship was top notch, however, my mentor left the company, so YMMV.\n\nThe job is actually in Dorchester, which is about 5 minutes East of London, so you should have your own transportation. It is possible to bike there.',650,'CAD','weekly',4.0,5.0,4.0,3.0,NULL,0,1,'2017-01-21T16:28:36.488Z','r333j288c207',0,0,NULL),('ck1x3b44r012101i9ewkg7djp','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav',' ',2600,'CAD','monthly',3.0,3.0,3.0,3.0,NULL,0,1,'2017-01-21T16:29:55.322Z','r334j289c208',0,0,NULL),('ck1x3b44r012201i91b7dcvk7','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I recently applied for the position of an intern as a software developer and after a rigorous interview process got selected. Here is my interview experience in brief:\nThe whole interview was classified into 4 rounds.\n\nRound 0: It was an online contest hosted on Hackerrank(90 mins). There were 3 questions, one was string based(medium), the second was a dynamic programming(easy), and third was a dynamic programming(medium hard). Doing one problem was enough, though it depends on the actual rank list and not the number of problems you solve. This was followed by a debug round, a question on binary exponentiation. We just had to correct the code and submit within 15 mins.\n\nRound 1: This was a GoToMeeting interview. The interview was all about your resume. The interviewer asked about the projects in detail for about 30 mins and then in general everything about your experience with past internships and stuff.\n\nRound 2: This was an online coding round. I was given a question on binary trees, had to find the maximum sum path in the tree and code it up within 40 mins. The interviewer expects you to go step by step in this round, that is first you give a brute force solution and then progressively try to decrease the time complexity until the interviewer is satisfied. (Tip: Don\'t jump to the answer directly even if you know the answer beforehand. They are not interested in the fact that you know a problem but they test your approach to a new problem.)This was followed by a general discussion about the resume again.\n\nRound 3: This was a problem design round, basically to check how you go about solving a problem and how much of your computer science concepts are clear. Firstly, the interviewer presented a problem about recommendations made on an online e-commerce website. I had to suggest how all this could have been done. Another question was to design a bot that wished your facebook friends automatically. Another question was about distributed systems, he posted a query which needed to be parallelized, and you had to discuss all the aspects of it. Basically what the interviewer was looking for was that you understand your solution inside out and know about all of its shortcomings that may occur and then he would ask you to somehow solve these shortcomings.\n\nThis was all about it. It was a great experience interviewing with Codenation. Note that interviewing opportunity can only be obtained by participating in the Codeagon contest conducted by Codenation. I think you need to be in the top 100 or so for getting to interview. This first process may vary a little depending on a lot of things. So keep your eye on their facebook page for the update. About all the perks and the compensation, I feel that Codenation is transparent enough and has all the details mentioned on their website.',75000,'INR','monthly',4.0,5.0,5.0,4.0,NULL,0,1,'2017-01-21T05:14:00.034Z','r319j279c201',0,0,NULL),('ck1x3b44r012301i972r3hn79','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Honestly, the thing\'s that made it good were the company culture and coworkers. I loved everyone I worked with. The work that was rather unique and interesting, and it gave a lot of insight into the field I wouldn\'t have had otherwise. I was working on a project  in post-production, so it wasn\'t as interesting as it could be, but it gave me the opportunity to explore a lot more than if we were starting from scratch. Not the best development environment as of writing, but plans to improve this.\n\nHours are 100% flexible, plus paid vacation. Opportunities for remote part-time.',18,'USD','hourly',3.0,3.0,3.0,5.0,NULL,0,1,'2017-01-21T06:08:55.130Z','r321j280c202',0,0,NULL),('ck1x3b44r012401i92g180j21','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Interned here for my 1st co-op. Your typical 9-5 (or 10-6) type job. Not much in terms of 1:1/mentorship per se, but the people are pretty chill and friendly. I mostly worked on bug fixes, code refactors, and features for a business app, so the application of the work was a bit dry, but it was 1st co-op, so a good first experience in the working world.',21,'CAD','hourly',3.0,3.0,2.0,5.0,NULL,0,1,'2017-01-21T07:03:46.121Z','r322j281c131',0,0,NULL),('ck1x3b44r012501i938t14qlv','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Interned while this was still at the old office location in the Tannery. The facilities back then were great, so I\'m sure the new office is amazing. This was my first taste at the \"tech life\" i.e. free food, and I\'m pretty sure I gained at least 5 lbs by the end. In addition to salary, you get a housing and transportation stipend. As for work, the project I was on ended up being high priority for launch in that quarter, and so it was a great experience to work with a bunch of other engineers on the team and to launch it to real users in the end. Everybody is super smart and super friendly - a great internship experience overall.',1400,'CAD','weekly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-01-21T07:11:25.650Z','r323j155c17',0,0,NULL),('ck1x3b44r012601i96c1ph0un','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','This was my first coop experience so I didn\'t know what to expect. It started off smoothly with me having a decent sized devops project. Within a few weeks, we had completed most of it and at this point, my role was simply to provide support to teams as they onboarded onto this new project. I asked to be removed from this as I was told this was a developer job and not a technical support job. \n\nI was removed from that project and put onto testing some small app. This took 2 weeks. After this, I would work on small random proof of concept projects for 1-2 weeks which would end up getting scrapped. The last 3 weeks I had no project at all - I approached my manager at least 10 times during the whole internship asking for more work and was told that they simply didn\'t have any for me.\n\nAll in all, I was quite disappointed with the internship. Why did they hire me if they didn\'t have any projects to put me on? I didn\'t learn much other than some high level architecture stuff. I was quite happy with the salary for my first year and saved quite a bit as I was able to live at home, but holy crap were those the longest 8 hours of my life (alternating between reddit, hotspotting on my phone to watch youtube and taking walks around the office).',21,'CAD','hourly',3.0,3.0,1.0,5.0,NULL,0,1,'2017-01-21T07:17:28.281Z','r324j235c189',0,0,NULL),('ck1x3b44r012701i91cez1gca','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','(Team Vikings) \nGot to do very interesting work with a team of all very smart/helpful PhD\'s. ',3000,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-01-21T07:31:41.948Z','r325j282c176',0,0,NULL),('ck1x3b44r012801i96kmp4wey','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Pros: Kik is a company that has managed to stay small (<200 employees), yet keep a market of millions of american teens using their app, which is quite impressive. This means Kik deals with complex problems with little manpower to solve them, which allows interns to have a high degree of responsibility. You will learn a lot here and you\'ll definitely come out of the internship a much better developer than before. Also the snacks in the kitchenette are great, not to mention the free catered lunch, and dinner (at 5pm so you don\'t have to stay too late).\n\nCons: Kik is a small company and has monolithic Facebook as it\'s main competitor, so it has a lot to prove with few people. This means that work/life balance suffers and there isn\'t much focus on having a chill work environment, so the workday tends to become dry and purely work focused. Also, while interns are treated like full timers, there is definitely a gap in that while interns have the responsibilities of full timers, there\'s not much mentorship given to interns which makes it harder to form good relationships with coworkers.',28,'CAD','hourly',4.0,3.0,5.0,3.0,NULL,0,1,'2017-01-21T07:42:32.503Z','r326j283c203',0,0,NULL),('ck1x3b44r012901i97j15ciof','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The work was very dull and far between. I found that a lot of the work I did was just stuff other people didn\'t want to do. The culture at the company was very \'white\' everyone plays golf, and there is mentality that once you work there you\'ll come back and work there forever. That said my manager and the other people on the standards team were very nice and new I had nothing to do and that the pay was bad they just couldn\'t do anything about it.',13,'CAD','hourly',1.0,2.0,1.0,4.0,NULL,0,1,'2017-01-21T14:22:41.310Z','r327j284c204',0,0,NULL),('ck1x3b44r012a01i97mx96yxg','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Honestly this was a pretty great coop, I feel like I underutilized it a lot. My direct manager was a bit bipolar but our supervisor was open to any original ideas and the other people on our team would give me work that actually needed to get done. They also expected you to come up with projects to do and gave you time to dedicate to them. I was the only coop on their team but there were other coops at the company who were cool.',16,'CAD','hourly',4.0,4.0,3.0,4.0,NULL,0,1,'2017-01-21T14:29:38.450Z','r328j285c205',0,0,NULL),('ck1x3b44r012b01i9d9240wqg','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Let me start off by saying the Yelp Intern Program (YIP) is really awesome. The recruiters do a great job showing you around town and making sure you have a good time. My mentor was just alright but I\'ve heard of others having really cool mentors. Unfortunately I didn\'t learn too much from my mentor. Work-life balance was okay too, most people regularly work over 8 hours but nothing ridiculous. There\'s a lot of clubs (board games, sports etc) and people are generally friendly. I really didn\'t find the work that meaningful and I\'m not very optimistic about Yelp\'s future as a company. But there is some really awesome stuff being done in their data science and infra teams. If Yelp offers you your first time in the Bay Area, definitely take it. Otherwise, maybe think about all your options more carefully.',7100,'USD','monthly',3.0,3.0,2.0,3.0,NULL,0,1,'2017-01-21T20:22:59.859Z','r345j213c58',0,0,NULL),('ck1x3b44r012c01i9at458azh','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I had an absolutely amazing time for my SDE internship at Amazon in summer 2016. My mentor and manager were both really great at making me enjoy my time there and getting me to work better - I had daily talks with my mentor as well as weekly one-on-ones with my manager. \n\nInterns typically get to work on their own project over the summer, which they present to other teams at the end of the term. You\'re expected to take a lot of ownership over your project during the time, so you get to make a lot of the decisions when it comes to your design and deliverables.\n\nMy project was scoped out well, so that I knew what I had to do at what time. The project was fun and challenging while still manageable. \n\nThere\'s a lot of other interns around and weekly events - so that part was also fun.\n\nI chose to take the housing stipend for $2500 / month.',6000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-01-21T20:26:40.382Z','r346j161c4',0,0,NULL),('ck1x3b44r012d01i9hkck322j','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked at Slack in the Fall of 2016, the term where Microsoft announced that they were launching a direct competitor to Slack, called \"Microsoft Teams\". This made the term an extremely exciting time, since everyone at the company buckled down to make Slack the best product it could be. This meant that there were many important projects to complete, which were distributed among interns and full-times alike.\n\nThe culture at the office is amazing – everyone is incredibly friendly and always willing to help. They also really live by the motto \"work hard and go home\" as shown by my team members encouraging me to go home when I was still working at 6.\n\nThe internship program in particular is also special because the University Recruiting team sets up time for interns to have casual Q&As with the execs of the company. Rarely would an intern be able to pick the brains of such powerful people at any other company.',40,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-01-21T22:14:23.013Z','r347j298c41',0,0,NULL),('ck1x3b44r012e01i94mzaav1v','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The work was really meaningful and I could see the impact it made to the projects I was working on. I was able to develop many useful technical skills in this role and made friends with many other co-ops (there was about 20 on my floor). \n\nMain issue is that your term was almost solely dependent on the team you were put on. I was very lucky because they were missing this role on the team. But it was really hard to sit down with my manager to get reviews on how I was doing or appreciation of any type in general - manager didn\'t really care about my work. ',19,'CAD','hourly',3.0,3.0,5.0,3.0,NULL,0,1,'2017-01-21T22:55:23.157Z','r348j299c189',0,0,NULL),('ck1x3b44r012f01i941585lv6','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Product manager work was very vague and did not let you have ownership on product features. Since Horizon is a client contract company there is little creativity on the tasks and features being built. PM work included HTML email campaigns, scripting reports, and occasional QA work. That being said everyone there is super cool and awesome so the time really flies.',18,'CAD','hourly',2.0,2.0,1.0,5.0,NULL,0,1,'2017-01-21T22:58:48.682Z','r349j300c213',0,0,NULL),('ck1x3b44r012g01i9gtsodhgp','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The work was really dependent on the team you were put on and if the manager had anything in mind for you. \n\nUnfortunately, the work I did there was really lacking purpose and although I continually requested for more work, I felt like I spent the term doing work that didn\'t really have an impact. \n\nHowever! The company overall has a really great culture: very young age group (for the most part) and so many perks! Just make sure you know exactly what you\'d be doing in your role prior to accepting the job - the company itself is honestly great though. ',23,'CAD','hourly',3.0,3.0,1.0,5.0,NULL,0,1,'2017-01-21T22:59:12.741Z','r351j302c176',0,0,NULL),('ck1x3b44r012h01i96g0n6tvt','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked in the US Office Properties division. Prepared workpapers and tax returns.',17,'CAD','hourly',3.0,2.0,2.0,5.0,NULL,0,1,'2017-01-21T23:01:44.320Z','r352j303c214',0,0,NULL),('ck1x3b44r012i01i9fpemawgf','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','This was my first co-op back in 2015 and it was honestly one of the greatest starting points I could\'ve ever asked for. Coming into the role with no office experience and still lacking in many other areas as well, both my managers were very kind in helping me develop my skills by asking me what I wanted to improve on and assigning me relevant tasks. The amount of work was strictly performed during work hours - so I had a great work life balance and the type of work could easily be traced to who it\'s impacting. \n\nThere wasn\'t many perks - but there was always snacks and candy on a drawer back when I was there, not sure if it\'s there anymore...',2400,'CAD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,'2017-01-21T23:02:56.235Z','r353j304c147',0,0,NULL),('ck1x3b44r012j01i9epfd30u6','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked for Shopify in the Ottawa office on my first co-op. Overall, it was a great experience, and it was especially exciting to be there during their 2015 IPO.\n\nPros:\n- Downtown Ottawa, not Kanata\n- Really fun work environment\n- Good dev environment/tools\n- Zero pressure to work long hours\n- Meet lots of other interns\n- Snacks, smoothies, espresso bar\n- Hack Days (internal hackathon)\n\nCons:\n- Culture is too hipster for my taste\n- Most likely only use Ruby on Rails',5200,'CAD','monthly',4.0,4.0,4.0,5.0,NULL,0,1,'2017-01-22T01:17:05.607Z','r354j305c40',0,0,NULL),('ck1x3b44r012k01i93l3cb1nc','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The job allowed me to take a lot of responsibility and this was when I was a 1st year student. Overall the office was a pretty nice place to work, had an enterprise vibe. The work was fun and I did learn a lot, but I had issues with the company because they offered less in their offer letter than what they had shown me in the interview. Despite that, I would recommend them for one of your first work terms when you need to learn a lot.',17,'CAD','hourly',3.0,5.0,4.0,4.0,NULL,0,1,'2017-02-08T04:49:04.373Z','r401j354c224',0,0,NULL),('ck1x3b44r012l01i9afte7syh','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','People were nice. The Technology Co-op Program at CIBC is well established and provides many opportunities for co-op students to meet and socialize (e.g. contests, monthly socials, lunches).',20,'CAD','hourly',4.0,4.0,2.0,5.0,NULL,0,1,'2017-03-06T19:28:18.719Z','r350j301c91',0,0,NULL),('ck1x3b44r012m01i9f5407qli','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The people at Capco are an amazing team of people to work with and work for. As an intern they did not treat me as someone who just does tasks for them but instead as someone part of the team and they cared more about me as a person and about my growth as a developer than about their specific tasks or products. I loved my first internship there so much that I returned for another one. I would recommend Capco to anyone.',22,'CAD','hourly',5.0,5.0,3.0,5.0,NULL,0,1,'2017-04-18T16:09:29.496Z','r465j411c118',0,0,NULL),('ck1x3b44s012n01i92bw7ehea','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked at Tesla in Winter 2016 on the Systems Integration team. What this role entails is working with all the other types of engineering teams, whether it be Electrical, Mechanical, Manufacturing or Autopilot, to successfully deliver on features for the cars. This role is very jack-of-all-trades; It requires mechanical, electrical, and software knowledge, as well a lot of PM know-how. One of the biggest perks of this role is that since you\'re tied into all aspects of the car, you get to see how the car is developed at every stage, from the designs on whiteboards to the freshly assembled vehicles rolling out of the Fremont factory. \nThe pay isn\'t the best in the Bay, and the hours are pretty rough, but if you\'re looking for truly meaningful work then this is the company for you. This isn\'t some tacky startup or bloated software company trying to lock down young talent with lavish perks; Elon Musk is changing the world with Tesla, whether it be building an autonomous future or a renewable one, and doing an internship at this company gives you the chance to be a part of that.',4000,'USD','monthly',4.0,4.0,5.0,2.0,NULL,0,1,'2017-01-22T02:09:22.539Z','r355j306c220',0,0,NULL),('ck1x3b44s012o01i9ftsefsjb','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I spent two of my co-ops at Snowflake. It was an incredible experience. I was on the SQL team, but the division between teams is not that important. I was assigned challenging, meaningful projects, and mostly worked independently, talking regularly with coworkers and mentors and having them review my code.\n\nPros:\n- Very smart engineers to work with and learn from\n- Excellent codebase (organized, documented)\n- Meaningful projects that affect customers\n- Annual Snowflake ski trip in March\n- Cheesy Thursdays (cheese and wine)\n- 30 minute Caltrain ride away from SF\n- I got $6500/month 1st time, $9000/month 2nd time\n\nCons:\n- They use Subversion',6500,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-01-22T03:00:57.933Z','r356j307c221',0,0,NULL),('ck1x3b44s012p01i97wzq1o6t','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','It was aight. Company is a little big so most people just work on internal tools. People are mostly friendly. Good for first few coops, but their codebase isn\'t really amazing.',720,'CAD','weekly',4.0,3.0,3.0,4.0,NULL,0,1,'2017-01-22T05:23:15.902Z','r357j308c222',0,0,NULL),('ck1x3b44s012q01i92wcoabtj','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Clock in very strict 9-5:30 hours. Coworkers are nice, but management is terrible. Constant lashing out to the employees. Although no flak was given to co-ops, it really demoralized the office. Didn\'t look like they had any real vision on where they were going, so the work seemed boring. Mentorship was weak and minimual; tasks were assigned one at a time by the supervisor, and only when you completed the one you were working on.',720,'CAD','weekly',2.0,1.0,2.0,2.0,NULL,0,1,'2017-01-22T06:08:42.513Z','r358j309c223',0,0,NULL),('ck1x3b44s012r01i9cjkn82j8','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Very friendly and flexible place. Many of the coworkers are also young Waterloo graduates, so it\'s easy to communicate with them. Many of them are extremely stereotypically nerdy, which may rub well/badly depending on how you are yourself. They have the occasional board game/bring-your-own-computer nights, which can be a good opportunity to get to know your coworkers better. They have a strong sense of mentorship, and they\'re happy to help or answer any questions. Work can get a little boring at times, but the products can be interesting. ',20,'CAD','hourly',5.0,5.0,4.0,5.0,NULL,0,1,'2017-01-22T06:14:41.299Z','r359j310c224',0,0,NULL),('ck1x3b44s012s01i98vq9ew0g','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','They do monthly reviews to give detailed feedback. Most people are very willing to teach as the workplace is mainly former UW grads. They give meaningful work and pay overtime too. As long as you prove that you can handle it, they give co-op students a lot of responsibility.',22,'CAD','hourly',5.0,5.0,5.0,4.0,NULL,0,1,'2017-01-22T15:31:22.749Z','r360j311c225',0,0,NULL),('ck1x3b44s012t01i95cmc90e7','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Excellent company to work for as you start up your engineering career. You get to take part in a lot of meaningful work that you can choose. This position is hands-off which means you are responsible for meeting deliverables. There are lots of great professionals who work at the company. They are extremely friendly and willing to help at any time, you just need to ask. The job is fast paced and priorities shift quickly. \n\nThe tasks you do are very front-end. If you have ROS experience, that is a big plus. You do everything for robot emulations to testing and integration robots for trade-shows, customer demos and deployment. You can put your hand everywhere but just make sure you can handle all your responsibilities. \n\nAdditional Perks: Every week or two there\'s some company wide event. Free breakfast everyday, free alcohol, free snacks and food otherwise. You also get a lot of free swag. ',21,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-01-22T18:51:59.378Z','r361j312c226',0,0,NULL),('ck1x3b44s012u01i95l665c0m','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked with the mobile team in Toronto in 2016 and I had a great time. Very relaxed office culture despite fixed hours of 9-6, free breakfast on Mondays, and lunch and happy hour on Fridays. Every one was very kind when I had questions and were very patient with teaching the co-ops. Often times my manager sat down with us and taught us things just because we were curious even if they were not related to the job. Great mentorship. I did a combination of manual and automated testing, but my group were their first co-op students so we got to create the automated test suite from scratch and future co-ops will probably build on that and do less manual testing. Recommend it for first internship or if your genuinely want to test.',650,'CAD','weekly',5.0,5.0,4.0,5.0,NULL,0,1,'2017-01-22T23:22:48.221Z','r362j313c227',0,0,NULL),('ck1x3b44s012v01i96nquhcnl','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The internship experience was great, it was my first time in San Francisco and the YIP (Yelp Intern Program) offered a ton of fun events to get to know the other interns. As well, they offered plenty of reimbursement and support to find housing. The work life balance was great, there were smash nights on Monday, board game night on Wednesday and occasionally movie or trivia nights will pop up. The work I did was primarily Android, I was one of 4 people on the Core Android team so it was extremely fulfilling.',7600,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-03-08T23:23:30.139Z','r433j213c58',0,0,NULL),('ck1x3b44s012w01i96t703uyl','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked on biz.yelp.com full stack web development. The intern program is tbh one of the best I\'ve ever seen. Everyone is super fun, they know exactly how to treat interns from fun events, to making sure your project is done at the end of the term. I got a bit unlucky put on my own project doing front-end which I found out I didn\'t like, so work-wise it was a bit of a rough ride. Still, from my mentor to the PM to the team, everyone was really nice and my coding style got infinitely better, so it was a good experience.',38,'USD','hourly',3.0,5.0,3.0,5.0,NULL,0,1,'2017-03-09T15:19:42.279Z','r435j213c58',0,0,NULL),('ck1x3b44s012x01i903fq45hp','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Redfin was a great place to work as an Internship. You are surrounded by incredibly smart people who like to get stuff done. Through the mentorship program I was able to grow and really learn some new concepts and try different things.  Everyone is very friendly and wants to help you. The company is small enough that you could strike up a conversation with the CEO or CTO.',7000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-04-19T21:39:53.985Z','r466j412c246',0,0,NULL),('ck1x3b44s012y01i997oj3hso','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','As a release and qa engineer you would help test for any features being released, verify fixes for bugs and help out with the release of each version at the play/app store. \n\nPros: The free food, close distance to campus, working with other co-ops. Get to attend meetings with project management and designers to understand what goes into designing features and how it can impact users. You really get to understand more about what Apple and Google require in an app before it is released. Your mentor will also let you work on a side project, which is nice but can be a dead-end if your mentor does not really know how to code.  \n\nCons: The work is just painfully boring, it\'s pretty meaningless. Some developers never want to fix the bugs you found. Mentorship is god awful. The people working at Kik are very young and most of them haven\'t been in the industry for too long, so it\'s kind of hard trying to find someone to look up to. People who are working there aren\'t passionate enough, in my opinion most of them probably don\'t see a long-term relationship with Kik. ',21,'CAD','hourly',3.0,1.0,2.0,5.0,NULL,0,1,'2017-01-23T03:08:07.173Z','r364j314c203',0,0,NULL),('ck1x3b44s012z01i9h86qcler','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Decent place to work; pay could be better, some grunt work involved\nMay need to deal with some spaghetti code',920,'CAD','weekly',4.0,4.0,3.0,4.0,NULL,0,1,'2017-01-23T03:36:38.594Z','r365j315c163',0,0,NULL),('ck1x3b44s013001i9273mautc','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Small engineering team with around 50 engineers and teams averaging 5 people. Work was generally meaningful and very interesting. It was exciting to see the company hit milestones and know that you are contributing to something that is growing and has goals to meet. I was fairly close with my team and some other co-workers. It was easy too since there were a lot of young people and everyone is friendly. There is also a company hackathon every 4 months (so us co-ops can participate in them for our time there) which is quite fun. The fridge is stocked with ice cream, and the snack room with bagels, chips, yogurt, avocados, you name it. All in all, pros: great mentors, delicious and abundant snacks, cons: pay was a bit low for the cost of living of the city (expect rent to be around $1000).',4800,'USD','monthly',4.0,5.0,4.0,4.0,NULL,0,1,'2017-01-23T06:19:29.245Z','r367j206c170',0,0,NULL),('ck1x3b44s013101i95rek065d','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Great people and culture - there\'s lots of socials (interns and company-wide). Lots of mentorship, responsibility, and opportunity to develop. ',4000,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-01-23T18:36:04.320Z','r368j316c66',0,0,NULL),('ck1x3b44s013201i9en5cdswt','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I was allowed to choose out of three projects; backend, front-end with a bit of backend, and hybrid mobile, but the only interesting project was the front-end one. The company does not offer much guidance to the co-ops and I was left alone quite often, having to direct myself. The people are quite nice, and there is quite often free food.',23,'CAD','hourly',3.0,3.0,2.0,4.0,NULL,0,1,'2017-01-23T19:26:08.373Z','r369j317c228',0,0,NULL),('ck1x3b44s013301i96f1kg23o','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked there during Summer of 2016. Team was really nice and we got along well together. Everyone worked hard when they needed to otherwise we all went home and no one bothered you outside of work hours. \n\nGot to work on proper backend stuff. I heard interns on mobile teams didn\'t get to do as much interesting stuff however.',24,'CAD','hourly',4.0,4.0,3.0,5.0,NULL,0,1,'2017-01-24T17:34:15.370Z','r370j328c229',0,0,NULL),('ck1x3b44s013401i98mksdulm','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked there Fall 2016. I was the only intern that term so ended up with a great studio apartment just by the Bay Bridge, 20 min walk from the office. I ended up working on JavaScript infrastructure stuff (static asset management/bundling, front-end build scripts, cache-busting etc.) which I enjoyed immensely and felt was very meaningful to the front-end developers. (I had the option to work on various web dev oriented teams. From what I understand most interns end up on client-facing stuff using Python + JavaScript.) I ended up doing a lot of code reviews, as well as getting my own code reviewed, which I feel I learned a lot from.\n\nThe product itself has so many moving parts, and it\'s difficult to understand how they all fit together, so I didn\'t develop any interest for the client facing stuff in my time there (largely because all my work was internal).\n\nMy mentor was PHENOMENAL. Weekly sync up meetings to see how I was enjoying myself, exceptional knowledge of everything we were working on and more, encouraged me to work on open-source stuff, organized so many events, the list goes on.\n\nI felt at home at the company really quickly - everyone is very friendly and the culture is relaxed. I didn\'t feel any pressure to work extra hard and I wasn\'t afraid to make mistakes or open pull-requests early. Regular company events (Giants games, beer bashes, etc.) really contributed to the chill atmosphere. I\'m relatively quiet so didn\'t always attend events, but I never felt pressured to participate or drink if I didn\'t want to.\n\nFor my first term in the US (incidentally my final co-op term), it\'s hard to imagine a better experience. It seemed like the perfect place to work while exploring a new city, what with the location, the provided housing, the flexible work hours, the work I ended up doing, and the people I was working with.',6400,'USD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,'2017-01-24T22:55:24.953Z','r371j199c155',0,0,NULL),('ck1x3b44s013501i99yimegtx','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','This was my second term with RBC and I feel I made the correct choice going back. \n\nThings in the first month were slow but there was a lot to learn. I quickly realized I got lucky as the full time Project Control Officer for my team was leaving and I got to do all the work. This included budgeting for a 5+ million dollar project for 2017! Even though I was doing the work of two people it never felt that bad and I rarely stayed past 5 on any given day except for month end. \n\nI probably got lucky as my manager and senior manager were both really nice to me and mentored me really well. I know friends who didn\'t have great experiences in other business roles at RBC. It all depends on your team. \n\nOverall great place to work but depends highly on your team. ',3000,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-01-25T03:19:19.711Z','r372j299c189',0,0,NULL),('ck1x3b44s013601i98hbe25l3','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Mentorship\nYou\'re assigned a one-on-one mentor to make sure that you get familiar with the codebase and addresses any questions you may have when ramping up. Everybody is really friendly and is willing to lend a helping hand if you ask.\n\nWork/life Balance\nThis is something that\'s really stressed at Eventbrite. You won\'t find yourself working late. They want to make sure that when you\'re at work your doing the best work that you can.\n\nMeaningful Work\nThe mobile team is fairly small, although their general engineering team is quite a bit larger. This means that as a mobile engineering intern, you have the potential to do work that impacts the core product in fundamental ways, but it won\'t be handed to you. You have to have the initiative to raise your hand and seek out what you\'re interested in.',1400,'USD','weekly',4.0,4.0,4.0,5.0,NULL,0,1,'2017-01-25T19:18:48.116Z','r373j39c81',0,0,NULL),('ck1x3b44s013701i9a06hfqab','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','A quickly changing company going through a lot of growth. When I was interning, teams were still being figured out, but working at such a company will provide a neat learning experience. Would recommend at least one internship in this kind of environment. People at TextNow were super friendly, and the work that they were doing was interesting and is becoming more interesting term after term as they face new challenges.',25,'CAD','hourly',4.0,4.0,4.0,4.0,NULL,0,1,'2017-01-25T19:21:57.310Z','r374j338c66',0,0,NULL),('ck1x3b44s013801i9crgb8qv6','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','This was my second year as an intern. I started as part of the Explore Program, chose to come back as a PM and will be returning this upcoming summer for my 3rd internship. \n\nI know others have talked about unenthusiastic teams, bad mentors, and bad managers. I understand. My first summer, my manager was horrible, chastising my abilities and my work. I expressed my concerns with my mentor, and thankfully, she was able to help me. The CEO said \"people don\'t quit companies, they quit teams\", which struck a chord with me. I decided to return the next summer as part of a different team. (I also found out that summer that my previous manager had been moved down to the position of Individual Contributor)\n\nI was also able to connect with someone on the UX Design team for HoloLens that summer and she took me under her wing. Because of the experiences I had with people outside of my team, I gave Microsoft a second chance. It was worth it. I had a phenomenal summer and created the initial prototype of an internal tool that is going to be used company wide and by the end of my internship they had decided to ship it. My mentor was extremely supportive and pushed me in the right direction to join her team and I will be returning next summer to work on UX Design for HoloLens. The people on my team this summer were amazing and it was well worth putting up with one bad manager to get to a better place.',7100,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-01-26T01:08:04.993Z','r375j339c27',0,0,NULL),('ck1x3b44s013901i90nohcb0p','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Really enjoyed this job, solely because they let me work on projects that would normally be reserved for full time engineers. Out of all my internship experiences, I can say that I learnt the most at this one hands down. Would really recommend working here if you want to learn as much as you can in 4 months time.\n\nBiggest con was the salary, tho I think that has to do with my lack of negotiation.  They do give a stipend but it really isn\'t enough to cover housing in the city (plus it gets taxed at a higher rate).',6000,'CAD','monthly',5.0,5.0,5.0,3.0,NULL,0,1,'2017-01-27T14:29:59.304Z','r376j340c104',0,0,NULL),('ck1x3b44s013a01i94iktdem0','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Such a great company :)\nThere\'s an intern retreat, they fly you out to Ottawa for onboarding, which is super fun, and there\'s Hack Days every semester. \nThe people in the Waterloo office are lovely, can\'t speak for the other offices. \nThe company culture overall is very open and I think they\'ll be growing a lot! Definitely worth interning for. ',30,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-01-28T22:05:45.132Z','r389j136c40',0,0,NULL),('ck1x3b44s013b01i94cb28tqe','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','May-August 2015. Unique opportunity to have both autonomy and valuable guidance. Extreme Blue gives interns access to industry experts who are open and willing to helping you succeed in your project. We were able to reach out to senior IBM leaders to receive feedback and mentorship as well as had the chance to grow our own ideas and thoughts. ',4500,'CAD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,'2017-01-28T22:05:46.728Z','r390j351c84',0,0,NULL),('ck1x3b44s013c01i9het0fph7','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked on financial models for interest rate derivatives. I liked the fact that I got to use a bunch of different programming languages. I had some guidance from one full-time employee. After a while, I ran out of work to do (partially my own fault, partially my superiors\').',3500,'CAD','monthly',3.0,2.0,3.0,4.0,NULL,0,1,'2017-01-29T00:01:27.507Z','r392j352c194',0,0,NULL),('ck1x3b44s013d01i9e15qac0t','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Free breakfast is pastries and fruit. Free lunch is catered by local restaurants, and is usually really good. The company is really good at accommodating dietary preferences and allergies, too. The company subsidizes housing for interns - I believe they pay 50% of your rent if you\'re working in Ottawa, not sure if the situation is the same elsewhere.\n\nI\'m only three weeks in, but really enjoying it so far. Cool problems to work on. Great coworkers and a supportive team. All interns did a three-day onboarding in Ottawa, and spent another three nights in Ottawa for the annual corporate summit (usually scheduled in January, I gather). Plenty of free clothing, if that interests you. Shopify is growing really fast, too - it seems like a great company to transition into a full-time role at.',1200,'CAD','weekly',5.0,4.0,5.0,5.0,NULL,0,1,'2017-01-29T00:07:08.154Z','r393j136c40',0,0,NULL),('ck1x3b44s013e01i9f9uv3n9v','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked at Polyvore, and the company culture was amazing. Everyone was really friendly, and my supervisor specifically chose tasks to maximize my learning experience, as well as my contribution to the product. Also, the food was delicious, and it was really diverse, as every day there were different options.',38,'USD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-01-29T00:33:01.297Z','r394j108c57',0,0,NULL),('ck1x3b44s013f01i92yja5hpw','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Kik is a great work environment. People are nice, free meals and Starbucks every day is nice. QA is fine, it\'s just testing the app for bugs, unfortunately that can only get so interesting. The QA full-times are super nice and helpful. You\'ll learn a bit about the mobile development cycle. Kik will encourage you to talk to others in the company if you are working on a side project, or if you want to return in a different role. I had lots of time outside work to work on passion projects. All in all, they\'re used to having lots of co-ops, so it was as comfortable as it could have been. Your experience is what you make of it! Thanks Kik, shoutout to Ted.',3200,'CAD','monthly',3.0,4.0,2.0,5.0,NULL,0,1,'2017-01-31T03:27:54.837Z','r397j314c203',0,0,NULL),('ck1x3b44t013g01i9gx033fzn','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','A9 operates like a start-up but has the resources and reach of Amazon! I worked on the Visual Search Mobile Team and got to ship features for the main Amazon application. My mentor and manager were both really supportive and gave me ample opportunities to work on what I was interested in. The work/life balance was great and there were a ton of fun events planned for the interns! The compensation was very competitive - the $9600 includes a stipend to help you with your rent expenses.\n\nOverall, A9 employs a lot of really intelligent people to work on challenging technical problems. Would recommend!',9600,'USD','monthly',4.0,4.0,4.0,5.0,NULL,0,1,'2017-02-04T04:22:40.070Z','r398j14c1',0,0,NULL),('ck1x3b44t013h01i9gx9y35hs','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I interned at Loblaw Digital in 2015. \nPros:\n- supportive, easy-going teammates\n- some free snacks in the kitchen\n- I got to work on very impactful features and had some flexibility to what I wanted to work on next. YMMV depending on the product you are working on. \n- very good working hours (9 - 5 with 1 hour lunch)\nCons:\n- The company hires contractors and the code quality in some parts of the code base is less than ideal, also quite some tech debt (might have changed since my time there)\n- My mentor was great but interns could benefit from more time with their managers. \nOverall, I would recommend working there, especially if it\'s one of your earlier internships. ',2800,'CAD','monthly',4.0,4.0,5.0,5.0,NULL,0,1,'2017-02-04T05:28:45.650Z','r399j106c112',0,0,NULL),('ck1x3b44t013i01i95isr5g68','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Interned Fall 2016. Salary was roughly $3500 per two weeks plus $1500 housing per month. Perks include but are not limited to: frequent intern events, quarterly offsites, and lunch on Fridays.\n\nPart of your experience depends on the team you\'re on and the project you\'re assigned. I believe your second round interviewers will recommend teams for you to be placed on so be sure to let them know where your interests lie and what kind of work you want to do.\n\nSome aspects that don\'t depend on team and project are the work-life balance and company culture. The vast majority of engineers, PMs, and managers I interacted with were very smart and approachable. Seize opportunities to check out what other teams are doing, through yelp-beans, show and tell sessions like web sync, or ask a recruiter to arrange a meeting with another team lead.\n\nOverall, I had a great time at Yelp thanks to the quality of people it attracts and the company\'s commitment to providing a solid internship experience.',8000,'USD','monthly',5.0,5.0,3.0,5.0,NULL,0,1,'2017-02-12T16:23:10.036Z','r403j213c58',0,0,NULL),('ck1x3b44t013j01i94ix44or1','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Got scammed. It was supposed to be a developer job but I ended up doing manual QA for the majority of the internship. Manager was super busy so I had almost no guidance;  I think he ran out of work for the interns to do. Glad I moved on to companies more suited for me.',20,'CAD','hourly',2.0,2.0,1.0,2.0,NULL,0,1,'2017-02-16T03:55:30.516Z','r404j308c222',0,0,NULL),('ck1x3b44t013k01i9h40a1v59','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Great mentorship, work/life balance, but not so meaningful work as you might work on a legacy codebase.',3500,'CAD','monthly',4.0,5.0,3.0,5.0,NULL,0,1,'2017-02-19T03:57:03.400Z','r406j357c231',0,0,NULL),('ck1x3b44t013l01i90awicfhv','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked there from July to December about six months. Great company, bunch of perks, but more importantly this company really cares about the interns and the work we do. Placed in various projects around the firm with senior people. ',25,'USD','hourly',4.0,2.0,5.0,5.0,NULL,0,1,'2017-02-22T23:59:43.430Z','r407j358c232',0,0,NULL),('ck1x3b44t013m01i99fhp6esa','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','This company has the best culture I\'ve ever seen.',45,'USD','hourly',5.0,4.0,5.0,5.0,NULL,0,1,'2017-02-24T12:13:25.388Z','r408j359c38',0,0,NULL),('ck1x3b44t013n01i9dfy4etsd','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','your experience totally depends on your team, but the company culture is amazing',9673,'USD','monthly',4.0,5.0,4.0,4.0,NULL,0,1,'2017-02-24T12:18:09.490Z','r409j359c38',0,0,NULL),('ck1x3b44t013o01i9ffrz2zi3','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Interned in Fall \'16. \nI Worked primarily on microservices written in Scala. The work is very fast paced and exciting, especially for those who enjoy more platform/backend oriented work. Also its in Vancouver which is an amazing city with tons to do.',4600,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-02-26T21:54:41.425Z','r410j360c233',0,0,NULL),('ck1x3b44t013p01i91d3gbf3x','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Great company for web development. Environment is very chill, but you\'re given enough work and responsibilities to always have something to do/improve on. Supervisor and boss extremely nice, and you learn a ton while you\'re there. Although the job description lists a lot of things I exclusively did React.js and Rails.',3200,'CAD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,'2017-02-27T00:57:53.521Z','r411j361c234',0,0,NULL),('ck1x3b44t013q01i9b5akagac','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I was an intern on the emerging technologies team which is very small (4 people including 2 co-ops). The type of work I did involved building out POCs (proof of concept) using proprietary SAP technologies. The team is really chill. We went out for lunch together nearly everyday and played foosball and table tennis. ',3200,'CAD','monthly',4.0,5.0,4.0,4.0,NULL,0,1,'2017-02-28T22:55:27.450Z','r413j362c39',0,0,NULL),('ck1x3b44t013r01i90bzq8964','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked with the enterprise solutions department. There\'s a lot of smart people at BlackBerry that provide excellent mentorship. There\'s no real perks/benefits to working there. There are plenty of other co-ops for you to socialize with. Overall, it\'s a good place to gain experience.',3220,'CAD','monthly',4.0,5.0,4.0,5.0,NULL,0,1,'2017-03-01T16:41:58.729Z','r414j64c62',0,0,NULL),('ck1x3b44t013s01i9dynv5s7h','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The Montreal office for SAP Hybris is an excellent location to do an internship. The workplace is very friendly, the work feels meaningful, there\'s lots of mentorship and plenty of work available to you. The office also has a gym, free breakfast on Fridays, fresh fruit delivered almost daily, and plenty of drinks. The city itself is great for students with lots to do and explore.',3520,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-03-01T16:44:41.678Z','r415j363c39',0,0,NULL),('ck1x3b44t013t01i95ya755oz','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I had a great time as an intern at Facebook\n1) Work: This varies heavily with team, but you do have some say in what team you\'re assigned. In the Seattle office the bigger teams are Ads and Messenger. I was on Ads and the work was impactful and challenging but fun. Facebook also has amazing internal tooling, processes, and support; meaning we get to spend more time on meaningful work rather than dealing with trivial setup and issues.\n2) Perks: FB definitely has one of the best perks among the top tech companies. There\'s the usual free food, mini kitchens, pingpong/foosball, and gyms, but FB also provides free housing on top of your salary, professional laundry on-site (includes dry cleaning), bike stipend, wellness stipend, a phone with an unlimited plan for the term, and a wide selection of tech equipment. \nAlso, if you are in Seattle, there are many chances to go to HQ (I went 5/6 times during my term). If you do, FB pays for the flight, hotels, rental cars, and food if you eat out. \n3) Culture: Work life balance is great, everyone is very friendly and helpful (especially if you tell them you\'re an intern). There are many hackathons and intern events that you can take part in, as well as company-wide events, clubs, and learning sessions. Leadership is also great. Mark Zuckerberg is very transparent with employees and hosts a Q/A every friday where anyone can ask anything about the company.\n',8000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-03-01T20:47:41.610Z','r416j91c14',0,0,NULL),('ck1x3b44t013u01i98ne5a3zf','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','A pretty fast-paced co-op, but that was very enjoyable for me. Was given a lot of freedom as to what I wanted to work on and how I managed my time. Also I was able to switch to more of a back end role in the latter half of the co-op which was great! Would definitely recommend TextNow; one of the better places to work for in the KW area.',27,'CAD','hourly',4.0,4.0,5.0,5.0,NULL,0,1,'2017-03-02T04:08:51.239Z','r417j364c66',0,0,NULL),('ck1x3b44t013v01i9a5qp79sg','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The supervisor times your washroom break',14,'CAD','hourly',2.0,2.0,1.0,4.0,NULL,0,1,'2017-03-03T22:17:32.630Z','r418j365c235',0,0,NULL),('ck1x3b44t013w01i974qycqpz','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Everything from the people I worked with to the workplace culture was absolutely awesome. The senior members of my team were always extremely helpful and patient when I was having any trouble with what I was assigned.',21,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-03-08T21:45:28.996Z','r432j147c82',0,0,NULL),('ck1x3b44t013x01i97wtf1b8i','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked at Premise when they were in their old office and it was just 30 people total. Company\'s mission and work is super inspiring, and they treat interns like full-time employees which means less hand-holding but also more responsibility and more interesting work. Team is super chill and great environment, even with startup growing pains.',9500,'USD','monthly',4.0,4.0,5.0,4.0,NULL,0,1,'2017-03-09T15:16:06.517Z','r434j392c240',0,0,NULL),('ck1x3b44t013y01i91baz7a91','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Was given a lot of responsibility and room to grow. However, the company culture seems to be very superficial. The company undeniably has very good perks for Waterloo, free lunch, breakfast, monthly events, etc... But that does not make up for some of the more serious issues with TextNow.\n\nThe company seems to have a large problem with work life balance, as a co-op this probably won\'t affect you too much, however be prepared to see some very stressed, overworked full time employees. There\'s also a lot of politics for a company of this size (~100 people) and the management team seems to push for things like unlimited vacation as a means to make up for the lack of work life balance. But as most people know in practice that does not lead to any meaningful change.\n\nOverall it is a good place to learn but not a good place to work at full time, most of these issues vary by team, but the company as a whole seems to have a culture that promotes burnout, especially when it comes to full time employees.',4200,'CAD','monthly',3.0,4.0,4.0,3.0,NULL,0,1,'2017-03-04T17:25:11.999Z','r419j366c66',0,0,NULL),('ck1x3b44t013z01i99ksrc58d','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Even though I was a co-op, I was given a lot of responsibility and make my own decisions regarding what I was doing. Gained a lot of experience. Their development environment uses Microsoft stack, so Visual Studio, Team Foundation Server and ASP.NET ',19,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-03-05T15:47:50.285Z','r420j367c236',0,0,NULL),('ck1x3b44t014001i91tmdfalf','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked on front end development. Overall project management seemed a little disorganized. At times UI design could significantly change from week to week, which caused a lot of code scrapping.\n\nOn the other hand. The pipeline for development was very well organized. There were code reviews for every commit and you were required to write extensive and robust tests for all your code. \n\nCo-workers were very approachable and helpful though my supervisor was often away on meetings. However, all my work was reviewed by my supervisor before committing so it wasn’t much of a problem.\n\nQuality of work can be team dependent, but it can range from bugfixing to creating new features or UI components.\n\nThere is a nice subsidized cafeteria at the ground floor with a large variety of food for relatively cheap. There is also a game room with a ping pong table but since the building is large, it can take a bit to walk there.\n\nOverall a great place to intern for beginner-level (1st/2nd years/internship) as their guidelines and detailed code reviews improve your code quality a lot and give you a nice base for writing industry-ready code',876,'CAD','weekly',3.0,3.0,3.0,4.0,NULL,0,1,'2017-03-05T18:49:41.796Z','r422j368c84',0,0,NULL),('ck1x3b44t014101i9f6k87o3s','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Culture was pretty laid-back for a bank; we could set our own hours. The people I worked with were very smart (most had a Masters of PhD in some sort of technical discipline). The work I did sometimes felt more like BI than Data Eng, but my manager tried his best to get me work that would be interesting. ',18,'CAD','hourly',4.0,4.0,3.0,5.0,NULL,0,1,'2017-03-05T18:54:31.562Z','r423j369c194',0,0,NULL),('ck1x3b44t014201i9azos80ip','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Opportunity to travel, varied work',9000,'USD','monthly',5.0,4.0,5.0,5.0,NULL,0,1,'2017-03-05T19:06:38.325Z','r424j370c44',0,0,NULL),('ck1x3b44t014301i9hdmo7j58','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Probably the most fun you can get from an internship. The Yelp Internship Program (YIP) is awesome, and they really help you explore the city/surrounding areas by providing events and weekend ideas. Perks are pretty standard: snacks + drinks, foosball, pool, free  in-house coffeeshop (especially the chai latte).\n\nThe work is very team-dependent. On Search, you work on pretty cool projects that cover a lot of different disciplines. Some of the other interns didn\'t like their projects too much, and a lot of people were placed on a different team than what the recruiter said. Mentors are hit-or-miss, but there\'s definitely a lot of opportunity to learn.\n\n',8300,'USD','monthly',5.0,4.0,4.0,5.0,NULL,0,1,'2017-03-05T21:46:05.200Z','r425j213c58',0,0,NULL),('ck1x3b44t014401i95xavclsd','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Company culture is great; everyone there is awesome and you get a chance to talk to everyone in the office everyday. Culture is super relaxed, you get to find a work schedule that\'s good for you (within reason). Fast paced, growing company and there is always something that needs testing as prototyping is quick here. Team knows how to get work done, but also knows how to have fun. Leadership is fantastic as well.',3000,'CAD','monthly',4.0,3.0,4.0,4.0,NULL,0,1,'2017-03-05T23:08:35.688Z','r426j371c237',0,0,NULL),('ck1x3b44t014501i9hkgg2gxa','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I interned at Flipp in Fall 2016. As a Data Quality Analyst, I could have been assigned to any of the teams in the Operations department.  Depending on the team, the responsibilities would differ, but in one form or another it would be some sort of quality assurance.\n\nI found the nature of my work to be a lot more repetitive than challenging, but the work that was assigned was also reasonable for a normal work day. That being said, the culture in Flipp is very good. I found it very easy to interact with people from other teams and I found my team very willing to let me explore new ways to do things (my team was still relatively new). In addition, each intern is assigned a mentor in their team whom they are usually able to meet with regularly.\n\nAs for perks, there is free lunch every Friday, free transportation passes and membership to GoodLife (There is one in the same building).\n\nI do think that the Data Quality Analyst position, in particular, is more suited for someone on an early work term unless they are joining a newer team.',850,'CAD','weekly',4.0,5.0,3.0,5.0,NULL,0,1,'2017-03-06T01:47:34.074Z','r427j372c238',0,0,NULL),('ck1x3b44t014601i9dupx09tx','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I interned in Statistics Canada in Winter 2016. The experiences of interns tend to vary a lot for Statistics Canada since each intern\'s projects for the term will depend on what their supervisor is responsible for. \n\nThere is no programming experience explicitly needed for the position, but every intern goes through a SAS training course for the first few days of co-op. Afterwards, there tends to be a lot less hand holding for interns. It is usually up to the intern to seek their supervisor if they need help. It was normal for me to see my supervisor once or twice a day to talk about any issues on my project, but it was normal for another intern to meet their supervisor just once a week for a regular update.\n\nEveryone in the office is very laid back and open to helping one another. There are also weekly statistical training seminars and other seminars and interns are generally open to be able to go to any that interest them.',2500,'CAD','monthly',4.0,4.0,4.0,5.0,NULL,0,1,'2017-03-06T01:59:55.120Z','r428j373c239',0,0,NULL),('ck1x3b44u014701i9h15egyni','2019-10-19 04:56:45.467000','2019-11-27 20:32:32.314000',0,'ck1n1du49000501jo4pwygsav','- Standard S&T Salary, if not a bit more than the other banks in Canada.\n- Took up a lot of responsibilities on my team, although experience does vary from desk to desk.\n- The people there are very enjoyable to work with and the culture of care is genuinely reinforced throughout the bank.\n- Work/Life Balance is definitely harder for anyone who is not used to front-office finance hours, but I know CIBC did have policies to relax the workload on interns for S&T (Not sure for investment banking).\n\nOverall: Had a great time and I would recommend CIBC to anyone who is interesting in working in Capital Markets.',-1,'CAD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,'2017-03-06T17:17:46.121Z','r429j384c91',0,0,NULL),('ck1x3b44u014801i96xl11nn9','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked on Google Research doing machine learning on my own project. Learned a ton and the team was really smart, I was playing catch-up the whole term. Culture is great, so even though I was the youngest person in the room by about 25 years we all go along great and imo Google does literally everything to make working there perfect. I\'d highly recommend joining a club, as bjj during lunch was a lot of fun. I think the well-known perks are overrated (food, laundry) and the biggest perk is the communities inside Google that are super friendly and inviting. Didn\'t have that many intern events but I was also not there in the summer, so go in the summer if you can!',7666,'USD','monthly',5.0,5.0,5.0,3.0,NULL,0,1,'2017-03-09T15:26:13.706Z','r436j15c17',0,0,NULL),('ck1x3b44u014901i95q7yb7bw','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked there for my first co-op term in 2016, and I loved working there. It has a really good culture/environment with transparency. It is a fast growing company, and the office is located west of Toronto. They have a really nice office stocked with food and perks. However, I did not find my main tasks that rewarding because of the repetitive work. But you can definitely get involved in other projects outside of your department if you are interested. Highly recommend this company!',600,'CAD','weekly',5.0,5.0,3.0,5.0,NULL,0,1,'2017-03-10T02:34:28.962Z','r438j372c238',0,0,NULL),('ck1x3b44u014a01i9g6tobgef','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked in the Digital Strategy department, which was less of a \"corporate\" culture. Your experience will vary depending on what team you\'re on. Everyone works on different projects and sometimes it is difficult to get feedback on your performance. However, you could tell that they value the co-ops there and the work is meaningful.',28,'CAD','hourly',4.0,3.0,5.0,5.0,NULL,0,1,'2017-03-10T02:40:46.371Z','r439j394c91',0,0,NULL),('ck1x3b44u014b01i996cgb82s','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Great Experience at American Express.\n\nFantastic culture that values work/life balance. Projects can vary and work can be more or less interesting depending on the team. Mentorship is good but not excellent.',5250,'CAD','monthly',4.0,3.0,4.0,5.0,NULL,0,1,'2017-03-12T00:10:17.191Z','r440j395c130',0,0,NULL),('ck1x3b44u014c01i97d52eoxe','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Great experience!',840,'CAD','weekly',5.0,4.0,4.0,4.0,NULL,0,1,'2017-03-13T00:46:07.364Z','r441j396c84',0,0,NULL),('ck1x3b44u014d01i9cnfy71qe','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','There seems to be a disconnect between upper management and the typical employees. A lot of the founders and upper management seem to have drank the Kool-Aid and think they\'re the greatest thing since sliced bread. There\'s also a structural disconnect between the two offices (Waterloo and Bangalore), where the culture of the Indian office seems to clash with the culture at the local office—one of the teams I encountered during my time there measured the state of a project by \"how many lines of code remaining to write\", which is a totally useless metric and given as an estimate at the start of the project.\n\nTheir technology is somewhat dated, although it varies by team. A lot of the company used an old VCS (IBM ClearCase), although they were beginning to transition to their own hosted Gitlab instance. Also, they have a lot of their testing infrastructure written in a rather esoteric language that nobody really seems to use anymore—Tcl. Java, C and C++ make up a majority of the rest of their codebase, although they were beginning to embrace newer technologies like Golang (for some newer services) and node.js (mostly for client-facing things). I think some teams use Python as well.\n\nI worked on the Subscriber Policy Broker (SPB) team, and the project I was given was pretty isolated from the rest of the team. It was a pretty important project for the company, and I basically had full control over it during my co-op term, which I drove to completion during my time there. As such, I didn\'t really have to deal with all the politics, and had little interaction with the rest of the team. Half of my team was remote (in Bangalore), and the other half was in Waterloo.\n\nFrom my perspective, it seemed as if the full-time employees would always be dealing with some sort of production issue during their on-call rotation, and would work rather long hours in order to ensure that their projects were on track. However, as a co-op, I didn\'t really have to deal with that, and basically did my own thing, working 35-40 hours per week. Basically, as long as I was on track and producing results, they didn\'t really mind what I did.\n\nThey had monthly social events, a popcorn machine, foosball/ping-pong table, free pop, and beer on tap (usually some craft beer).',3900,'CAD','monthly',3.0,2.0,5.0,5.0,NULL,0,1,'2017-03-18T05:24:15.372Z','r442j228c183',0,0,NULL),('ck1x3b44u014e01i9ct9y9z3r','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Had a really hard time at RBC. First two weeks were very slow. Didn\'t get my own laptop, badge or even a project. Had to really press the manager to be put on a project, which was literally dead. The code was messy, old and mostly written by previous interns. I guess your experience is determined by how quickly you take action. But overall, the entire management is pretty bad from my perspective. Period.\n',3400,'CAD','monthly',2.0,2.0,1.0,3.0,NULL,0,1,'2017-03-18T19:53:52.553Z','r444j397c189',0,0,NULL),('ck1x3b44u014f01i9akjb7g3d','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I absolutely loved my experience at AeroFS (they also go by Amium/Air Computing). \n\nYou are able to choose the area you want to work in and given a series of projects intended to help ramp you up. You are exposed to a lot of different tech stacks and you are able to work on critical features and systems.\n\nThe mentorship and culture of the company are also great. It is a small enough company that you are able to know and interact with everyone. You are able to learn from very smart and capable engineers who are also very chill/friendly. ',1500,'USD','weekly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-03-19T02:23:00.520Z','r445j398c241',0,0,NULL),('ck1x3b44u014g01i98z7lgq06','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked during the Fall of 2016, company was ~ 45 employees when I joined and 65+ when I left.\n\nPros:\n- Fast moving means you get to contribute code right away\n- Same responsibilities as a full time employee\n- Lots of company perks\n\nCons:\n- Growing pains, as always, lead to some disorganization\n- Sometimes best engineering practices aren\'t always followed',5500,'CAD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,'2017-03-19T16:38:28.592Z','r446j399c242',0,0,NULL),('ck1x3b44u014h01i9eusicdqt','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Absolutely no meaningful work, my manager was very busy and it seems that he had very little time and patients for co-op students on the team, other than the one he is working directly with. Makes you look for your own work starting from week 2, after you are done with the God awful/boring testing work. Office is very closed and everyone gets their own cube (imagine Kelly\'s desk from The Office, except for the entire office is like that).\n\nHighly not recommended ',3000,'CAD','monthly',1.0,1.0,1.0,5.0,NULL,0,1,'2017-03-21T19:46:36.897Z','r447j400c194',0,0,NULL),('ck1x3b44u014i01i956ir9257','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','You get to work on a variety of projects. On each of these projects, you\'ll be looking at something new that IFDS/DST Systems is looking at using. Things that I looked at specifically included blockchain ledgers, distributed databases vs traditional databases and Docker architecture (note that most banks nowadays have massive mainframes somewhere, so Docker is pretty new for them).\n\nThe team is very nice and knowledgeable about the banking world, and they will help guide you through your tasks. You are given a lot of freedom in what you look at though, so be sure to take advantage of that. Most of your coding skills will be used to make prototypes to demonstrate to someone inside/outside the team.',25,'CAD','hourly',4.0,3.0,4.0,5.0,NULL,0,1,'2017-03-23T17:20:00.634Z','r448j401c243',0,0,NULL),('ck1x3b44u014j01i94mi30ufc','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I loved my experience at Capco.\nThey were all very down to earth people who genuinely wanted you to get something useful out of the term. \nThey have an amazing work/life balance because everyone works very hard to get things done but also have company events once or twice a week.\nWould totally recommend applying here, best co-op experience I\'ve had!',920,'CAD','weekly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-04-18T13:02:10.393Z','r463j409c118',0,0,NULL),('ck1x3b44u014k01i9azepdp8v','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','TL:DR: If you want to build projects from the ground up with complete control over tech-stack and implementation, and are comfortable with self learning and having little to no mentorship, then LCBO next might just be what you are looking for.\n\nPros:\n- Small team: just 4 coops + a non-technical manager (they did just hire a full time dev though).\n- No BS meetings: Once the specs were decided on, people were left to work distraction free\n- Many small projects: we had 3 different projects over the span of 4 months.\n- Full tech-stack & creative control: we started 2/3 projects from nothing more than a blank Git repo and a rough set of specs from the higher-ups. True 0 Technical Debt™\n- Modern Development: The Frontends were SPAs build with React + Redux, and the Backends were node.js with Express, Passport, Sequelize + Postgres, Docker, etc... Our mobile apps used Swift or React-Native.\n- Communitech: it\'s a really nice place to work. Communitech in general has a nice atmosphere, and LCBO next has a really nice work-area. Also, there is a gym in the building.\n\nCons:\n- Some Corporate BS: There are times where LCBO\'s corporate machine clashes with the fast pace of innovation. Eg: we were once blocked on a project for several weeks due to internal bureaucracy in getting access to some internal data.\n- No Mentorship: (this might change with the recently hired dev) We didn\'t have anyone on-site to help up with any technical questions we had. We built everything ourselves, and when we ran into problems, we overcame them ourselves too. NOTE: this isn\'t really a con, more of a fact really...\n- No Free Food (barring the occasional Communitech event) \n- No Free Company Swag\n\nOverall, I really enjoyed my internship at LCBO next. I got a chance to finally learn and polish my skills with a wide array of different technologies, and it felt great to have such complete control over the projects I was working on.',1100,'CAD','weekly',4.0,1.0,4.0,4.0,NULL,0,1,'2017-04-18T14:16:55.116Z','r464j410c212',0,0,NULL),('ck1x3b44u014l01i9cy63b3ri','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The Office team in Microsoft Japan worked on docs.com and Office Lens while I was there.\n\nYou\'ll be assigned an onboarding project to start off with, and then move onto a main project to finish off the term with. If you finish your main project quickly, then you\'ll probably end up working on regular engineering tasks. The projects were in different fields, and a couple of them were quite interesting (involved NLP, OpenGL), but a lot of them were fairly standard web/mobile-development feature tasks. Obviously, these choices will vary each term.\n\nHours aren\'t particularly long, but they\'re pretty offset from the usual business hours (most people came in at 11 and left after 7). You\'re not pressured to commit to 11-7 at all though. Your mentor is mostly there to answer any questions you have, but you\'ll need to be fairly proactive in asking questions to get anything meaningful from them. I wasn\'t so proactive, and mostly ended up asking my mentor for help with Japanese paperwork.\n\nLiving in Japan is great, and there\'s a lot to see, do and eat. I highly recommend you take lots of trips on weekends and holidays!',400000,'JPY','monthly',4.0,3.0,4.0,4.0,NULL,0,1,'2017-03-23T17:28:32.605Z','r449j19c27',0,0,NULL),('ck1x3b44u014m01i918jvbbbz','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Mentorship was almost non-existent and the project was useless. Most intern software projects are demos / proof of concept work that never see the light of day. If you are lucky, you might work on some small features that actually ship. Company culture is really strange, everyone is super secretive about what they are working on. The company is also extremely stingy with perks, offering no free breakfast/dinner and free dinner only if you stay past 7 PM. Overall, I think that Apple is a good company to work at if you are into hardware or are a massive fan boy. If you are into software, there are better companies out there.',5600,'USD','monthly',3.0,3.0,2.0,4.0,NULL,0,1,'2017-03-28T04:04:35.693Z','r450j402c5',0,0,NULL),('ck1x3b44u014n01i98jt92ihs','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked here during 2016. Company culture is really good, everyone is friendly and the CEO shows a lot of respect for his employees. Intern projects were meaningful and challenging projects that were released into production. Mentorship is excellent and the company has fairly good work/life balance. Food was top notch with free breakfast, lunch and dinner. Intern housing was also extremely nice, although you do have to share a bedroom which can be annoying. Only complaints were that the commute from Redwood City to Sunnyvale was a little long (~1 hour) and the other interns in my term weren\'t very social. Overall I highly recommend it.',7200,'USD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,'2017-03-28T04:13:13.505Z','r451j193c24',0,0,NULL),('ck1x3b44v014o01i9cfog8tel','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked on containerization.',40,'USD','hourly',4.0,4.0,5.0,3.0,NULL,0,1,'2017-03-28T13:44:07.651Z','r452j403c244',0,0,NULL),('ck1x3b44v014p01i9cigm92e8','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I co-oped for Facebook twice: first time in Summer 2015, and second time at Instagram in Winter 2016. Both times I had excellent mentors, and who coached me during my term.  Facebook really does not differentiate between interns and full-times, so the work you get to do will be real and meaningful. They are also really flexible, and try to accommodate to your interests; I was initially assigned an Android project, since my resume has a lot of Android experience. However, I really wanted to learn something new, and my manager was able to accommodate to my learning needs. The corporate housing is luxurious and EVERYTHING at work is free!!!!! (Food, tech, snacks, etc...) The team and managers really try to ensure you have a good work-life balance, and encourage you to have fun at the campus arcade and bouldering rock! However, Facebook does move fast, and it can get busy at times. I would 100% recommend working at Facebook to everyone!',8000,'USD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,'2017-03-28T14:31:40.570Z','r453j30c14',0,0,NULL),('ck1x3b44v014q01i9ad1rhqii','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked at TD for my second coop term. I was able to work on interest projects and see them through to production. I didn\'t learn about any cutting edge technology in this position.',22,'CAD','hourly',4.0,3.0,4.0,5.0,NULL,0,1,'2017-03-28T17:08:43.566Z','r455j404c85',0,0,NULL),('ck1x3b44w014r01i9gcyi4gli','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I was given the opportunity to work on projects that i was most interested in. The team was extremely helpful and the work/life balance is awesome. I\'ve interned with Facebook for 2 terms and both terms have been very exciting. ',6800,'USD','monthly',4.0,5.0,4.0,5.0,NULL,0,1,'2017-03-28T18:16:14.376Z','r456j90c14',0,0,NULL),('ck1x3b44w014s01i94ra16y0o','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','It was a good internship for first years but the work wasn\'t meaningful and was quite boring.',18,'CAD','hourly',2.0,2.0,2.0,3.0,NULL,0,1,'2017-03-28T18:21:01.745Z','r457j149c133',0,0,NULL),('ck1x3b44w014t01i9737t275h','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','One mentor per coop guided you through. Worked as part of the team for a bit, then on a project in the app. Overall good experience. The housing sucked though',9000,'USD','monthly',5.0,5.0,4.0,4.0,NULL,0,1,'2017-03-28T18:39:22.365Z','r458j2c42',0,0,NULL),('ck1x3b44w014u01i98rht1dwu','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Working on really cool and interesting software. Sometimes difficult to communicate with other coworkers as they live in different time zones.',40,'USD','hourly',5.0,5.0,4.0,5.0,NULL,0,1,'2017-03-28T21:22:33.509Z','r459j405c30',0,0,NULL),('ck1x3b44w014v01i98fxp813r','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Learned a lot about fullstack web development. Coworkers and mentors were all super nice and friendly. Had lots of responsibilities and was able to make sizable contributions to the codebase.',31,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-03-28T21:35:13.126Z','r460j406c245',0,0,NULL),('ck1x3b44w014w01i99xc7hkkk','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The people there were friendly and always willing to help. Strong mentorship from one of the senior developers there who was always willing to help. Only downsides were that direction of the product is unclear and the salary was low for the amount of work that was being done. ',2850,'CAD','monthly',4.0,4.0,3.0,5.0,NULL,0,1,'2017-03-31T19:18:59.947Z','r461j407c69',0,0,NULL),('ck1x3b44w014x01i9hampb2c8','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Had a great time at Flipp. The people are really friendly and make an effort to make you feel part of the team. They have monthly company events that are lots of fun and free lunches on Friday, they also give you a Goodlife membership for the term and TTC passes. \n\nThe work they give you is pretty interesting, although that depends on the team. You\'ll have an opportunity to work along full time employees and take on as much work as you feel comfortable with. Overall their expectations are pretty reasonable and they seem like they really want to see you grow. I would really recommend working there!',19,'CAD','hourly',5.0,5.0,5.0,4.0,NULL,0,1,'2017-04-16T14:36:31.385Z','r462j408c238',0,0,NULL),('ck1x3b44w014y01i973vl0dkj','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Working for Capco was an awesome experience. The projects are super cool, the people are amazing and you will learn a lot. There\'s a solid work/life balance with a bunch of fun corporate events. I would highly encourage everyone to intern at Capco if you get the chance!',23,'CAD','hourly',5.0,5.0,4.0,5.0,NULL,0,1,'2017-04-20T00:02:49.100Z','r467j413c118',0,0,NULL),('ck1x3b44w014z01i90aj56vb3','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Your experience at D2L will be extremely team dependent.\nPoliticking between the team appears to be strong, and some get overloaded with work.\nYou\'ll have a mentor, and the office is a pretty nice open concept space.',650,'CAD','weekly',4.0,4.0,4.0,5.0,NULL,0,1,'2017-04-20T03:23:58.159Z','r468j414c247',0,0,NULL),('ck1x3b44w015001i94bmpb0d1','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Your experience at D2L will be extremely team dependent.\nPoliticking between the team appears to be strong, and some get overloaded with work.\nYou\'ll have a mentor, and the office is a pretty nice open concept space.\n\nIf you go to D2L on a dev term, you\'ll be stuck doing a video tool \'onboarding\' for about a month and a half.',600,'CAD','weekly',4.0,4.0,3.0,5.0,NULL,0,1,'2017-04-20T03:25:33.699Z','r469j415c83',0,0,NULL),('ck1x3b44w015101i95z3khr61','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Had a fantastic mentor, and a great opportunity to contribute to a new tool.\nOffice was a bit depressing with the empty cubicles, but they\'re moved everything to the buildings up at Northfield now.\n\nWork is about as hectic as you let it be - there\'s always more work in this transition period.',805,'CAD','weekly',4.0,5.0,5.0,4.0,NULL,0,1,'2017-04-20T03:26:54.404Z','r470j416c62',0,0,NULL),('ck1x3b44w015201i9er0o8c9q','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Did a 4 month internship at the CBC, and overall had a great time. Being a large public sector corporation, there are definitely office politics at play in some departments, but I felt that my immediate managers did a good job at sheltering the team from outside noise. As a mobile developer, I got to work on some of the company\'s most meaningful and important projects. Company culture is very relaxed and everyone is friendly and accommodating. Some aspects of the development process were a little slow for my liking, but as an intern I was treated no differently than a full-time dev. One perk of working at the CBC is that every 5th week is an innovation sprint, where you can work on a side project or learn something new that adds value to the company. Working in downtown Toronto is also very cool.',3000,'CAD','monthly',4.0,4.0,4.0,5.0,NULL,0,1,'2017-04-20T16:01:00.736Z','r471j417c248',0,0,NULL),('ck1x3b44w015301i9gib152v1','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Redfin is a real estate tech company headquarted in Seattle. On the first day, I got to meet all the execs and they were super nice. All the recruiters and managers I worked with were approachable as well. I was an intern in the Notifications Team. I worked with engineers who were from great schools and who had worked in Amazon and Microsoft before Redfin. They let you choose any team and project you want based on your interest. I loved the flexibility. The work culture is great and there is a lot of great mentorship and work-life balance. We also had team events to increase team morale. Overall, I would highly recommend Redfin as an internship, especially someone who is interested in Big Data problems and the Real-Estate business.',7000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-04-23T03:29:48.007Z','r472j412c246',0,0,NULL),('ck1x3b44w015401i91vycasah','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Not bad place. Management doesn\'t really have a good coop system so you might be left in the dust for a while. There\'s lots of work though, tons of features to work on. People are generally friendly. Perks are pretty meh.  Work varies between teams so don\'t fall for the \"big data\" meme although in general we do use a lot of cool tools.',3750,'CAD','monthly',4.0,4.0,5.0,3.0,NULL,0,1,'2017-04-26T00:53:28.174Z','r473j418c249',0,0,NULL),('ck1x3b44w015501i9himx7chw','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Had a fantastic experience with Ciena at their Ottawa location. My team, and specifically my boss, were fantastic to work with. Didn\'t get any busy work after the first few weeks, was actually given meaningful work that taught me important software development practices and more. My boss specifically took me aside at times to highlight important things both about my work and thriving in a corporate environment. Team were all super friendly and helpful.\n\nPositive outlook on the company as a whole. Work life balance is there as most of the company is just people looking to do their ~40 hours and enjoy life outside of work. The occasional weekend of overtime would be asked in order to hit a target date but this seemed to be a very infrequent thing. Cool product and the company looks to be heading in the right direction.\n\nA few footnotes:\n\n1. Company is aging. Ciena Ottawa is a lot of former Nortel employees, and the company really didn\'t hit their stride until recently. This has created a bit of a hiring gap where you have a lot of employees aged 40+ but very few in the late twenties/early thirties area. They\'ve been hiring a lot of new grads so there is definitely youth there.\n2. Canadian pay. You can see their fulltime numbers easy enough on glassdoor and it\'s nothing exceptional as far as Canadian software goes. They have decent perks for employees who have stuck with the company for a bit, and I get the vibe that this is a \"work here for potentially the rest of your life\" kind of place. Having experienced both this environment and the much faster paced, swap companies frequently, higher paid environment of the states, I am not sure which I prefer. Two completely different paths which I believe both have their benefits.\n\nAnyways, as far as co-op goes you can\'t go wrong spending some time here. Great company, great people, good work, and Ottawa is a fantastic place to live. Give it a shot and see if it\'s for you.',20,'CAD','hourly',5.0,5.0,4.0,5.0,NULL,0,1,'2017-04-26T00:54:31.624Z','r474j419c250',0,0,NULL),('ck1x3b44w015601i9du5h3cq4','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Being the only intern in the department, there is a lot of flexibility in the time taken to complete different projects. The job is mostly writing VBA code to automate a lot of manual work being done using MS Excel and Outlook. If you know how to work with BEx Analyzer, it would be advantageous.',18,'CAD','hourly',4.0,4.0,4.0,5.0,NULL,0,1,'2017-04-26T01:39:37.161Z','r475j420c251',0,0,NULL),('ck1x3b44w015701i96wjw94vk','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','If you\'re a UX-er or product designer, Shopify should be on your list. They (are starting to) bring in some top talent from all over the world. Literally, I\'ve got to work with designers from Facebook and Airbnb during my time here. The design work is really starting to get noticed globally, and Shopify is one of those companies who deeply care about their design. You will come out of this co-op feeling as though you became a better designer for sure. \n- Lots of opportunities for growth. Your lead will take care of that for sure. \n- They actually give a shit about their design work\n- Amazing designers to talk to, lots of talent coming in \n- Intern housing in Ottawa is nice\n- Projects are super fun and there is lots of transparency so you\'ll get the big picture of what you are doing\n\nOnly cons: Ottawa is kinda boring if you\'re into big cities. Intern culture is kinda bland (lots of waterloo engineers). ',4000,'CAD','monthly',4.0,5.0,5.0,5.0,NULL,0,1,'2017-04-26T02:20:04.029Z','r476j421c40',0,0,NULL),('ck1x3b44w015801i905ql34td','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','My co-op experience with the Region of Peel was good as the staff was friendly and the work environment was comfortable. Depending on your team and manager, your experience may vary. ',21,'CAD','hourly',4.0,4.0,4.0,5.0,NULL,0,1,'2017-04-26T02:23:50.274Z','r477j422c252',0,0,NULL),('ck1x3b44w015901i97k497i0t','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Job was ok, you are basically just doing people\'s taxes using their really old software. If you think that will help your career, probably won\'t be bad to work here. ',14,'CAD','hourly',3.0,3.0,2.0,5.0,NULL,0,1,'2017-04-26T03:21:14.076Z','r478j423c253',0,0,NULL),('ck1x3b44w015a01i99frp479p','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Capco is a great place to intern at ! Great work, great people, and great social events. I learned a lot about iOS development here. When I graduate, I will definitely consider Capco for full time work. ',4000,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-08-31T14:08:27.559Z','r554j479c118',0,0,NULL),('ck1x3b44w015b01i99hribm3v','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The work is pretty hard, fast paced physical labour. Coop students do spend a little bit of time working in the office, but it\'s mostly line work. You get used to it after a week or two, after which point it\'s not a bad job. Coworkers are friendly. If you can\'t get a coop in your field, it\'s not a bad consolation prize.\n\nI filled in the ratings kind of randomly, because I don\'t have a lot of frame of reference.',15,'CAD','hourly',4.0,4.0,5.0,5.0,NULL,0,1,'2017-04-26T03:56:10.775Z','r479j424c254',0,0,NULL),('ck1x3b44w015c01i95o832cud','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Depending on what team you get, your experience can be meh, or very positive. I was given several independent tasks to do over my term, but it felt like no one really cared about what I was working on. The people were nice; although it there is a TON of red tape (it\'s a bank). RBC is very big on co-op/internships so there were meetings with other interns (~10 in Capital Markets), and some of them seemed to be working on really cool stuff. Although being into finance isn\'t required, it\'s something I would recommend as most of the stuff you are taught on the job revolves around that.\n',3200,'CAD','monthly',3.0,3.0,2.0,3.0,NULL,0,1,'2017-04-26T12:51:01.773Z','r480j235c189',0,0,NULL),('ck1x3b44w015d01i90w4s256s','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','January - April 2017\nThe people are nice and funny but there is not a lot of work to do. Work they do give you is meaningless. The only cool work was doing some Android development. It was their first time doing software dev and thats the only cool bit; other than that pretty boring.',18,'CAD','hourly',2.0,3.0,1.0,4.0,NULL,0,1,'2017-04-26T14:30:52.329Z','r481j425c255',0,0,NULL),('ck1x3b44w015e01i964fi0yxw','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Very meaningful work with lots of freedom to take on larger responsibilities. If you do well, customers will write glowing feedback about your changes. Felt like I was actually part of a team where no one is too busy for you. They were flexible with frontend/backend and I did a bit of both. The culture is very open and fairly laid-back while avoiding startup cult culture. You can always find someone to help you with work or just to hang out with you.',3500,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-04-26T14:52:48.378Z','r482j426c256',0,0,NULL),('ck1x3b44w015f01i9do1l7ky9','2019-10-19 04:56:45.467000','2019-11-27 20:34:52.787000',0,'ck1n1du49000501jo4pwygsav','Good environment, good people. ',18,'CAD','hourly',4.0,5.0,4.0,5.0,NULL,0,1,'2017-04-26T15:44:23.877Z','r483j427c257',0,0,NULL),('ck1x3b44w015g01i9cnk5h0q7','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','So I was in the first cohort of co-ops that joined the Jan Kelley Idea Incubator in Communitech (Our first day was the full-times\' first day). \n\nWe didn\'t have a ton of work at the beginning of the term (which is somewhat understandable considering the outpost was just starting up) and as the term went on we gradually got more work.\n\nIt was a great work environment and we worked with great people, but we were left on our own a lot. The two full-times spent 2 days a week in the Burlington HQ, so if we ran into a road block, we\'d often have to message them on slack (which isn\'t the worst thing in the world, but definitely not ideal)\n\nI\'d recommend this job for someone looking for a lot of autonomy and control over design decisions, and doesn\'t want to just be handed a spec.',17,'CAD','hourly',4.0,2.0,4.0,5.0,NULL,0,1,'2017-04-26T15:53:27.744Z','r484j428c258',0,0,NULL),('ck1x3b44w015h01i917qf05lh','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','It was a great experience working at Capco. During my time at Capco. I was thrown right into development and given significant work. The people at Capco were willing to help me with any issues and I learned a lot through their mentorship. If you don\'t like your work, Capco will find you a project that you are happy in. I would highly recommend applying to Capco.',20,'CAD','hourly',5.0,5.0,5.0,4.0,NULL,0,1,'2017-04-27T13:30:00.577Z','r485j117c118',0,0,NULL),('ck1x3b44w015i01i93gr0fsyl','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I really enjoyed my experience at Capco. Everyone I met was easy going and willing to help with anything you asked. I had a great work/life balance during my time at Capco, and they supported it by hosting many company events over the term. My role provided a unique blend of experience in consulting and project management while also allowing me to learn more about technology and software development. I would recommend applying here to anyone interested in consulting and/or technology, best co-op experience I\'ve had!',4500,'CAD','monthly',5.0,4.0,4.0,5.0,NULL,0,1,'2017-04-27T14:00:12.425Z','r486j409c118',0,0,NULL),('ck1x3b44x015j01i981qb39ih','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','People are absolutely awesome; fun and insightful. Work is also great, all you have to do is ask people to open up more opportunities. ',3840,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-04-27T15:45:30.630Z','r487j117c118',0,0,NULL),('ck1x3b44x015k01i9gkfhbqse','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','KC in Huntsville was an incredible place for an 8 month work placement. The town itself is wonderful and the whole Muskoka region is great. The mill is staffed by a team of veteran engineers who are great mentors to the students. I was given the chance to program, works hands on with the electricians and take the lead in a number of high-impact projects. I really feel like I learnt a lot in my time here and I seriously recommend this placement to any who get the opportunity!   ',18,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-04-27T19:01:17.113Z','r488j429c259',0,0,NULL),('ck1x3b44x015l01i99pof2y2a','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I believe the purpose of an internship is to challenge you, whether that be by putting you in new situations or providing opportunities that force you to learn new things.\n\nCapco provided ample opportunities to be challenged this term, and that was by design. I have learned so much at Capco as a result, and would recommend others take up the opportunity to do the same.',3840,'CAD','monthly',4.0,4.0,4.0,4.0,NULL,0,1,'2017-04-27T20:30:30.287Z','r489j117c118',0,0,NULL),('ck1x3b44x015m01i908110ei1','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The quality of the internship really depends on these three things:\n\n- The team you end up on\n- The manager/mentor/lead you end up having\n- The project you get assigned\n\nThese things can vary greatly and I lucked out with fantastic team, manager/mentor/lead, and project. When interviewing, make sure to make it perfectly clear what your interests are. They\'ll try their best to put you on something that matches your interests.\n',7500,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-04-27T23:14:23.267Z','r490j17c27',0,0,NULL),('ck1x3b44x015n01i9dh5rbs0g','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The Microsoft intern program is well-organized with lots of special intern events (eg game nights, Mariners games, hiking etc). You get lots of perks with your salary including subsidized corporate housing, gym membership, and lots of gifts/swag.\n\nMicrosoft is large and fragmented, so your experience will depend a lot on your specific team and manager. Overall, the people are smart, the culture is laid back, and the company mood is optimistic.\n\nThere is lots of interesting stuff going on at Microsoft, but 4 months is not enough to ramp up and fully take advantage of everything. Your internship will likely be project-based and you shouldn\'t expect your intern project to be something cutting-edge.\n\nReturn offers are relatively easy to get as long as you put your work in.',7100,'USD','monthly',5.0,4.0,4.0,5.0,NULL,0,1,'2017-04-28T14:11:35.974Z','r491j430c27',0,0,NULL),('ck1x3b44x015o01i9dlix5uub','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The projects given did not seem meaningful, but I did learn a lot through independent learning. There was the need to show up to the office early since the QA team is offshore. I had many long hour meetings that were not necessary.',3000,'CAD','monthly',2.0,2.0,1.0,3.0,NULL,0,1,'2017-07-06T04:25:51.205Z','r524j187c157',0,0,NULL),('ck1x3b44x015p01i9gfkp533g','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','TD Lab is a prototyping environment. Interns are split into groups of 3-4 that work on experimental projects that can be used in context with the bank but will not be pushed to production. These projects are presented to the executives at TD at the mid-point and end of each term and are supposed to inform digital strategy.\n\nAs a designer, you will get the most out of this experience if you are able to take a step back from your individual work (working with tools such as Sketch, Marvel, etc.) and can think deeply about the meaning of your project. The Lab emphasizes ideas and concepts over perfecting visuals or UI.\n\nThe culture is great. Co-ops will get very close as they will be working together the entire time. 1 or 2 full timers will get assigned to each group to point the interns in the right direction. ',2750,'CAD','monthly',4.0,4.0,3.0,5.0,NULL,0,1,'2017-04-28T21:05:51.687Z','r492j431c191',0,0,NULL),('ck1x3b44x015q01i9d55acte5','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Very smart people, great support. Everyone there is very passionate so long hours aren\'t uncommon. However, you aren\'t forced to work long hours. They give cool projects and try to line them up to your interests.',4600,'CAD','monthly',4.0,4.0,5.0,3.0,NULL,0,1,'2017-05-04T19:12:58.396Z','r494j25c71',0,0,NULL),('ck1x3b44x015r01i91yycfdeh','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I was a Developer with Capco and had an absolutely wonderful time! The company is great and they have lots of fun events where you get to meet other project members and pretty much every event is free and has food :) It\'s not too corporate, it has a pretty flat structure, which is great. In terms of work, I lucked out with a really good project and with dev, I think you\'ll always have something to do. I learned a lot and it was definitely an awesome experience!',21,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-05-06T01:35:15.800Z','r495j117c118',0,0,NULL),('ck1x3b44x015s01i96zy3cfof','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Honestly, hands down the best co-op i have ever had. Lots of smart people and I was given an insane amount of ownership!',6500,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-05-07T23:58:22.112Z','r496j16c67',0,0,NULL),('ck1x3b44x015t01i93zzegmbf','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','amazing mentorship & very interesting work',4000,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-05-13T01:26:07.814Z','r497j432c72',0,0,NULL),('ck1x3b44x015u01i98zsv1lcr','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked at the Rogers Media for a 4-month internship on their web development team in downtown Toronto. Mainly working with JavaScript, PHP, and a little bit or Ruby. I was on the radio/broadcast/publishing team focusing on the Rogers Media radio sites. \n\nI really liked it there, it was an open environment with great feeling to it. The hours are great and very flexible and the amount of work is very manageable. They treat you just like another developer, so you are given your own project to work on. Sometimes you run out of work to do but I have never gone beyond 2 days of nothing to do. \n\nI had code reviews with my manager for my code regularly and people were very open to questions I had. \n\nOverall, I really liked it at Rogers in their Digital Media department. I would say though that I really liked working in the media field. If you are not interested in that kind of work, you will probably really dislike your day to day work. ',18,'CAD','hourly',5.0,5.0,4.0,5.0,NULL,0,1,'2017-05-13T01:55:38.126Z','r498j433c280',0,0,NULL),('ck1x3b44x015v01i9bukgeblu','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The toronto office is great! I got to work with a lot of nice people. Particularly my manager and mentor Blake was very helpful. He gave me a lot of room of freedom that I can decide what projects I want to work on. The job itself is very hard to explain. It\'s kinda a combination of later stage pm and marketing on a scale (through the sales pods). Food can be a surprise sometimes. I\'ve had alligator and rabbit there. Gym and wellness expense are subsidized as well and you get $300 something everything on ad credits. Overall it\'s a very cool experience.',5000,'CAD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,'2017-05-17T15:45:42.306Z','r499j434c14',0,0,NULL),('ck1x3b44x015w01i9acz130gw','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Pros:\n- Foosball, pingpong and free snacks/drinks\n- Great culture\n\nCons:\n- Very few experienced or senior engineers\n- Greater budget for sales than engineers\n- Low salary\n- Long hours\n',2800,'CAD','monthly',3.0,2.0,3.0,3.0,NULL,0,1,'2017-05-17T16:34:16.798Z','r500j435c173',0,0,NULL),('ck1x3b44x015x01i93mg234cd','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Nice co-workers, the projects weren\'t particularly interesting though. Decent mentorship, but the code reviews were not rigorous. Everyone wants to help you out though so there\'s that!',17,'CAD','hourly',3.0,3.0,3.0,5.0,NULL,0,1,'2017-05-18T01:41:21.597Z','r501j436c281',0,0,NULL),('ck1x3b44x015y01i91o1lezbe','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Although the company is declining, the coop experience is pretty nice. Lots of perks and outings. There may not be too much work to do, depending on your team.',6400,'USD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,'2017-05-19T12:29:04.138Z','r502j437c57',0,0,NULL),('ck1x3b44x015z01i9gtax7px0','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked there for Winter 2017 term, it was friggin awesome. The impact you can make working there is unreal, and for those less experienced you can really learn a ton.\n\nTry to work for relevancy, product, or infrastructure team; the platform team coops were slaves.',8500,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-05-22T05:24:23.513Z','r503j438c104',0,0,NULL),('ck1x3b44x016001i95gsp0ccl','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','You\'ll get a lot of responsibility and make your own features, but the culture is a bit dull. Not very diverse and not really any company events.',1100,'CAD','weekly',4.0,4.0,5.0,4.0,NULL,0,1,'2017-05-24T09:18:56.086Z','r504j366c66',0,0,NULL),('ck1x3b44x016101i92q1k19so','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','It\'s a good work-from-home job where you work with AngularJS (1.x) almost exclusively. Depending on the position, you may get access to the back-end PHP as well.',20,'CAD','hourly',4.0,4.0,5.0,5.0,NULL,0,1,'2017-05-24T23:17:38.638Z','r505j439c282',0,0,NULL),('ck1x3b44x016201i95wzv1kp7','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Hours were 9-5 and you develop proof of concept (POC) applications with Meteor and RapidMiner. The code you develop is not tested for quality and you are monitored on final product only. You can write garbage code and not be mentored on it. The code is considered throwaway since it is only a POC, not production code.\n\nBut the team lead cares a lot about you getting value with learning useful, new technologies.',800,'CAD','weekly',4.0,3.0,4.0,5.0,NULL,0,1,'2017-05-24T23:24:30.584Z','r506j440c283',0,0,NULL),('ck1x3b44x016301i97a90fwkb','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked as an intern in the winter term in 2017. The culture was surprisingly awesome for such a huge company - everyone is friendly and the company is very open. The perks were top notch - housing was luxurious, buffet of great food every day for three meals, fitness stipend and snacks. I had the opportunity to work on some pretty impactful projects and was treated like a full-time employee. At work, you\'re surrounded by really smart, driven people. There\'s excellent infrastructures and tools in place for developers.',8000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-05-25T18:30:03.766Z','r507j441c14',0,0,NULL),('ck1x3b44x016401i9gtkjcgfc','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I loved working at SkyWatch. You get to work on many projects and pretty much work on all aspects of the company\'s public API.\nYou\'ll learn a lot about building scalable back-ends and low-level geo-spatial libraries for processing satellite images.',3000,'CAD','monthly',5.0,4.0,5.0,4.0,NULL,0,1,'2017-05-29T21:16:45.334Z','r508j442c174',0,0,NULL),('ck1x3b44x016501i99xkjatlp','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Loved it. Everyone\'s professional and friendly. Working environment is casual. Somewhat flexible hours.',1000,'CAD','weekly',4.0,4.0,4.0,4.0,NULL,0,1,'2017-05-29T22:57:29.257Z','r509j268c198',0,0,NULL),('ck1x3b44x016601i95cacgu8l','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','First term was at N8.  Super friendly team, board games after work once a week.  Burlington\'s not the most exciting but it made for a simple first co-op term with a good intro to being a dev at a company.',17,'CAD','hourly',4.0,4.0,3.0,5.0,NULL,0,1,'2017-06-04T23:52:58.093Z','r511j443c94',0,0,NULL),('ck1x3b44x016701i90vd0azow','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Everyone there is really nice and friendly. Interns are treated well. If you tell them what youre interested in, they will make an effort to pair you up with someone with expertise in that area and get you working on a project you will enjoy.  Lots of oppurtunity for training or learning more on a topic that intrigues you, but it may come from the perspective of sales, and not the nitty-gritty techinical, which can be good or bad depending on what you want. \n\nYou get to tag along to fun corporate events with food and schmoozing. It is as laid back as corporate enterprise gets.',20,'CAD','hourly',4.0,4.0,4.0,5.0,NULL,0,1,'2017-06-06T18:53:00.975Z','r512j444c289',0,0,NULL),('ck1x3b44x016801i95up8gngr','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Did two winter co-op terms in financial services audit. \n\nReally enjoyed the team atmosphere of the job and the responsibilities I was given as my comfort level and experience progressed.  Benefits were quite good with a sizable fitness credit and a pretty solid points recognition program. Got some sweet shoes and a guitar through this.\n\nWork hours are bad but it\'s to be expected in this field. Initial pay is fairly low but that\'s also to be expected. Ultimately I left as I wanted to pursue another profession, but PwC would have been a great choice had I stuck with accounting.',3417,'CAD','monthly',4.0,4.0,3.0,2.0,NULL,0,1,'2017-06-12T02:29:04.014Z','r513j445c272',0,0,NULL),('ck1x3b44x016901i99a9d4u1b','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Interned here in the Winter of 2017. The work was interesting, but got a little repetitive over time. Coworkers and other interns were very chill and open to collaboration for the most part. Free snacks, weekly catered lunches, and other benefits are great. My specific team was lacking a clear leadership presence, but managed to make do with help from other teams\' leads chipping in.',22,'CAD','hourly',4.0,4.0,4.0,5.0,NULL,0,1,'2017-06-26T03:54:01.058Z','r514j408c238',0,0,NULL),('ck1x3b44x016a01i90odz357z','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','PROS\n- great people\n- really interesting projects\n- free snacks / foosball table / ping pong / coffee / tea\n- treat you like a full timer from day 1\n- lots of focus on culture - company events, awesome office space\n- really want you to learn - some 1 on 1s\n\nCONS\n- bit divisive in terms of cross-functionality... business and tech people are divided\n- though a \"startup\" environment, not a lot of perks for non-full timers\n- sometimes they think you know more than you actually do\n- high attrition pains\n\nOVERALL\n- really good early coop, but experience is definitely different for full time workers',3200,'CAD','monthly',5.0,4.0,5.0,5.0,NULL,0,1,'2017-06-30T03:44:44.744Z','r515j446c112',0,0,NULL),('ck1x3b44x016b01i94jw11ztg','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The experience was great overall. You\'ll get to work on a meaningful product and get ownership of any new features you develop. You\'ll get to be a part of all the meetings and work closely with product managers, designers and senior engineers. You\'ll learn a lot of different coding practices and code reviews will push you to write better industry standard code. Perks include free drinks, snacks, team outings and monthly company lunches. Highly recommend!',5600,'CAD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,'2017-06-30T16:41:18.151Z','r516j447c290',0,0,NULL),('ck1x3b44y016c01i974hnd0f0','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked there two terms now. Both on different teams as a EE intern. \n\nThe most important thing I find interning at Apple is finding a good team/mentorship.\nI was lucky enough to have amazing mentors and team during my time there which led me to learn a ton of things. \n\nLots of work to be done, so had some late nights, but no-one forcing you to stay late. Only stayed late because I really enjoyed the work.\n\nTip : Remember Apple is a huge company 40,000 + employees.. Every team is different, so when you are interviewing ensure there is proper mentorship and good work. For hardware, I say its a really good place if not the best, but for software I\'m sure there are other companies that are much better. ',35,'USD','hourly',5.0,5.0,5.0,4.0,NULL,0,1,'2017-07-04T01:57:00.331Z','r517j448c5',0,0,NULL),('ck1x3b44y016d01i95pq9ajc9','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Did an 8 month co-op for my 3rd and 4th co-op term. I realized this was probably one of my biggest career mistakes. We were in a hire class of 10 individuals and were treated like brand new co-op students(for pay and other perks) even though most of us already have 2 busy seasons worth of experience.\n\nWe were paired up with a coach. Fortunately, I had a nice enough coach.\n\nHowever, while the Firm states there is a strong work-life balance, there really isn\'t. I was put on a large engagements that was short staffed which resulted in us working 14+ hour days for two months.\n\nAlso, work gets boring and is easily outsourced overseas.\n\nOverall, I would not recommend this job.',3400,'CAD','monthly',1.0,3.0,2.0,1.0,NULL,0,1,'2017-07-06T02:00:44.095Z','r518j449c272',0,0,NULL),('ck1x3b44y016e01i9a02d55n6','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked in 2017 after previously working at the New York office. Company culture was consistent. I felt that the projects were meaningful and enjoyed working on my team. London did not have as many intern events as NYC, though there isn\'t as much of an intern program in London so this is to be expected. Having 8 vacation days was nice and allowed me to take extended trips and long weekends.',3583,'GBP','monthly',5.0,5.0,5.0,4.0,NULL,0,1,'2017-07-06T02:47:35.779Z','r519j156c8',0,0,NULL),('ck1x3b44y016f01i971b4fqqn','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Kik was my favourite co-op in terms of work experience. Getting to develop full features here was great. Unfortunately pay is not competitive with the US, but it\'s definitely worth a co-op here to learn new things.',4333,'CAD','monthly',5.0,4.0,4.0,5.0,NULL,0,1,'2017-07-06T02:52:32.149Z','r520j450c203',0,0,NULL),('ck1x3b44y016g01i907el8v1a','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I enjoyed my time at Uken Games a lot. I definitely learned a lot from working at Uken. I was given some pretty meaningful features in a fairly decent sized game. They also try to pair you up with senior developers, so if you have any trouble you can always ask for help. The environment is very friendly. There was no overtime for this position since the task estimations were done really well. Interns also have many perks like free food and events every month.',4000,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-07-06T04:20:17.495Z','r523j453c292',0,0,NULL),('ck1x3b44y016h01i93eq37ikb','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','3rd month into the term, experience has been nothing short of amazing. Super exciting to work at one of the best self driving car company in the world right now, I worked in a very small team (a special feature) of 2 people, I basically owned the entire feature stack, my work involved everything from frontend, backend, server scalability, data pipeline to the autonomous vehicle stack on the car. To put it simply, I learned a shit load.\n\nWork is very meaningful and relevant, company is evaluated by milestone, therefore everything I worked on was purely towards the milestones, and the impact of my work is clearly visible from metrics and benchmarks. \n\nCompany is growing extremely rapidly, we have about 300 full time right now, though the managements are doing a great job aligning the focus, especially the CEO who is also super down to earth and friendly. However as a consequence it can be difficult to get help just because the pace of the company\'s growth, it sometimes take a couple of redirecting to get to the right person. If you can self learn quickly then it isn\'t a problem.\n\nThe company is actively pushing equality and healthy work culture *cough cough uber*, there are 15 interns this summer, the intern program is new but also well planned, lots of intern events. The expectations of interns are just about the same as full time, still the workload is very resonable, and the work hours are very flexible. \n\nLots of benefits: free breakfast, lunch, dinner, snacks, deductable commute, free self driving car ride to work (soon to be to everywhere in the city), you can go on a test drive whenever you feel like, I like to go when I\'m just bored or can\'t figure out a hard problem. \n\nOverall the company is in a very interesting position after GM\'s aquisition, we are still independent as a company and very much like a startup, however backed up by a massive cooperation. I honestly can\'t ask for much more.\n\n\n\n',10500,'USD','monthly',5.0,4.0,5.0,5.0,NULL,0,1,'2017-07-06T06:49:19.533Z','r525j454c293',0,0,NULL),('ck1x3b44y016i01i93abehmds','2019-10-19 04:56:45.467000','2019-11-27 20:34:38.359000',0,'ck1n1du49000501jo4pwygsav','Mainly debugging of old legacy code with little to 0 mentorship and poor leadership. Culture is very clique with people hanging out in group, however there were 8 co-ops so you get to meet lots of new people.\nWould not recommend.',19,'CAD','hourly',2.0,3.0,2.0,4.0,NULL,0,1,'2017-07-06T18:35:08.832Z','r526j455c294',0,0,NULL),('ck1x3b44y016j01i9hsi8cx36','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Pros:\nAbove average pay, lunch provided\nDo actual work, not meaningless stuff that never gets used\n\nCons:\nYour experience with the CEO can be super hit or miss\nBad full time to co-op ratio\nThe codebase is a mess. Only by looking at it can you understand\n\nOverall, not as bad as the horror stories you normally hear, but I wouldn\'t work here if you already have some experience under your belt.\n\nThis picture describes Rave perfectly: https://i.redd.it/wzn251tvq49y.png',25,'CAD','hourly',3.0,1.0,3.0,4.0,NULL,0,1,'2017-07-07T02:04:15.814Z','r531j459c120',0,0,NULL),('ck1x3b44y016k01i90cjj4ok6','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The company culture is very laid-back which was good. However, they really need to work on managing and hiring enough developers to do the work instead of over-working their interns. ',4500,'USD','monthly',3.0,3.0,4.0,1.0,NULL,0,1,'2017-07-18T17:34:00.546Z','r532j460c295',0,0,NULL),('ck1x3b44y016l01i93g7fdo10','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I thought the internship program was fantastic. My mentor was extremely helpful and available whenever I needed help. I learned the whole stack of development, and felt like i was contributing a ton to the effort and to the team.\n\nThe specifics about what I learned are as follows: Continuous integration, Python, Django, React, Redux, a little AWS, page crawling, creating APIs etc.\n\nI was out largely because of an injury, but there were many awesome events for interns and the whole company. I was also housed in an apartment in San Francisco (mission district). The venue was good.\n\nIn terms of remarks, the learning curve is high, so you will definitely learn a lot.',38,'USD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-08-04T21:09:49.708Z','r533j461c155',0,0,NULL),('ck1x3b44y016m01i91yov8zf7','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Company culture was great, pretty fast and small, growing startup in Toronto. There isn\'t too much of mentorship for the tech team since it\'s pretty small and the startup focuses more on marketing aspect. Personally, the work wasn\'t very impactful because it\'s mostly fixing bugs, fixes on their new management platform. ',2720,'CAD','monthly',2.0,3.0,3.0,3.0,NULL,0,1,'2017-08-05T22:07:04.108Z','r534j462c296',0,0,NULL),('ck1x3b44y016n01i9e746bf7e','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','New startup in Toronto, good experience for first co-op, the work is interesting since it focuses on data engineering. Pay is a bit low for living in Toronto though. ',3040,'CAD','monthly',3.0,2.0,4.0,2.0,NULL,0,1,'2017-08-05T22:10:36.410Z','r535j463c297',0,0,NULL),('ck1x3b44y016o01i99nevdsi4','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Overall pretty good company, great company culture, people here are really friendly and willing to help. The work you do will depend on your team, but my team gave me lots of options and many were very interesting, they definitely promote giving interns interesting work. The Bellevue office is very new and nicely decorated, it has a barista bar who makes fresh coffees, expressos, etc. \n\nThey give an option of corporate housing or $11500 (after tax, this is your take home amount) stipend which is more than enough for Bellevue.  They have lots of other interns and intern events during the summer, not sure about other terms. Theres also a monthly 100 dollars \"wellness perk\", which is just a free 100 dollars to spend on whatever you want. They also promote volunteering and have whats known as VTO (Volunteer Time Off) which interns are encouraged to take advantage of.',7800,'USD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,'2017-08-14T17:39:42.626Z','r536j464c38',0,0,NULL),('ck1x3b44y016p01i91tayaw9z','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Located in the Old Port of Montreal,  Lightspeed deals with retail and restaurant POS systems.',20,'CAD','hourly',4.0,4.0,4.0,5.0,NULL,0,1,'2017-08-15T01:20:10.731Z','r537j465c298',0,0,NULL),('ck1x3b44y016q01i9gizs0zyg','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','It really depends on your team. I didn\'t feel connected to my team at all, and they didn\'t seem that interested in me or what I was doing. The test environment broke all the time and people didn\'t care. I was stuck with an underpowered dev server for the first 2 months which made everything very slow and flaky. Sometimes it took weeks for people to review my code. When planning my project, one teammate kept harping on the fact that it\'s \"an intern project\" and \"Maybe he doesn\'t know how to code.\"\n\nMy manager was not a good mentor. One of the first things he told me was how his previous intern\'s project is no longer used in production at all. He often acted as if things could be done in a \"few hours\" or \"a day\" when it would obviously be more work than that. When I was almost done planning my project, he changed his mind and wanted part of it to work completely differently.\n\nThat being said, the food and perks and corporate housing are great. They throw a ton of cash at the intern program. It\'s also cool to listen to Mark at the Q&A every Friday.',8000,'USD','monthly',4.0,1.0,3.0,4.0,NULL,0,1,'2017-08-16T06:51:22.171Z','r538j466c14',0,0,NULL),('ck1x3b44y016r01i99g236as3','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','My experience with Bloomberg in NY was great. You get provided housing in full ($2000 USD/month value) in Manhattan (30 minute walk, 10 minute subway), along with a $2000 USD lump sum pay for relocation. The internship program itself comes with tons of events including weekly tech talks, picnic (they rent an island), data centre tour and hackathons (overnight, 16 hr overtime) and algorithm contests. Of course, you get access to Bloomberg’s pantry, unlimited museum pass and other perks like breakfast and dinner. The building is fantastic, especially the views of uptown in Lex and downtown view in Park.\n\nWork-wise the projects were very interesting, you get to pick what you’re interested in and they try their best to do something you love. I worked with the latest technologies as well (including React/Node, Scikit-Learn, Microsoft Cognitive Services). \n\nI would recommend this internship to anyone in a heartbeat, just be careful of the team that you join.  I also interned here during the summer so YMMV for the other terms.',43,'USD','hourly',4.0,3.0,4.0,5.0,NULL,0,1,'2017-08-21T00:20:40.625Z','r539j467c8',0,0,NULL),('ck1x3b44y016s01i99a6q062m','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Spent 1 term working as an investment banking analyst. Averaged around 70 hours a week and worked Sunday - Friday. Work ranged from tedious formatting updates to financial modeling. Formalized program gives you exposure to different groups within investment and corporate banking in both fall and winter terms',1650,'CAD','weekly',3.0,3.0,4.0,2.0,NULL,0,1,'2017-08-21T00:42:27.646Z','r540j468c133',0,0,NULL),('ck1x3b44y016t01i9cz76gli9','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked Summer 2017. Bosses were all cool people and fun to talk to. Work was not heavy but had many opportunities to explore different things.',18,'CAD','hourly',4.0,4.0,4.0,5.0,NULL,0,1,'2017-08-21T01:18:58.487Z','r541j469c251',0,0,NULL),('ck1x3b44y016u01i93astfzvo','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The company builds enterprise software for corporate clients, so the end product isn\'t always all that interesting, but everyone there is really great to work with.  Every second Thursday there\'s a company-wide \"Thursday Night Social\" where dinner is catered and sometimes a staff member will give a talk about something they\'re interested in.',28,'CAD','hourly',4.0,4.0,3.0,5.0,NULL,0,1,'2017-08-21T01:29:53.029Z','r542j470c299',0,0,NULL),('ck1x3b44y016v01i9e4eo33qq','2019-10-19 04:56:45.467000','2019-11-27 20:34:22.051000',0,'ck1n1du49000501jo4pwygsav','Had a pretty chill experience at Zynga. Great office, smart people and fun environment overall. They have an amazing intern program, and they have cool perks. Work was interesting for the most part. All in all, it was a lot of fun working at Zynga. ',23,'CAD','hourly',5.0,4.0,4.0,5.0,NULL,0,1,'2017-09-30T22:05:00.656Z','r581j165c61',0,0,NULL),('ck1x3b44y016w01i90qe035l3','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked at Microsoft in summer 2017. Despite not being at the HQ in Redmond, there were intern events every week or two (paintball, baseball games, cruise, etc), and we also got flown to Seattle for a week for the famous signature event. In terms of work, I was put on a great team where my project was actually critical for the team. I became good friends with my mentor and manager, but with a company as big as Microsoft, team culture can really vary. The team asked for my preferences on the type of work I want beforehand and gave me something that matched them exactly, despite me not having any experience in that domain beforehand. However, I did find that intern expectations here were noticeably higher than the other companies I worked at. For compensation, we were also given $1200 USD for transportation (or a subsidized car rental), a few hundred for shipping things, and mad discounts on Microsoft products. The corporate housing is super nice and you don\'t have any roommates.',7800,'USD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,'2017-08-21T01:38:36.728Z','r543j471c27',0,0,NULL),('ck1x3b44y016x01i9g6hxaxvx','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Best internship I\'ve had so far. Company culture is great, everyone is very friendly and we had lots of fun events throughout my term. While I never intended to go or stay in QA, I loved my time at Unata, and I was definitely able to learn a lot of skills that are applicable outside of direct QA work. ',750,'CAD','weekly',5.0,5.0,4.0,5.0,NULL,0,1,'2017-08-21T03:27:45.678Z','r544j472c300',0,0,NULL),('ck1x3b44y016y01i9hwq1bn9k','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Absolutely amazing company. Everyone is extremely passionate about helping people, the direction of the company, is always willing to help you out, make sure your learning, and really strive to succeed.\n\nThe openness and friendliness of everyone are really welcoming, and the general culture is great. It\'s common to just ask anyone for lunch of coffee, even if you have no reason or connection to them, and it\'s always great learning from them or chatting.',7900,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-08-21T05:11:17.605Z','r545j111c45',0,0,NULL),('ck1x3b44y016z01i91wkm35mr','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','My expectations coming in were fairly low considering the fact that Yahoo no longer has the tech giant reputation that it once had. However, I was greatly surprised and had a great internship. Note that experiences at Yahoo are team dependent, but the general consensus among the other interns was that the internship was awesome. \n\nThe perks are cool (3 free meals, micro-kitchens with snacks, gym, VTA pass, etc), but what really makes this place great is the people. The full time employees on my team were super smart and helpful and seemed to care about making sure I learned and enjoyed my time here. I was really impressed that my team gave me meaningful projects since coming in, I was expecting to work on \"side projects\" that wouldn\'t get shipped. \n\nAgain, experiences are team dependent, but the good thing is that you can have the chance to talk to teams (just make sure to list your interested teams during the team matching stage). Don\'t let the supposed reputation fool you (even after the acquisition). Would definitely recommend an internship here!',48,'USD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-08-21T06:07:13.685Z','r546j473c57',0,0,NULL),('ck1x3b44y017001i9admg0tw4','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','You learn alot about project management and project engineering and get experience in real work the company is doing. There is not many other coop students and it can get pretty boring. Overall a pretty good internship',31,'CAD','hourly',4.0,3.0,5.0,4.0,NULL,0,1,'2017-08-21T12:37:06.293Z','r547j474c301',0,0,NULL),('ck1x3b44y017101i98teue2we','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Great place to work at. Loved the work culture and how they\'re pushing forward now. Relaxed workplace with an emphasis on getting impactful work done. Joined the company during its\' changing phase and it\'s been quite the ride.',3000,'CAD','monthly',4.0,4.0,5.0,5.0,NULL,0,1,'2017-08-21T15:52:39.626Z','r548j475c237',0,0,NULL),('ck1x3b44y017201i9cy2353o0','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Yahoo is a great place to work as an intern. The free food here is amazing, however dinner can be hit or miss. YMMV with your project, however I was given a lot of responsibility to work on my project, and implement new features. There are a lot of intern events in the Summer, including UW specific events that are also there during Fall and Winter. I would highly recommend Yahoo, especially for people in years 1 - 3. There\'s also a 6k housing stipend. ',38,'USD','hourly',5.0,5.0,4.0,5.0,NULL,0,1,'2017-08-25T21:52:41.216Z','r549j476c57',0,0,NULL),('ck1x3b44y017301i9426zejid','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Great work environment; on-site gym, bikes to use on campus, free lunch and dinner. Work was meaningful and challenging. I worked on the mobile team and was given plenty of opportunity to grow my skills and learn new things. Team is very talented and supportive as well. On top of the $7000 / month salary you also receive $1300 / month housing stipend.',7000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-08-28T05:11:36.310Z','r550j477c302',0,0,NULL),('ck1x3b44y017401i92x419vxi','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','One of the best companies to intern at in Silicon Valley. Just wrapped up my summer internship at LinkedIn\n- Interesting and challenging work.\n- Excellent mentorship and focus on employee growth\n- Some of the best meals I\'ve had\n- Multiple on-site gyms and fitness classes (Brazilian Jiu Jitsu, Kickboxing, Yoga, Bootcamps)\n- On site massages\n- Luxurious corporate housing (Swimming pools, hot tubs, large spacious rooms with balcony)\n',8000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-08-29T05:24:59.937Z','r551j193c24',0,0,NULL),('ck1x3b44y017501i9fm65dfjm','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I really enjoyed working at Zugata for a few reasons. First, the people who work there are all passionate about the product and improving it, and you easily get drawn into the culture of putting your butt on the line every time you complete a ticket. \n\nAlthough mentorship isn\'t always available as everyone is super busy, I was able to learn most of the stack on my own, and ask quick questions on slack if I ever needed help or was stuck on something. Generally, people come in whenever they want in the morning, before standup at least, and leave around 6ish, so they won\'t have you working crazy hours. Usually I stayed back later to perfect features, as I had to opportunity to work on large pieces of the application.\n\nThe kitchen is always stocked with a bunch of snacks, and lunches are catered and are restaurant quality.  Overall, I really enjoyed my term and learned a lot!',35,'USD','hourly',5.0,4.0,5.0,5.0,NULL,0,1,'2017-08-30T23:07:01.991Z','r552j478c303',0,0,NULL),('ck1x3b44z017601i9hm1i0pqq','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked summer of 2017 on the platform team.\nThe platform team really improved throughout my term to become a team that\'s quite enjoyable to work in. Work hours are flexible, and you get a lot of flexibility in your own work as well.\nFrom day 1, you\'re treated exactly the same as full time engineers, and have the same privileges as them. The work is very impactful, and you\'re encouraged to come up with your own solutions to problems that they try to solve.\nThe food, location, and coworkers are all nice. They really push you to work hard and be responsible for your work, which can make you adjust your own work hours in order to get the work done.\nThe salary could be higher to match other larger companies, as they really strive to attract talented students.',6000,'USD','monthly',4.0,4.0,5.0,3.0,NULL,0,1,'2017-08-31T06:50:41.334Z','r553j438c104',0,0,NULL),('ck1x3b44z017701i9h47zdogh','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','There seemed to be a lot of pressure to get work done while I was coop here. Lots of emphasis on billable hours since this is a consulting company. ',4000,'CAD','monthly',2.0,2.0,3.0,1.0,NULL,0,1,'2018-06-20T20:49:05.196Z','r692j574c164',0,0,NULL),('ck1x3b44z017801i96r6f9yaz','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked here in Spring 2017 as an iOS developer. Capco offers the unique opportunity of contributing to projects that will affect millions of consumers due to their position in the finance industry (clientele include all of the big banks in Canada). The work culture here is fast-paced but you\'ll have lots of support within your team, as you\'ll often work with experienced developers who are more than willing to help you out. Capco also hosts lit socials almost every week throughout Downtown Toronto that are completely covered. I guarantee your time here will be worth it.',4000,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-08-31T14:48:22.896Z','r555j479c118',0,0,NULL),('ck1x3b44z017901i9b6dyey25','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked here for four months for Chris Tharmalingam and Igor Omerasevic. This was easily the best co-op experience I\'ve had up to date. My supervisors were extremely supportive and allowed me to take on responsibilities that you would not get in most other internships. The overall culture at Capco is excellent. Everyone is supportive from top to bottom. Tom Wan, the head of the BA coops during my time was also a great mentor who was always willing to provide advice. I would recommend this co-op to anyone looking to get their feet wet in FINTECH consulting. ',4000,'CAD','monthly',4.0,5.0,5.0,3.0,NULL,0,1,'2017-08-31T15:06:04.161Z','r556j409c118',0,0,NULL),('ck1x3b44z017a01i97pb5bhy2','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Great culture, tons of smart people to learn from and hang out with. Work wasn\'t boring.',9166,'USD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,'2017-08-31T17:53:01.112Z','r557j57c7',0,0,NULL),('ck1x3b44z017b01i9b2v64eqz','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I returned to Capco for a second work term due to the positive experience I had with them in the past & I absolutely do not regret that decision! Everyone at this company has such a great mentality to \"work hard, play hard\" which is why the culture is so great. I had amazing opportunities to take on responsibility well outside the realm of a co-op student, but with great mentorship and learning capabilities. My favourite co-op experience by far and would recommend to anyone who wants real experience and amazing co-workers!',26,'CAD','hourly',5.0,5.0,5.0,4.0,NULL,0,1,'2017-08-31T18:16:44.192Z','r558j409c118',0,0,NULL),('ck1x3b44z017c01i9h6hj9xgx','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Pay was competitive, the tech stack was varied (I got to work with 3-4 languages, and a bunch of different tools) and you\'re given a lot of space to figure things out for yourself. The environment is very relaxed, work is independent. You can finish tasks at your own pace, and they\'ll have more for you when you\'re done. In addition to your personal co-op projects and adding features onto their existing stuff, you\'ll work on their automated testing/CI/CD frameworks. \n\nThe office is  quiet. The manager is a really nice guy, but often out of the office, so you\'ll have to ask the other devs for help. I struggled to do this because it\'s not clear who has the time/expertise to look at what you\'re doing. They\'re nice though, so don\'t be afraid to do ask.\n\nIt was an excellent internship and I learned a lot. Unless you have an offer from a big name US company or equivalent, I\'d seriously consider these guys.',850,'CAD','weekly',4.0,3.0,5.0,5.0,NULL,0,1,'2017-08-31T20:50:05.984Z','r560j480c304',0,0,NULL),('ck1x3b44z017d01i93heqcpax','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','At Mosaic, I worked on a Ruby on Rails application for a small period of time during my internship. There was a new React Native project starting up, so I got to work on the initial stages of the project. I also did Scrum work, so I had a nice balance of dev and business work, which was great for me. The people I worked with were great, and very helpful. The hours were flexible, which I also liked very much. Overall, an amazing experience for me.',4000,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-09-02T00:07:32.952Z','r561j481c305',0,0,NULL),('ck1x3b44z017e01i9fh574qcc','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked on the search team at A9. Lots of very important, and very interesting work going on. Pay is also top notch ($8,475 + $3,500 housing stipend per month). Mentorship could have been better. My project was something I was not very interested in, but I learned a lot regardless.  ',11975,'USD','monthly',4.0,4.0,5.0,5.0,NULL,0,1,'2017-09-02T03:29:40.413Z','r562j482c1',0,0,NULL),('ck1x3b44z017f01i9adlj3dv3','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked there from May to September 2017. InFlight has great culture and the work you do directly affect the client so it\'s pretty meaningful. You get a team lunch every Thursday. The internship is the best I\'ve had so far. ',23,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-09-03T14:51:46.029Z','r563j483c306',0,0,NULL),('ck1x3b44z017g01i91lqf789n','2019-10-19 04:56:45.467000','2019-11-27 20:36:01.765000',0,'ck1n1du49000501jo4pwygsav','I worked as part of the IoT/AI team from the 120 Bloor Location at IBM. Mostly built PoCs relating to IoT throughout the work term. Got to learn a lot as I was using cutting edge technologies involving AI (Computer Vision). The team was really small (3 co-ops) so we did a lot of fun activities together throughout the term. Work/life balance was great (super flexible hours). Overall a great experience!',-1,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-09-11T03:28:53.635Z','r564j484c84',0,0,NULL),('ck1x3b44z017h01i94oi1hczf','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Internship greatly exceeded my expectations. There were a lot more perks than I was expecting and the full times on my team were great. The experience does seem to vary based on which team you are placed in (luckily I had an amazing team). Additionally nice if you are a Canadian or UWaterloo student as there is additional mentorship available from grads that work at Yahoo (about investing, building credit, etc). Work is not super meaningful (hence 4 out of 5), but still more interesting than other places I\'ve interned at.',38,'USD','hourly',5.0,5.0,4.0,5.0,NULL,0,1,'2017-09-15T01:13:46.662Z','r565j485c57',0,0,NULL),('ck1x3b44z017i01i9d4ing7wf','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked at Heap both summer 2015 and summer 2016. The listed salary was for my first summer when I was a sophomore. My experience at Heap was amazing. I was not treated like an intern, I was treated like a full-time employee who happened to be there for only three months. I was given a much-desired feature to work on, as well as working on the team with their goals. I was expected to be as productive as someone who\'s been in industry for many years, but was also given the resources and mentorship necessary to make that possible. My experience at Heap was so amazing that I returned for a second summer and then joined full-time after graduating.',6500,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-09-19T19:48:59.262Z','r566j486c307',0,0,NULL),('ck1x3b44z017j01i9clsma4xa','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Great work environment. Mentors are very smart and you\'ll learn a lot. All the code you write will be useful/shipped, though the difficulty of the work varies based on what they need to get done.',30,'CAD','hourly',5.0,5.0,4.0,5.0,NULL,0,1,'2017-09-21T14:22:29.362Z','r567j487c61',0,0,NULL),('ck1x3b44z017k01i91b2433q1','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Interned here during Summer 2017, during the acquisition. Work was a lot of fun; got to work on a meaningful project and design/implement it from start to finish. Mentors were really helpful and patient.\nNot sure how the acquisition will change the culture... after becoming Oath things seemed to have a more corporate overtone, but the work I was doing was not impacted and there was still free food, so I can\'t take anything away for that.',38,'USD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-09-23T13:50:14.215Z','r568j476c57',0,0,NULL),('ck1x3b44z017l01i94r5d0fe2','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Lots of work to do :( \n\nAccounting for the overtime + rent costs, I\'d say this internship wasn\'t worth it for me.\n\nYMMV',4800,'USD','monthly',3.0,4.0,3.0,1.0,NULL,0,1,'2017-09-23T22:13:34.382Z','r569j206c170',0,0,NULL),('ck1x3b44z017m01i9dh23811v','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','PROS:\n\n-Management is good, no personality issues\n-100% project ownership: you can do things the way you think is good and you don\'t face a lot of resistance\n-You are almost always left to work in peace, meetings are minimal\n-Kitchener is close to Waterloo, you can still enjoy student life.\n-Communitech is nice\n-Pay is quite good\n\nCONS:\n\n-You work for the government. This sometimes entails some extremely boring meetings where no one knows what they are talking about. I\'ll emphasize that this is rare but it\'ll probably happen once or twice during a coop term based on the way they decide to take on projects.\n-LONG PERIODS OF BOREDOM. This is the biggest con. Sometimes you complete a project, and you won\'t have another one to do. You will end up reading reddit and grinding leetcode questions for a week or two.\n-Not really hardcore technical. If you\'re a really big computer science nerd and are hoping for difficult and interesting problems, you will be disappointed. Most tasks involve very standard problems and solutions.',4400,'CAD','monthly',3.0,1.0,3.0,5.0,NULL,0,1,'2017-09-24T01:19:44.025Z','r570j488c212',0,0,NULL),('ck1x3b44z017n01i9blkc1gn3','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I think the biggest thing about working at Wave was the type of people you work alongside with. Some of these people were among the early people who helped bring computer science to where it is today. I have learned a lot just having conversations with them now and then, and they are always willing to have a chat with us interns. My supervisor was very respectful of my abilities, so were every other person I worked with. The higher ups always had an open ear to my suggestions on various things, and they actually followed through with most of them.\n\nThe work itself was really fun as well, it\'s hard to find places that solve challenges as complex as the one Wave is solving. This is a place where your work is valued a lot since it actually matters.\n',5000,'USD','monthly',5.0,4.0,5.0,5.0,NULL,0,1,'2017-09-24T13:24:08.327Z','r571j489c308',0,0,NULL),('ck1x3b44z017o01i9115s5q8s','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','just ok, nothing special',3500,'USD','monthly',3.0,3.0,4.0,2.0,NULL,0,1,'2017-09-24T18:58:02.729Z','r572j490c309',0,0,NULL),('ck1x3b44z017p01i9f1v104dd','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Salary doesn\'t include the 1500 after-tax housing stipend. Nice.\n\nNot the most exciting job, and the perks are a little poor compared to other companies (catered lunches happen very infrequently, no gym stuff, etc.). Those things aside, it\'s still a decent place to work overall.',6933,'USD','monthly',4.0,5.0,4.0,5.0,NULL,0,1,'2017-09-25T16:53:31.633Z','r573j491c152',0,0,NULL),('ck1x3b44z017q01i93mdl2lhn','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked there Summer 2017.\n\nThe company was going through very fast paced growth while I was there, with numerous new hires being made both on the engineering and business side of things.\n\nThe overall culture was great, with a lot of fun events happening throughout the summer. The people there were all nice and supportive and the company was full of incredibly smart engineers primarily from MIT.\n\nBoston is also a really fun place to be in the Summer. The entire city is basically within a 1 hour walking radius, and there\'s cheap and efficient public transportation. I really enjoyed my time there and I\'ll probably cherish the unforgettable experience I had in Boston forever.',4000,'USD','monthly',5.0,3.0,3.0,5.0,NULL,0,1,'2017-09-25T18:53:51.063Z','r574j492c310',0,0,NULL),('ck1x3b44z017r01i9hn9735g7','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked there for my first internship. Everyone helped me even though I didn\'t know much. Teams are flexible with letting you work on what you want.',700,'CAD','weekly',5.0,5.0,4.0,5.0,NULL,0,1,'2017-09-25T22:56:44.268Z','r575j493c311',0,0,NULL),('ck1x3b44z017s01i94ok153e3','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Mentorship and work/life balance were great. Work was not that meaningful because I was assigned to a product that no one ever heard of and I was working on an intern project (meaning my work probably end up in the garbage right now). The intern events are probably the best out of all the big companies. Microsoft invited Daya and the Chainsmokers to perform in front of 2,000+ interns and gave out free xbox one to every intern. Overall, it\'s a very big company and your experience varies drastically depending on what team you are assigned. HR is also flexible on switching team/organization for your next co-op, though sometimes they are very unresponsive and unhelpful.',7200,'USD','monthly',4.0,5.0,2.0,5.0,NULL,0,1,'2017-09-26T14:58:54.669Z','r577j495c27',0,0,NULL),('ck1x3b457017t01i9dnbg7mva','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked for Finastra as a software developer intern for one of their financial software applications. This was my first co-op, and for a first co-op (or a first dev job, really), it\'s an excellent opportunity. I got to use new, up to date technologies, learn a LOT of stuff, and pay was fair especially for a first job--technically, I only needed to work 6 hours on my work, and 2 hours on whatever I wanted to learn (didn\'t have to be related to the work at hand). Overtime was never mandatory (and always unpaid). My boss and co-workers were extremely helpful, and I had a lot of freedom on which problems to tackle in the code. The job would not be particularly challenging for those who already have dev experience, but it was an excellent job for someone who lacked experience.',19,'CAD','hourly',4.0,5.0,4.0,5.0,NULL,0,1,'2017-09-27T19:05:10.594Z','r578j496c313',0,0,NULL),('ck1x3b458017u01i96af25frh','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','My best internship so far! I got to work with very talent people and work on impactful features. The leadership team is also amazing!\n\nSome cool perks:\n* Monthly hack-days\n* Monthly company socials (bowling, paddle-boarding, escape room, arcade, etc)\n* Backstage pass for budwesior stage & echo beach\n* Free music festival / concerts tickets\n* Standing desk + 4k monitor\n* Protein bars',1325,'CAD','weekly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-09-28T00:35:12.022Z','r579j497c314',0,0,NULL),('ck1x3b458017v01i95nq2d1te','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Depending on what kind of work you\'re put on, your experience might be great or terrible. Some people are staffed on extremely mundane projects dealing with Oracle, SAP or other kind of software packages, while others are staffed on interesting & creative projects. \n\nThe culture at Deloitte is very go-getting. If you put the effort in to put yourself out there you will be able to pickup cool side projects (PRD) and network with a lot of people. Be careful not to overextend yourself as it is easy to fall into working 9-11 hours a day. \nThere is a tiny bit of a fraternal culture at Deloitte, but it\'s relatively under-the-table (and they are doing a lot of work on diversity programs etc), but it does exist to some degree. Other than that, the people are generally really cool and down to earth. \n\nIt\'s important to note that as an organization Deloitte is a consulting firm first and a technology firm second. ',3500,'CAD','monthly',3.0,3.0,3.0,2.0,NULL,0,1,'2017-09-29T00:01:27.898Z','r580j498c135',0,0,NULL),('ck1x3b458017w01i9gw7h4hsh','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','This was my first co-op, so I\'m grateful to have had the chance to work for a startup that did some really cool things with security, data mining, and machine learning. That said, despite receiving an offer for software development, I was placed on the QA team where I was far removed from the core software product and big data algorithms. My manager was not a coder and I did not receive the technical mentorship I needed. As a result I felt that my growth as a student there was very limited.\nThat said, Interset is still a solid company to work for provided you\'re placed in the right team to make an impact. The office is in Kanata which can be quite dull as there\'s not that many lunch options nearby and the whole area lacks the youthful vibrancy of other tech communities. ',3340,'CAD','monthly',3.0,2.0,2.0,5.0,NULL,0,1,'2017-10-06T05:31:48.922Z','r582j499c186',0,0,NULL),('ck1x3b458017x01i91ny1hwoj','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Summer 2017 (May - Aug)\nHighlight: They really care about your mentorship and you as a person in all aspects!\n\nI worked on the iOS team without any previous experience in mobile at all, and everyone I spoke to made it very clear that doing something that you don\'t have experience in is completely and totally fine - and actually encouraged. In theory a lot of companies do the same, but in practice very few actually do that. Each person I spoke to have some crazy background story, like they were homeless for a few months and then biked across the USA for charity or studied food tasting science and then decided to go into data science. That made being there really interesting, and the company tries to be very transparent and very human all around. The perks and compensation were also top-tier with a culinary team that is part of the company for the sole purpose of making healthy yet delicious food for the employees. There used to be corporate housing until they decided that interns get taxed a lot because of this, and just added it to the salary instead so now they just help you extensively look for housing.\n\n',9166,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-10-06T19:33:25.303Z','r583j57c7',0,0,NULL),('ck1x3b458017y01i90x1h6eh3','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I was a developer in my second year at PointClickCare. Pay was okay (above engineering average but not by much). Culture at PointClickCare was very good. Big open office, subsidized meals, free on-site gym, lots of recreational activities.',22,'CAD','hourly',5.0,5.0,4.0,5.0,NULL,0,1,'2017-10-10T15:43:12.123Z','r584j500c315',0,0,NULL),('ck1x3b458017z01i91qhvcswb','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked there Spring term of 2017. The company is growing extremely quickly and hiring lots of people, so it\'s a bit of a chaotic workplace. Things were beginning to improve by the time I left but still not what I consider great. Work itself was okay, not very challenging; none of the teams they hire interns for deal with very interesting technical problems. \n\nPeople are all very friendly and chill. Lots of food, drinks and snacks. Free lunch, and usually there\'s leftovers you can save for dinner. They have ping pong, foosball, Wii U and PS4. ',25,'CAD','hourly',3.0,3.0,3.0,4.0,NULL,0,1,'2017-10-11T14:54:19.475Z','r585j501c316',0,0,NULL),('ck1x3b458018001i9h6tu3bbg','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Mainly did web development. Small office, very small team, very low pay.',2400,'CAD','monthly',2.0,1.0,2.0,2.0,NULL,0,1,'2017-10-16T18:33:50.254Z','r586j502c317',0,0,NULL),('ck1x3b458018101i9dibsdsqw','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Working at Encircle was a great co-op experience. I worked with the server, front-end, and mobile code even when I didn\'t have a ton of experience in those areas. All of my code was code-reviewed so I was able to improve my programming abilities. Additionally, productivity is measured by the tasks you finish rather than the time spent. This is not only a more sensible method of measurement, but it improves motivation to finish tasks, and allows for more flexible work hours. The entire team was very friendly and approachable. I would highly recommend working at Encircle if you want to learn a lot.',1100,'CAD','weekly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-10-21T20:18:00.642Z','r587j290c209',0,0,NULL),('ck1x3b458018201i9dx8shy3p','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked there as part of the first batch of uWaterloo interns hired by Zuora in the summer of 2017.  The work I was given was meaningful and challenging.  The company itself is growing very fast but still maintains a very personable startup culture, which is definitely unique even in the valley.  The snack bar is amazing as well as the catered lunches every now and then. The one con I will say though is that the pay is not very competitive and there is no financial assistance for relocation or housing.  This might be partly due to inexperience in hiring students from Canada, so hopefully that will change in the future.  Overall a very enjoyable internship!',30,'USD','hourly',4.0,4.0,4.0,5.0,NULL,0,1,'2017-10-23T02:43:26.641Z','r588j503c318',0,0,NULL),('ck1x3b458018301i91756as6y','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Had a wonderful experience at Magmic -- the team was small but everyone knew and were comfortable with each other. I worked on really meaningful projects while I was there -- like their server that handled hundreds of thousands of users.\nMy Supervisor was amazing as well and went out of his way to help and teach me along the way when I needed it while still allowing me to be independent and learn/implement things on my own.\n',2800,'CAD','monthly',4.0,5.0,4.0,4.0,NULL,0,1,'2017-10-24T23:43:42.708Z','r589j504c319',0,0,NULL),('ck1x3b458018401i97ajd2tsa','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked as a Data Scientist in the Consulting division.  Got to work under an incredibly smart supervisor, however much of the work revolved around Business Intelligence and building client dashboards.  Culture is weak, as people vanish for weeks at a time at client sites and little mentorship as people are working on 3-5 projects at a time.  PwC does offer classes to improve skills which is extremely good for a co-op. Opportunities to work from home, typical 9-5 with flexible hours',4125,'CAD','monthly',3.0,3.0,2.0,5.0,NULL,0,1,'2017-11-01T20:19:51.624Z','r590j505c272',0,0,NULL),('ck1x3b458018501i93x2k9w0q','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','A co-op farm.  No valuable experience is gained from the internship.  If you are a co-op student at uWaterloo, I strongly recommend to not rank this job.  All day is spent reviewing tax forms from farmers. DO NOT PROCEED',2025,'CAD','monthly',1.0,1.0,1.0,2.0,NULL,0,1,'2017-11-01T20:21:44.737Z','r591j506c253',0,0,NULL),('ck1x3b458018601i98p152848','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Interned during the summer of 2017. I was on the Google Help/Feedback mobile team (iOS) and had two semi-independent projects throughout my term, both of them fully launched! I also got to do a large amount of backend development despite being hired as an iOS developer. The office culture was very laid back, and my host/team was very helpful during the entire internship. Not included in the salary is a $9000 relocation bonus at the start of the internship.',6667,'USD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,'2017-12-16T18:51:27.845Z','r607j518c17',0,0,NULL),('ck1x3b458018701i91v77bmcl','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','It was alright overall, but the product is kinda boring and Hootsuite doesn\'t seem to be doing anything very interesting tech-wise. The people were nice and supportive tho. Good for your first three coops maybe. Also they kinda cheap out with housing stipend and salary.',4000,'CAD','monthly',4.0,4.0,2.0,5.0,NULL,0,1,'2018-02-09T16:15:06.725Z','r623j521c111',0,0,NULL),('ck1x3b458018801i91pu975ah','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Great company with a fantastic environment to learn and grow as an engineer. I was given opportunities to work on high impact projects and the culture there was amazing.',35,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2018-02-10T16:41:58.157Z','r624j528c40',0,0,NULL),('ck1x3b458018901i932wwaimk','2019-10-19 04:56:45.467000','2019-11-27 20:35:05.693000',0,'ck1n1du49000501jo4pwygsav','I worked at Linamar in Fall 2016. My position there was really an entry level mechanical design and manufacturing position. Although the pay was extremely low (16.67/hr), the experience I got from the position really improved my co-op career. In my position, I started off with some menial officework (documentation and other paperwork), and in the 2nd month started drafting work in Solidworks. The first two months were really boring, but the exposure to Solidworks was a good formative experience. After this, I started doing far more interesting work, which involved designing fixtures for CNC machines, which included figuring out what the purpose of each part was, actually designing them, and then getting quotes for the parts and having it made. This portion of the job was a great experience and gave exposure to both the technical and business sides of things. In my opinion, YMMV depending on which facility you are in, but it does seem that this co-op position provides some good opportunity if you\'re willing to put some effort in. Be aware that the position is  fast paced since it is a manufacturing environment, and pretty much means you must be there from 8-5, no exceptions.',17,'CAD','hourly',4.0,4.0,3.0,3.0,NULL,0,1,'2017-11-02T06:26:17.378Z','r593j508c321',0,0,NULL),('ck1x3b458018a01i95ilk4wan','2019-10-19 04:56:45.467000','2019-11-27 20:34:12.354000',0,'ck1n1du49000501jo4pwygsav','I was at ATS in Summer 2017, and I found it to be a worthwhile co-op. The position gave me great exposure to Solidworks modelling practices as well as good experience in mechanical design, including dimensional tolerancing and weld specification. Towards the end of my term, I was able to do some interesting static FEA work on weldments, which was certainly the highlight of my term. In my particular position, I felt that I was not given much design work until the 3rd month of the placement, which was unfortunate, but this may be different depending on the work the company has at the tine of a placement. As for the company itself, there is a cafeteria in each building with reasonably priced meals (~$7 for lunch), but no amazing perks. They do give free ice cream every payday (biweekly) and basically everyone goes for a 15min walk in the morning and afternoon around the buildings, which are a nice break from work. People are nice and hours are fairly flexible. Wish they had better coffee though lol. This is a great intermediate-senior mechanical design position, and if you pursue it,  try to ask for more and more technical work, because the company has a lot of opportunity for co-ops in that regard, if your manager is willing to give that to you.',23,'CAD','hourly',4.0,4.0,4.0,4.0,NULL,0,1,'2017-11-02T06:37:44.650Z','r594j509c322',0,0,NULL),('ck1x3b458018b01i9g82y4ixn','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked as a front-end developer intern for Fall 2017. The people and environment are really nice and I had a great term here. You get treated like a full time member of the team rather than an intern. Nice office, catered lunches mon-thurs',30,'CAD','hourly',4.0,5.0,4.0,5.0,NULL,0,1,'2017-11-03T20:07:21.803Z','r595j510c40',0,0,NULL),('ck1x3b458018c01i91nt239as','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Did my second co-op here and overall it was pretty alright. Learned a lot of Angular and TypeScript so that\'s great. I just felt like my team lead wasn\'t very interested in helping/dealing with the interns. Maybe I\'m reading too much into it but he always seemed irritated when I asked questions and gave very vague answers so I ended up mostly working on my own. The work was interesting though so 3/5 would recommend.',19,'CAD','hourly',3.0,2.0,3.0,4.0,NULL,0,1,'2017-11-03T20:11:05.295Z','r596j354c224',0,0,NULL),('ck1x3b459018d01i96k3z76j5','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I did my first coop here so for a starting position it was really good. Got to play around with new technologies and the work wasn\'t stressful. My team was 4 people with one other coop and the manager didn\'t program so there was a lot of confusion to start. I feel like I didn\'t get good mentorship/support but everyone was super friendly and I figured stuff out on my own so it all worked out alright in the end.',19,'CAD','hourly',3.0,2.0,2.0,5.0,NULL,0,1,'2017-11-03T20:14:40.711Z','r597j235c189',0,0,NULL),('ck1x3b459018e01i9hctu6jua','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Was a part of the \"Innovation Team,\" your experience may be different for other teams. Basically just a team of co-ops. Worked on a bunch of different projects mostly for internal use, nothing user-facing. Pushed most things directly to dev, no code review or QA, no mentorship. ',21,'CAD','hourly',2.0,1.0,2.0,3.0,NULL,0,1,'2017-11-04T04:10:24.755Z','r598j511c323',0,0,NULL),('ck1x3b459018f01i9887y4q1p','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Great co-op culture, there\'s a good portion of co-op students who are not from Waterloo. \n\nOne of the downsides of working here is that most of the work involves a lot of coding and scripting. I had to be proactive and ask for electrical related work.',982,'CAD','monthly',4.0,4.0,3.0,5.0,NULL,0,1,'2017-11-06T15:06:42.847Z','r599j512c324',0,0,NULL),('ck1x3b459018g01i97ffjfvt1','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Connected Lab is a gem in the Toronto tech scene.  Although it\'s still really young, the company has partnerships with some of the top tech companies in the industry, and it\'s super cool getting to work on these products.  It\'s worth mentioning that the company really believes in pair programming - it definitely has its pros and cons (mentorship with full times and great learning opportunity but more tiring).  Overall it was an amazing internship and I definitely recommend it!',20,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-11-06T19:52:03.155Z','r600j513c325',0,0,NULL),('ck1x3b459018h01i95wsiavo4','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Really great work environment (can only speak for the Core team), and awesome people to work with. But as expected, the actually work of manual testing wasn\'t that great. ',17,'CAD','hourly',4.0,4.0,2.0,4.0,NULL,0,1,'2017-11-06T21:43:26.173Z','r601j514c279',0,0,NULL),('ck1x3b459018i01i91nznfmg8','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked with one department on one project for the duration of the co-op term. Was provided a lot of independence in my roles & responsibilities, with many degrees of freedom in my research. ',3246,'CAD','monthly',3.0,1.0,3.0,5.0,NULL,0,1,'2017-11-06T22:27:56.975Z','r602j515c70',0,0,NULL),('ck1x3b459018j01i90kcth5de','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Extremely fun and meaningful work.\nWorked at Cardiogram when there was only 4 fulltimes.\nYou get to work on everything and anything that fulltimes work on. The team and cofounders are extremely talented and approachable.\nFood is great, usually restaurant food, or Uber eats and awesome drinks and snacks.',8250,'USD','monthly',5.0,4.0,5.0,4.0,NULL,0,1,'2017-11-07T21:55:35.478Z','r603j516c326',0,0,NULL),('ck1x3b459018k01i92q4sai4j','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Honestly, it wasn\'t the most exciting work. They did offer a one time relocation stipend to help with moving.',23,'CAD','hourly',3.0,4.0,3.0,5.0,NULL,0,1,'2017-11-07T23:59:17.135Z','r604j197c84',0,0,NULL),('ck1x3b459018l01i9atf57lai','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Product is extremely dumb and it\'s hard to be motivated working for it. Codebase is decade old and most of it is using ancient technologies; you\'re basically given grunt work that\'s left in the backburner. Company morale is low and turnover rate is high. Pay is alright, but it\'s one of the few things going for it. Co-workers are nice, however, and generally resourceful. ',4400,'CAD','monthly',2.0,3.0,1.0,2.0,NULL,0,1,'2017-11-15T23:46:50.197Z','r605j517c327',0,0,NULL),('ck1x3b459018m01i98jbcfu22','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Hard work, challenging project. Rewarding + Great Mentorships',10000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2017-12-07T11:12:53.621Z','r606j2c42',0,0,NULL),('ck1x3b459018n01i9dqtr2ngs','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Great team atmosphere, get to work on meaningful projects.',18,'CAD','hourly',5.0,4.0,5.0,4.0,NULL,0,1,'2017-12-23T16:02:35.305Z','r609j519c328',0,0,NULL),('ck1x3b459018o01i9bwvb1tg8','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Pros:\n  - Interesting work and projects that you can take complete control over\n  - Projects are big in scope but move quickly so you work on multiple per term\n  - The ability to experiment and try out new tech if there\'s a use case for it (e.g. Elastic Search, Redis, Rust, etc...)\n  - Ping pong, Foosball and a Basketball Court as well as a culture that actually lets you use them during the day\n  - Pretty sick looking workspace\n  - Free shirt and sometimes free food in the cafeteria\n\nCons:\n  - Sometimes head office process\' gets in the way and this can either affect the velocity of a project or forces you to get creative to solve otherwise very simple problems \n  - Not very Agile (if you\'re in to that)\n  - Most of the tasks and projects involve very standard solutions. (i.e. you won\'t need a lot of well defined algorithms in the application you build)\n\nOverall I really enjoyed this work term. It allowed me to become proficient with Node.js, React and Azure as well as giving me exposure to things like Blob Storage, Redis and elastic search. With the excellent management it really is an amazing choice.',4400,'CAD','monthly',4.0,4.0,4.0,5.0,NULL,0,1,'2017-12-25T02:17:43.292Z','r610j520c212',0,0,NULL),('ck1x3b459018p01i97bsa9fbf','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','...',3200,'CAD','monthly',3.0,3.0,3.0,2.0,NULL,0,1,'2018-01-06T03:46:26.475Z','r611j521c111',0,0,NULL),('ck1x3b459018q01i971ko4c0j','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','They gave me an interesting and impactful project and all the resources to get it done. In hindsight I\'d rather have worked on something else but they did everything they could to accommodate me. I never felt pressured by any deadlines and my coworkers were all super nice.\n\nYou get free dinner every day and free lunch on Wednesdays. They also paid for flights to-and-from Waterloo.\n\n',7500,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2018-01-09T21:36:52.281Z','r612j522c60',0,0,NULL),('ck1x3b459018r01i9gsohfis8','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','do NOT work here.\n\nFirst of all, they pressure you to come to work early and stay late. On the contract and in the interviews, they say that it\'s a 9-5 job, but realistically, it\'s at least 8:30-6:30. To give you an idea, one of the coops left at 5:30 in the first week and got called out by the CEO who happened to be by the door. We weren\'t even doing anything that first week other than some warmup coding exercises. Needless to say, no one wanted to be the first to leave, resulting in sad kids staying WAY past their designated hours because they\'re all pressured to stay and pressured to not look bad for the next four grueling months.\n\nAdditionally, the office is tiny. Smaller than a classroom on the 4th floor of MC. It\'s as big as a 3-bedroom suite that you would find off-campus, and imagine fitting in ~20+ employees (including co-ops). The kitchen is also small enough that it\'s literally a fridge, a sink and a counter that fits a microwave on top. You would literally be unable to fit 3 people in the kitchen all together at one point in time. There are absolutely no perks and you are expected to work during weekends too. The only thing that the office spent their money on was probably their blinds. No amount of sunlight got in the office and added to the depressing atmosphere.\n\nFurthermore, they say that they pay the average amount according to CECA numbers. But that is for a 37.5 hour work week. They pay you biweekly, so doing the math with the hours that I had stated above, you would be earning < 15/hr for work that should be worth more based on how badly the company needs it. Their product is just starting to get off the ground and it will be hell for people working here in Winter/Spring 2018. (read, stay past 6:30)\n\nSo in conclusion, do NOT come here unless you are ABSOLUTELY desperate. They hired 7 software interns and their fulltime team has 2 backend developers and 1 front-end developer. The coops had to code a majority of their backend, so you can imagine how fun it\'ll be to work with that. Already by the first few weeks, us group of coops were all regretting taking this offer, because literally any other company would at least let you leave before 6:30pm without feeling guilty.',1400,'CAD','monthly',1.0,1.0,1.0,1.0,NULL,0,1,'2018-01-14T03:51:11.776Z','r613j463c297',0,0,NULL),('ck1x3b459018s01i9azas8vl1','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','$200 for bike, $100 /month for other housing\n$1800 per month for housing,\ncan work lot of overtime if you want/manager approves.',37,'USD','hourly',4.0,3.0,3.0,2.0,NULL,0,1,'2018-01-14T04:20:32.492Z','r614j119c30',0,0,NULL),('ck1x3b459018t01i95emr1bdf','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Technically is supposed to be ~$6500 per month but they make you work lot of overtime and you rack up those hours (~$8000)',40,'USD','hourly',5.0,4.0,5.0,1.0,NULL,0,1,'2018-01-14T04:25:56.359Z','r615j523c329',0,0,NULL),('ck1x3b459018u01i9ce3o9ml4','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Company culture is great. There are 4 co-ops (2 fullstack, 1 mobile, 1 designer) each term. You get to take complete ownership with other co-ops and build projects from the ground up and learn pretty much whatever tech you want.\n\nThe pay is fixed at $1100 which is a really good opportunities for lower years to earn more.',4400,'CAD','monthly',5.0,1.0,5.0,5.0,NULL,0,1,'2018-01-17T05:14:20.845Z','r616j488c212',0,0,NULL),('ck1x3b459018v01i9cp3d0cx5','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Typical startup company, where everyone is pretty much expected to work 40+ hours/week to meet deadlines. Great company culture, had a great time being able to get to know everyone. Also were happy to help me with anything.',728,'CAD','weekly',4.0,5.0,4.0,3.0,NULL,0,1,'2018-01-19T20:01:55.784Z','r617j524c311',0,0,NULL),('ck1x3b459018w01i9gx0l3yv3','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Working at Communitech is great. It\'s probably been the most enjoyable co-op term in terms of the environment. Being the only mobile developer, you\'re kind of alone which could be both a good and bad thing. If you\'ve done any sort mobile development before and you\'re comfortable holding your own then you get to take full control of the mobile projects. On the other hand, there isn\'t too much mentorship on the mobile side.\n\nWe had more web apps to work on in my term so I learned a great deal about web development which was great. This openness is not just for the mobile developer but we had a full-stack developer work on an Android project so there is lots of freedom to work with technologies you\'re interested in learning about.\n\nThe worst part about the work is that sometimes it gets slow between projects but a lot of it is because head office slows things down and the work in the pipeline can get changed.\n\nOverall, the culture is amazing and every innovation lab should strive to have this culture and it seems you get paid more here than other companies around Communitech so it\'s a great place to work.',4400,'CAD','monthly',4.0,2.0,4.0,5.0,NULL,0,1,'2018-01-20T21:40:53.999Z','r618j525c212',0,0,NULL),('ck1x3b459018x01i912jbb5xn','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','It largely depends on your team but my work was not very interesting. My team had very little guidance and mostly consisted of 16 month interns from other schools. We were actually entirely trained by the previous year\'s interns during a 4 month overlap, we rarely saw a full time employee on our team.',850,'CAD','weekly',2.0,2.0,2.0,4.0,NULL,0,1,'2018-01-23T02:01:44.836Z','r619j526c84',0,0,NULL),('ck1x3b459018y01i95oei764x','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked at Uber during Fall \'17. I thoroughly enjoyed my time there. I went to Uber as I had consistently heard from previous interns that they got really impactful projects. I was not disappointed - I could actually show off my work to my friends and family! There have been a lot of changes since some of the negative press that the company has received. Under the new leadership, the company is on an upward trend. Also, dinners are at 7pm now. ',46,'USD','hourly',5.0,5.0,5.0,4.0,NULL,0,1,'2018-01-23T02:41:51.261Z','r620j38c52',0,0,NULL),('ck1x3b459018z01i93jvubx77','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Symbility is an agency that works on strategy, design, and development projects for clients such as the LCBO.\n\nLots of smart people that you\'ll learn great things from.',920,'CAD','weekly',5.0,5.0,5.0,5.0,NULL,0,1,'2018-01-26T05:10:36.303Z','r621j527c330',0,0,NULL),('ck1x3b459019001i908tn392l','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','plenty of voluntary overtime work. experience is worth it.\nhaving beach is nice, great manager.',24655,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2018-01-31T00:51:22.373Z','r622j2c42',0,0,NULL),('ck1x3b459019101i91avf5xxw','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','My internship with Interset was great thanks to fantastic mentorship and challenging/interesting work there. I\'ve had the opportunity to work on high impact tasks \n and build up a set of skills in the area of my interest. The company culture was a 10/10 with flexible work hours/team bonding events/etc.',21,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2018-02-10T16:54:04.400Z','r625j529c186',0,0,NULL),('ck1x3b459019201i94jcue6fr','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Pros: Good culture, socials are fun on Fridays, interns are treated as full times with similar responsibilities. Pair programming is practiced rigorously which may be a pro/con depending on the type of person you are.\n\nCons: Low pay, long hours (9-6 not including overtime which is unpaid but isn\'t too common). Also, depending on your project (can very greatly), may be stuck with something boring for many weeks/months.',2800,'CAD','monthly',3.0,3.0,4.0,2.0,NULL,0,1,'2018-02-27T03:59:25.393Z','r626j211c173',0,0,NULL),('ck1x3b45a019301i9dbwl706p','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Interned with Yahoo Finance. Great mentorship, learned a lot of new technologies and given impactful projects featured on the homepage. Manager was very involved with making sure I was working on things I found interesting and overall had a great time with great perks. Corporate culture could be improved - team was a bit boring but all in all a fantastic learning experience.',41,'USD','hourly',4.0,5.0,4.0,5.0,NULL,0,1,'2018-02-28T06:03:36.702Z','r627j108c57',0,0,NULL),('ck1x3b45a019401i98t4ob55z','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Good for earlier coops.',4400,'CAD','monthly',4.0,4.0,4.0,5.0,NULL,0,1,'2018-03-01T00:33:06.825Z','r628j530c71',0,0,NULL),('ck1x3b45a019501i94brq23ck','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I had great mentorship and social experience at the company. I feel that the work could be more meaningful (I didn\'t get into the team I wanted), so that could be the reason I found the work somewhat lacking.',7500,'USD','monthly',4.0,5.0,3.0,5.0,NULL,0,1,'2018-03-01T03:36:47.413Z','r629j531c166',0,0,NULL),('ck1x3b45a019601i92q8z89pg','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked there in Fall 2017. Environment was super hyped and everyone is happy to help you with anything. Company covers your moving cost, and half of your housing. Catered breakfast and lunch are provided, and they are indeed fascinating and tasty.\nGood:\n  - You\'ll be assigned with a mentor, and usually have a weekly checkup.\n  - Intern retreats, and sometimes team offsite.\n  - Good working environment where you can make a lot of friends in your field.\n  - Pay is good.\n\nEhhh:\n  - Ottawa is just not for me, I felt kind of bored. But with all the interns it was not that bad.\n  - I joined in a special time when everyone is pressured with releasing date. Do expect some overtime.',5200,'CAD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,'2018-03-05T04:38:28.119Z','r630j305c40',0,0,NULL),('ck1x3b45a019701i98vm9etkp','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked at Innovation team in 2017 which you probably will build prototypes. If you\'re lucky you might stick with one project for the whole term.\nPros:\n- People are really helpful when you have questions for them.\n- Took a super interesting project that term. Built it from scratch, and learned lots of stuff.\n- Work env is very chill. There was no rushing and fast due dates, as long as you take your time learning stuff.\n- Able to get in touch with lots of new-born technologies, and learn from scratch how things work.\nCons:\n- Mentorship is not good. Supervisor did know lots of stuff but there\'s no regular checkup, nor code review, which is super important for your learning. Not sure if they changed it or not.\n- Internal technologies were old, and lots of things need to be changed and improved. Hard to get started due to lack of documentations.\n- Location is not bad but also not good. Looking for food is kind of hard even compared with Waterloo (at least there\'s plaza for us). Also they don\'t have free pop... :(\n\nOverall, a really nice place for the first couple coop terms!',3300,'CAD','monthly',4.0,3.0,4.0,5.0,NULL,0,1,'2018-03-05T04:47:19.968Z','r631j511c323',0,0,NULL),('ck1x3b45a019801i99egy0psc','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','While a solid tech company to work for overall, your experience at Shopify is largely dependent on which team you\'re placed on. Shopify is also a great launchpad is you\'re looking to coop in the states next.',4800,'CAD','monthly',3.0,1.0,3.0,5.0,NULL,0,1,'2018-03-07T03:32:51.966Z','r632j532c40',0,0,NULL),('ck1x3b45a019901i95203fts0','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Hubdoc is an amazing start-up to work for in your earlier coops. A talented and hardworking group of people make it a very enjoyable and exciting place to work for. Everyone is super nice and you\'ll learn a lot during your coop term, as well as provide significant, tangible impact to the company. Would 100% recommend to anyone looking to work in a startup environment!\n\nPerks: Lots of free snacks and drinks, catered lunches once a while, team outings\n\nCons: They pay a bit above the Waterloo coop salary average, no commuter pass. The work, while meaningful, can get repetitive after some time.',21,'CAD','hourly',5.0,4.0,4.0,5.0,NULL,0,1,'2018-03-07T03:37:35.293Z','r633j533c331',0,0,NULL),('ck1x3b45a019a01i9cc1y4pcj','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I did a lot of R&D work with new technologies. The experience you get really depends on your manager/team that you get to work with. There isn\'t a lot of co-op specific stuff; with only one coop event in the whole term (escape room). The work is not really meaningful as you are working to improve their current system.',19,'CAD','hourly',4.0,5.0,2.0,5.0,NULL,0,1,'2018-03-07T14:54:24.733Z','r634j534c228',0,0,NULL),('ck1x3b45a019b01i95jb2fh91','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Fun start-up like culture at zero gravity labs. A lot of the internship has to do with using new technologies to explore possible implementations. There\'s a lot of free food and co-op events. They also give you 20% time to work on any side-project. You also get a lot of perks like Uber, Netflix and ritual credits. \nThe salary is standardized for waterloo coops regardless of term. (Unless you\'re a master\'s student)',26,'CAD','hourly',5.0,5.0,4.0,5.0,NULL,0,1,'2018-03-07T14:58:21.117Z','r635j535c176',0,0,NULL),('ck1x3b45a019c01i91g225e7h','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Took a position in the Institutional Relationship Management desk of BMO Capital Markets. Work was not meaningful and offered neither new opportunities to learn new tools/skills or interesting problem solving.\n\nThis only reflects placements on \"Institutional Relationship Management\" specifically, and shouldn\'t count against any other positions offered by Capital Markets.',6600,'CAD','monthly',1.0,1.0,1.0,2.0,NULL,0,1,'2018-03-07T18:56:51.855Z','r636j536c133',0,0,NULL),('ck1x3b45a019d01i9372xhfzp','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked there from sept to dec of 2017. Great company to work at! I worked on full stack development for one of Nvidia\'s internal platform. I included the $2250 monthly housing stipend to the salary. The mentor is very willing to help and the general culture in very positive. Nvidia provides subsidized food, so that was pretty good. I would highly recommend this job to anyone!',8450,'USD','monthly',4.0,4.0,4.0,5.0,NULL,0,1,'2018-03-11T01:18:26.544Z','r637j119c30',0,0,NULL),('ck1x3b45a019e01i96xzecsbc','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked there from sept to dec of 2017. Great company to work at! I worked on full stack development for one of Nvidia\'s internal platform. I included the $2250 monthly housing stipend to the salary. The mentor is very willing to help and the general culture in very positive. Nvidia provides subsidized food, so that was pretty good. I would highly recommend this job to anyone!',8450,'USD','monthly',5.0,4.0,4.0,5.0,NULL,0,1,'2018-03-11T01:22:40.501Z','r638j537c30',0,0,NULL),('ck1x3b45a019f01i9d6azaag3','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I was working at Salesforce at Fall 2017. Overall, the internship experience is awesome. There are lots of intern only events. The corporate housing is wonderful, large and clean.  And it is 10 minutes walk to the office, right in the downtown of Bellevue. There are gyms downstair and gym at your apartment. You got 100 dollar every month for your well being and you got to participate lots of VTO events.  My manager gave me a lots of freedom to choose the project I would like to work on. My mentor is super helpful with scoping the project. Would recommend this internship to anyone.',44,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2018-03-11T15:27:22.105Z','r639j538c38',0,0,NULL),('ck1x3b45a019g01i9aemm3dha','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked at Veeva for my first co-op in Fall 2017. I had a really positive experience here. There are some very cool, meaningful projects to work on, and interns are treated very much like full timers. \n\nPeople at the office were generally friendly and approachable. Even though there was often ample work to be done, the work atmosphere was still quite relaxed and not stressful. Throughout the term, there were also events for interns. \n\nMy only complaint was that the salary was a bit low compared to other similar jobs (although I heard that they were increasing it after I left).',3000,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2018-03-18T00:47:49.491Z','r640j539c198',0,0,NULL),('ck1x3b45a019h01i92pbg4e5a','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked here 4 months in Winter 2018.\n\nInteresting work. You get to work pretty independently, but mentorship is really good and the staff are pretty highly skilled.\n\nPros:\n\n-management was very easy to work with\n-paid overtime at time and a half, of which you can have plenty. (the salary I gave it the straight money/hours worked, I worked pretty standard times for my team)\n-housing stipend of $1300\n-awesome location in midtown\n-breakfast and lunch provided, dinner as well past 6:30\n-very interesting technical problems in software and hardware\n-no useless meetings\n-flat company structure, you get to work very autonomously.\n-company outings fairly often.\n\nCons:\n\n-I rated work life balance five stars because you work however much you want, but generally people work longish hours (9-10hr daily). It\'s finance, you get used to it pretty quickly.\n-I\'d say the work is pretty tough, so hopefully you\'re up for it. Not a con so much as a word of warning.\n\nDefinitely would recommend',33,'USD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2018-04-11T03:50:12.560Z','r641j540c332',0,0,NULL),('ck1x3b45a019i01i91pbrensi','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','There are definitely some organizational pains that come with a company trying to grow. They were aggressively hiring full-time employees when I worked there for both the San Francisco and Waterloo offices, as there was an extra signing bonus for new employees going on. However, at least 5 full-time employees left the company or were fired in the 4 months I was there, so take that how you will.\n\nMost of their old monolithic application is still written in PHP, with most of the newer services written in Ruby on Rails and Golang. Mobile applications are written in Java (Android) and Objective C (iOS), although they’re planning on rewriting in Swift at some point. Some custom firmware and other things are written in C, although for the most part this is legacy or pretty stable and doesn\'t really need to be touched. Web stack was pretty standard. Git is used for version control. CI builds run on most of the important repositories, and backend deploys daily.\n\nI worked alongside full-times mostly on backend (although I did fix a few CSS bugs and worked a bit on Android, iOS, and the ops side of things). You\'ll probably ship your first PR within the first 1-2 days. They have some smart Senior developers and ops-guys (and ex-Big 4 UI/UX designers) who know what they\'re doing. Unfortunately, most people have only been at the company for about 2 years, and are probably out of their element in many problems you\'ll encounter. iOS guys are generally good considering they’re all senior, and there’s a few who know Android really well.\n\nThere\'s a bi-weekly Town Hall where Finances, company updates, and product direction are discussed. User metrics are always available to everyone. This flat organizational layout means that things can get bumped up the priority list if \"higher-ups\" see a bug, and they will demand that it get fixed ASAP (usually via hot-fix the day of). Some of the business decisions regarding product direction are questionable, yet nobody seems to say anything about it. However, most people are pretty chill, and lots of people hang out by the corner outside to smoke/vape or talk about games/anime/sports on Slack.\n\nA lot of the full-time employees worked 45+ hour work weeks. As a co-op, I didn\'t really have to deal with that, and pretty much worked 35 hours/week on average, as long as I got the work done. My manager and mentor regularly checked in with me, and they understand that you\'re probably there to get experience and care about your career goals. With that said, your experience will likely vary depending on your team lead, and it’s definitely not the case across all teams. According to the last co-op here, unless you put in like 50+ hours a week and implement features off the backlog “for fun”, you probably won’t be getting an Outstanding.\n\nThey do have some nice perks, including unlimited vacation days. There’s the typical tech company benefits with monthly social events, flex hours, free swag, a Christmas party, trips if the company meets their OKRs, foosball table, free pop, beer on tap (usually some craft beer), onsite massages every month, onsite gym and trainer, free snacks, 3 meals (restaurants are on a 3-4 week rotation). The food rotation is pretty sweet, and pretty much everyone goes for lunch as clockwork, which is nice. If you stay late, there usually is a dinner food order going on.',1200,'CAD','weekly',4.0,4.0,4.0,5.0,NULL,0,1,'2018-04-15T21:01:31.875Z','r644j366c66',0,0,NULL),('ck1x3b45a019j01i9b54p4jpz','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The experience is very team dependent here. For people working on high-profile teams like AutoPilot, which is essentially its own organization, the hours are pretty intense and there’s a lot of pressure to deliver. And when there’s a deadline approaching (like Model 3 launch), there might be some pressure there. I know one of the interns working on critical components of Model 3 was putting in upwards of 70 hours per week.\n\nThe pay isn’t the greatest in the Bay area, but you’re eligible for overtime, so most interns end up working an extra few hours here and there. Some managers aren’t about that life though, and one of my friend’s managers told him to stop working so much overtime (he was only working 3-4 hours extra per week). They’re pretty chill about hours though, and taking time off to go explore California.\n\nThere’s a few intern events that go on throughout the term, and at least one off-site event. \n\nAt DC, there’s free cereal (Happy Shapes, Crisp Rice, Raisin Bran, Corn Flakes) and drinks (soft drinks, coffee, orange juice, regular/almond/coconut milk). Some of the new offices have different cereal flavours or new drinks. There’s lunch and dinner from Rebecca Jean’s Catering that comes to around $7-12 per meal, depending on what you get. There’s also vending machines that sell food and a salad bar if you’re into that. Food trucks come by at lunchtime.\n\nOrientation happens at Fremont, regardless of whether you’re working at Fremont or DC (not too sure what happens with Gigafactory interns or Design interns). You’re supposed to have weekly 1-on-1 meetings with your mentor to go over how you’re progressing, but some totally ignore it. There’s a midterm and final evaluation that Tesla does as part of their internship program, which is available to other managers if you’re returning.\n\nCulture-wise, I’d say it’s fairly open. I found out about new products and direction pretty easily, although they’re trying to make that harder. Some projects have been becoming more secretive, which people are unhappy about.\n\nI ended up working on stuff that was actually going into the cars, and learned a lot from my mentor and the people on my team. DC is an open concept office, so most people are pretty approachable (unless you’re in the labs downstairs). I finished my project pretty quickly, and then my mentor seemed to use that to gauge my abilities to assign more interesting work afterwards. Other interns barely finished a single project, and their evaluations reflected that. Overall, I’d say the internship is what you make out of it, and if they realize that you’re doing good work, they’ll give you more interesting work to do. Some of the new hires’ abilities seem suspect, but the Senior and Staff Engineers (at least the ones I interacted with) definitely know what they’re doing.\n\nTesla uses the TN visa, so they’ll probably have you fly through YVR. A lot of full-times are Canadians! They’ll cover round trip flights and provide a $2,000 relocation bonus (after tax), and will reimburse the visa fees. Returning interns get a $1 raise which I’m not sure is negotiable, but everyone I’ve talked to wasn’t able to negotiate anything higher. This includes 8-month co-op terms. There’s the standard tech company perks like a table-tennis table, etc. There\'s a small on-site gym, and you\'re eligible for a Wageworks card that gives you $120 for UberPool/Clipper Card per month. There\'s also biking benefits, which nets you $5 each day you bike to work.',28,'USD','hourly',4.0,5.0,5.0,4.0,NULL,0,1,'2018-04-15T21:42:41.615Z','r645j542c220',0,0,NULL),('ck1x3b45a019k01i922ha14e6','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Great workplace environment and culture. People are very friendly and you get complete ownership of a feature. Highly recommended',6500,'CAD','monthly',4.0,4.0,5.0,5.0,NULL,0,1,'2018-04-17T18:09:29.664Z','r646j16c67',0,0,NULL),('ck1x3b45a019l01i965k0b99v','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked there W2017. Terrible experience all around.\n\nPros\nThe developers know what they are doing\nThe tech they use is modern\n\nCons\nPretty much everything else\n\nCompany Culture\nThe company culture at Bespoke is the worst culture I have seen in a company. The full-timers are a close-knit group. They frequently make insulting remarks towards the interns and this behaviour is enabled by the group and CEO. People at the company do not understand proper workplace conduct. They are aware of this, and joke that they need HR but make no attempt to correct their behaviour.\n\nWork-Life balance\nInterns are urged to stay late, even though this is a 9 to 5 job. The CEO makes passive aggressive remarks when you leave early. This occurs even if there is no work. For a start up, it is normal to stay late and work hard, but the company culture was so terrible that no one bothered. Pro-tip, if you want interns to stay late, the trick is to make them want to stay late instead of shaming them into doing it.\n\nWork Content\nInterns often didn\'t have any work to do. On the team I was on, there was four interns being managed by one full-timer. He struggled to give any meaningful work to us. Often, there was no work in the backlog so we were assigned to write tests for code that he wrote. This was a failure of both management and the full-timers. The management has to ensure that there is always features that need to be developed and deployed and it is the full-timers responsibility to constantly update the backlog. None of this was done effectively. \n\nThe CEO\nMichael promotes this toxic company culture. He makes racist remarks, acts like an asshole and seems proud of the fact that no one can call out his behaviour. He has an astounding lack of self-awareness. He told the interns about the time he was working at a company and they told him to do HR training and he told them to fuck off. He also told a story about how he was competing with another white guy for a high ranking position at a company, he got in a competition with him and won, but did not get the position. He blamed it on the fact that the company management was racist. You don\'t think the two stories are related? I think it is likely that they didn\'t give him the position because he is a toxic, racist jerk that doesn\'t know how to interact with the people working under him.\n\nIn summary, the work is good and meaningful (when you get it). The company culture is terrible. The CEO is terrible. If you have another job on Waterloo Works, take that job instead.\n',2200,'CAD','monthly',1.0,2.0,2.0,1.0,NULL,0,1,'2018-04-19T00:49:47.405Z','r647j543c297',0,0,NULL),('ck1x3b45a019m01i9g99c2m43','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Great experience - friendly coworkers, well built tech, and gave a lot of freedom.',8500,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2018-04-25T22:21:01.584Z','r649j292c36',0,0,NULL),('ck1x3b45a019n01i98telaz2f','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Working at D2L was for my third work term and I could not ask for a better internship. My mentor was very passionate about explaining stuffs and providing technical resources. My co-workers were talented, friendly and nerdy developers who motivated me to stay focused and grow. They have pride in their works and care about the quality of codes over the quantity. They follow good practices and use the latest technology to monitor, build and ship their works which helped expanding my skill sets. Work-wise, I sometimes had a bit of too much free time, but most of the time, was occupied on meaningful works. Highly recommended for students in their early co-op career.',3760,'CAD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,'2018-04-26T19:04:57.638Z','r650j545c83',0,0,NULL),('ck1x3b45a019o01i9c1vq3xdf','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Great place to work at. Great team. Company culture is great, lots of events. Free snacks / food in the kitchen. Given meaningful work to do, your contributions will noticeably be seen in the product. ',3553,'CAD','monthly',5.0,4.0,4.0,5.0,NULL,0,1,'2018-04-27T13:53:07.378Z','r651j546c333',0,0,NULL),('ck1x3b45a019p01i90ph10yyl','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked on a new team for one of the company\'s products. Most of the team consisted of new hires, so there was a positive experience of learning along side full-time employees. Mentorship is great, everyone is very helpful and easy to talk to. The atmosphere is positive, with a lot of office events including weekly massages, pizza Mondays, and Yoga. ',28,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2018-05-02T15:04:13.533Z','r652j547c334',0,0,NULL),('ck1x3b45a019q01i95l9yatqs','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I had my best internship here for my second last coop term. I worked on the 3D team and had a blast with the team. Since the 3D product is a fairly small team (the company at the time was also fairly small of only 60 people including sales), I got to work on everything from product management to deployments. I learned a lot and the stack they were using was really advanced and modern. As well, we had tons of team events such as cabins, cross country skiing, drinking + video/board games, curling etc. Overall it was a great time!\n\nNote: the food was amazing, definitely better than that of many company in the bay area. As well, the company pays for phone plan, your travel to/from Norway and visa costs.',250,'NOK','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2018-05-15T17:19:40.378Z','r663j554c337',0,0,NULL),('ck1x3b45a019r01i98ntvekr5','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked at Capco as a Software Engineering Consultant Intern from January 2018 - April 2018 in the Toronto office. I\'d say that this experience was one of the best work experiences I\'ve had so far. \n\nFrom a technical/educational perspective, I worked with Java Spring on the back end team. When I first started I was given the right resources to get myself set up and familiarised with the code base. My teammates were highly experienced in the field but were also very helpful and approachable. I first started off with some simple tasks, but as time progressed I got assignments that were as important as any other full time developer\'s. One of the best educational advantages was that I had top tier programmers reviewing my PRs and giving comments/suggestions on how to improve my code. There is also plenty of opportunity to work on side projects through out the term. I had the chance to work on one of them and in the process gained practical experience with Angular, Node, and MongoDB. Different projects use different tech stacks, so there\'s room to learn a lot (including Machine Learning).\n\nFrom a non-technical perspective, I met dozens of enthusiastic and laid-back people. Everyone knew how to have fun and understood that work isn\'t all about pushing out code. There was a ping pong table in the area where anyone could set up and play at any time. There were also free refreshments in the kitchen and almost always someone that was willing to sit down and just talk for a bit. Capco is well known for having one of the best work place cultures and after working there I can completely agree.\n\nOverall, working at Capco was great for both learning new things and making great connections. I\'d definitely recommend working there.',4000,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2018-05-02T17:34:07.934Z','r653j479c118',0,0,NULL),('ck1x3b45a019s01i9da6gb398','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked at Bazaarvoice in Winter. I got a chance to work with some really smart people, do interesting and meaningful work. Company culture is also great with occasional celebrations and lot of team activities. Honestly, I couldn\'t have asked for any better.\n\nSubsidized corporate housing and a subsidized shared rental car is provided with insurance paid for.\n\nAs far as Austin is concerned, its an amazing city with a lot of stuff to do and good food. In winter, the weather is also great and I got to attend SXSW which was pretty awesome.',27,'USD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2018-05-03T05:37:28.399Z','r654j548c261',0,0,NULL),('ck1x3b45a019t01i99a56d78e','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','As for mentorship, people are willing to help but they won\'t babysit you. In other words, you can\'t just wait there and hope someone is going to check in with you every hour. Being in a rapid startup environment (NYC life), I learned the importance of effective communication. I learned how to ask good questions to right people so that I can get things done quickly.\n\nI rated work/life 4/5 balance because the work is so interesting and I ended up working overtime sometimes.\n\nWhat makes Datadog unique is the scale of its engineering team vs the scale of its infrastructure. We are a relatively small team of engineers (<60 people working on the distributed system as of winter 2018) but because of the nature of our product, we are handling a crazy amount of traffic. You are able to work on a huge distributed system in a small team. As an intern, I got to own a service and make a lot of impact.\n\nI really enjoyed working at Datadog and I will consider coming back full-time after I graduate.',45,'USD','hourly',5.0,5.0,5.0,4.0,NULL,0,1,'2018-05-03T20:09:25.273Z','r655j549c335',0,0,NULL),('ck1x3b45a019u01i96coy7wtb','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','[Fall 2017] \nI worked at The Coalition, a game studio owned by Microsoft best known for the Gears of War series. They have an office in Downtown Vancouver (15 mins away from \"Big Park,\" the other MSFT office)\n\nWORK:\n\nGame development is hectic and haphazard, and unfortunately, I came in during a particularly busy time for my team. I didn\'t really have a chance to sit down with someone and \"learn the ropes,\" and I was instead thrust head-first into a task and told to \"figure it out.\" \nNow, Unreal Engine 4 is a BEAST, and is not something that easily lends itself to \"self learning.\" Pile-on all of the game-specific things you need to know, getting started in the codebase was incredibly difficult... \n\nRegardless, one of the (few) nice things about the \"diving in head first\" method of learning a codebase is that after you thrash around a bunch, you eventually get pretty good at figuring things out yourself! By then end of the term, I wrote code fairly quickly, and learned a bunch of invaluable skills in terms of navigating my way around a gargantuan C++ codebase.\n\nLIFE:\n\nThis was the real highlight of the internship :D\n\n1) I supremely lucked out with my team. The Audio Team at the coalition were some of the coolest and nicest people i\'ve had the pleasure of working with. They really made the day interesting, and banter was always on-point. DISCLAIMER: i\'ve heard from other interns that other teams were not as good, so YMMV\n2) The Coalition has a super laid-back culture, with free beer and snacks every-other Friday\n3) The intern-group I had was awesome, and made after-work events and weekends a ton of fun\n4) Vancouver is a really awesome place to live. There is a ton to do, both within the city, and in the surrounding cities. There are lots of really cool hikes (if you\'re into that!)\n\nMISC:\n\n- Microsoft doesn\'t set you up with housing, which is annoying :( I was lucky enough to live with a friend from Vancouver, so his parents scouted out the place first, but otherwise you\'d have to go in blind\n- Housing is bloody expensive in downtown (I paid 1500/mo for a queen-size bed in a closet)\n- The 5800 salary = 4400/mo base + 5000/term housing stipend + misc bonus monies\n\nTL;DR: It was a pretty good time!\n\nLearned a lot, and had a lot of fun doing it.\n8.5/10 would intern again.',5800,'CAD','monthly',5.0,1.0,4.0,5.0,NULL,0,1,'2018-05-04T00:25:48.714Z','r656j550c27',0,0,NULL),('ck1x3b45a019v01i9edm4469f','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The people were really nice and the work life balance was relaxed. Work seemed pretty menial at times, and you\'ll work with offshore doing similar tasks as them. Management is pretty absent starting from regular engineering managers who came to work twice a week to a senior director who showed up to the office once in the 4 months I was here. Given that key employees rarely show up, it follows that mentorship was pretty lacking in all aspects. \n\nThey company has a high engineer turnover rate, and I feel like that kinda contributed to a slightly negative atmosphere. With that being said, everyone was super friendly and welcoming, which is why I\'m giving it a 3/5 overall instead of something lower.',6200,'USD','monthly',3.0,2.0,2.0,5.0,NULL,0,1,'2018-05-04T01:06:15.319Z','r657j551c28',0,0,NULL),('ck1x3b45b019w01i9crjc931z','2019-10-19 04:56:45.467000','2019-11-27 20:33:48.172000',0,'ck1n1du49000501jo4pwygsav','Had a nice term at Yahoo. Great perks and nice people. Learn a lot. ',41,'USD','hourly',5.0,4.0,4.0,5.0,NULL,0,1,'2018-05-04T04:52:17.292Z','r658j485c57',0,0,NULL),('ck1x3b45b019x01i987v62z28','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Really smart people working on technical problems.',10300,'USD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,'2018-05-06T18:24:19.553Z','r659j552c336',0,0,NULL),('ck1x3b45b019y01i9go8t0ibp','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','YIP (Yelp Intern Program) is awesome and their dedicated team for handling interns is the best I\'ve come across. They host weekly events that allow you to really get to know the other interns and explore San Francisco which is honestly a major plus.\n\nThat being said, the work depends on what team you end up on and what projects are available. I personally did not get much mentorship and worked independently on an intern project for most of the term which does not give me a good feel of what it is like to be a full-time at Yelp. However, some of the other interns had good experiences and caring mentors, so that is not to say you will not find any meaningful work.\n\nCulture-wise, Yelp is great and all the people I met and interacted with were friendly and made me feel welcome. The people at Yelp are what makes working at Yelp awesome in my opinion.\n\nOverall, I had a great time as an intern and would definitely recommend it for a coop just because of how well run the intern program is!',7360,'USD','monthly',4.0,3.0,3.0,5.0,NULL,0,1,'2018-05-06T18:56:24.046Z','r660j553c58',0,0,NULL),('ck1x3b45b019z01i984q6duk9','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked @ Quora during Winter 2018 and had the time of my life.\nI was the only intern there, but did not feel like I was given any \"intern treatment\". I was welcomed and treated as a full-time.\nManagers + mentors put a lot of effort into making sure the work you\'re given aligns with your interests and goals, whether that be a long-term project or many shorter-term tasks. I personally preferred full-time tasks over an intern project and was placed on an ML team despite not having any previous practical ML experience. Interns are given real work with huge impact. They put a heavy focus on working efficiently, enabling them to respect work-life balance. You get to learn from, work with, and hang out with insanely smart people - there are social groups for every interest imaginable.\nIn terms of perks, they offer all three meals, a free Caltrain pass, and a housing stipend or provide housing (depending on the term).\nThe company culture is awesome - everyone is excited about the product, extremely welcoming and very approachable. There\'s no doubt you\'ll learn lots and make meaningful contributions.',8250,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2018-05-14T21:49:23.664Z','r661j220c37',0,0,NULL),('ck1x3b45b01a001i92wmn7d7o','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked here in 2017. Interns are assigned projects on the infrastructure team that they are responsible for. Each intern is assigned a mentor that is responsible for helping them with their project. The projects were all very useless; the kind where you know it won\'t be in use at all after you leave. Overall, the work was very meaningless and I didn\'t learn much from this experience. The perks were nice though.',9500,'USD','monthly',2.0,2.0,2.0,5.0,NULL,0,1,'2018-05-14T21:56:37.522Z','r662j297c104',0,0,NULL),('ck1x3b45b01a101i99iuj49so','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Overall, I really enjoyed my time at Uber. I thought that the work I was given was really meaningful and I could see the direct impact it had on my team and the company\'s OKRs. I loved that I was treated just like any other engineer. I was invited to all my team\'s meetings, my thoughts and input were actively sought out, and I got to work with some really smart people both on my team and across the company.\n\nThe bad stuff: Now that Thomas (the old UW recruiter) left for Lyft, the recruiting team is a complete mess. They don\'t seem to care at all about the current interns, most of the recruiters seemed to forget we even existed and they didn\'t even respond to emails. The food is free, but not great. The internship program also doesn\'t seem to be very established even though there\'s a ton of interns, the events were okay but pretty infrequent, and there\'s barely any swag.',7750,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2018-05-16T05:54:14.143Z','r665j38c52',0,0,NULL),('ck1x3b45b01a201i99m7whagn','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','You\'ll never meet a nicer group of people! I pulled tickets from the same backlog as the rest of my team that was meaningful to the company\'s goals. They use the latest tools and have really good software development practices. The one-on-ones with both my mentor and my manager were tremendously valuable as well. The company and intern events were also really fun and made the 4 months an amazing experience.',5750,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2018-05-16T20:32:44.817Z','r666j555c95',0,0,NULL),('ck1x3b45b01a301i93ylq30o7','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','- Best culture out of all the companies I\'ve worked at so far\n- Smart people\n- Encouraged to take risks and try new things to learn',7794,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2018-05-19T07:18:00.769Z','r667j556c24',0,0,NULL),('ck1x3b45b01a401i9d4rb12rd','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Really team dependent. I was in a newly formed team so every person on my team had a lot of responsibilities. We were in charge of a lot of things so we learned a lot too. Our team had a start-up culture while being backed by a large corporation like IBM.',4050,'CAD','monthly',4.0,4.0,4.0,5.0,NULL,0,1,'2018-05-19T23:54:05.138Z','r668j197c84',0,0,NULL),('ck1x3b45b01a501i9cleb03xg','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked here in Winter 2018. Originally hired as a mobile developer working on cross-platform (Xamarin), later moved on to an internal project as a full-stack developer. Office culture is a little boring at times but everyone is friendly and open to questions. Lots of smart people in the office, potential for great mentorship depending on project assigned. ',4250,'CAD','monthly',4.0,4.0,4.0,4.0,NULL,0,1,'2018-05-21T02:24:07.689Z','r669j557c338',0,0,NULL),('ck1x3b45b01a601i99jn8huch','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Top Hat was a place to do an internship. They are huge on board games and if you love playing board games, you will fit right in. Everyone on the engineering team is super smart and talented; definitely some of the smartest people I have ever worked with. ',5300,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2018-05-21T16:43:24.067Z','r670j104c110',0,0,NULL),('ck1x3b45b01a701i9g8fd6zmb','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Great culture, people are really willing to teach you and let you learn. You\'re able to get involved if you take initiative. Free food all the time and on-site free gym are added benefits. They treat you like a full-time employee.',18,'CAD','hourly',4.0,5.0,4.0,5.0,NULL,0,1,'2018-05-22T23:35:23.495Z','r671j558c339',0,0,NULL),('ck1x3b45b01a801i9c7145any','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Really great place to work for an early co-op.\nNice people, meaningful work. Relaxed work environment.\nThe CEOs are really cool people, amazing role models. Lots to learn.\nEveryone is willing to answer any questions you have about software development. It\'s a really great learning environment all around.\n\nOnly real complaint is the pay was pretty low (compared to other software developer co-ops), but seeing as it was an early co-op, the experience was more important than the money for me. Also expected since they are a startup and hire around 13 co-ops per term.\n\nAbsolutely recommend Hubdoc for an early co-op.',18,'CAD','hourly',5.0,4.0,5.0,5.0,NULL,0,1,'2018-05-22T23:49:37.532Z','r672j533c331',0,0,NULL),('ck1x3b45b01a901i9hgmp713v','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Spring 2018, work was great, join infra teams for meaningful work',7000,'USD','monthly',4.0,5.0,4.0,5.0,NULL,0,1,'2018-05-23T01:16:37.813Z','r673j562c334',0,0,NULL),('ck1x3b45b01aa01i99hw79rp7','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','People were nice and good work culture even though it\'s a government office. Many people there are French first.',18,'CAD','hourly',3.0,4.0,3.0,5.0,NULL,0,1,'2018-05-23T01:23:27.853Z','r674j563c340',0,0,NULL),('ck1x3b45b01ab01i9gmrdd0jg','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Learned a lot about battery chemistry. Since the company is so small ~20 people, the interns can make a pretty big impact. People are friendly.\nManagement can be improved.',19,'CAD','hourly',4.0,4.0,5.0,4.0,NULL,0,1,'2018-05-23T03:29:06.553Z','r675j564c341',0,0,NULL),('ck1x3b45b01ac01i9ar1ngtef','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','- didn\'t find the work that rewarding (doing mainly back-end stuff) because I realized I wasn\'t interested in accounting software\n- my mentor was amazing. very helpful and knowledgeable\n- work atmosphere was very chill and the people here are awesome\n- catered lunches every Thursday\n',5800,'CAD','monthly',3.0,5.0,3.0,5.0,NULL,0,1,'2018-05-23T04:12:53.609Z','r676j565c65',0,0,NULL),('ck1x3b45b01ad01i9h6pv498z','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I had a great experience interning at Redfin. The compensation package is pretty standard and fair - housing stipend, relocation bonus and transportation subsidy. There are many incredibly smart people who have worked at other top companies before coming to Redfin. On my team, the work life balance was excellent - I had an extremely good manager who hit the perfect balance between pushing the team to work while giving enough flexibility to allow the team to work. The internship program is fairly well structured and they try their best to provide meaningful mentors, but it does depend a bit on personality types. To me, Redfin is the perfect size for a company - large enough to give comfortable compensation and in house infrastructure, while small enough such there are plenty of opportunities for an intern to impact the larger organization. ',7500,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2018-05-23T04:52:48.508Z','r677j412c246',0,0,NULL),('ck1x3b45b01ae01i95h1a1lz0','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I interned at Yelp in Winter 2018. Yelp has a really solid internship program. They really try to give the interns the best experience with weekly events. It helps to have a smaller intern group in the Winter term because you can really get to know everyone.\n\nIn terms of actual work, I mainly got worked on their backend APIs and business logic. Nothing too challenging, but still pretty fun. The mentorship I got from my mentor was exceptional, but this is very team/mentor dependent.\n\nThe culture at Yelp is definitely one of its major perks. Everyone is super nice and chill, no overtime expectations.\n\nThe salary was 8000$/month with a 1500$ monthly stipend.',8000,'USD','monthly',4.0,5.0,3.0,5.0,NULL,0,1,'2018-05-23T17:20:26.308Z','r678j553c58',0,0,NULL),('ck1x3b45b01af01i915q1fecb','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','A fun experience, but don\'t expect too much free time as it\'s still a startup. Work hard play hard culture, so you\'ll spend most nights there past 8-9 but there\'s lots of great people there to spend the rest of the night with! Free food is amazing, terrific snacks and great location at Trinity Bellwood\'s! Also great product, would recommend investing!',700,'CAD','weekly',3.0,2.0,5.0,2.0,NULL,0,1,'2018-05-23T22:50:04.905Z','r679j566c242',0,0,NULL),('ck1x3b45b01ag01i9gzs28hj7','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','As mentioned in other reviews, Microsoft is the biggest software company in the world and your internship experience varies drastically depending on what team you are assigned.\nI would like to emphasize the compensation in this review. Microsoft literally makes it rain for interns. For first time Microsoft interns (not explorer), you will get paid $7200 per month (per tax). If you were to return to Microsoft as an intern, your salary will get bumped to $7650 and you will receive a one-time bonus of $5000. On top of the base salary and bonus, you can either choose to live in a corporate housing (hella fancy one, with bi-weekly cleaning service) or a one-time $9000 housing stipend for your 4-month internship. So if you are a returning Microsoft intern, who chooses the $9000 housing stipend, your total compensation for the internship would be close to $45k USD (equivalent $135k annual salary). In addition, Washington state (where Microsoft headquarter resides) does not collect state tax, so you would definitely get more money in your paycheque than your cali friends.\nLast but not least, Microsoft also provides rental car program to interns. Basically, you can rent a car from a Micorosft-partnered car rental company with a subsidized price of ~$700 a month (Insurance and toll included). Having a car is blessed because you don\'t have to wait for the bus / uber everywhere.\nIn conclusion, I am so thankful that Microsoft really takes care of their interns money-wise and I would highly recommend Microsoft if you wanna cash out.',7650,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2018-05-24T16:40:11.319Z','r680j495c27',0,0,NULL),('ck1x3b45b01ah01i96eeh0zf2','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I was hired as a Software Engineer but managed to be placed on the Data Platforms team doing Machine Learning stuff after a quick interview with the Engineering Manager on the team.\n\nMy manager was great at figuring out what kind of skills I want to develop, and then create relevant tasks for me to do based off of that. There\'s always an excess of stuff to do on the Data team; things like building ETLs tasks on Airflow to developing ML models. People from other teams were extremely open for you to book a meeting room and then teaching you all about the stuff they\'re working on, it\'s a great way to develop skills for a specific field if that\'s what you\'re into.\n\nThe on-site gym is not the best, but it gets the job done (no bench press or squat rack, just a smith machine, treadmills, free weights, and some machines). There\'s a lot of variety with the snacks, and drinks. In the lobby, there\'s a $20,000 espresso machine where you could make the best coffee you\'ll ever have (after taking a barista course). Happy hour every Thursday, lots of team outings, workout classes 2 times a week. You get a 1-year cal-train pass which you could use even after your internship is over as long as it\'s within that calendar year. ',8200,'USD','monthly',5.0,4.0,5.0,5.0,NULL,0,1,'2018-06-02T20:56:26.855Z','r681j567c13',0,0,NULL),('ck1x3b45b01ai01i99hor3mmi','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Pros:\n- great company culture\n- new projects are built with modern tech\n- catered lunches, unlimited snacks and coffee\n\nCons:\n- potentially uninteresting projects (since team assignment is random)\n- certain projects contain legacy perl code + tech debt',23,'CAD','hourly',3.0,3.0,3.0,5.0,NULL,0,1,'2018-06-06T01:32:12.152Z','r683j568c316',0,0,NULL),('ck1x3b45b01aj01i9hvm5btac','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Great experience',40,'USD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2018-06-07T18:51:40.962Z','r684j507c320',0,0,NULL),('ck1x3b45b01ak01i97q4pedj4','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked at the Autonomous Vehicles team. Super meaningful work. Extremely flexible hours. I literally went to work sometimes at 11:00. You own your project. Best place to work at. If you like C/C++, choose NVIDIA over any other BigN in a heartbeat.',50,'USD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2018-06-12T00:36:11.207Z','r685j569c30',0,0,NULL),('ck1x3b45b01al01i9a08k274c','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Definitely one of the best places in Canada to work. Great pay, culture, and development seems pretty well run.\nGreat opportunities for mentorship, but you may need to actively seek it out. Learned a huge amount from the various engineering talks as well as chatting with teammates.',5500,'CAD','monthly',5.0,4.0,5.0,5.0,NULL,0,1,'2018-06-13T17:31:03.412Z','r686j305c40',0,0,NULL),('ck1x3b45b01am01i96dmbbxfx','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Best coop I\'ve had to date. Work environment is very chill, the manager at the time (Danny) is an amazing person who truly cares for the coops. It\'s also very informal so you have the ability to discuss things/projects however you want. You get to take on multiple tasks and you get to choose/use as many technologies as you like. By the end of the term you can be an expert in Javascript, Python or whatever you\'ve wanted to become an expert on. The roles are also very flexible. Even though you may be hired in as a fullstack, if you want to do some data science/machine learning on a project, no one will stop you from putting heavy emphasis on machine learning while your team-mates work with the backend etc.. There is low stress on the job so you don\'t have to worry about spending your freetime on any of the projects. The salary ($4400/month) is also pretty good considering the region and the best of all, the office is in the Tannery Communitech hub, full of events and food! WLB is 10/10. \n\n\nOverall 5/5, this is a fantastic coop and I definitely recommend it to everyone in their lower years. You\'ll have a great work environment, superb manager and lots of opportunity to learn.  ',4400,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2018-06-15T21:39:01.081Z','r687j570c212',0,0,NULL),('ck1x3b45b01an01i98v6rbovz','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','OANDA was my second co-op and I definitely learned a ton. I worked on the core application and got to work on a lot of user-facing features and bugs as well as internal networking frameworks. There was a lot of autonomy in terms of how I approached features and was given lots of freedom on the work I wanted to do. Co-workers were super nice and willing to help whenever I approached them. The perks were pretty nice, we had breakfast on Mondays, pizza dinners on Tuesday, lunch on Wednesdays, and snacks and drinks. There were also some events throughout the term in the office. Overall pretty good company and would recommend.',3500,'CAD','monthly',4.0,3.0,4.0,5.0,NULL,0,1,'2018-06-18T22:33:16.852Z','r688j571c136',0,0,NULL),('ck1x3b45b01ao01i98c6p555h','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','This was my first co-op so I was just happy to be doing any programming. That being said, the applications that I worked on were very internal to RBC and not sure if they were too useful. I mainly worked on UI features, and bug fixes from time to time. There were definitely lots of times where I did not really have anything to do, and I\'d just play games on my laptop or left early. My team was very small, one other co-op (which was nice considering how boring lunches would have been alone), one lead developer, and a project manager who was non-technical really. I\'d say its a decent first co-op, no fancy perks or anything, but there were always events going on since I interned in the summer and they usually had free food and stuff at the events.',2850,'CAD','monthly',3.0,2.0,3.0,5.0,NULL,0,1,'2018-06-18T22:39:55.958Z','r689j235c189',0,0,NULL),('ck1x3b45c01ap01i90ubzbl25','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Outstanding experience, competitive pay, very smart co-workers + intern cohort. ',11000,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2018-06-19T19:03:53.521Z','r690j572c8',0,0,NULL),('ck1x3b45c01aq01i99dkkd6hj','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Mentorship really depends on your team. It can be very good or very bad. There seems to be a lot of growing pains with the code base and some of the code is very difficult to work with. There is great work life balance however and you will have time to explore Boston. ',6000,'USD','monthly',3.0,3.0,3.0,5.0,NULL,0,1,'2018-06-20T20:47:23.052Z','r691j573c170',0,0,NULL),('ck1x3b45c01ar01i9crhscsqe','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Docker was a great experience for me. The mentorship was excellent and everyone was eager to help me out with my problems. Great work-life balance, I was allowed to WHF whenever I needed to. Lunch was Monday, Wednesday and Friday with three fully stocked kitchens.',7000,'USD','monthly',4.0,5.0,5.0,5.0,NULL,0,1,'2018-06-20T22:38:41.330Z','r693j575c342',0,0,NULL),('ck1x3b45c01as01i928x9cnq4','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The experience is highly team dependent, and there are a lot of possible teams for interns to work on. Take the mentorship/w-l balance/meaningful work/overall rating with a grain of salt; this is not indicative of the entire company, but rather to my one experience.\n\nSometimes the work gets a little dry and it\'s not the most interesting, but honestly, that\'s what you get when you ask to be treated like a full-time employee; you do everything which includes features, tech debt cleanup, tests, documentation, etc.\n\nThere are some really smart people at the company and they run different groups/workshops (such as a Ruby monthly group and a Frontend monthly group) where they discuss best practices for those technologies and how they\'re used across different teams at Square. Square has a lot of engineers working on open source projects, eg. okHTTP, Ember.js, Decaffeinate, etc. \n\nThere are lots of groups for other activities such as sports groups, different cultural groups, acapella, board games, movies, bubble tea, etc.\n\nIn terms of perks, you\'ll get a housing stipend (depending on term it\'ll be either a $2000 stipend or corporate housing, though corporate housing is extremely rare now). This brings total comp up to around $9000/month.\n\nFor food, breakfast/dinner is completely free. For lunch, you pay $10, and then get it reimbursed on your paycheck (so you have to pay income tax on the reimbursement). After 90 days, interns can elect to receive benefits (eg. medical/vision/dental, health plans, transportation plans) or opt out and get a flat taxable fringe benefit added to your paycheck.',44,'USD','hourly',3.0,3.0,3.0,5.0,NULL,0,1,'2018-07-05T02:18:41.323Z','r697j286c44',0,0,NULL),('ck1x3b45c01at01i9d03r665a','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Was very happy with choosing SAP for my work term as it was definitely a formative experience in the development of my career and skillset.',3699,'CAD','monthly',4.0,3.0,5.0,5.0,NULL,0,1,'2018-07-08T17:19:19.993Z','r698j576c39',0,0,NULL),('ck1x3b45c01au01i904g4a35g','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Pay was not \"competitive\" like they said during the interview. But constant flow of work so you usually aren\'t sitting there bored. Able to do more if you ask.\n\nOnly free coffee, nothing else.',760,'CAD','weekly',3.0,4.0,3.0,4.0,NULL,0,1,'2018-07-08T17:25:37.548Z','r699j577c343',0,0,NULL),('ck1x3b45c01av01i94nnc2yur','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Pretty great place to work for in Toronto. Pay is competitive and there\'s also a $2000 signing bonus. Area is kinda hard to get to by TTC since it\'s not super close to downtown, but there\'s lots of good restaurants around. It\'s a dog friendly office, so if that\'s you\'re thing then its a huge plus.\n\nThe management and my mentor was great, and the work was pretty good - but you have to be pretty interested in accounting to enjoy it.  They truly care about your personal development here though. They\'ll be pretty adamant in getting you to voice your opinion on what you want to do/learn, as well they give money to buy books for anything you\'re interested in. Overall an amazing place to work and i\'d highly recommend it.',34,'CAD','hourly',5.0,4.0,4.0,5.0,NULL,0,1,'2018-07-09T04:47:03.865Z','r700j11c65',0,0,NULL),('ck1x3b45c01aw01i9bxsl1g2w','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Great company.',42,'USD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2018-07-09T05:30:49.206Z','r701j127c44',0,0,NULL),('ck1x3b45c01ax01i9hc70e3zj','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Winter 2018, Salary was $36/hr + $6000 one-time housing.\nWas at Tumblr\'s original office until the last two weeks, when Tumblr moved into the Oath NY building.\nPretty team dependent. My team had 4 engineers, all with PhDs in EE/CS, and I was the only intern. Got to work between 10-10:30, and left at around 5:30, with a ~45min lunch. I still got paid for 8hrs work per day.\nWork was interesting, although there wasn\'t too much to do.',7500,'USD','monthly',4.0,3.0,2.0,5.0,NULL,0,1,'2018-07-11T15:37:01.411Z','r702j578c344',0,0,NULL),('ck1x3b45c01ay01i9d9qlb90r','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Really enjoyed it!',42,'USD','hourly',5.0,4.0,4.0,5.0,NULL,0,1,'2018-07-15T05:13:01.598Z','r703j213c58',0,0,NULL),('ck1x3b45c01az01i93hk2ck9j','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked there in my fourth work term. Good environment!',4200,'CAD','monthly',3.0,3.0,3.0,5.0,NULL,0,1,'2018-07-22T15:26:39.472Z','r704j308c222',0,0,NULL),('ck1x3b45c01b001i980uudq4m','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','This my first co-op term. I was doing the automation test at the beginning of the term.  After I finished the automation tests, the manager gave me an interesting project to work on. Overall, it is a great start and I have learn a lot !!!',18,'CAD','hourly',4.0,4.0,4.0,4.0,NULL,0,1,'2018-07-24T01:11:52.678Z','r705j579c279',0,0,NULL),('ck1x3b45c01b101i9gr6sh1yo','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','It is my third coop term. Great work-life balance. Mentorship needs to be improved. Projects are quite challenging. You need to take more initiative to really make an impact.',25,'CAD','hourly',4.0,3.0,4.0,5.0,NULL,0,1,'2018-07-24T01:25:20.795Z','r706j580c84',0,0,NULL),('ck1x3b45c01b201i91cosgsur','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Free coffee, espressos, tea and a subsidized cafeteria. Work was interesting, though not much mentorship. Free beer and other drinks on Thursdays.',4600,'CAD','monthly',4.0,2.0,3.0,5.0,NULL,0,1,'2018-07-25T03:21:11.008Z','r707j369c194',0,0,NULL),('ck1x3b45c01b301i9hyyxc7in','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Free coffee and tea. Decent mentorship to my surprise--though work was not very meaningful, as expected for a large company.',3600,'CAD','monthly',3.0,4.0,2.0,4.0,NULL,0,1,'2018-07-25T03:23:19.061Z','r708j581c345',0,0,NULL),('ck1x3b45c01b401i9b8fq9tms','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Pros\n\n- Coworkers are very friendly, helpful, and knowledgable\n- Comfortable, spacious desk and workspace\n- Company lunches every week\n- Games room, stocked fridge in the break room with drinks + beer\n- Interns are treated like full-time devs. You can expect lots of flexibility, responsibility, and independence\n- Lots of opportunity to learn modern tech\n\nCons\n\n- Management tends to be pretty opaque',27,'CAD','hourly',5.0,4.0,5.0,5.0,NULL,0,1,'2018-07-25T15:01:49.681Z','r709j582c346',0,0,NULL),('ck1x3b45c01b501i9dxzg3ohq','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Decent place to work, especially in your early co-ops. Work in T&O, they actually seems to operate pretty separate from the bank and it feels like you\'re working at a tech company. RBC in general is doing a ton of things to adopt tech in as many spaces as they can.\n\nIn terms of the work I got as an Android dev, it was pretty good. Was sitting idle occasionally even when I asked for work. Overall a pretty good place to work.',23,'CAD','hourly',4.0,4.0,3.0,5.0,NULL,0,1,'2018-07-25T15:17:29.296Z','r710j237c189',0,0,NULL),('ck1x3b45c01b601i96re59afn','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked in Enterprise Continuous Delivery back in 2016. The team was cool and the work was good, especially since it was my first co-op term. Worth taking this job, you\'ll definitely learn a lot about continuous integration, which plenty of companies have asked me about since. ',775,'CAD','weekly',4.0,5.0,4.0,4.0,NULL,0,1,'2018-07-25T15:22:03.491Z','r711j583c62',0,0,NULL),('ck1x3b45c01b701i982bv265c','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked as a full-stack developer on an internal tool. I was given a good amount of work, and was treated like a full time employee. My mentor, manager, and senior engineers were great at giving me support.',32,'CAD','hourly',4.0,4.0,3.0,5.0,NULL,0,1,'2018-07-27T20:07:37.342Z','r712j584c347',0,0,NULL),('ck1x3b45c01b801i9argn1rpj','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','1. Everyone at Focal has a strong belief for success and this makes them improve themselves all the time.\n2. For internship program, the mentorship is great and the interns grow very fast.\n3. The weekly meeting has many new ideas and inspirations. It also improves the communication skills of new employees.\n4. Great company culture. Work hard play hard. Every one is easy to get along with.\n5. For technical side, they research deeply into papers, classical DL repos. This builds up a solid CV/DL/ML foundation for me and helps me become a much better ML engineer.',30,'USD','hourly',5.0,5.0,5.0,3.0,NULL,0,1,'2018-08-07T01:09:31.872Z','r713j585c348',0,0,NULL),('ck1x3b45c01b901i9800x2ffg','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Highly dependent on the team. My team was very good and had an interesting project that I worked on. I learned a lot and there are a lot of bright people working there. Gave a one time flight stipend ($750 if you\'re from Waterloo).',4200,'CAD','monthly',5.0,4.0,4.0,5.0,NULL,0,1,'2018-08-07T01:13:07.458Z','r714j368c84',0,0,NULL),('ck1x3b45c01ba01i93cvibyhj','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Working with the mobile team, you get to work on the Dayforce app which is used by millions of people around the world so the work you do has an impact on those millions. As an iOS developer, I learned way more than I expected to learn. The other iOS developers (and even the android and API guys) are incredibly smart and they teach you a lot. Two of the iOS developers work remote so you have to be pretty comfortable using Skype and other communication tools, which also means you have to be able to work well independently. The plus side is they\'re open to you working from home or from another office when you need to.\n\nThe work environment is really relaxed and there are hardly days where you\'re bored out of your mind or you\'re swamped with so much work that you have to work weekends. So the work/life balance is fantastic.\n\nThe work environment is also not super trendy. You\'ll find a foosball table but you won\'t get perks like free swag, free daily food (there are days with free food though), couches, bean bag chairs, beer on tap, etc. Additionally, Ceridian ships enterprise code and recently went public so they\'re fairly big. That can be seen as both a pro and a con.\n\nIf you\'re okay without those fancy perks (that really do nothing in the long run), and want to ship good code, this is a great place to work and guaranteed you will learn a lot and your code quality will improve a ton. If you care more about the perks, you\'re better off going to a startup or somewhere in Cali.',5583,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2018-08-17T20:16:56.456Z','r715j586c290',0,0,NULL),('ck1x3b45c01bb01i9bk9y23rb','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','\nUltimate Software - a hidden gem of a company. Their company motto is \"People First\" and it\'s true. It\'s the best reason to work here. From fun office events, to free food, to after hours activities with coworkers, you\'ll enjoy your time here, all the while contributing to a strong performing product, UltiPro. The business is strong, culture is strong, and you\'ll feel like you\'re part of a winning team. \n\nOn the software testing side, you\'ll be exposed to software automation, advanced tools, and parts of the SDLC that\'ll teach you more than just manual testing things, as is the case at some companies.\n\nLocated downtown on Bloor Street, the Yorkville neighbourhood is nice, and it\'s right beside the subway and GoodLife (corporate membership discount) Pay is well above the Waterloo average and based on which co-op term you\'re in.',29,'CAD','hourly',5.0,5.0,4.0,5.0,NULL,0,1,'2018-08-23T18:14:50.577Z','r717j587c334',0,0,NULL),('ck1x3b45c01bc01i9265u2k8b','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked on the autonomous vehicle team. \n\nI had a super awesome experience working here. I got to do everything from hardware to software to product design, and I felt like I was actually an integral part of the team that I was on. I felt like I gained a lot of experience in writing well-architected C/C++ code as well as other skills more specific to building an autonomous vehicle.\n\nMost of all, I really liked the people at NVIDIA. The people I worked with at NVIDIA were some of the most humble but yet smart people I\'ve ever worked with, and I felt like I became close friends with many of the people I worked with despite stark differences in age / backgrounds / nationalities. NVIDIA is also a very diverse workplace, and I was actually the only US-born person in my entire team. \n\nI didn\'t enjoy life in bay-area that much as other cities I\'ve lived in, but the company itself made it all worth it. ',8500,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2018-08-24T23:57:56.908Z','r718j569c30',0,0,NULL),('ck1x3b45c01bd01i91tbp9x9z','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I recommend Zugata to anyone looking for a meaningful internship in software engineering. As a frontend intern I was fully incorporated into the engineering team and assigned the same work as FTs. You get to work with modern frontend technologies. It is a great place to grow yourself as a software engineer. The work was very fulfilling and everyone was extremely easy to get along and work with. ',5600,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2018-08-25T06:22:23.226Z','r719j478c303',0,0,NULL),('ck1x3b45c01be01i988xeempa','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked on the Merchant Payments team(platform). It is chill as long as you code fast.',8500,'USD','monthly',4.0,5.0,3.0,5.0,NULL,0,1,'2018-08-31T05:30:23.699Z','r720j588c104',0,0,NULL),('ck1x3b45c01bf01i9g1lkenr1','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Probably one of the nicest offices in the world; even by tech standards. \n\nTheir team matching was done well and placed me with a team that I was very happy with. The people at Airbnb are noticeably more friendly/outgoing than other companies I have worked at which was refreshing. \n\nWork/life balance, at least on my team, was pretty much perfect. I never felt pressured to put in extra hours and my project was well-scoped.\n\nThe perks and compensation is solid:\n1. $40/hour  ($60/hour overtime) + $4000/month housing stipend = ~$11000/month (pre-tax)\n2. Free breakfast/lunch/dinner/snacks/drinks\n3. $1000 in Airbnb credits\n4. ~$250/month in transportation credits\n5. Lots of intern/team offsites',11000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2018-09-01T13:46:53.345Z','r721j589c3',0,0,NULL),('ck1x3b45c01bg01i90n5hh60h','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The company is growing very quickly. The engineers there are very talented and, being a younger company, there are lots of opportunities to work on new and interesting projects.',7000,'USD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,'2018-09-01T13:52:27.525Z','r722j307c221',0,0,NULL),('ck1x3b45c01bh01i902ncfkvq','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked there in 2017, had a good experience.\n\nMentor was very knowledgable about the work while also being very approachable and easy to get along with. Other team members were also very open to helping with any questions.\n\nWorked with SAS and Teradata, technologies aren\'t the most applicable to other jobs but still good to learn about databases and SQL.\n\nWork-life balance was amazing, hours were very flexible, if work is done no need to stick around. A perfect amount of work was assigned, enough to not sit around bored but also leaving lots of time for pool, Tim\'s runs, long lunches, or self-learning. WFH also allowed (within reason of course).\n\nFree parking was also given.\n\nThere were a few opportunities to learn about other areas of the business through lunch and learns by other teams and team members.\n\nRare team potlucks, lunches, outings.\n\nOverall would recommend it if you are interested in the data engineering field and ETL.',18,'CAD','hourly',5.0,4.0,5.0,5.0,NULL,0,1,'2018-09-11T04:01:34.353Z','r734j597c355',0,0,NULL),('ck1x3b45c01bi01i94atb7tip','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Pros:\n- Great mentorship and work-life balance. \n- Flexible hours and work from home policy\n- Treated as full time member of team, with an equal say in team decisions\n- Teams have a very large amount of autonomy, supporting different working styles. Some teams are very autonomous, while others rely heavily on pairing. Many teams are split across offices.\n- Interns can lead Failure Friday, and motivated interns can go on-call for their team\n- Functional programming is applied very widely; Many teams have most of their code in either Elixir or Scala, with only legacy code in Ruby\n- Free lunch\n- The people are very accommodating to different backgrounds and lifestyles. [Daddy|Mommy]Duty, for example, is a common term for when you adjust your work schedule so that you can take care of your kid. There are also various support groups within the company, like SisterDity and VeteranDuty. PD doesn\'t use \"culture fit\" as an excuse to exclude people, like some other bay-area companies do.\n\nCons:\n- Some teams work mostly in (an exceptionally old version of) Ruby on Rails. \n- General growing pains as the company grows\n\nI have worked in both offices. I would highly recommend anyone to intern at PD, but make sure you talk to a previous intern on your team to make sure it is a good fit. The Toronto office is better in every respect except weather and pay, with a more laid-back culture and better free lunch.\n\nThe lunch is exceptional. There was a wide variety of food from many different vendors each day. If you are in the Toronto office, I highly recommend Spicy Ethiopian day. In SF, deep dish pizza.\n\nPD hires people from a wide variety of backgrounds, which is great. If you can code but you aren\'t in CS or Software Engineering, don\'t let that stop you from applying.\n\nI would also recommend asking about their policies on affirmative action if that is something that is important to you. \n\nQuestions to ask your team if you get an offer:\n- What tools does the team use?\n- How much time is usually spent in meetings? How much of the time is spent working on new services and features, vs. polishing existing ones? Ops work vs. coding?\n\n',8000,'USD','monthly',4.0,5.0,3.0,5.0,NULL,0,1,'2018-09-01T14:30:52.951Z','r723j116c95',0,0,NULL),('ck1x3b45c01bj01i9g5n2bmrf','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Culture was great, pay is decent for early on, scales with previous experience (875/week to 1000/week).\nFairly typical small company (60 people in office) but if you live nearby I’d recommend it',3500,'CAD','monthly',4.0,4.0,4.0,5.0,NULL,0,1,'2018-09-01T14:52:00.818Z','r724j590c349',0,0,NULL),('ck1x3b45c01bk01i9c2xq45j1','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I was on iOS team, holy **** everyone on my team is super nice and super smart. They are just amazing people to talk to. The work was super meaningful, I was able to fully ship 2 major features to AppStore in the span of 4 Months. Asana really cares about your passion and make sure you enjoy what you work on. Asana has no doubt the best mentorship program for interns in the Bay Area. 11/10 would recommend. (I am a foodie, and Asana has one of the best in-house chefs, food is 12/10)',9166,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2018-09-01T18:06:48.440Z','r725j57c7',0,0,NULL),('ck1x3b45d01bl01i96ja2bbh8','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Best co-op to date. Company culture is fantastic, and your mentor will do their absolute best to support you and your learning. Since it is a mature startup, there is definitely some red tape and work you do might get re-prioritized, but your manager will do their best to shield you from it.',6000,'CAD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,'2018-09-01T19:07:19.601Z','r726j591c350',0,0,NULL),('ck1x3b45d01bm01i9daz039n7','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','PROS\n- great people\n- interesting projects\n- free coffee / tea / large variety of drinks / beer/ chips / cookies etc\n- biweekly BBQs\n- flexible hours\n\nCONS\n- salary is on the lower side for second coop\n\nOVERALL\n\nWorked here as a Android developer, but I also worked with some Java Swing and C. Had a really good time working here, I was assigned a lot of tickets and some big features. The coworkers are very kind and knowledgeable and were always willing to give me a hand.',3200,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2018-09-02T21:55:42.985Z','r727j592c351',0,0,NULL),('ck1x3b45d01bn01i96s238aqe','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','There were a fair few co-ops, so the social life in the office was quite nice. Since it wasn\'t their toronto office, busy season was never too bad. The early months of my co-op were quite work-less (as seemed to be the case for many others in the office). Overall, I feel like I learned a good amount without being worked to death',3250,'CAD','monthly',4.0,4.0,3.0,5.0,NULL,0,1,'2018-09-02T22:04:57.859Z','r728j593c352',0,0,NULL),('ck1x3b45e01bo01i9a1d6bc2v','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked at the Toronto studio during Summer 2018 on an unannounced AAA title. To start with, Ubisoft has a very thorough onboarding process as well as an awesome mentorship program that makes sure all newbies get a quick start on the project and take on whatever task that interests them the most, so I was able to understand the scope of the game and catch up with the development in the very first week. As a rendering programmer, I worked on lighting and post-fx features concerning cutting-edge techniques in computer graphics, which was fun and challenging since I had to read tons of papers before even starting to write a single line of code. I was also treated as a full-time employee and given full ownership of the features I worked on, meaning that I had to communicate extensively with artists and technical directors about the features, and was solely responsible for whatever issue that popped up. Work-life balance was pretty good as there\'s no overwork unless a deadline is approaching. Overall, 10/10 would recommend to anyone passionate about gaming and curious about how video games are developed. After all, you might have a good chance of leaving your name on your favorite game XD',5600,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2018-09-02T23:10:37.307Z','r729j594c353',0,0,NULL),('ck1x3b45e01bp01i9djr5b06c','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Awesome company culture like Work from Home day for every Thursday. Paid Volunteer Time Off. Great Benefits. Payment is 7500 + 3900 + 100 per month.',11500,'USD','monthly',5.0,4.0,5.0,5.0,NULL,0,1,'2018-09-07T04:43:03.942Z','r732j359c38',0,0,NULL),('ck1x3b45e01bq01i93hpobtu1','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked there recently, loved my time at Flipp.\n\nThe work itself wasn\'t the most exciting (not the newest technologies, more refactoring work vs new stuff), but it got better as the term went on.\n\nThat aside, what I really loved is the close rapport with most of your team. Everyone was open at any time to help, and we had weekly 1on1s to make sure everything is going well. My mentor was super knowledgeable about many topics, and it was really cool getting to know him and staying in touch in the future.\n\nWork life balance is great, the working hours are flexible and occasional WFH is also allowed.\n\nThe company itself is also awesome, weekly town halls with the whole company to discuss goals, progress etc. Biannual overnight trips with the whole team. Free Goodlife membership and TTC metropass. Tons of snacks and drinks in office. Weekly lunch. Occasional team lunches and company outings.\n\nBecause of all of this I really looked forward to coming to work every day. Loved getting work done and learning while also having fun with the team. Definitely recommend it',1080,'CAD','weekly',5.0,5.0,3.0,5.0,NULL,0,1,'2018-09-11T03:53:25.091Z','r733j596c238',0,0,NULL),('ck1x3b45e01br01i93fm8a45l','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','forced coops to work 12 hours a day and CEO told us that we shouldn\'t be \"bound by the go train schedule\" in terms of our time in the office - aka slave driver',2200,'CAD','monthly',1.0,1.0,2.0,1.0,NULL,0,1,'2018-10-13T01:23:07.478Z','r747j463c297',0,0,NULL),('ck1x3b45e01bs01i9ag7517y4','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Overall it was a great experience as I got to work on some cool projects. Danny is a great mentor but the only full time that was there during my term. He lets the co-ops have full control of the project which we respected a lot. The company had a startup feel but the projects at the time were frustrating due to head office restrictions. I would recommend this co-op for a first or second year student.',4400,'CAD','monthly',4.0,2.0,4.0,5.0,NULL,0,1,'2019-01-17T19:06:38.448Z','r778j627c212',0,0,NULL),('ck1x3b45e01bt01i98nmnhl9n','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked here in 2018. The infrastructure team has subteams, although they\'re now hiring for each one individually. The infrastructure team is amazing - they\'re all more than willing to listen and help, and always encourage questions. My mentor always made sure I wasn\'t blocked.\n\nPay was $50/hr + 1 time housing stipend ($3500 before taxes) + ~$250/month for clipper. \n\nI got to work on some pretty cool projects that used a lot of modern tools, and learned a ton.\n\nCulture and work/life balance are really great, very SF startupy (they\'re a mid-sized company). Went on multiple outings, and PlanGrid frequently has events. ',8750,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2018-09-17T15:08:33.216Z','r735j598c354',0,0,NULL),('ck1x3b45f01bu01i91ha1gx7x','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked there in summer 2018, since they only have summer internship so be sure to apply if you are gonna coop in summer. I was given 6500 a month but my colleagues from Waterloo are given 7500 so be sure to negotiate about salary. The intern program is  extremely well structured with a dedicated mentor who had a detailed project plan before I arrived. I also had weekly formal oral feedback and bi-weekly written feedback from mentor. However, YMMV depends on what team you are on, but most of them are very good and have meaningful work. In terms of intern events, they literally have multiple events every week to do stuff like hiking, cruising, kayaking, glass fusing, bubble soccer, to name just a few, so there were lots of fun. Besides, their cafeteria is the best in bay area. (Any contenders?) BTW, corporate housing was 2 people in one bedroom (not as good as FB) but was very close to Dropbox. Overall, outstanding intern experience. ',6500,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2018-09-20T20:47:26.868Z','r736j599c12',0,0,NULL),('ck1x3b45f01bv01i95omwcc4i','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Salary doesn\'t include the housing stipend which was around $1200 USD/month\nSuper fast growing company, tons of interesting work. Building tools for developers help keep the code quality relatively good and enforces a strong dev-ops culture with all the engineers. Managers have a lot of trust in their interns so you generally will have full ownership over a service or feature that impacts all the customers.\n\nUnique perks include 5 PTO days (for vacation purposes, sick days/WFH days generally is unlimited within reason) and travelling to company conferences, where flights/hotels/meals are paid for and after the conference if you arrange housing you get the chance to explore a new place, so it\'s great paired with the PTO for a chance to travel in the middle of an internship. ',7200,'USD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,'2018-09-21T16:06:46.291Z','r737j549c335',0,0,NULL),('ck1x3b45f01bw01i94110amal','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked there during busy season, expect to pull at least 50 hours per week, with many people going over that. You\'re with a senior most of the time, so you can ask them lots of questions but co-ops usually do the grunt work. They had busy season events every week such as free food and massages and even an end-of-season party so if you really value those things then you\'ll enjoy the company. Be prepared to either have no work, or pull OT for all the work you have. Definitely better than Big4 though. ',2400,'CAD','monthly',2.0,4.0,3.0,1.0,NULL,0,1,'2018-09-22T23:00:09.071Z','r738j600c356',0,0,NULL),('ck1x3b45f01bx01i95x4r8j4u','2019-10-19 04:56:45.467000','2019-11-27 20:35:29.306000',0,'ck1n1du49000501jo4pwygsav','Overall a good internship',15,'CAD','hourly',4.0,4.0,3.0,5.0,NULL,0,1,'2018-09-23T23:35:20.551Z','r739j601c357',0,0,NULL),('ck1x3b45f01by01i9ezbmchso','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','People are great. I had an awesome manager who really cared about my learning and growth, and an amazing mentor who was always willing to help when I needed it and made sure I was never blocked. Would recommend.\n\nCompensation: $8750 monthly + $3500 stipend + clipper card (put as much money as you want on it)',8750,'USD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,'2018-09-24T20:41:31.916Z','r740j595c354',0,0,NULL),('ck1x3b45f01bz01i9ejgo39as','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked here on the ELT Params team for my first co-op in Summer 2018. Everyone on the team was great to work with and I learned a lot about the Agile process as well as good software development practices in Python. The office is located at Yonge-Dundas in downtown Toronto, which makes transit to and from work a breeze. The only downside is the lower than average pay.',2700,'CAD','monthly',5.0,5.0,4.0,4.0,NULL,0,1,'2018-10-06T03:03:52.853Z','r741j287c206',0,0,NULL),('ck1x3b45f01c001i95ti11kz1','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I loved my internship at NVIDIA. The salary was recently increased a very large amount as I was paid $46/hour. I got along very well with my team and they really treated me like a full time. I learned a lot while working on the project assigned to me. I included the $2200 housing stipend they give every month to the salary as you keep any that you don\'t use. ',9640,'USD','monthly',5.0,4.0,4.0,4.0,NULL,0,1,'2018-10-08T19:18:01.845Z','r742j602c30',0,0,NULL),('ck1x3b45f01c101i9dcpsg5xw','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Everything about the company was awesome. Everyone I met was super friendly and very talented. The work that I was given was more impactful than any other coop I had before and I was able to see the results of my work. The futureforce team organized many fun events throughout my summer internship including meeting many upper execs (including co-CEO!) in person, baseball games, all-you-can-eat food truck park, day at amusement park, day at zoo, day touring SF, etc... There was also the work-from-home day every thursday. \nThe only downside is that you are required to share the bedroom in corporate housing with another roommate. The room itself is very luxurious (free gym & spa) and is fully furnished even with kitchenware.',47,'USD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2018-10-10T15:29:45.154Z','r743j359c38',0,0,NULL),('ck1x3b45f01c201i9gtu64xgd','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The studio is closed :\'(',26,'CAD','hourly',3.0,3.0,4.0,3.0,NULL,0,1,'2018-10-10T15:38:53.109Z','r744j102c108',0,0,NULL),('ck1x3b45f01c301i9atl12r9e','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Second co-op semester. I worked January-April 2018 for a research and development team based in Mississauga, but my position was officially in the Southcore Financial District office. Did require some travel to Mississauga. Absolutely gorgeous 31st-floor office, near Union Station. Semester started off slowly (that\'s why I rate it 4/5), but halfway through I had much more work to do. Boss was very flexible in letting me choose what challenges to tackle. Mentorship is great but you have to actively seek it! The work that I did actually impacted the teams that I was supporting. This company hires a lot of co-ops, and your experience will depend heavily on the team you end up on.',22,'CAD','hourly',4.0,4.0,5.0,5.0,NULL,0,1,'2018-10-12T03:07:12.179Z','r745j603c313',0,0,NULL),('ck1x3b45f01c401i9azr20dwv','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The mobile team was great. My mentor on the Android team was extremely helpful and provided a ton of great feedback and support. I was given the opportunity to work on the coolest features in an app that was being redesigned. The Android team is fairly small, there were only 2 full time Android developers at the time and the mobile team was 10 people in total including the UI/UX team. \n\nYou\'re not expected to know anything about forex trading before hand. \n\nPerks:\n- Once a week: catered lunch, pizza night and catered breakfast\n- cereal and snacks\n- drinks and coffee\n\nPros:\n- Get to learn Kotlin (big push to write more of the app in Kotlin)\n- work designers on improving the UI/UX\n\nCons:\n- main app is large and has parts of legacy code \n',26,'CAD','hourly',4.0,5.0,4.0,4.0,NULL,0,1,'2018-10-12T15:19:07.216Z','r746j604c136',0,0,NULL),('ck1x3b45f01c501i9f2huggpn','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Contributes to the data here',9000,'CAD','monthly',3.0,3.0,3.0,3.0,NULL,0,1,'2018-10-13T20:31:17.853Z','r749j606c359',0,0,NULL),('ck1x3b45f01c601i9dqbwhqil','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I loved my co-op term at GroupBy! They placed a lot of emphasis on making sure that I was constantly learning and working on meaningful sprint work. The mentorship was great, everyone was always really friendly and always more than happy to help me in any way or answer my questions.\n\n The culture was fantastic! There was some fun social event going on pretty much every week, which gave me lots of opportunities to make friends and meet new people! There was also catered lunch every Thursday, and their kitchen was always stocked with snacks, fruit, coffee and tea!\n\nOverall I think that it\'s a great company and I would definitely recommend it for a co-op term!',4000,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2018-10-19T14:04:12.693Z','r750j605c358',0,0,NULL),('ck1x3b45f01c701i9hn357tav','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Your experience is very dependent on the team you\'re placed in, and the manager and mentor you get. Mine was a horrible prick who had no experience working with interns, didn\'t set expectations and had basically no idea on how to mentor an intern. Was also sort of arrogant and totally not open to any opinions on how to do a task, and liked to boss around. My experience was pathetic and I would never return. Didn\'t get any meaningful work or learn much, through some other interns on better teams did have better experiences. Also compensation is very low given how expensive Vancouver is, and you will just be able to cover basic living expenses. \nTake their offer only if all your other intern offers are much worse, otherwise go elsewhere. ',3600,'CAD','monthly',2.0,1.0,1.0,3.0,NULL,0,1,'2018-10-24T00:42:20.381Z','r751j521c111',0,0,NULL),('ck1x3b45f01c801i9daouafo0','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The team I was placed on was very supportive and always down to help interns. Truly made an effort to make you feel like you fit in, and the work was mostly meaningful. Besides, the job is very chill and strictly 9-5. They also lots of other interns, and many intern events planned throughout the term. Would definitely recommend for the first few coops.\nHowever, it is also very bureaucratic and you will waste lots of time on useless meetings. \n\n',2800,'CAD','monthly',4.0,4.0,3.0,5.0,NULL,0,1,'2018-10-24T00:47:56.005Z','r752j607c191',0,0,NULL),('ck1x3b45f01c901i9bmw79t2c','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Very nice employees, great work life balance',26,'CAD','hourly',4.0,4.0,3.0,5.0,NULL,0,1,'2018-10-29T08:07:59.700Z','r753j608c268',0,0,NULL),('ck1x3b45f01ca01i97whgau5w','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Company culture was amazing. I got to experience a lot of fun intern events and had the experience to work on some very interesting technologies. Although I do feel that the projects given to me were not too meaningful to the company. The corporate housing was also pretty nice too; though you have to share it with another roommate in the same room. I highly recommend it.',7280,'USD','monthly',5.0,5.0,3.0,5.0,NULL,0,1,'2018-10-29T12:29:11.379Z','r754j359c38',0,0,NULL),('ck1x3b45f01cb01i9btxa3oaf','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','DISCLAIMER: I had many friends who worked at Apple and really loved it, I was just incredibly unlucky with my project and team.\n\n- I worked in the Hardware Tech org, the majority of which was situated in satellite buildings around Apple Park, but not in it. Instead of working in a bright, modern, open office, I worked in a claustrophobic, depressing sea of cubicles. \n- The manager who hired me was transferred right before I arrived, which meant no-one on the team really knew what I was supposed to be doing. I eventually worked on a project spearheaded by the team\'s former manager, but without him giving guidance and direction, the project stalled, taking nearly the entire term to finish.\n- My team was incredibly antisocial, not just with me, but amongst themselves. Lunches were quiet, with no-one being able to start and sustain conversations. Laughter came in short bursts, with long stretches of silence in between.\n\nThat said, the area was quite nice, with the housing being pretty decent (shared-room, but I lived with someone I knew, so it wasn\'t that bad). If you can get a group of friends together, there is lots of stuff to do on the weekends in and around the bay-area (not in Cupertino itself though, it\'s really boring)',7000,'USD','monthly',1.0,1.0,1.0,2.0,NULL,0,1,'2018-11-01T17:19:43.613Z','r755j68c5',0,0,NULL),('ck1x3b45f01cc01i99h6o4apd','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The review is team specific because people have different experiences with different managers. I would say Capital One in Toronto (overall) is good for one of the early coops, but I personally did not have the best experience. I was given an intern project, which I am pretty sure never got put into production. There weren\'t any code reviews either so I didn\'t learn much (if anything) about industry coding. The salary was great for a first coop and they gave a $1000 bonus.',23,'CAD','hourly',4.0,4.0,2.0,3.0,NULL,0,1,'2018-11-02T09:35:39.493Z','r756j609c175',0,0,NULL),('ck1x3b45f01cd01i9631af3xl','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked here for my first coop in Summer 2018, mostly creating internal tools for the team. It was mostly individual work, but it is really easy to find people around the company to help you out. The overall company culture is great and you get frequent one on ones with an assigned mentor. The kitchen is stocked with fruit several times a week, and there\'s always free coffee, tea, and drinks. There\'s a Costco just down the road for cheap food as well. Unfortunately, the team tends to use older technologies for development, but other than that, it was a great experience!',900,'CAD','weekly',5.0,5.0,4.0,5.0,NULL,0,1,'2018-11-03T17:15:49.860Z','r758j611c361',0,0,NULL),('ck1x3b45f01ce01i9ans78961','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','One of the best internships to date. Great culture and extremely smart people. The engineering projects were high impact and you could see the value they brought to the company. People really care about your growth and interests. I would definitely recommend it.\n\nThe perks and compensation are highly competitive (the salary includes $1500 housing stipend).',9000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2018-11-03T19:47:27.283Z','r759j612c11',0,0,NULL),('ck1x3b45f01cf01i99ouq6o6q','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I interned here as a SWE intern. Work was really good and my team gave me a lot of autonomy on what I could work on. The company is huge but every org works pretty autonomously so I didn\'t feel like I was doing unimpactful work. Everything is extremely team dependent.\n\nApple Park is one of the most beautiful buildings I\'ve seen in my entire life and they\'ve recently opened it to all Apple employees. The facilities, gyms, etc are all top notch and in pristine condition and exactly what you would expect from Apple. \n\nFrom my experience, at Apple you\'ll get a shared private office with another co-worker. IMO it\'s way better than the crowded open office layout all the other tech companies have. YMMV though, some (unlucky) people have cubes.\n\nEngineering orgs get free snacks/drinks but YMMV. \n\nCaffe Macs food is amazing, it\'s way better than the food they serve at Google but you have to pay a subsidized cost for it. The food quality is probably comparable to LinkedIn, Twitter, etc. \n\nBreakfast costs $2 (Avocado toast with half an avocado) or $3 (Acai bowl). There are other options like omelettes and breakfast burritos but it depends on which office you get placed in. Lunch costs between $5 (for an unlimited topping sandwich) and $12 (Scallops, Oysters, etc). Pizzas are $8 and are really good. Engineers get a $12 dinner credit past 7pm. \n\nPay seems a bit off in all of these postings for some reason. My guess is that hardware/embedded/low-level SW roles are paying less than pure SW roles. I got paid 38/hr ($6600/month) + free corporate housing but I was really early in my co-op terms. You get paid by the hour and (with manager approval), you can work OT for 1.5x the pay. You can get around $42/hr ($7280/month) if you\'re slightly more senior. \n\nCorporate housing is a really nice 2BR place. They do stuff 4 people in that 2BR place though. This is pretty common, its done the same way in LinkedIn too. If you don\'t like having a roommate, I\'d advise taking the $1000 post-tax housing stipend and finding your place around the Sunnyvale area (you can find a private room for ~1200 on PadPiper). \n\nInterns get access to Apple\'s Employee Purchase Program for substantial discounts on Apple products, both for yourself and for your friends & family.\n\nApple\'s University Relations team basically doesn\'t host any intern events other than in the summer, but even then, there aren\'t that many of them and they\'re way too large scale since Apple hires so many interns. Orientation is only for half a day, so don\'t count on meeting many other interns during your internship unless you really make an effort to. ',38,'USD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2018-11-05T15:58:17.574Z','r760j402c5',0,0,NULL),('ck1x3b45f01cg01i95n739pso','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','They grant an incredible amount of ownership and unlimited freedom to pursue any improvements or ideas you might have to help improve the company\'s products. Rob & Jasmin are also fantastic mentors.',25,'CAD','hourly',5.0,5.0,5.0,4.0,NULL,0,1,'2018-11-06T01:11:36.579Z','r761j613c62',0,0,NULL),('ck1x3b45f01ch01i9en7ehftj','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','It\'s a very good place that is working on unfortunately a very boring product. It is ultimately a great enviornment with a cool office, sociable people and a lot of perks (free snacks, catered lunch once a week, on site gym). Mentorship was also top notch, and they made a lot of effort to aid your growth and development.\n\nThe office location is pretty awful and out of the way however (junction area) with not much around. It is also very hard to get motivated working for their product since they are playing catch up most of the time, thus having little innovation or interesting projects. ',5400,'CAD','monthly',3.0,5.0,2.0,4.0,NULL,0,1,'2018-11-13T19:20:46.320Z','r763j11c65',0,0,NULL),('ck1x3b45f01ci01i9h1jr8my5','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','This was my favourite internship experience by far. No it is not a big tech company, so you miss out on many of those perks. But the work experience is invaluable. Everyday I looked forward to getting to work on my project and it never felt like work (I have not felt this way in other internships). I felt very fortunate to work on something that made an actual impact in the company which made it not feel like the typical intern role. I was given real responsibility which made the internship so much more rewarding. The team is small and fast paced, and you get a good idea of what everyone is working on. The mentorship is excellent and I walked away from this internship with even more than I put in. I would highly recommend this company to anyone considering taking an internship here. ',26,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2018-11-17T06:19:13.352Z','r764j615c362',0,0,NULL),('ck1x3b45f01cj01i93a8o6wdj','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','This was a co-op from 2017. The salary was low given that it was 4th year co-op and had no overtime pay. The role was Financial Reporting for CPA, so you get your hours. The working environment is great and the company treats the co-ops really well. It provides us lots of free meals and even allowed co-ops to go on company retreats (3-day) with accmodation, tranportation, all meals paid for (and you still earn your salary). They really treated co-ops as one of their own and provide meaningful work and gave you responsibility. However, they do not retain co-ops for full-times so that\'s a downside.\n\nOverall, great experience and treated co-ops with respect and provided lots of opportunities.',22,'CAD','hourly',5.0,3.0,5.0,5.0,NULL,0,1,'2018-11-17T19:02:22.676Z','r765j616c363',0,0,NULL),('ck1x3b45f01ck01i945h268d5','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Great foot-in-the-door opportunity as a psychology student. Was afforded the opportunity to work on diverse projects of measurable impact regarding unified tobacco legislation reform. As my first co-op, this position allowed me to sharpen my professional skills and grow into more nuanced roles.',16,'CAD','hourly',3.0,1.0,3.0,5.0,NULL,0,1,'2018-11-26T07:11:35.642Z','r766j617c364',0,0,NULL),('ck1x3b45f01cl01i96uvs9mmm','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked there a few terms ago, the experience was great and I joined a team doing something that I had previously no experience in, so I definitely learned a lot and grew as a developer. \n\nThe work was pretty great but the team was doing some not so interesting things when I joined so I didn\'t really get to do a lot of what I wanted which is fine since what I did was interesting as well in it\'s own rights I guess.\n\nThe free lunch is dope, we get awesome food from great restaurants in TO everyday and work life balance is a blessing too, with no one expecting you to stay back too much or go out of your way to do anything.\n\nThe company events, culture and perks are all really awesome, we have intern events, DnD nights etc. and it\'s a really nice and welcoming culture imo, Really liked the other interns and fulltimes at the company, especially my mentor and people on my team -- they all were really cool and funny people.\n\nOverall a solid internship, bunch of learning and understanding how software works at scale with focus on reliability and uptime.',34,'CAD','hourly',4.0,5.0,3.0,5.0,NULL,0,1,'2018-12-02T16:52:51.434Z','r767j618c95',0,0,NULL),('ck1x3b45f01cm01i9gdjcar3l','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Without a doubt one of the best companies to work at in Toronto. Very talented leadership team with extremely impressive backgrounds. Culture here is unbeatable; everybody works hard, while also being laidback and very approachable. Learning and personal growth is the number one priority for employees here, and management does as much as they can to support that. The company is a leader in the Canadian AI ecosystem, has tremendous financial backing and ambitious goals.\n\nCan\'t go wrong applying for a job at integrate.ai',1700,'CAD','weekly',5.0,5.0,5.0,5.0,NULL,0,1,'2018-12-05T16:38:29.444Z','r769j620c365',0,0,NULL),('ck1x3b45g01cn01i9edk0461g','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Work, and Mentorship\n\nThe work was very meaningful and I felt like I made a real impact in the company. I was treated as a full time engineer from day 1 working on the same projects as other engineers on the team. I also had an amazing mentor that seemed to know the answer to everything but only gave me enough hints to help me learn on my own. \n\nCulture\n\nThe culture at Zanbato is very sports oriented. If you love basketball or football you will fit right in. Near the end of the day, all the engineers huddle up and we play Super Smash Bros or ping pong which can get very involved at times.\n\nPerks\n\nTo make my internship experience that much better, Zanbato gave me a bike and cell phone. They also have free lunch everyday, and dinner on Tuesdays & Thursdays. You also get every other Friday off to work on any project you want on the side.\n\nOut of my 5 previous in internships, Zanbato was definitely the best and I highly recommend it if you are looking to do an internship in the bay area.',4800,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2018-12-07T17:18:02.738Z','r770j621c366',0,0,NULL),('ck1x3b45g01co01i9cr348a4n','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked here in the fall of 2018 as a software engineer intern. The company culture was just fantastic, there were many events planned for both interns and full times, including happy hour every Thursday and team dinner outing every month. The perks are great - free lunch, on-site gym, and snacks every floor. I had the opportunity to work on impactful and meaningful projects and was treated like a full-time. I learned a lot about handling large data sets in a batch fashion while working there. I also had excellent mentors, and who coached me during my term. Lifion also has excellent infrastructure and a great number of resources I could leverage. \n\nOverall, Lifion by ADP is a great place to grow and learn as a software engineer.',8000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2018-12-16T23:11:09.893Z','r771j622c367',0,0,NULL),('ck1x3b45g01cp01i98qze99h0','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Really liked working here, the people were smart, kind, and a pleasure to work with. The company has serious scaling concerns but he product and engineering work behind it is pretty good. The corporate apartments were really really nice. I lived with another intern in 2 bedroom 2 bathroom place in midtown east, ~10 minute walk to work/grand central. ',7900,'USD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,'2018-12-19T16:58:11.589Z','r773j623c2',0,0,NULL),('ck1x3b45g01cq01i91rge7zqj','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Great place to work overall - work environment is relaxed and you\'re surrounded by a lot of smart engineers with strong technical backgrounds. A few of the full-times have experience working at Google, Facebook, Asana etc. \n\nWork-life balance is quite good as you have flexible work hours and have the option to work from home. Company has free lunch/breakfast usually every Friday and there are a few events throughout. As a start-up, company is rapidly growing and acquiring new talent.\n\n\n\n\n',5700,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2018-12-24T19:47:51.513Z','r774j624c368',0,0,NULL),('ck1x3b45g01cr01i982wp5nmo','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','\"When you look at someone through rose-colored glasses, all the red flags just look like flags\"\n\nWhen you\'re working somewhere, it\'s often easy to get used to your surroundings and not notice anything wrong. I thought that my time at Bespoke Metrics was average, until I went to other companies to work and realized the smoldering dumpster of a workplace that this was.  \n\nInternships should be an investment that companies make so that there are hopes that the interns will convert to a full-time employee that will require less training to get started. This is why Silicon Valley and top tech companies pay their interns an exorbitant amount of money to hire them, even though the company won\'t make that money back from the intern\'s work.\n\nHowever, Bespoke Metrics hire interns because their core product requires cheap labour and what better way to get this than to hire poor students and then use the workterm evaluation as a \"carrot on the stick\" to overwork them?\n\nIn my term here, there were many serious issues with the full-time team. Some of the people are nice (4/13), but all the people who held key positions high up were the most arrogant and tactless people that I have ever met. You can read the other reviews to see the things that certain people have said, as that topic can be itself another review.\n\nAlso, if everyone in the company and their mother is a \"senior X\" does that \"senior\" keyword even matter? It literally becomes a label to inflate your ego, and it clearly has gotten to the heads of the people working here.\n\nThe work here was also really spotty. You can either be nuked with work, often a deliverable due by the end of the day or you would literally have nothing to do even if you ask your manager (I was told to \'read up on best practices\' of certain libraries MULTIPLE times throughout the term). \n\nThe work culture here is perfectly represented as waterboarding. Everyday is a fun game of Russian Roulette where your personal physical + mental health is on the line and the bullet is a truckload of work due before you are allowed to leave. Hours are insane when you are required to finish the work because the company needs this functionality to make money.\n\nAlso, as mentioned by someone else, they pay you biweekly, so you\'re doing volunteer work if you stay past 9-5, but you can\'t leave or else they will passive-aggressively comment on you \'leaving early\'.\n\nBack to the spotty work. I cannot imagine the time that I have wasted just waiting for time to pass. I started reading CTCI, fueled by the motivation of getting as far away from here as possible and ended up getting better jobs. I would say that this job is like that abusive cheating ex that you learn what to look out for in future relationships, but made your everyday life a living hell when you were with them.\n\nAlso, the management team comes from Finance backgrounds. This means that they bring the toxic \"time at work > everything else\" mentality that you find in Finance/Big 4 firms, which is insane. You have interns that are blackmailed and guilted to start work early, stay late, while often doing nothing. I sometimes wondered if this is what jail time looked like while working here. \n\nThere have literally been times when the interns would play games together during work hours because they have no work and have asked if they can leave early for the day, get denied and then resort to doing something beside photosynthesize. Funny enough, the fulltimes would drop their work to watch. This raises a few key questions:\n\n1. If the interns have 0 work and are playing games, why can\'t they leave? It\'s literally wasting everybody\'s time and adds to the electricity bill for a poor little startup.\n2. If the fulltimes are just watching, is there no work that needs to be done? It\'s startup, there is always work. It\'s just that the engineers aren\'t doing their jobs and pulling in more work for the interns to do. I believe that work > no work, but there\'s no work and no one is trying to fix that.\n3. Did we sign a job offer or a prison sentence? I\'m locked up in a tiny and poorly lit room with a bunch of other horribly depressed people while being berated by management who literally would pace around to watch what we were doing.\n\nManagement, if you really do care about the interns, which I honestly doubt, I would start changing the way you treat them. There was legitimate harassment and bullying that happened to an intern during my term and they got depressed because they had to put up with this for 4 months. We aren\'t monkeys for you to play with or robots that idle until your next command. Please show just the normal amount of respect that you would show to someone else. Please grow up.',2213,'CAD','monthly',1.0,1.0,1.0,1.0,NULL,0,1,'2019-01-12T06:47:12.869Z','r775j463c297',0,0,NULL),('ck1x3b45g01cs01i9f2la7y77','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Small dev team, nice tech stack, free snacks',4000,'CAD','monthly',5.0,3.0,5.0,5.0,NULL,0,1,'2019-01-17T03:25:38.673Z','r776j625c369',0,0,NULL),('ck1x3b45g01ct01i97szq1b5s','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I learned a lot from this position. I was given challenging and interesting assignments/projects throughout the week.',3000,'CAD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,'2019-01-17T03:38:41.690Z','r777j626c62',0,0,NULL),('ck1x3b45g01cu01i9hn0l498v','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Bidvine is a fast growing and experienced company that deals with several projects simultaneously. \n\nDan was an excellent mentor who trusted me with very big projects that went live on the site. You will not be working on \"intern projects\" while you are there and will actually make an impact.\n\nThe team is very insightful, everyone there is an expert in their own field and are very friendly people. Would highly recommend Bidvine as a co-op placement.',4800,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2019-01-17T19:11:04.497Z','r779j628c100',0,0,NULL),('ck1x3b45g01cv01i99pz42r1n','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','$8000 + 2000 Stipend Monthly\n\nFall 2018 Term\n\nThe company is growing quickly and is expanding quite fast. Some interesting problems to tackle in terms of dealing with scaling users and data.\n\nSuper friendly people and great perks (all meals catered).',10000,'USD','monthly',5.0,4.0,5.0,5.0,NULL,0,1,'2019-01-19T04:27:04.464Z','r781j629c370',0,0,NULL),('ck1x3b45g01cw01i9etbe3wcs','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Had a ton of flexibility - great work, people, laidback culture. Company is in the middle of acquisition though. ',6000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2019-01-21T04:04:18.552Z','r782j87c102',0,0,NULL),('ck1x3b45g01cx01i94yovauba','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The culture\'s amazing and there\'s good opportunity to move from one position to another and collaborate. Interns are treated like full-times, i.e. if you\'re doing good work, you\'ll be assigned to interestig projects over full times. The company has a recognition system where the completion of major projects get you Air Miles. Loads of Co op events starting from arcades to going to watch a Raptors Game, all sponsored by the company.',35,'CAD','hourly',5.0,4.0,5.0,5.0,NULL,0,1,'2019-01-26T23:02:06.495Z','r784j631c176',0,0,NULL),('ck1x3b45g01cy01i939l4duk5','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','It was pretty good. ',27,'CAD','hourly',5.0,4.0,5.0,5.0,NULL,0,1,'2019-01-28T23:04:17.786Z','r785j632c372',0,0,NULL),('ck1x3b45g01cz01i9ea3d437y','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Work consists mostly of full-stack work. I worked a lot with React and Redux on the front-end, and Django and SQL on the back-end. Pay was good though company/team culture was lacking. Co-ops work independently and solely with mentors.',25,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2019-01-31T00:21:53.548Z','r786j633c373',0,0,NULL),('ck1x3b45g01d001i90ftegw3c','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Depending on the team, the hours can vary a lot. The client-facing teams do tend to work longer hours since the company is growing so rapidly and have a lot of deadlines. Definitely learned a lot during my coop term here.\n\nDue to the pair programming nature of the job, there is a great opportunity for mentorship available from the senior engineers. Overall, a great company to work for, interesting product and some really smart and motivated people working here.',4200,'CAD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,'2019-02-02T17:03:58.350Z','r787j634c374',0,0,NULL),('ck1x3b45g01d101i98wrm6ogr','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','There is the opportunity to have incredible amount of impact as an intern. My mentor was extremely helpful, and the work life balance is great.',8500,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2019-02-05T05:08:21.039Z','r788j635c34',0,0,NULL),('ck1x3b45g01d201i9gnkohst9','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Lots of perks like corporate phone, health insurance, 17% off Uber and Eats, Uber credits, free breakfast, lunch, dinner, overtime pay, new tech (new macbook pro), free headphones/earbuds.\n\nMentorship depends on team but my mentor was great. Work was really interesting and impactful as well. I worked a lot by choice and got paid overtime. Monthly salary worked out to roughly $11000.\n\nHR is a mess though',11000,'USD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,'2019-02-05T09:59:56.954Z','r790j38c52',0,0,NULL),('ck1x3b45g01d301i97i1t8lva','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','It is not bad',22,'CAD','hourly',3.0,3.0,5.0,5.0,NULL,0,1,'2019-02-06T14:07:58.003Z','r791j636c375',0,0,NULL),('ck1x3b45g01d401i9b54sdixz','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Team was awesome, everyone was down to help out. I got to do actual important stuff and people were just nice I guess. There were all smart and it felt nice to always be in good hands.',7000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2019-02-15T05:03:41.340Z','r792j637c376',0,0,NULL),('ck1x3b45g01d501i92ke43sez','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Had an awesome time there - great mentorship and a welcoming, laidback culture. Kitchen filled with snacks. ',5440,'CAD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,'2019-02-22T03:39:16.544Z','r793j638c350',0,0,NULL),('ck1x3b45g01d601i95s5503cf','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked here during fall 2018 for my 3rd coop. I did not negotiate my pay but you can if you push a bit. The company with the best culture..want to go full time here. ',5300,'CAD','monthly',4.0,4.0,5.0,5.0,NULL,0,1,'2019-02-28T17:40:09.900Z','r794j639c377',0,0,NULL),('ck1x3b45g01d701i940z5g1q5','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I worked here for my third coop, and I had an amazing time! My team was very friendly and my manager really cared a lot about their team. Definitely the best mentoring I\'ve ever gotten from a manager.\n\nI worked on meaningful projects which would impact a lot of customers, and learned a lot about software development and best practices.\n\nThe company is still growing, and it\'s exciting to be part of the process.',4600,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2019-03-02T02:43:13.709Z','r795j640c198',0,0,NULL),('ck1x3b45g01d801i92vgteyxv','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked there in second year. The people were nice but there wasn\'t much to work on and it was very boring overall. Also the pay is bad if you\'re not in first year.',19,'CAD','hourly',2.0,2.0,1.0,4.0,NULL,0,1,'2019-03-02T09:25:59.937Z','r796j357c231',0,0,NULL),('ck1x3b45g01d901i94169cb44','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I enjoyed working at Ultimate Software. The best part was how much I was able to learn as the data science team really prioritizes you having the opportunity to take on interesting problems. We had a regular reading group so I could gain a better understanding how data science works. The work is generally independent and the team is very academic focused so you will have a lot of ownership over your work.\n\nAt the office we had free lunch every Monday and Wednesday and free snacks. There were also plenty of social events and I got to meet with teams around the office. The inclusive atmosphere definitely made working here a great experience.',7000,'USD','monthly',5.0,4.0,5.0,5.0,NULL,0,1,'2019-03-02T18:45:48.104Z','r797j641c334',0,0,NULL),('ck1x3b45g01da01i9gd708hu0','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Absolutely the greatest coop I\'ve experienced there. I have no complaints whatsoever.',6969,'CAD','monthly',1.0,1.0,1.0,1.0,NULL,0,1,'2019-03-06T05:47:54.095Z','r798j395c130',0,0,NULL),('ck1x3b45g01db01i9hh7wg7od','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','It\'s fire',2750,'USD','weekly',5.0,5.0,3.0,5.0,NULL,0,1,'2019-03-06T16:12:28.370Z','r799j642c26',0,0,NULL),('ck1x3b45g01dc01i97fkhfpvw','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Awesome',8800,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2019-03-06T18:11:19.336Z','r800j643c378',0,0,NULL),('ck1x3b45g01dd01i98bgm1lbp','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Great mentorship with lots of room for learning. Part of the full-time dev team from day 1.',2800,'CAD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,'2019-03-06T18:48:33.083Z','r801j644c379',0,0,NULL),('ck1x3b45g01de01i96syuggws','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Worked there summer of 2018 when it was under the banner of Oath, got to meet and work with really amazing people. Although there is some instability with the company due to all the restructuring, culture is very collaborative and freeing (at least in my experience).',5420,'USD','monthly',4.0,4.0,4.0,4.0,NULL,0,1,'2019-03-21T04:18:14.057Z','r803j646c57',0,0,NULL),('ck1x3b45g01df01i9hr6c1po6','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Pretty awesome overall. Project was solid, mentor was very resourceful, great events. The only disappointing thing was the company outlook.',8000,'USD','monthly',4.0,5.0,5.0,5.0,NULL,0,1,'2019-03-27T01:43:19.708Z','r804j553c58',0,0,NULL),('ck1x3b45g01dg01i94gnyagoy','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I love - love - loved my internship at Apple as a Software Engineering Intern. The work I did was developing a core production product where I was able to make valuable contributions to developing services that helped complete goals for the team that I was on.\n\nI think in terms of pay they have recently made significant increases? At least for the Siri organization. I was paid $45 USD/hour with the chance to do basically unlimited overtime (1.5x hourly).\n\nMentorship was excellent - of course this is team based - my mentor constantly checked up on me to ensure that we were in sync and that I was having an enjoyable experience.\n\nPeople were incredibly friendly in my organization. Although you have to pay for lunch (dinner is free), the food is really good.\n\nOn site gym at Apple Park is really nice and your corporate housing will be right beside the campus so it\'s a 5 minute walk to go to the gym.\n\nAll in all, a great place to work on the software side. I do hear on the hardware/product design and EPM side hours are longer, but don\'t know enough details about those teams.\n\nIn terms of other benefits you get:\n- 15% for friends and family on Apple products\n- 25% for personal use on Apple products\n- $500 off an Apple product at the fourth month of your internship\n- A bunch of other discounts for third party products',7200,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2019-04-10T20:50:12.118Z','r805j402c5',0,0,NULL),('ck1x3b45h01dh01i9439d1hdh','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','My internship at PlanGrid was amazing! It was by far my favourite internship. I got to work in a new role that I had never done before but got amazing mentorship and learned a lot about user research and data science. \n\nI got to lead my own project and had a large impact in shaping the direction of the product team. It definitely made me feel like I was doing good work to push the team forward.',8750,'USD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,'2019-04-19T17:27:48.707Z','r806j647c354',0,0,NULL),('ck1x3b45h01di01i95l1xh19x','2019-10-19 04:56:45.467000','2019-11-27 20:33:39.902000',0,'ck1n1du49000501jo4pwygsav','Best internship I have ever had. I highly doubt companies at the size and scale of Uber are willing to give interns real work that has impact, but Uber definitely doesn\'t shy away from that. The work is very very interesting and challenging. You\'ll definitely enjoy your time here. \n\nPerks include breakfast, lunch, dinner, $200/month Uber credits, 17% Uber discount, fresh fruits, snacks, overtime salary, housing stipend, monthly phone stipend, fitness discount (Fitness SF). \n\nOverall, fantastic company to work at, great culture, WLB, and most of all the work is definitely something that will allow you to grow as an engineer. I\'m very strongly considering Uber for full-time over places like Google just because of the growth opportunities I see here. Definitely take this internship if you get a chance, you\'ll come out a 100% (or more) better engineer than going in.',44,'USD','hourly',5.0,5.0,5.0,5.0,NULL,0,1,'2019-04-21T21:58:50.645Z','r807j38c52',0,0,NULL),('ck1x3b45h01dj01i9g6ax37x0','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Great team,  really smart people, everyone is willing to help out. I had a really good work term here. Work is meaningful and interesting. ',4520,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2019-04-22T14:23:45.736Z','r808j648c203',0,0,NULL),('ck1x3b45h01dk01i99hhudbvf','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','A small company with a tightly-knit culture, and an interesting product. \nScope for personal development as a tester isn\'t too much, and have to request for coding work repeatedly. Coding work would mostly involve writing unit tests.\n\nThe team has a great culture, but need to understand an issue completely before turning to blame the co-ops for any issues that they might be facing. \n\nMentorship is very low with not much scope for personal improvement, and feedback is available once a month. They only provide the feedback after a delayed time which ends up being pointless as it doesn\'t address the entire need for timely feedback.\n\nOverall, a decent co-op experience with its own set of ups and downs. \n',2240,'CAD','monthly',2.0,2.0,1.0,3.0,NULL,0,1,'2019-04-22T15:56:12.434Z','r809j649c89',0,0,NULL),('ck1x3b45h01dl01i9ho5ggg56','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Interview was with the non-technical cofounder who asked deadass easy questions it was insulting',8000,'USD','monthly',1.0,1.0,1.0,1.0,NULL,0,1,'2019-04-23T14:30:51.028Z','r810j650c367',0,0,NULL),('ck1x3b45h01dm01i97doq3mso','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Great company to work for. The senior devs here are incredibly experienced and offer great mentorship. I didn\'t know anything about backend development before coming here, but was able to pick things up rapidly and learned a lot. Most people come in at 9:30 and leave between 5:30 - 6:00.\n\nThey have free breakfast, lunch, snacks, beer, etc. They also have a fitness benefit ($100 a month), a commuter benefit ($150/month), a phone benefit ($100/month) and an internet benefit ($100/month). ',4200,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2019-04-23T19:58:34.244Z','r811j651c374',0,0,NULL),('ck1x3b45h01dn01i9f9sj6f05','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','TLDR: Awesome experience, great company culture, full ownership over projects, good modern tech stack with lots to learn, competitive pay (especially for earlier coop terms), perfect WLB and great mentorship. I would highly recommend this position if you are self-motivated and passionate about full stack web development.\n\nAwesome opportunity to learn about all aspects of full stack web development, since there are only two full stack developer co-ops you will have full control over your projects, from ideation to development to deployment. There can be some downtime between projects, however if you take initiative and find problems to solve, you are more than encouraged to innovate new solutions for them. The projects solve real problems that LCBO faces, so your work will very likely go into production and have real users after completion.\n\nAnother great thing is the amount of freedom you have in your role, for example, the UI/UX designer on my term wanted to learn frontend development, whereas I spent my focus on backend and devops work and the other full stack spent some time on data science work. In terms of development, the tech stack is pretty widespread and modern, focused on the MERN stack for building web apps with supporting tools such as Elasticsearch, Redis and Docker, however we were highly encouraged to introduce new technologies if they see fit.\n\nCompany culture is amazing, the innovation lead and technology lead are both extremely chill and fun to be around. WLB is great, no pressure to deliver products fast, however you can accomplish a lot if you are motivated to do so. We did monthly team events on the last Friday of each month (VR, Escape Rooms), although they aren’t covered by the company, the high pay makes up for it. Mentorship used to be a problem in past terms, however a technical technology lead was hired in my term who providing us with technical help when we needed it.',4400,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2019-05-09T20:31:19.013Z','r812j488c212',0,0,NULL),('ck1x3b45h01do01i92psc6wny','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Experience wise, this is a team-to-team company where some teams offer better internship opportunities versus others. My experience was on the backend team and you will have a great team full of smart, hard working guys and it\'s really easy to get along with them all and get going. The learning curve is difficult but they allocate for that, allowing you for a well paced coop. The company offers catered lunches everyday and pays in a higher bracket, so do what you want with the money. ',8000,'USD','monthly',5.0,5.0,4.0,5.0,NULL,0,1,'2019-05-15T15:43:00.485Z','r813j652c367',0,0,NULL),('ck1x3b45h01dp01i9eeb735bv','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','- full ownership of projects and ideas\n- interesting project problem spaces\n- great pay\n- small team of 4 co-op students (2 full stack dev, 1 mobile dev, 1 UI/UX designer) and 2 full time employees\n- lots of opportunities to learn new skills and apply them to the project you\'re working on\n- awesome workspace\n- Communitech has a bunch of other innovation teams there, as well lots of cool events\n- basketball court, arcade machines, ping pong table, and Foosball table\n- super friendly manager\n\n\nawesome experience overall, highly recommended to all co-op students\n\n\n\n\n\n',1100,'CAD','weekly',5.0,4.0,5.0,5.0,NULL,0,1,'2019-05-29T01:45:50.692Z','r814j627c212',0,0,NULL),('ck1x3b45h01dq01i9gpb3hkx3','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','1. Perfect for people who know what they want to do/learn. You are always welcome to try new stuff as long as it adds value to the team. \n\n2. Fast-paced, we move on quickly. On average, each co-op would work on 3 projects per term.\n\n3. 100% ownership of the project.\n\n4. Communication is never an issue due to the small team. You can always receive feedback immediately. \n\n5. Office is located at Communitech, where you can talk with people from the other labs and learn from them.',4400,'CAD','monthly',5.0,4.0,5.0,5.0,NULL,0,1,'2019-05-29T08:01:22.886Z','r815j520c212',0,0,NULL),('ck1x3b45h01dr01i9g1nrbyom','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Pretty good overall.\nSalary is top notch for an internship at $60 an hour + 1.5k post-tax for housing.\nEveryone is friendly and energetic at the company. Project and work-life balance depend heavily on the team. Work is generally pretty fast-paced, but manageable. Things can get a little chaotic sometimes but in a good way.',60,'USD','hourly',5.0,5.0,5.0,3.0,NULL,0,1,'2019-05-29T22:12:47.416Z','r816j653c26',0,0,NULL),('ck1x3b45h01ds01i91g4k5c1f','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Interned in Winter 2019, overall it was a great experience, learned a lot from it.\n\nTeam was great, lot\'s of smart and chill people to learn from.',5780,'CAD','monthly',4.0,4.0,4.0,5.0,NULL,0,1,'2019-06-02T03:34:11.704Z','r818j305c40',0,0,NULL);
INSERT INTO `Reviews` VALUES ('ck1x3b45h01dt01i98oqjhjcz','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Possibly my least enjoyable co-op. I would not touch this place with a 10 foot pole and a hazmat suit because it\'s absolutely toxic.\n\nFirst of all, you *will* get roasted by your manager, in front of everyone on your team during meetings. Everyone goes through this. You will get roasted for the most trivial of things, such as forgetting to update your tickets.\n\nSecond, this place is straight up corporate. Useless bureaucracy everywhere. Enterprise grade micromanagement. The team operates on waterfall. Virtually every piece of code you write (including bugfixes) requires you to write a big ass design document with a 20 page template, and you need to get that reviewed and approved by the team *before* *you* *can* *write* *any* *code*. After that\'s done, you have to provide detailed end dates for every task in your project. God forbid you miss one of those deadlines, because you\'re in for a roasting. We all know how good the software engineering industry in general is at estimating deadlines...\n\nDuring your project, you have to provide constant email updates about the status of your project. Micromanagement nuff said. Forget an update? You\'re in for a roasting.\n\nWhat\'s good? The people on the team tend to be smart, nice, and pleasant individuals to work with. Unfortunately the culture set by the leaders is straight out of office space.',52,'USD','hourly',1.0,1.0,2.0,1.0,NULL,0,1,'2019-06-05T04:02:28.226Z','r819j655c380',0,0,NULL),('ck1x3b45h01du01i98gq478c0','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Loved my term on the quality engineering team S/X in Fremont, CA. Less perks than a Bay area tech company, BUT lets be real, Tesla is an automotive company building cars! So perks and salary compared to automotive competitors is much above par. Experience and hands on work is unparalleled in my opinion, lots of authority (making engineering decisions) and freedom in choosing projects. Management a bit unstable but always had great mentorship. \n\nPerks: $130/month in Uber pool credits/commuter benefits (BART, Cal train etc.) (This comes two months into your internship!), $5/day for biking to work, 3 sick days after 90 days of working, $3000 post-tax housing stipend (avg rent around Fremont is $1150/mnth), Free cereal and oatmeal + Jones sodas + different kinds of tea. ',4480,'USD','monthly',4.0,5.0,5.0,4.0,NULL,0,1,'2019-06-07T18:35:05.397Z','r820j656c220',0,0,NULL),('ck1x3b45h01dv01i9517w4gyk','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','If mentorship = handholding, then this isn\'t the place for you. Mentorship to me means being able to push me in the right direction when I am stuck, and at the same time encouraging me to figure out something on my own. This internship taught me how to be independent. I learned how to actually navigate source code in a large repository and understand code that I did not write. By far one of the best companies that I have interned at, in terms of becoming a better software engineer. Mozilla also flew everyone in the company to San Francisco for a work week, and we were exposed to different Mozilla products (e.g. Firefox, Rust, WebAssembly, AR/VR, etc.). Interns were also given a MacBook Pro 15\" (latest model) to take home after the internship. This is one of the best places to intern at if you are really into the web and open source (+ a lot of swags and stickers). They have a ton of people on the W3C team, if that excites you. Salary is based on your location and education (Degree, Masters/PhD). It is the same for everyone in the same category.',4700,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2019-06-08T03:06:18.675Z','r821j657c29',0,0,NULL),('ck1x3b45h01dw01i910fe2l0y','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Fabulous Work-Life Balance! Probably the best in the SF Bay Area. Stocks are also doing fabulous. I got paid $40 USD/hr with $8000 USD lump sum for 12 weeks. Aside from that you also get $360 USD wellness dollars to spendon anything you like.',9100,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2019-06-08T04:36:26.966Z','r822j658c381',0,0,NULL),('ck1x3b45h01dx01i9c8qkhgbp','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The culture at BMO is excellent, very welcoming and very professional. \n\nThey assigned me a mentor and helped me with everything I was assigned. There was little pressure on completing a task, there would be frequent meetings to keep everyone up to date.\n\nI find that the people working at BMO were very open-minded and friendly. I would recommend this job to anyone who would like to learn and grow professionally.\n',4600,'CAD','monthly',5.0,4.0,4.0,5.0,NULL,0,1,'2019-06-10T23:29:15.568Z','r823j645c133',0,0,NULL),('ck1x3b45h01dy01i9da7mf93q','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Fantastic experience. They give a 10k signing bonus (meant to be used for relocation/housing). Awesome culture, lots of events (with free food and drinks) going on all the time. Monthly engineering events, bi-yearly offsites, at least monthly intern events, etc.\n\nThey take care of their interns and engineers in general. The free lunch and dinner is $17 per meal and you order it through Seamless (basically Uber Eats but in New York).\n\nHighly, highly recommend this internship to anyone.',7800,'USD','monthly',5.0,5.0,5.0,4.0,NULL,0,1,'2019-06-12T13:03:24.749Z','r824j659c59',0,0,NULL),('ck1x3b45h01dz01i9bjlo94tk','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','- great people, learned a lot\n- no independent intern project, just take tasks from the JIRA board\n',8000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2019-06-12T19:35:56.065Z','r825j659c59',0,0,NULL),('ck1x3b45h01e001i9cr3r1nva','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','I had an absolute blast at Coursera. They let me pick meaningful projects that I wanted to work on, and really cared about my personal interests and growth. Would recommend 100%. ',9000,'USD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2019-06-13T12:51:13.154Z','r826j612c11',0,0,NULL),('ck1x3b45h01e101i97xrod12v','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','A good place to work. Extremely friendly coworkers who are always ready to help you even if they aren\'t in your team. It is like any other typical corporation. Supervisors are great mentors. You get to work on significant projects. \nDepending on what project you are working on, it might get a bit repetitive and boring. Overall a pretty good company and experience.\n\nPROS:\nWork life balance is good. 1-2 work from home days per week. Very understanding superiors if you need holidays/ time off work/ want to leave early etc.\n\nCONS:\nNo perks as such. No free food/gym etc. The only free thing you get is free coffee.',3400,'CAD','monthly',4.0,4.0,5.0,4.0,NULL,0,1,'2019-06-18T03:59:21.945Z','r827j660c382',0,0,NULL),('ck1x3b45h01e201i956ceadkj','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','The 7100 does not include the housing stipend of around another 2500CAD per month before tax.\n\nWork life balance is mediocre and the company is very frugal.',7100,'CAD','monthly',4.0,3.0,5.0,3.0,NULL,0,1,'2019-06-23T22:53:34.099Z','r828j661c4',0,0,NULL),('ck1x3b45h01e301i95xvxe6f6','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Had an amazing experience. Top notch pay for a Toronto company, amazing people, cool office.\n\nPerks:\n\n- Everything the other poster mentioned\n- Fully stocked kitchen',5920,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2019-06-24T19:56:36.913Z','r829j662c314',0,0,NULL),('ck1x3b45h01e401i902zg41ch','2019-10-19 04:56:45.467000','2019-11-25 20:25:10.488227',0,'ck1n1du49000501jo4pwygsav','Just an absolutely great place to work.\n\nThe culture was fantastic and I learned so much about full stack development.',4500,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,1,'2019-06-29T20:48:47.611Z','r830j663c383',0,0,NULL),('ck33qrrf9007401jv3s1i58fo','2019-11-18 01:19:52.725000','2019-11-25 20:25:10.488227',1574098054,NULL,'test',222,'USD','hourly',4.0,5.0,3.0,5.0,'science,startup',1,0,NULL,NULL,1,1,NULL),('ck33tgnlm002f01k24y4j5q7g','2019-11-18 02:35:13.402000','2019-11-25 20:25:10.488227',1574098054,NULL,'test',222,'USD','hourly',4.0,4.0,4.0,3.0,'software,science',0,0,NULL,NULL,1,0,NULL),('ck37n7xzd002301mp88gzdfhi','2019-11-20 18:51:33.962000','2019-11-25 20:25:10.488227',1574275972,'ck1n1du49000501jo4pwygsav','',10,'','',1.5,NULL,NULL,NULL,NULL,0,1,NULL,NULL,0,0,NULL),('ck37pflzp00ny01mpdkjwbdbw','2019-11-20 19:53:30.901000','2019-11-25 20:25:10.488227',1574279722,NULL,'test',222,'EUR','weekly',5.0,5.0,5.0,5.0,'',0,0,NULL,NULL,1,0,NULL),('ck37pigxa000g01mo8t0i181o','2019-11-20 19:55:44.303000','2019-11-25 20:25:10.488227',1574377481,NULL,'test',222,'EUR','weekly',5.0,5.0,5.0,5.0,'',0,0,NULL,NULL,1,0,NULL),('ck37r6brh006601jecq1u0frx','2019-11-20 20:42:16.974000','2019-11-25 20:25:10.488227',1574282773,NULL,'',22,'USD','weekly',4.0,2.0,4.0,2.0,'big',0,0,NULL,NULL,1,0,NULL),('ck37rdckd00bh01ju980v8g30','2019-11-20 20:47:44.609000','2019-11-25 20:25:10.488227',1574377481,NULL,'',22,'USD','weekly',4.0,2.0,4.0,2.0,'big',0,0,NULL,NULL,1,0,NULL),('ck39bo3qs000u01li3l6zhw5h','2019-11-21 23:03:44.887000','2019-11-25 20:25:10.488227',1574395659,NULL,'test',2222,'USD','weekly',5.0,4.0,2.0,1.0,'test',0,0,NULL,NULL,1,1,NULL),('ck39fvfdt006e01lb8p3fb1o3','2019-11-22 01:01:25.027000','2019-11-25 20:25:10.488227',1574395659,NULL,'test',123,'USD','hourly',3.0,5.0,5.0,5.0,'fe',0,0,NULL,NULL,1,1,NULL),('ck39g3trk008s01l60p151zi1','2019-11-22 01:07:56.913000','2019-11-25 20:25:10.488227',1574395659,NULL,'spam',2222,'USD','hourly',3.0,5.0,4.0,4.0,'',1,0,NULL,NULL,1,1,NULL),('ck39hqxsd006y01jo7bfzhrri','2019-11-22 01:53:54.829000','2019-11-25 20:25:10.488227',1574395659,NULL,'test3',22,'USD','weekly',4.0,5.0,5.0,3.0,'startup,fintech,free lunch,great',0,0,NULL,NULL,1,1,NULL),('ck39hvdjy00cg01jo2chm949b','2019-11-22 01:57:21.886000','2019-11-25 20:25:10.488227',1574395659,NULL,'test',222,'USD','weekly',4.0,4.0,4.0,3.0,'test,tetet,te,tet',0,0,NULL,NULL,1,0,NULL),('ck39i011s00eu01jod7cm1blb','2019-11-22 02:00:58.962000','2019-11-25 20:25:10.488227',1574395659,NULL,'test',22,'USD','monthly',3.0,3.0,5.0,3.0,'',0,0,NULL,NULL,1,0,'alexieyizhe@gmail.com'),('ck3cimfk7000o01jfeapdfp0l','2019-11-24 04:41:42.728000','2019-11-27 20:37:37.307000',0,NULL,'Loved my work there on my first co-op term so I returned for a second! I was working on a new digital flyer production system and there was lots to do, so I never felt like I was bored or doing menial work. There\'s some ramp up as Flipp is getting to be a medium sized company, but the team definitely valued my input and I had a lot of opportunities to learn and grow. ',1082,'CAD','weekly',5.0,5.0,4.0,5.0,'software,e-commerce,backend',0,0,NULL,NULL,1,1,'alexieyizhe+promos@gmail.com'),('ck3dq3g2q000c01mk2ud5148o','2019-11-25 00:58:40.035000','2019-11-27 20:38:15.969000',0,NULL,'I worked at Shopify during my second internship and loved the overall culture that the company strived to cultivate. I got to express interest in and pursue different technologies and problem areas I wanted to work in and had 1-on-1 mentorship meetings on a weekly basis so I always knew how I was doing. Would highly recommend working here!\n\nBonus points for the in-house catering (breakfast, lunch, snacks throughout the day) was incredible (we had a dedicated pastry chef!), amazing office, credits to purchase anything that will advance professional development, housing stipend, etc. ',30,'CAD','hourly',5.0,5.0,4.0,5.0,'e-commerce,canadian,data-science',0,0,NULL,NULL,1,1,'ajangie0707+spam1@gmail.com'),('ck3dsazf2001t01kz5bpdg0c8','2019-11-25 02:00:30.927000','2019-12-18 00:03:56.184000',1576627436,NULL,'Baby this is me',13,'EUR','weekly',2.0,3.0,4.0,5.0,NULL,1,0,NULL,NULL,1,1,'jacksonpollock@gmail.com'),('ck3dtbpxv001901mgbwp46g6m','2019-11-25 02:29:04.915000','2019-12-18 00:03:56.181000',1576627436,NULL,'It was good',1500,'CAD','weekly',3.0,5.0,4.0,5.0,'ass',1,0,NULL,NULL,1,1,'fuckmeplease@gmail.com'),('ck3eua9jf00e301mg5jtpe6mu','2019-11-25 19:43:42.795000','2019-11-27 23:00:25.871000',0,NULL,'Paid for flight.\nTook stipend over housing.\nDid content-experience in content systems, amazon retail team.\nOur org was behind pictures and text on the website.\nTeam was fantastic, small team engineers were good at what they did.\nI had a lot of autonomy, as long as the deliverables were there.\nThe work was fun, my manager and I talked about the work I\'d like to do, after I finished the first project he found another project I\'d like on another team he managed.\nPay was good.\nThey had intern events but really if u want friends u should make them during orientation or through tinder.\nSeattle amazon is close to UW so go there for fun.\nWe were given a budget for food and my manager would buy us food.\nJeff Bezos showed up on stage at a concert I was at :D\nBasically I had a good time.\nApply early if u want the job.',-1,'USD','monthly',5.0,4.0,4.0,5.0,'software',0,0,NULL,NULL,1,1,'ryan.qiyu.jiang@gmail.com'),('ck3fgvw5i001u01mq7suj2fpj','2019-11-26 06:16:23.432000','2019-11-27 20:39:06.209000',0,NULL,'I interned at Wish during my second internship on their search and recommendations team. It was amazing to be able to work on many production-facing tasks/analysis over the course of the term. There is decent flexibility in what you want to work on (as long as it\'s relevant ): I worked on improving Wish\'s search experience and conducting/analyzing A/B tests, while other interns on the team worked on productionizing ML models, improving data infrastructure, etc. My mentor was great in guiding me throughout my internship, and so were the other full-times on my team. The free meals (breakfast, lunch, and dinner) as well as an amazing office view were a plus too!',8500,'USD','monthly',5.0,5.0,5.0,5.0,'e-commerce,data',0,0,NULL,'',1,1,'kelvin_322@ymail.com'),('ck3hsl50y002h01jm588ydkva','2019-11-27 21:19:29.459000','2019-12-18 00:03:56.184000',1576627436,NULL,'Here is some fake review body text',222,'USD','weekly',4.0,3.0,3.0,5.0,'tag1,tag2',0,0,NULL,NULL,1,0,'anotheremail@test.com'),('ck3pe0cdf00ka08k293wp0e5r','2019-12-03 04:53:33.987000','2019-12-12 23:19:44.939000',0,NULL,'Amazing place for a early co-op. Salary is not the best but that is expected for smaller companies. Mentorship is amazing, the people are amazing, and having lots of co-ops there with you is great. The work is meaningful but eventually will get a bit repetitive, but there is still lots to learn for early co-ops. I would recommend this job to people for their first/second co-ops. ',20,'CAD','hourly',4.0,5.0,4.0,5.0,NULL,0,0,NULL,NULL,1,1,'aman.brar@uwaterloo.ca'),('ck3pe7hg9001808jj29el9oc6','2019-12-03 04:59:07.162000','2019-12-12 23:20:02.351000',0,NULL,'There is definitely a lot to learn in this co-op, I easily learned the most in this one than my previous 2. They heavily bait with trying to sell the position as an AI position when in reality you will be working on infrastructure, backend, and DevOps for the AI team. You will likely not be doing any data science. Regardless of that, it\'s a bank so you don\'t get the amazing chill environment that you would get in a startup, but the team I was a part of was full of great people and I did enjoy my time here. You are expected to be able to do a fair bit of work independently, but that environment was what allowed me to learn a lot. If you are interested in AI and infrastructure I would recommend this job, there is still a lot you will learn about AI, but do not take it if you are under the impression you will be doing data science.',25,'CAD','hourly',4.0,4.0,4.0,4.0,'ai,software,infrastructure,backend,devops',0,0,NULL,NULL,1,1,'aman.brar@uwaterloo.ca'),('ck3xgz1v300a008jq1vrdhg4q','2019-12-08 20:38:41.968000','2019-12-12 23:19:13.714000',0,NULL,'Had a great time. It was 6.5k/month salary + 500/week housing stipend (heavily taxed). Food was amazing, on-site cafeteria (breakfast + lunch only).',8500,'USD','monthly',5.0,5.0,4.0,5.0,NULL,0,0,NULL,NULL,1,1,'lawrencefeipan@gmail.com'),('ck402ewdq000p08jra5r7aqsa','2019-12-10 16:14:25.647000','2019-12-12 23:39:24.629000',0,NULL,'* great WLB, no one is at the office passed 5:30 pm\n* nice modern office\n* foosball/ping pong\n* large intern cohort\n* modern tech stack\n* very competitive pay',6000,'CAD','monthly',5.0,3.0,5.0,5.0,NULL,0,0,NULL,NULL,1,1,'simon.wong@uwaterloo.ca'),('ck457wn9b000f08mb5ce93xnw','2019-12-14 06:47:02.592000','2019-12-18 00:04:16.716000',0,NULL,'Design team was great (amazing people & culture). Product and work was mediocre. Very slow moving and team was not extremely motivated. ',23,'CAD','hourly',3.0,3.0,2.0,4.0,'design,ux,product',0,0,NULL,NULL,1,1,'amanmathur99@gmail.com'),('ck4a5jfm0002w07l395poe9ut','2019-12-17 17:39:37.801000','2019-12-18 00:05:22.397000',0,NULL,'Access to lots of resources. Had a good mentor but wrote unit tests for 2 months. No intern projects.',23,'USD','hourly',3.0,4.0,2.0,5.0,NULL,0,0,NULL,NULL,1,1,'sginovke@edu.uwaterloo.ca'),('ck4a5ynsp003j08l2ekwh3x1p','2019-12-17 17:51:28.250000','2019-12-18 00:38:57.790000',0,NULL,'Fast-paced, interns are given meaningful tasks. Fun company events.',21,'USD','hourly',4.0,4.0,4.0,5.0,NULL,0,0,NULL,NULL,1,1,'sginovke@edu.uwaterloo.ca'),('ck4a60v5j002d07jv6o3x1ywq','2019-12-17 17:53:11.096000','2019-12-18 00:39:46.256000',0,NULL,'Test automation. ',25,'USD','hourly',3.0,2.0,2.0,4.0,'',0,0,NULL,NULL,1,1,'sginovke@edu.uwaterloo.ca'),('ck4hn35kl001108l8dknneovq','2019-12-22 23:25:14.614000','2019-12-23 00:48:32.416000',0,NULL,'Great company to work for as an intern, plenty of opportunities to learn, great managers that encourage you to learn wherever you can and take on responsibilities that will help prepare you for the future. In-house gym and restaurant, candy bar, ping-pong and working from home are all great perks as well!',-1,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,0,NULL,NULL,1,1,'nbalaven@uwaterloo.ca'),('ck4ho5kh3002407micofkg6oo','2019-12-22 23:55:06.856000','2019-12-23 00:48:49.260000',0,NULL,'The culture is really amazing here! Perks are not the best but they didn\'t lie when they said the snacks are good. ;) Expect to become a full member of your team, with meaningful work to do each week.',22,'CAD','hourly',4.0,4.0,4.0,5.0,'startup,fintech,forex,fullstack',0,0,NULL,NULL,1,1,'jfdoming@uwaterloo.ca'),('ck4hon5h000tn08ibcoda12z9','2019-12-23 00:08:47.220000','2019-12-23 00:58:10.739000',0,NULL,'ok for first co-op.',23,'CAD','hourly',3.0,3.0,3.0,4.0,NULL,0,0,NULL,NULL,1,1,'k62zhou@edu.uwaterloo.ca'),('ck4hoqfxy00dh08mq9cmwho5n','2019-12-23 00:11:20.758000','2019-12-23 00:58:24.838000',0,NULL,'Good internship with opportunity to make meaninful contributions.',32,'CAD','hourly',4.0,5.0,5.0,5.0,NULL,0,0,NULL,NULL,1,1,'k62zhou@edu.uwaterloo.ca'),('ck4hqybg000xu07laggk39hvd','2019-12-23 01:13:27.409000','2019-12-24 00:56:58.845000',0,NULL,'Had an awesome time here. Got to use the FP side of Scala using Scalaz and ZIO. Never needed to work overtime but there\'s always plenty of stuff to do. The people on the ATA team are also great to work with; really can\'t go wrong here if you\'ve got the initiative and drive to learn.',25,'CAD','hourly',5.0,5.0,5.0,5.0,'functional-programming,scala,data-pipelines,streams-processing',0,0,NULL,NULL,1,1,'gary.feng@uwaterloo.ca'),('ck4hvwcmd009g08mdb7rv1gxe','2019-12-23 03:31:53.702000','2019-12-24 01:14:02.540000',0,NULL,'Great mentor, this was my 1A co op and I didn’t get to contribute to meaningful projects because of lack of experience. Would definitely recommend for upper years. (All other interns were Stanford seniors or grad students) also has positions for AI, SE, and EE',20,'USD','hourly',4.0,5.0,3.0,5.0,'startup,robotics',0,0,NULL,NULL,1,1,'bdschnap@edu.uwaterloo.ca'),('ck4hwxgks001a08l54elf2tve','2019-12-23 04:00:45.101000','2019-12-24 01:19:12.942000',0,NULL,'3500 one time relocation stipend, free lunch 3 times a week',50,'USD','hourly',5.0,5.0,5.0,5.0,NULL,0,0,NULL,NULL,1,1,'ipxulin@gmail.com'),('ck4i3clzz013n07jsccmqcuyt','2019-12-23 07:00:29.663000','2019-12-24 01:20:48.092000',0,NULL,'Worked as an Android developer intern in Fall 2018. Amazing office design (even better with their newly opened office). Loved the catered breakfast and lunches. The company really cares about continuing personal growth (free book wall, education stipend etc), and there was a lot of transparency which helps you get to learn what everyone else is doing and how you contribute to the overall company. One downside is that the engineering work is based on what happens during the term. Sometimes that means you can get unlucky and they\'ll be refactoring / paying down tech debt all quarter (I didn\'t get stuck with that too too much, but I know people who did).',33,'CAD','hourly',4.0,4.0,4.0,5.0,NULL,0,0,NULL,NULL,1,1,'mickeydang7299@gmail.com'),('ck4i7ypx0023607mh5x952aiw','2019-12-23 09:09:39.636000','2019-12-24 01:22:21.772000',0,NULL,'I worked during layoffs that affected about 1/4 of the company. Many full times left during this time. It hurt the mood of the company, but there were so many interns it didn\'t affect us that much (although there was less work to go around and some had no work for some periods). Overall very fun.',20,'CAD','hourly',4.0,5.0,4.0,5.0,'pair-programming,agile,consulting',0,0,NULL,NULL,1,1,'davidzhoucanada@gmail.com'),('ck4ijk74301k709mkhtq3avcz','2019-12-23 14:34:17.477000','2019-12-24 01:22:59.418000',0,NULL,'The perks are amazing and this is a definitely a place I would want to work full time. But your performance is based on how independent you are, so don’t ask too many questions as the term progresses unless you want a bad review. Also your resume points won’t be as good compared to a startup since all code you write must be thoroughly reviewed and tested, but this would apply for all big companies.',33,'CAD','hourly',5.0,4.0,4.0,5.0,NULL,0,0,NULL,NULL,1,1,'jsjdj@gmail.com'),('ck4ilj79v00ry08l5heyl5t1a','2019-12-23 15:29:30.260000','2019-12-24 01:24:32.669000',0,NULL,'Overall a decent experience, doing work contributing to the organization from day one. However, some technologies that they\'ve used are a bit outdated...',22,'CAD','hourly',4.0,5.0,4.0,4.0,NULL,0,0,NULL,NULL,1,1,'chun.bryant@gmail.com'),('ck4iwehcq03ru08li1p93g0xf','2019-12-23 20:33:45.820000','2019-12-24 01:25:27.797000',0,NULL,'Great location. Good pay for my coop term. Free breakfast on Fridays and free transit pass. A few developers got annoyed if you asked questions but most were very helpful. ',25,'CAD','hourly',4.0,4.0,5.0,5.0,NULL,0,0,NULL,NULL,1,1,'g2sanmar@uwaterloo.ca'),('ck4iwkp6x02tx07l7apnx7be8','2019-12-23 20:38:35.914000','2019-12-24 01:26:39.222000',0,NULL,'Giant snack wall and free food on Wednesdays. Good location.',28,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,0,NULL,NULL,1,1,'g2sanmar@uwaterloo.ca'),('ck4janyd700uc08mue7h53s3a','2019-12-24 03:13:02.396000','2019-12-28 16:54:14.808000',0,NULL,'Horrible code base; incompetent developers.\nLacking mentor-ship.\nUnwelcoming company culture.\nNo prospect, a dead-end job',26,'CAD','hourly',1.0,1.0,1.0,3.0,'android',0,0,NULL,NULL,1,1,'slleung@uwaterloo.ca'),('ck5h0err9007b08l1dwtv3sya','2020-01-16 17:30:07.750000','2020-01-19 17:12:48.200000',0,NULL,'Great place to meet new people and make friends. In terms of work, not that great.',25,'CAD','hourly',2.0,1.0,2.0,5.0,NULL,0,0,NULL,NULL,1,1,'abc@xyz.manulife.ca'),('ck5jw8w9000u208l45p9gfinv','2020-01-18 17:56:53.700000','2020-01-19 18:09:09.171000',0,NULL,'In the interview, you will be asked what teams interest you, but in the end, it doesn\'t matter as you will get placed in a random team. The kind fo work given is not that challenging or interesting. Manulife hires a large batch of students, so you can expect to make a lot of new friends and have a great time in the office and outside. No perks or benefits given.',4000,'CAD','monthly',3.0,3.0,3.0,5.0,'insurance,salesforce',0,0,NULL,NULL,1,1,'nssakhar@uwaterloo.ca'),('ck5xc7b74006908ld5s8z6mqu','2020-01-28 03:44:33.905000','2020-01-30 18:26:56.315000',0,NULL,'If you want to support a family and live a happy upper middle class life, this is the place to go. If you want to make a name for yourself, or do something adventurous with your life, this is not the place.',7500,'USD','monthly',5.0,4.0,3.0,5.0,NULL,0,0,NULL,NULL,1,1,'danielw68@gmail.com'),('ck601dnxg002307mk385y22b2','2020-01-30 01:04:53.093000','2020-01-30 18:33:42.331000',0,NULL,'Fantastic team and office in SF is great. Working for a company which builds tools for other engineers and technical staff makes for a very strong engineering culture on quality and continuous delivery. Had to work on meaningful and difficult projects with a lot of mentorship and opportunities to learn a lot of different tools. Made it only 4 stars because as with any large company there is a lot of quality tools and pipelines that reduce velocity at the benefit of less bugs. But as an intern it means you have less of a chance to move fast and break things. Work life balance is great and promoted by my mentor. Some teams are def less close knit than others so YMMV.',48,'USD','hourly',5.0,5.0,4.0,5.0,'software,data,backend',0,0,NULL,NULL,1,1,'mdang@splunk.com'),('ck67d58wy006408l459xf8iw4','2020-02-04 04:08:39.011000','2020-02-08 16:28:55.922000',0,NULL,'Definitely an amazing place to work for in an earlier coop. Lots to learn, though work does get repetitive near the end (but a few weeks were allocated in between to work on a totally different development subteam, which was an awesome break and even more to learn). Amazing support from mentors/full-times, lots of other coops too so easy to make friends, catered lunches whenever there\'s a new hire. Pay is standardized with the Waterloo averages. They have integrated with Xero now, so the work and structure may be slightly different, but the same people are there and are still amazing.',765,'CAD','weekly',5.0,5.0,4.0,5.0,NULL,0,0,NULL,NULL,1,1,'m474li@uwaterloo.ca'),('ck6hzy0m101ut08kv835z7ct3','2020-02-11 14:44:34.586000','2020-02-12 00:10:34.381000',0,NULL,'My favourite co-op so far. The engineering culture is amazing. Everyone is always going out of their way to help out. Its a great place to learn.  They also give $15 daily for lunch, on-top of the salary.',30,'CAD','hourly',5.0,5.0,5.0,5.0,'software,backend,data,toronto,engineering',0,0,NULL,NULL,1,1,'sahyder@edu.uwaterloo.ca'),('ck749c2a100br07laflwmheho','2020-02-27 04:38:22.346000','2020-03-02 18:02:50.005000',0,NULL,'Best co-op experience I\'ve had in Canada.',40,'CAD','hourly',5.0,5.0,5.0,5.0,NULL,0,0,NULL,NULL,1,1,'william@thoi.ca'),('ck749ee38001708mjcg71dk89','2020-02-27 04:40:10.964000','2020-03-02 18:04:19.315000',0,NULL,'Didn\'t enjoy my time. Felt like I was copy pasting old ladder logic code because the line I was working was a repeat order. No team culture to speak of. Heads down and work type of vibe.',23,'CAD','hourly',2.0,1.0,2.0,4.0,'dell',0,0,NULL,NULL,1,1,'william@thoi.ca'),('ck749fo1k000x07lag3jo4mt0','2020-02-27 04:41:10.521000','2020-03-02 18:06:10.522000',0,NULL,'Nice place, small company, lofty goals.',17,'CAD','hourly',3.0,2.0,4.0,4.0,'old',0,0,NULL,NULL,1,1,'william@thoi.ca'),('ck749h4qs001i07la6pjc2t17','2020-02-27 04:42:18.821000','2020-03-02 18:06:38.777000',0,NULL,'Nice team. Good culture. Not much to do.',18,'CAD','hourly',5.0,5.0,2.0,5.0,'lenovo',0,0,NULL,NULL,1,1,'william@thoi.ca'),('ck7bsorii002408mkb15id85o','2020-03-03 11:14:30.858000','2020-03-05 19:51:19.721000',0,NULL,'Very fast paced culture. Working on solving interesting problems. Interns have a lot of opportunity to make a large impact.',35000,'NOK','monthly',4.0,5.0,5.0,3.0,'design,ux,product',0,0,NULL,NULL,1,1,'amanmathur99@gmail.com'),('ck8z0phf300ct07l6gfv8bi2w','2020-04-13 21:57:25.743000','2020-04-13 21:57:25.743000',0,NULL,'Dope team!',100,'CAD','monthly',5.0,5.0,5.0,5.0,NULL,0,0,NULL,NULL,1,0,'fjndksj@gmail.com'),('ckane7lmm000v08k2badk490z','2020-05-26 04:01:36.575000','2020-06-01 18:25:56.051000',0,NULL,'Not much innovation. Enjoyment and morale varies depending on the team, so you could get lucky.',21,'CAD','hourly',2.0,1.0,1.0,3.0,'software',0,0,NULL,NULL,1,1,'deez@nuts.com');
